insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANOFLARE疾光系列', 'NF700NF-700YX疾光700', Null, '产地：日本\n颜色：红(001)、蓝绿(749)\n\n全新的NANOFLARE700羽毛球拍即将于3月1日发布。这是一款头轻型球拍，采用独有的技术和结构制造而成，它不仅能帮助选手在赛场上灵活自如，适应速度拉锯战，让击球能够深深打入对方的后场。YONEX带来了5U头轻型系列球拍NANOFLARE，灵活性和操作性进一步提升。\n\n为了实现这次颠覆传统的创造，YONEX的设计师和工程师合力完成了拍框的设计。NANOFLARE700是YONEX第一款搭载了音速闪击系统的日本产球拍，还采用了先进的碳素材质东丽卡®M40X，使得拍框的稳定性和高弹性得以兼顾。\n\nT头左右钉的两个双联，应用了透明连丁，连钉内侧仍有字母，而且是在一端，并不内侧在中间。球拍拍框横截面为流体破风，而且是全线槽。拍框12点位顶端外侧，以往明显可见的工艺合模印痕，已经一点也没有了。\n\nNF700并未使用在天斧88，99上应用的力量转化锥盖，而是低风阻锥盖。这点和天斧77类似。拍框明显宽而薄，对比手中有的锐速球拍，比4U的NR800宽不少，厚度也薄一些。手柄不是加长，但也长于200MM。拍框整体长宽与NR800对比，正（俯）视下，框型似乎大小一样。', '高弹性碳素；M40X；Super高弹性碳素', '高弹性碳素', 84.0, 75.0, 675.0, 'G4、G5、G6', '中等', 5.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6805.html');
insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '2BD2161023EJ20-009', 2021, '1.破风式框型：挥拍时将空气快速导流，降低空气阻力，提高扣杀速度。\n2.中管：高弹性细中管6.5mm直径，采用全新韧性树脂材料，弹性更强，刚性更刚。\n3.二次成型，使用高刚性碳素原料制成：\n（1）提升拍框刚性→A.从容承受高磅数网压B.有效提升攻击系数C.强化拍框控制性，控球效能佳\n（2）有效提升拍框及中管之抗扭力系数→A.强化控球效能。B.提升击球手感。\n4.乌纹：中管1.5KWoven,有效提升球拍抗扭力效果与弹性，并显现高档质感。', '高刚性碳纤维', '高弹性中管+Woven', 84.0, 80.0, 675.0, '1#/G5', 'M', 28.0, 24.0, '295±5mm', 'https://www.badmintoncn.com/cbo_eq/view_10444.html');
insert into detail values('羽毛球拍', '李宁Lining', '风系列', '鲍春来御凌风N70', 2009, '李宁御凌风STORMN70羽毛球拍（国羽顶尖高手鲍春来专属）\n\n拍身重，进袭时势大力沉；中管平衡点适中，兼得凶猛势道，与精准拉吊；拍头边缘，以“方盒结构”打造，拍面稳定扎实，控球迅疾而毫无破绽。\n\n御凌风StormN70，匹配拉吊突击型打法中擅长突击的选手，为国羽顶尖高手鲍春来专属。防御时风雨不透，攻击时凌厉绝伦，正是御凌风StormN70。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2（32/8英寸）、S3（33/8英寸）', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1888.html');
