insert into detail values('羽毛球拍', '李宁Lining', '立体风刃', 'AYPM394', Null, '科技：机翼恒定系统、力学优化拍框、空气动力学截面系统、超导纳米、UC碳纤维、纤细高强度仿生中管', '碳纤维', '碳纤维', 94.0, 81.0, 675.0, 'S2（82.5mm)', '偏软', 30.0, 30.0, '296mm', 'https://www.badmintoncn.com/cbo_eq/view_6858.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '驭系列', '驭NANO7DX-NANO7DX纳米7', 2022, 'VICTOR经典纳米7搭载动力流体六角框，诞生新一代驭-NANO7.导入高强韧强芯填充技术，使拍框的强度和弹性更加优异。打感适中，性能全面易上手。', '高强韧碳纤维+纳米树脂+HARDCOREDTECHNOLOGY', '高强韧碳纤维+NANOTUBE+6.6SHAFT', 89.0, 80.0, 675.0, 'G5、G6', '适中', 4.0, 27.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10946.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR-ZSPYXNRZSP炸薯片', 2016, '新内置T形接头\n水平管线构造加大线床甜区,二次反弹区提供瞬间杀球的爆发力', '高弹性碳素；音效金属；高硬度超级高弹性碳素', 'X链富勒烯纳米碳素；高弹性碳素；致密型纳米碳素', 94.0, 85.0, 675.0, 'G4,5', '硬', 3.0, 20.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_7003.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧100ZZASTROX100AX100ZZ100ZZ深藏青', Null, '通过球拍的重量分布、拍杆、拍框形状和锥盖方面的进化，天斧100可以利用力量和敏捷性来应对比赛节奏的快速变化。\n天斧100对天斧系列的创新型回转力生成系统进行了优化。在拍柄底部、拍框顶部和接头位置进行了更精密的重量分布，提升了球拍的回转力。这些增强的功能确保了快速的连续进攻。球拍采用的Namd，可提高柔韧性和反弹性，释放巨大的爆发力。与回转力生成系统所产生的协同作用可实现持续有力的进攻。\n拍杆经过改良，采用高性能的碳素材料制成了YONEX极细的拍杆。它能减少空气阻力来提供更流畅的挥拍感受，并通过更大的弯曲度和更快的回弹力来提升回转力。\n进化了的方形拍头能进一步扩大甜区，降低击中非甜区时的力量损失，更大的甜区带来强有力的击球。', '高弹性碳素；新次元碳素；黑色微核；钨；致密型纳米碳素', '高弹性碳素；新次元碳素', 89.0, 80.0, 675.0, 'G4、G5、G6', '硬', 4.0, 20.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_7717.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'ZF2VTZF2VT-ZF2二姐夫', 2014, '尤尼克斯VT-ZF2羽毛球拍，创新的科技，带来令人震惊的扣杀力！采用了YONEX纤细的拍杆（纤细加长拍杆二代），足够的硬度配合进一步流体工程优化的拍框，大限度的提升击球威力，尽量推迟羽毛球飞行过程中的减速，确保扣杀效果势大力沉。拉线磅数上，VT-ZF二代羽毛球拍，3U重量可以拉28磅，比之前的VT-ZF27磅，还要高一磅。VT系列的威力三角也得到了进化！vtzf2相比较vtzf，杀球的初速度和落地速度都有提高，初速度提高了10km/h，落地速度提高了6.2km/h！是一把不折不扣的强劲的进攻拍！涂装上是低调的华丽，磨砂亚光的漆水，深邃黑中点缀着幽兰的纹理，彰显个性和品质感！', '高弹性碳素音频滤清器致密型纳米碳素钨', '高弹性碳素EX-高硬度感弹性碳素致密型纳米碳素', 89.9, 80.0, 675.0, 'G4.G5', '超硬', 4.0, 20.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_6101.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR800NR-800', 2012, 'Drivetowin！尤尼克斯YONEXNR800羽毛球拍，2012下半年最受瞩目的羽毛球拍，楚天运动频道首发！攻防自如的一款顶级球拍，能连续打出平抽的“平抽之王”！\n新型材料，三通处采用了最新的新型内置T头；\n新型拍框设计：拍框上部较细，减少空气阻力；下部较粗，提高强度、增加反弹，使球拍在打球的过程中，只受到很小的冲击力，反弹恢复极快！\nX链富勒烯纳米碳素与高强度、质量轻且手感轻柔的新型钛合金——音效金属结合，加强反弹性能的同时，使击球音清脆悦耳，且球速极高！足以满足你对胜利的渴望！\nNANORAY系列在NR700FX和NR700RP主推下一直不温不火，很多还是停留在NANOSPEED的追求阶段，有介于此，YY终于提前发布NR800，配色类似VTZF沉稳闪蓝搭配，定价和原先得NS9900一样。\n黑色为底色，亮蓝色、黄色点缀，拍框处的贴漆的工艺，五彩斑斓、波光琉璃，仿佛散发宝石般的光芒，魅力非凡，精致得让人赞叹！\nNR-800：运用强韧树脂的新型流体雕塑拍框轻松的防守和推挡。拍框中上部运用了，另对手防不胜防。', '高弹性碳素、音效金属', '高弹性碳素、X链富勒烯纳米碳素', 89.0, 80.0, 674.0, 'G4，G5', '硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6095.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧100TOURAX-100TEXAX100TOURAX100T', 2021, 'YONEX尤尼克斯天斧100GMAETOUR\n中端进阶款，适合业余球员', '高弹性碳素；钨；纳米网状树脂NEO', '高弹性碳素；新次元碳素', 89.0, 80.0, 675.0, 'G4、G5', '硬', 4.0, 21.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9521.html');
insert into detail values('羽毛球拍', '李宁Lining', '能量聚合', 'AYPH152能量N7TCN7', Null, '能量聚合，其特点是翻转的梯形框型设计。即在拍子的上下不同部位，采用两个相反方向的梯形截面设计：在拍框3/9点以上，内框呈梯形，外框呈平面；3/9点以下，内框呈平弧面，外框呈梯形；球拍拍框在3/9点处自然过度翻转。据官方宣称，采用能量聚合技术后，可以增加3%的击球能量，提升3.5%的球速。', '超导纳米技术能增强球拍中碳纤维', '超导纳米技术能增强球拍中碳纤维', 89.0, 85.0, 675.0, 'S2', '中', 30.0, 24.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_6215.html');
insert into detail values('羽毛球拍', '李宁Lining', '立体风刃', 'AYPM388AYPR299', 2018, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、热熔胶、高刚性细中管\n尺码对照', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, 'S2（82.5mm)', '偏硬', 30.0, 30.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_6796.html');
insert into detail values('羽毛球拍', '李宁Lining', '林系列', 'N901啸天林N90', 2009, '李宁啸天林WOODSN90羽毛球拍（林丹专用）\n\n啸天林WoodsN90，将林丹一身绝学极致发挥，与其人拍合一，啸傲羽坛。\n\n拍头沉，发力凶狠，中管硬、平衡点高，势道迅猛，令扣杀强悍凌厉；拍头边缘，以“压缩结构”打造，升级拍框抗扭力，与拍面稳定性，控球调度随心所欲。\n\n啸天林WoodsN90，匹配技术全面的力量型打法，为现役国羽头号高手林丹，专制御用。林丹，爆发时摧枯拉朽，稳守时绵密扎实，激情处指天长啸。啸天林WoodsN90，将林丹一身绝学极致发挥，与其人拍合一，啸傲羽坛。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2（32/8英寸）、S3（33/8英寸）', '适中', 30.0, 20.0, '304mm', 'https://www.badmintoncn.com/cbo_eq/view_1887.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '神速系列', 'AURASPEED90FARS90FARS-90F90FM', Null, '羽量级挥重设定，搭载WES鞭击增益系统及FREECORE悬浮核心科技人造柄，挥拍轻快流畅，平抽与各项球路轻松衔接。', '高强韧碳纤维+TR增韧纳米碳管', '高强韧碳纤维+PYTOFIL+6.8SHAFT', 84.0, 75.0, 675.0, 'G5、G6', '稍硬', 5.0, 27.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9244.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'DUORA双刃系列', '双刃10LCWduora10duora10lcw', 2016, 'DUORA10—双刃10的特殊设计让使用者的正手和反手同时提高攻击力，搭载尤尼克斯‘DUALOPTIMUMSYSTEM’，正手是强劲击球的盒式拍框，加强杀球威力，反手则是快速敏捷，尖锐高弹的流体拍框，让防守更迅速。有了双面异型框，选手在比赛中能更有效的发挥正反手。\nDUORA10使用东丽集团公司（TORAY）次时代航空用材料，并结合尤尼克斯独有的“NANOSCIENCE”技术开发出的新型“NANOMETRICDR”碳素材料。在球拍中体现了更高的坚韧性和反弹性。无论是正手击球或是反手推挡都威力十足。', '新型DR致密型纳米碳素；高弹性碳素；镍钛合金纤维', '致密型纳米碳素；高弹性碳素', 89.0, 85.0, 675.0, 'G5', '硬', 26.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6422.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击HMRTKHMRM突击铁锤TKHMRF', Null, 'TK-HMRM亮天蓝\nTK-HMRF普鲁士蓝', '碳纤维+树脂+强叠层系统（FRS）', '碳纤维+树脂+7.0SHAFT', 84.0, 75.0, 675.0, 'G5、G6', '软', 32.0, 32.0, '4U：300±4mm、5U：303±4mm', 'https://www.badmintoncn.com/cbo_eq/view_7093.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧99ASTROX99AX99YXAX99', Null, 'ASTROX99（天斧99），世界优秀选手始终坚持信赖的系列球拍。面向高水平和专业级选手的ASTROX99（天斧99）在连续攻击中产生强大力量。球拍于2018年9月中旬全球正式发售。目前为止的ASTROX天斧系列球拍的拍杆采用了新一代新次元碳素材料，这导致拍杆的回弹速度大幅提升，实现更强更快的扣杀*1。而全新的ASTROX99（天斧99）的全拍身都采用了新次元碳素材料，不仅在拍杆中，拍框也加入了新次元碳素材料，增加拍面与球头的接触时间*2，将挥拍时产生的力量传达到球拍，较大限度提升出球速度。此外，力量转化锥盖的形状提升了拍杆的弯曲范围，进一步保证了新次元碳素效果较大限度的发挥。天斧系列的另外一个标志性科技-回转力生成系统，在连续进攻中使挥拍力量更加顺畅，从而帮助选手较大限度的发挥全拍身新次元碳素的效果。ASTROX99（天斧99）的设计灵感来源于被称为能量之源的太阳。橙色和黑色的底色象征着在广阔的黑暗的宇宙中旋转的太阳，而显眼的红色部分则与太阳表面爆发的耀斑相呼应。', '高弹性碳素；新次元碳素；钨；致密型纳米碳素', '高弹性碳素；新次元碳素', 89.0, 80.0, 674.0, 'G4、G5、G6', '硬', 4.0, 20.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_6726.html');
insert into detail values('羽毛球拍', '聚将GGEM', Null, 'Excalibur-XExcaliburX', Null, '凭借台湾制造工艺，业界公认的WOVEN制造技术，使这款经典球拍\n以亚瑟王佩剑-Excalibur的名义再现于世人眼前。\n打法：攻守兼备', '碳纤维', '碳纤维', 90.0, 88.0, 675.0, 'G5', '稍硬', 29.0, 20.0, '290±2mm', 'https://www.badmintoncn.com/cbo_eq/view_8062.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', 'TK-RYUGA', 2020, '高模量混合碳素纤维是VICTOR研发的全新材料科技。它能突出球拍的“返弹性”和“传导性能”。这种材料被运用到TK-RYUGA上，鞭击增益系统，提升其短兵相接的突击能力。', '高强韧碳纤维+强芯填充技术', '高强韧碳纤维+PYROFIL+6.8SHAFT', 89.0, 75.0, 675.0, 'G5', '偏硬', 8.0, 2.0, '3u:306mm、4u:308mm、5u:310mm', 'https://www.badmintoncn.com/cbo_eq/view_8646.html');
insert into detail values('羽毛球拍', '李宁Lining', '雷霆系列AXFORCE', 'AYPS071AYPS073雷霆90虎MAXAXFORCE90MAX虎跃雷霆90AF90TMAX90MAX', Null, 'AXFORCE90TMAX雷霆90MAX虎跃；6.2mm纤细弹性中杆，挥重大、进攻一锤定音；适合力量强的进攻型专业及高水平选手。', 'M50新生代碳素', 'M50新生代碳素+6.2mm中杆', 89.0, 80.0, 675.0, 'G5', '适中', 7.0, 1.0, '302-305mm', 'https://www.badmintoncn.com/cbo_eq/view_11417.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANOFLARE疾光系列', 'NF700NF-700YX疾光700', Null, '产地：日本\n颜色：红(001)、蓝绿(749)\n\n全新的NANOFLARE700羽毛球拍即将于3月1日发布。这是一款头轻型球拍，采用独有的技术和结构制造而成，它不仅能帮助选手在赛场上灵活自如，适应速度拉锯战，让击球能够深深打入对方的后场。YONEX带来了5U头轻型系列球拍NANOFLARE，灵活性和操作性进一步提升。\n\n为了实现这次颠覆传统的创造，YONEX的设计师和工程师合力完成了拍框的设计。NANOFLARE700是YONEX第一款搭载了音速闪击系统的日本产球拍，还采用了先进的碳素材质东丽卡®M40X，使得拍框的稳定性和高弹性得以兼顾。\n\nT头左右钉的两个双联，应用了透明连丁，连钉内侧仍有字母，而且是在一端，并不内侧在中间。球拍拍框横截面为流体破风，而且是全线槽。拍框12点位顶端外侧，以往明显可见的工艺合模印痕，已经一点也没有了。\n\nNF700并未使用在天斧88，99上应用的力量转化锥盖，而是低风阻锥盖。这点和天斧77类似。拍框明显宽而薄，对比手中有的锐速球拍，比4U的NR800宽不少，厚度也薄一些。手柄不是加长，但也长于200MM。拍框整体长宽与NR800对比，正（俯）视下，框型似乎大小一样。', '高弹性碳素；M40X；Super高弹性碳素', '高弹性碳素', 84.0, 75.0, 675.0, 'G4、G5、G6', '中等', 5.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6805.html');
insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '2BD2161023EJ20-009', 2021, '1.破风式框型：挥拍时将空气快速导流，降低空气阻力，提高扣杀速度。\n2.中管：高弹性细中管6.5mm直径，采用全新韧性树脂材料，弹性更强，刚性更刚。\n3.二次成型，使用高刚性碳素原料制成：\n（1）提升拍框刚性→A.从容承受高磅数网压B.有效提升攻击系数C.强化拍框控制性，控球效能佳\n（2）有效提升拍框及中管之抗扭力系数→A.强化控球效能。B.提升击球手感。\n4.乌纹：中管1.5KWoven,有效提升球拍抗扭力效果与弹性，并显现高档质感。', '高刚性碳纤维', '高弹性中管+Woven', 84.0, 80.0, 675.0, '1#/G5', 'M', 28.0, 24.0, '295±5mm', 'https://www.badmintoncn.com/cbo_eq/view_10444.html');
insert into detail values('羽毛球拍', '李宁Lining', '风系列', '鲍春来御凌风N70', 2009, '李宁御凌风STORMN70羽毛球拍（国羽顶尖高手鲍春来专属）\n\n拍身重，进袭时势大力沉；中管平衡点适中，兼得凶猛势道，与精准拉吊；拍头边缘，以“方盒结构”打造，拍面稳定扎实，控球迅疾而毫无破绽。\n\n御凌风StormN70，匹配拉吊突击型打法中擅长突击的选手，为国羽顶尖高手鲍春来专属。防御时风雨不透，攻击时凌厉绝伦，正是御凌风StormN70。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2（32/8英寸）、S3（33/8英寸）', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1888.html');
