insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓箭2ARC2弓剑2', Null, '产地：日本\n科技：方形拍头+单通道线孔+实感框芯+流体盒式拍框+轻质内置T型接头+纤细加长拍杆+低风阻锥盖\n产品介绍：尤尼克斯YONEXARC-2TOUR羽毛球拍，均衡的平衡点，加长拍设计，YY经典的纳米技术使球拍拥有超轻重量，与普通球拍相比，不但更纤细、更强韧、更稳定，而且易用性更高，轻松就能获得更快的速度和更大的威力。球拍的涂装略带磨砂质感，深红色加以金色的点缀，沉稳大气，质感佳，是一款中端全面均衡型好拍！', '碳纤维', '杯状碳素纳米管；碳纤维', 89.0, 85.0, 675.0, 'G5', '适中', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7754.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '极速系列', 'JS10极速10', 2015, '以增韧纳米碳管和百洛碳素纤维打造的轻量疾速型球拍，拍头加重、中管刚韧、甜区集中，打感扎实有攻击性。适合打法轻巧带有进攻压制能力的选手。', '高强韧碳纤维+NANOFORTIFY', '高强韧碳纤维+6.8SHAFT+PYROFILBYMITSUBISHI', 84.0, 75.0, 675.0, 'G4、G5', '适中', 5.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6981.html');
