insert into detail values('羽毛球拍', '威克多VICTOR', '驭系列', 'DX巭DX-巭功夫巭', 2021, 'VICTOR「巭」系列采用国风汉字「巭」提炼彩墨线条，结合运动视觉设计，达到裸眼3D效果。传统文化与羽球运动的魅力，打造潮流运动新时尚。\n\n悬浮核心科技带来突破性操控体验；手柄前端释放，球路更开阔；动力流体六角框搭配百洛碳纤维中管；刚柔相济，攻守圆通，全面操控；更适合把握节奏的控制型选手。', '高强韧碳纤维+强芯填充技术+TR增韧纳米碳管', '高强韧碳纤维+PYTOFIL+6.8SHAFT', 84.0, 75.0, 675.0, 'G5、G6', '适中偏硬', 5.0, 27.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10364.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧100ZZ新色AX100ZZ新色100ZZ新色', Null, '天斧100ZZ全新配色以如同铭刻在灵魂深处的厚重深红色为基础，白色和鲜艳的薄荷蓝的反差彰显出强烈的威严感。新色预定使用球员为：安赛龙、石宇奇、山口茜等顶尖球员。将于2021年6月上旬登场。', '高弹性碳素；新次元碳素；黑色微核；钨；致密型纳米碳素', '高弹性碳素；新次元碳素', 89.0, 80.0, 675.0, 'G4、G5、G6', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9362.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击猎鹰TK猎鹰黑金小隼小黑隼小隼', 2020, '威克多（victor）胜利羽毛球拍TK-HAWK全碳素猎鹰偏进攻小隼\n蓝色、黑金色', '高强韧碳纤维+PYROFIL+HARDCOREDTECHNOLOGY', '高强韧碳纤维+PYROFIL+6.6SHAFT', 84.0, 75.0, 675.0, 'G5', '适中', 5.0, 26.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_7740.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧99ProASTROX99ProAX99Pro', Null, '在YONEX深受世界顶尖选手信赖的天斧系列中，将推出全新天斧99系列，带来更强的杀球力量与持球性。天斧99PRO面向高水平球友和专业级选手，白虎纹（825）、日耀红（826），预计将于2021年9月下旬上市。\n就近年来的羽毛球发展而言，除了赢得快节奏对抗所需要的连续强攻能力，还需要从容不迫赢得多拍拉锯的快速挥拍性能。此次，天斧全系列所搭载的创新技术“回转力生成系统”得到升级。PRO版本在拍框整体使用了高强度体积压缩树脂，实现超致密的重量分布，使挥拍更顺畅，提升连续强攻。\n在拍框顶部搭载含钨连钉，相比传统的单体护线管有所增重，为回转力生成系统实现增强，使击球力量快速传递至球头。并在拍框两侧采用了全新大孔径线孔设计，通过扩大拍线的可动范围，提升击球时拍面与球头的接触时长。\n除此之外，PRO版本为标志性的方型拍头进行升级，形成更大且更具容错率的甜区。拍框侧面的加厚设计提升了拍框刚性。拍杆采用相对旧款更细的EXTRASLIMSHAFT，挥拍感受更佳。并且采用力量转化锥盖PLUS，带来更好的拍杆弯曲度与回弹。这些技术改变使扣杀更具威力，挥拍更加流畅，为高水平选手带来更优的球拍性能。\n位居世界排名第一的男单选手桃田贤斗（NTT东日本）将使用天斧99PRO（颜色：白虎纹）。\n\n※大孔径线孔设计指增大横线甜区部分线孔直径。\n\n创新\n1.超致密重量分布设计实现更顺畅的挥拍（运用于PRO·TOUR·GAME）\n通过在拍框使用高强度的体积压缩树脂，带来超致密的重量分布设计，使挥拍更顺畅的同时，提升连续进攻的能力。另外，在拍框顶部搭载含钨连钉，相比传统的单体护线管有所增重，为回转力生成系统提供了增强，使击球力量快速传递至球头。\n为回转力生成系统带来升级，实现更高层次的重量分布设计\n2.全新线孔设计提升了持球性（运用于PRO·TOUR·GAME）\n在拍框中加入体积压缩树脂后，拍框的强度得到了提升，因此拍框两侧使用大孔径线孔也不会影响拍框强度。通过扩大拍线的可动范围，提升了击球时拍面与球头的接触时长。\n3.面向高水平选手的拍框设计（仅运用于PRO）\n与旧款相比，拍框更接近四边形。YONEX标志性的方型拍头得到升级，形成更大且更具容错率的甜区。即使没有击中拍面中心，也能强力且稳定地出球。拍框侧面的加厚设计提升了拍框刚性。\n4.全新拍杆和锥盖带来了更佳的挥拍感受，实现更好的拍杆弯曲度与回弹（仅运用于PRO）\n拍杆使用了相对旧款更细的EXTRASLIMSHAFT，挥拍感受更佳。并且采用力量转化锥盖PLUS，带来更好的拍杆弯曲度与回弹。', '高弹性碳素；新次元碳素；体积压缩树脂；钨', '高弹性碳素；新次元碳素', 89.0, 80.0, 675.0, 'G4、G5、G6', '硬', 29.0, 21.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9706.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '极速系列', '极速10极速10QJS10Q西瓜刀', Null, 'VICTOR的极速（JS）系列球拍，据说是从亮剑(BRS)速度系列发展而来，口碑不错。\n作为以速度主打的JS10新色，今年9月份上市以来，颇受VICTOR球拍爱好者的欢迎。小拍框，而且拍框采用了三中框型组合：箱型+流体破风+椭圆破风（又有点像菱形破风）框型。控制风阻，速度兼顾力量。\n球拍上手，尽管是小拍面，由于使用过小拍面球拍，新拍上手，对我并不陌生，手感非常适应，不需调整。网前，及前场球，球拍灵活，甜区集中，出球速度快。\n对拉后场高球，正、反手击球，手感清楚。挥拍及球拍出球比较快，击球点位于甜区中心附近时，效果会更好些，也比较省力。实测锥柄上端中杆直径约7.0MM。手感中杆比较硬，弹性不错，回弹速度快，也比较稳定。\n中、前场杀球速度比较快，击球感也比较扎实，球拍线的指向性比较好，线路落点也不错。后场杀球，尤其是击球点在甜区上方时，落点不够尖，暴力不足。\n体验的球拍为4U5。个人觉得，力量足的球友可以考虑3U，力量手感会更好些。\n虽说球拍轻量化、小拍框，突出了快速进攻，扎实的控球手感，及兼顾进攻力量。\n测评参见:\n极速锐弹VICTORVBS-66N新线及JS10球拍新色联合体验-神兵利器中羽在线社区http://bbs.badmintoncn.com/forum.php?mod=viewthread&tid=818039', '超高刚性碳纤维+增韧奈米碳管', '超高刚性碳纤维+百洛碳素纤维+奈米树脂', 89.0, 80.0, 675.0, 'G5', '硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6651.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC11YXARC11ARC-11弓箭11弓11弓剑11', 2017, 'YONEX尤尼克斯ARC-11（弓箭11）羽毛球拍。外观结合了ARC10的经典颜色和ARC-ZS的霹雳旋风风格，视觉上更具冲击，更时尚，ARC-11的使用球星是印尼名将陶菲克。材料上的革新是大的卖点，弓剑11结合了YONEX其他系列，如VT系列、NR系列以及弓剑系列本身的一些代表性元素。富勒烯的加入让弓箭系列球拍拍框较软的问题得到解决，叠杯纳米碳素，PEF减震，带来爽快的手感，更强的高远球能力！ARC-11的击球声音，是一种金属爆破的声音，会让您有听觉上的享受。更快的速度，更悦耳的炫音爆破效果，更扎实稳定的手感！暴力不能解决所有问题，拒绝纯力量，弓剑11传承弓剑系列控球性能佳的血统，加上其他系列的亮点元素，真正是准确点杀，掌控的典范！追求快速准确落点的球友不能错过！', '新型杯状碳素纳米管；高弹性碳素；音效金属', '高弹性碳素；超级聚乙烯纤维', 94.0, 80.0, 675.0, 'G4、G5', '硬', 4.0, 19.0, '295~300mm', 'https://www.badmintoncn.com/cbo_eq/view_7623.html');
