insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MX80MX-80', Null, 'METEORX80尖锋X80采用创新的OCTABLADE八面刀锋结构拍框，融合了菱形破风结构与钻石型六角结构特性，比一般框型提升22%的拍面稳定性；再佐以CarbonXT碳纤维强化叠织技术，采用双轴向X型连续交织方式，使碳纤维更紧密地交织叠合，形成强有力的连续拉力网，显著提升拍面的刚性与抗扭力，产生空前爆发力；世界独创的80线孔模式，让拍线分布更加均匀，有效改善横竖线相互摩擦情况，稳定线床磅数，最大限度保护拍线。', '超高刚性碳纤维+纳米树脂', '超高刚性碳纤维+纳米树脂+7.2SHAFT', 89.0, 80.0, 675.0, '-', '硬', 4.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4024.html');
