insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '龙牙之刃二代TK-RYUGAll龙牙之刃2代龙牙2', Null, '威克多龙牙之刃2JTK-RYUGAll羽毛球拍（深紫色）\nTHRUSTERRYUGAll、TK-RYUGAll\n鞭擊增益系統2.0\n(WIPPINGENHANCESYSTEM2.0)(WES2.0)采用新的碳纖維疊層設計，抗扭性提升，回彈加速更直接，力量傅導更好，進攻時的下壓角度更加尖銳，重新定義反折鞭甩的犀利本色。\n龙牙二代特点:\n1.中管采用了新的WES技术，为WES2.0，针对中管做了全新设计。\n2.WES2.0中管采用全新的叠层设计，这样的设计也能让三通位置的抗扭性和整体力量传导更好。可以在高远、杀球等球路上，能明显的体验到力量传递效果;\n3.WES2.0技术的体现，主要也是我们同时连动了人造柄技术，如果用在传统木柄上\n就会无法实现。WES2.0技术搭配人造柄技术的运用，使龙牙二代跟一代在挥重上相比，虽然有所降低，但可以达到与一代相同的进攻效果，而进攻时的下压角度也会比一代更尖锐。', '高强韧碳纤维+强芯填充技术', '高强韧碳纤维+PYROFIL+6.6SHAFT', 89.0, 80.0, 675.0, 'G5', '偏硬', 4.0, 14.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11566.html');
