insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击66ITK66ITK-66I', 2020, '箱形结构\n拍框断面采用箱形结构设计，有效提高击球时稳定性和抗扭力，可承受较高的拉线磅数。\n\n强叠层系统\n透过全新碳纤维叠层设计，强化拍框刚性，可耐高磅数乘载力，提供扎实击球手感。\n\n纳米材质\n采用纳米级树脂材质添加技术，能使Nano微细颗粒均匀分布于碳纤维束间的空隙，增加碳纤维复合材质的整体刚性与强度，减少拍框变形。', '高弹性碳素+纳米树脂+强叠层系统（FRS）', '高弹性碳素+纳米树脂+7.0SHAFT', 66.0, 66.0, 675.0, 'G6', '适中', 31.0, 30.0, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_7451.html');
