insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88DPAX88D-PAX88DP88DPRO', Null, '广受欢迎的ASTROX88S和ASTROX88D在2021年3月推出进化版，其中采用了新的创新技术和精心制作的材料以提高性能。ASTROX88SPRO和ASTROX88DPRO旨在配合不断发展的更快节奏的双打比赛，它需要选手更快的反应和连续有力的进攻。与PRO一同上市的还有大众化的ASTROX88S/DTOUR和GAME，它们的使用了相同的设计理念，带来同等性能表现。\n\n进化的重量分布设计使球拍回转力得到提升。本次全新升级了天斧系列球拍的重量分布。通过在全拍框使用高强度新材料体积压缩树脂，实现了更为细致的重量分配，为连续强攻提供必要的回转力。为高速进化的双打，实现更顺畅的操控性。\n\n全新打孔设计，通过使用高强度新材料体积压缩树脂，在拍框两侧首次使用粗孔设计。提升拍线的可形变范围，同时提高击球时的拍面接触时间，增强持球性。根据S版和D版各自的特性，在最合适的位置配置了最佳数量的粗孔，发挥符合前后场选手的性能。\n\n全新拍框设计提升拍框刚性，使甜区扩大。与旧款相比,拍框更接近四边形，通过搭载升级后的YONEX独家拍框设计方型拍头，使甜区扩大。拍框侧面更厚提升拍框刚性，使出球速度提高。', '高弹性碳素+体积压缩树脂+钨', '高弹性碳素+新次元碳素', 89.0, 80.0, 675.0, 'G4,G5', '硬', 4.0, 20.0, '302mm', 'https://www.badmintoncn.com/cbo_eq/view_8875.html');
