insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO800', Null, 'YY的经典型号,曾在多位名将手中夺得过众多殊荣,如龚智超,葛菲,顾俊,叶昭颖,叶城万,张军,高凌等,在高级资深玩家口中有"拍皇"之称,堪称YY中最趋完美的型号!', '碳素纤维', '碳素纤维', 94.0, 90.0, 664.0, 'G3/G4/G5', '超硬', 20.0, 16.0, '282mm', 'https://www.badmintoncn.com/cbo_eq/view_2888.html');
