insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧99LCWAX99LCWAX99LCWTEX', 2019, '李宗伟亲自参与设计的新色球拍ASTROX天斧99LCW荣耀出世，这把专为羽坛传奇李宗伟打造，并且由他本人亲自参与设计。在这把球拍孕育的过程中，YONEX开发团队人员数次飞赴马来西亚，与李宗伟商讨球拍事宜，听取他的想法和意见，并在设计上与他达成了一致。这把球拍力求展现李宗伟对羽毛球这项运动作出的卓越贡献以及倾注的非凡热情。球拍主色调为绿色，象征着活力，速度和力量，这一颜色由李宗伟本人亲自选择，也是他的幸运色。紫色的加入与绿色形成强烈对比，除了增加设计的动感之外，也平添了一份荣耀感，象征着李宗伟在羽毛球界的尊崇地位。包括拍框在内，ASTROX天斧99LCW全拍身都采用了新次元碳素材料*，大幅增加了拍面与羽毛球的接触时间，挥拍结束时球拍会迸发出惊人的力量，实现强力扣杀。此外，力量转化锥盖的形状提升了拍杆的弯曲范围，进一步保证了新次元碳素效果较大限度的发挥。回转力生成系统，作为天斧系列标志性的技术革新，能使连续进攻更加顺畅，从而帮助球员较大限度的发挥全拍身新次元碳素的效果。*新次元碳素NAMD是由NITTA（株）所开发的全新碳纤维材料，将纳米材料均匀地分布在碳素纤维上', '高弹性碳素；新次元碳素；钨；致密型纳米碳素', '高弹性碳素；新次元碳素；钨；致密型纳米碳素', 89.0, 80.0, 675.0, 'G4G5', '硬', 29.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7339.html');
