insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC-10弓10弓箭10ARC10弓剑10红弓', 2008, '“弓剑系列”在拍框侧面装上具备强韧性和强粘性新材料的“叠杯纳米管”，同时具备“力量性能”和“控制性能”。这款球拍利用对拉高远球和扣杀进行反复攻击，可自由操纵速度的性能在新规则中发挥了强大的威力。\n\nYONEX弓剑系列羽拍在推出ARCSABER－7后，现已在日本、中国、新加坡等市场同步上市。该拍以红色为主色调，预计YONEX将在即将到来的北京奥运会上掀起一阵红色风暴。\n\n\n叠杯碳素纳米管：“弓剑系列”在拍框侧面应用的“叠杯碳素纳米管”复合树脂技术提高了拍框塑性，能让拍框在对羽毛球释放惊人的力量与速度之前，更多地储存撞击时的冲击能量。拍框塑性的提高也延长了羽毛球在线床上的驻留时间，充裕的驻留时间允许球员创造出更隐蔽多变的有效击球，积极自信、掌控大局。\n\n装上新型内置T形接头的ARCSABER：内藏在拍框和拍杆连接部位的“内置T形接头”，强抗变形性提高了拍面的稳定性，实现高精度的控制性能，是YONEX羽毛球拍的“原创技术”。『新内置T形接头』把合金材料改为轻量的特殊塑料材料，结合了新型的环氧树脂。精度和品质都有进一步的提高，拍框、拍杆更加一体化。而且更能避免打球时产生的变形，拍面更加稳定，进一步提高对拉高远球的控制性能。扣杀速度加快，发挥无与伦比的威力。\n球拍做工细腻，漆工考究，大红色，震人心魄！拍杆硬，头重进攻型，特别适合喜欢凌厉杀球的羽毛球球友!\n\n此拍新上市，颇受广大羽球爱好者喜爱，推荐中高级水平选用。', '超高弹性碳素叠杯碳素纳米管，同时具备高强度和柔软性的新材料叠杯纳米管', '高弹性碳素超级聚乙烯纤维', 94.0, 80.0, 674.0, 'G3,4,5', '硬', 3.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_480.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '极速系列', 'JETSPEED11DJS11JS11D', 2020, '结合薄翼拍框与劲疾能梁工技术打造的速度型球拍。薄翼拍框可增加球拍挥速，并优化球拍抗扭性能；劲疾能梁工科技使球拍反弹性能得到大幅提升，挥拍时释放更大击球力量，适合擅长快速进攻的双打选手。', '超高刚性碳纤维+HARDCOREDTECHNOLOGY', '超高刚性碳纤维+6.8SHAFT', 89.0, 80.0, 675.0, 'G5、G6', '-', 30.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9041.html');
