insert into detail values('羽毛球拍', '李宁Lining', '锋影系列BLADEX', 'AYPR264AYPR266BLADEX800', 2021, '锋影800BLADEX800锋影系列\n性能特点：中杆回弹速度快，拍框风阻低，适合发力好抽压能力强的速度型专业及高水平选手。科技：飞电加速系统、灵控速弹中杆、UC碳纤维、热熔胶、超导纳米、空气动力学截面系统、力学优化拍框、高复合密度减震系统', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, 'G5', '偏硬', 7.0, 1.0, '293-295mm', 'https://www.badmintoncn.com/cbo_eq/view_10601.html');
