insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓1000ARC1000tourARCtour1000弓剑1000弓箭1000', Null, '红蓝两种颜色\nArcsaberTour1000羽毛球拍是在日本开发和制造的。YONEXNanoscience在分子水平上实现了对球拍功能的精确控制，创造了比普通球拍更薄，更结实，更稳定的超轻型球拍，可从挥杆能量中获得最大的力量和最快的速度。\n球拍杆长10毫米，并且平衡。ARCSABER框架设计为在冲击点弯曲，以将梭子保持在弦床上的时间更长。\n在YonexArcsaber1000Tour中使用CS盖–与普通球拍相比，控制支撑盖可提供88％的平坦表面，以便于抓握，快速跟进和最出色的操纵性。', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, 'G4、G5', '适中', 28.0, 19.0, '290-295mm', 'https://www.badmintoncn.com/cbo_eq/view_8491.html');
