insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NRZSPNR-ZSP炸薯片', 2013, 'NR-ZSP：运用强韧树脂的新型流体雕塑拍框轻松的防守和推挡。拍框中上部运用了，令对手防不胜防。\n\n1、NANORAY纳米锐速系列拥有更加灵活的操控性，更高的反弹力，在当今闪电般的对攻中发挥光束般的快速优势！\n\n2、拍框中部运用了TOUGHLEX强韧树脂提高拍框两侧的柔韧性，延长羽毛球在甜区的驻留时间从而提升控球性能，帮助球员打出快速又精妙的底角推挡球，令对手防不胜防。\n\n3、全新AEROFrame拍框：高反弹型与高舒适性之间的极佳平衡，全新AEROFrame拍框采用独特的拍框结构，拍框沿框边从顶部到底部不同的厚度。顶部的薄边结构降低空气阻力从而提升拍头挥速，底部的厚边结构结合高硬度产生极高的反弹力。\n\n4、X-FULLERENE纳米技术：拍杆运用X链富勒烯，比纳米系列更有弹性，NANORAY纳米锐速系列的拍杆运用富勒烯的升级材料X链富勒烯，提升拍杆的总体抗弯能力，硬度提升6%，反弹力提升4%。更高的反弹性能可以让球员在中前场激烈的争抢中，即使短促的推挡拦截动作也能将球深深的推到对手的底角。X链富勒烯能使球拍“瞬间反弹”，使新系列球拍打出光速般的击球。\n\n5、球拍拍框采用YONEX独特的三角形威力拍框（DeltaPowerFrame）：符合空气动力学原理的三角形威力拍框，能在不减低拍框威力的前提下提供扎实、稳定的击球拍面。\n\n6、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n7、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '高弹性碳素+强韧树脂+音效金属', '高弹性碳素+X链富勒烯纳米碳素', 94.0, 85.0, 674.0, 'G4，G5', '硬', 5.0, 1.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_6359.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓剑11PROARC-11PROARC11-P弓11PROARC11PRO弓箭11PROARC11-PYX', Null, 'ARCSABER11自2013年上市以来9年，广受各位消费者的喜爱，现在决定于2022年2月底推出升级后的羽毛球拍ARCSABER11PRO，面向高等水平者、专业选手。本产品采用新设计、新结构，进一步进化了以往产品"ARCSABER11"的特征——持球感、独特的击球感，实现了更精准的控制性能。\n\n为了提高持球性的稳定性，采用了2种全新横截面形状。在拍框的上部和下部使用了高刚性的有凹槽的框型，提升拍面稳定性。便于产生形变的无凹槽框型。配合甜区、使用于拍框两侧。带来持球性和独特的击球感。另外，在接头部分使用了高刚性、高强度的锚状T形接头。从而在击球时抑制拍框的抖动，提升拍面稳定性。\n\n拍框顶部搭载与锚状T形接头相互配合的助控连钉，提升拍框高刚性和稳定性。除此之外，使用了拥有类似橡胶的延展性和快速还原特性的弹性体材质“PB弹性体”，提升持球性和出球速度。\n\n通过这些技术提高了击球准确性、持球时间，增加杀球的威力，创造出精准的控制性能和击球力量。混合双打世界排名第一的选手沙西丽·德拉达那猜（泰国）将使用此球拍。\n\n创新技术\n\n1.提高持球性与拍面稳定性的全新拍框设计\n在拍框的上部和下部使用了高刚性的有凹槽的框型，提升拍面稳定性。拍框两侧搭载无凹槽框型、带来持球性。在接头部分使用了高刚性、高强度的锚状T形接头。从而在击球时抑制拍框的抖动，提升拍面稳定性。\n\n2.拍框搭载“助控连钉”和“PB弹性体”提高持球性与拍面稳定性\n与锚状T形接头相互配合的助控连钉，搭载于拍框顶部，提升拍框高刚性和稳定性。“PB弹性体”拥有类似橡胶的延展性和快速还原特性的弹性体材质，能提升持球性和出球速度。', '高弹性碳素＋PB弹性体', '高弹性碳素＋SUPER-高弹性碳素＋ULTRA-聚乙烯纤维', 89.0, 80.0, 675.0, 'G4、G5、G6', '-', 4.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10836.html');
