insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VTLDFVTLD-FCHVT-LDF红豆腐', Null, '接头：新内置T形接头\n为林丹量身打造——YONEX羽毛球拍中的力量扣杀型球拍将于2019年5月下旬限量发售。\nVOLTRICLD-FORCE采用致密型纳米碳素DR，使拍框更具坚韧性和反弹性，同时也搭载了兼具力量和操控性一体的威力三角系统，同时为了大幅度减少空气阻力,采用了YONEX较细的拍杆，使扣杀球速不易丢失，在VOLTRICZ-FORCEII的原有基础上而开发的林丹专属球拍。\n在新设计中，主打黑色的部分营造了凤凰张开羽翼翱翔的感觉，寓意了林丹依然占据羽坛王者的风范，与林丹的气势相得益彰的设计理念。', '高弹性碳素拍框+致密型纳米碳素DR+钨+音频滤清器', '高弹性碳素拍杆＋致密型纳米碳素', 89.0, 80.0, 675.0, 'G5', '特硬', 4.0, 20.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_7040.html');
