insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击9900TK9900', 2015, '分别有2个版本，南京产版本和台湾产版本，台湾是百洛碳，南京是FLASH，台湾版使用配重连钉，南京版12点六连钉；\n胜利VICTORTK9900羽毛球拍此次的配色选用了红橙+蓝色，特别醒目的是拍框10、2点处加装了配重条！就是尤尼克斯VT80etune那种联钉配重条！集成了特别设计的套管条，以提高瞬间发力的功率，另外TK-9900还配有一个紧凑型的拍面，甜区显得浓缩了一些，加上一个额外的细轴，使得此拍拥有令人惊讶的强大攻击力。', '超高模石墨纳米M30J+树脂+PYROFIL三菱+ZXION', '多层石墨烯纳米M30J+M46J+树脂+硬合金包芯技术+FLASH6.4SHAFT', 89.0, 75.0, 675.0, 'G4、G5、G6', '适中', 8.0, 2.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6453.html');
