insert into detail values('羽毛球拍', '威克多VICTOR', 'HYPERNANOX系列', 'hx7spHX7HX-7SP纳米7SP', Null, '胜利超级纳米7羽毛球拍，经久不衰近十年，堪称羽拍中的传奇，畅销款，现在依旧是广大球友心中值得信赖的球拍；HX-7SP，纳米7的继承者！\n相比纳米7羽毛球拍，HX-7SP在拍框处进行了全面升级，拍框在原有的钻石拍框基础上，在4、8点处采用流体破风拍框，既保证了挥拍速度，又更加稳定了击球，同时中杆由7MM提升至6.8超细中杆。\n后场拉高远球时，明显会觉得风阻更小挥拍更迅速；拉吊突击打法的朋友在劈吊的时候落点更加的精准，增加了速度、弹性和硬度。', '高刚性碳纤维+纳米树脂', '超高刚性碳纤维+NANOTUBE+6.8SHAFT', 89.0, 80.0, 675.0, 'G5', 'S○○●○○F（适中）', 4.0, 11.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_6443.html');
