insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', Null, Null, 'YONEXVoltricomegapro是专为激进的羽毛球运动员设计的头部重型羽毛球拍。由于其头部沉重的框架配置，VTOmegapro在扣球和特别是在三线投篮时产生巨大的力量。Omegapro的车架由全碳石墨制成，带有三电压系统，而轴材料则由全碳石墨开发。使用三电压系统，它可以在不影响球拍摆动速度的情况下提供强大的击球。因此，羽毛球运动员可以同时享受快速的球拍摆动以及强力扣球和三线击球。Voltricomegapro拥有85至89.9的体重和中等柔韧性，适合中级玩家、高级玩家。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G4', '适中', 24.0, 24.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_9948.html');
insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', 'J20ZD006ZD007', Null, Null, '30T高刚性纳米树脂碳布+1.5KWOVEN工艺', '高刚性碳纤维+100%1.5KWOVEN工艺', 89.0, 80.0, 675.0, 'G4', '适中', 30.0, 30.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_8987.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧100ZXASTROX100AX100ZX', Null, '天斧100对天斧系列的创新型回转力生成系统进行了优化。在拍柄底部、拍框顶部和接头位置进行了更精密的重量分布，提升了球拍的回转力。这些增强的功能确保了快速的连续进攻。球拍采用的Namd，可提高柔韧性和反弹性，释放巨大的爆发力。与回转力生成系统所产生的协同作用可实现持续有力的进攻。\n天斧100推出了2款型号，分别为天斧100ZZ和天斧100ZX，它们拥有相同的设计理念和性能。', '高弹性碳素；钨；纳米网状树脂NEO', '高弹性碳素；新次元碳素', 89.0, 80.0, 675.0, 'G4、G5', '硬', 4.0, 20.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_7763.html');
