insert into detail values('羽毛球拍', '威克多VICTOR', '亮剑系列', 'BRS12亮剑12BRS-12', 2012, '球拍断面高度降低10%的亮剑系列，拍框采用SWORD菱形结构，如利剑破风般犀利，有效减少挥拍时空气阻力，使控球轻盈敏捷，掌握最佳进攻节奏，INNERWAVE内波浪拍框加强结构设计，甜区面积增加5%。同时，增强击球时吸震性，维持拍面稳定性，显著提高回球质量，“亮剑”出窍，彰显王者之气!', '超高刚性碳纤维+纳米树脂', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 89.9, 80.0, 675.0, '不详', 'S○○●○○F', 4.0, 26.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_4488.html');
