insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VTZF2LVVTZF2LLD', 2015, '王者之志四大天王签名版林丹\nYonexVoltricZ-ForceIILV林丹羽毛球拍具有强大的耐力，但在操控性上却丝毫不逊色，因为它得到了中国传奇羽毛球明星林丹的认可。它具有钉书钉的等距形状，可显着增加甜蜜点，并具有Tri-Voltage系统，可确保与头部沉重平衡相称的爆发力。声音过滤器技术可以在激进的击球时以高亢的声音震撼对手，而柔和的核心技术则可将减震复合材料放置在车架上，从而减轻每个击球的振动。球拍的球拍弦线带有坚固的BG65ti混合弦线，给人以奇妙的感觉，', 'HM石墨/声音过滤器/钨', 'HM石墨/EXHMG/纳米', 84.9, 80.0, 675.0, 'G4', '-', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9025.html');
