insert into detail values('羽毛球拍', '高神Gosen', '凌驾RYOGA', 'RYOGASHIDEN', 2010, '1,半四方形拍框与拍杆均採用了Zylon（柴隆）制造，Zylon纤维由美国空军于20世纪80年代首先研制，日本研究并转为民用，这样的碳纤维合成结构质量轻而且韧度高。\n2，拍杆内外径呈锥形，6.7mm-7.5mm渐变粗细拍杆，从拍锥到拍框T头位置是由粗到细渐变过去的，让我想到从前GOSEN在拍锥中杆附近采用的力节点加粗设计，不过这样的改变相信会增加球友的一些适应过程。凌驾天舞侧重速度，一闪是力量型进攻拍，而紫电则号称是力量和速度兼备的选手专用，说白了就是更加的全面,我解读为这拍子您的速度快没力量是玩不动的，有力量要再增加一些速度，这拍子是可以的。\n3.不光中杆是粗细渐变，而且拍框也是上下不同，T头部分是10MM厚，顶部是9MM。挥拍更快，这也可以解释为什么一闪和天舞规定磅数是小于等于30，而紫电少了三磅只有27，对拉线师的要求也应该是更高了。高磅球友还望三思。\n3.5颜色与韩国版天舞很像，只不过在T头附近的花纹沿袭的是一闪的样式，三者可以看得出一脉相传。\n4，紫电平衡点也属于适中的285MM，一般在加线加手胶的情况下，会再降低1-2MM。一闪是头沉，天舞则是MIDDLE，头轻一些。硬度虽然和天舞都是最硬，比一闪硬，但我觉得紫电应该使用起来会给人更硬的感觉，毕竟知拍锥的这一段中杆有7.5MM粗，在中杆7.0MM大行其道的今天绝对有点力道。\n5，官方推荐线，紫电只有一种R4X110，类似YY80，当然这不是绝对的，但是从推荐线可以推断出一些端倪，110是0.68MM线径，力量和弹性兼顾，而且耐打不错，全面线配全面型的拍子，显然是有点过分强调全面了，我倒觉得可以根据个人喜好上纯力量线或者纯高弹线来最求个人的手感需求。', 'Zylon（柴隆）四轴碳纤维', 'M40四轴碳纤维', 93.0, 83.0, 675.0, 'G5', '超硬', 27.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3632.html');
