insert into detail values('羽毛球拍', '李宁Lining', '风动导流', '风动6000IAYPR006', 2021, '风动6000I蓝色\n2孔风洞设计，球速更快，落点精准；79g超轻克重，克拉30磅；挥拍灵活，攻防俱佳\n科技：多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、热熔胶、复位弹性扭角、高刚性细中管', '碳纤维', '碳纤维', 0, 0, 670.0, 'S1', '适中', 30.0, 30.0, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_8815.html');
