insert into detail values('羽毛球拍', '威克多VICTOR', '亮剑系列', 'BRS12L亮剑12LBRS-12L', Null, '其实球拍如枪，并不应该有所谓的进攻和防守之分，\n本来就都是为了打击对方的存在。\n只是有的如冲锋枪，\n射程短，精度高，速度快，瞬间爆发力高，以速度取胜；\n有的如步枪，\n近可扫，远可点，场上全能的存在，人手一支的经典；\n还有的如狙击枪，\n拉开距离，一击毙命，\n进战虽然容易被动，但瑕不掩瑜，一样受到追捧，威力不容小觑。\n\n无非有些威力大，有些射速快，有些准度高。\n但不管是什么武器，都是以干掉对手为根本目的，\n至于进攻还是防守，全看你在战场上的需要。\n同样是狙击手，\n有时是掩护，有时是射杀，\n一种武器，百种战法。\n\n从亮剑08诞生起，\n胜利就像一位铸剑大师。\n仅亮剑系列，就诞生了多支好拍，\n可以说，\n每一个人都能找到一支适合自己的“剑”\n这支有着亮剑12血统的12L，\n在适当将物性调整轻软之后，\n还很明智的将手柄细化，\n这样既能够轻松发力，\n还能从容控制，\nL，意味着Light，却又蕴含着“KILL”中的L\n清冷的拍框仿佛散发着寒光的剑刃，\n剑指要害，\n虽然没有夸张的破坏力，\n但却更加危险，\n更加防不胜防，\n剑本就变化多端，\n在亮剑12L上体现的更加明显，\n比较明显的体现就是双打时的防守，\n往后场挑的时候很轻松，\n结合头轻的贴点，\n还能更好地控制方向，\n从而调动对方后场队员的位置。', '超高刚性碳纤维+纳米树脂', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 84.0, 80.0, 675.0, 'G6', 'S○○●○○F', 28.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6134.html');
