insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS9900', 2009, '适合对象：中级/高级.单打/双打选手\n头轻，杆硬，抗扭力强，色调稳重大气，男女皆宜，克服了NS9000X、AT900P、AT700等大力进攻球拍的缺点。\n手感轻灵而有力度，是挥拍速度较快的一款高端YY羽拍。', '高性能碳素纤维+纳米级弹力钛纤维', '高性能碳素纤维+纳米碳粒子', 94.0, 85.0, 674.0, 'G4,5', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1833.html');
