insert into detail values('羽毛球拍', '李宁Lining', '雷霆系列AXFORCE', 'AYPR248AXFORCE80CL雷霆80CLAF80CL谌龙签名版', Null, 'AXFORCE80CL雷霆80谌龙签名礼盒限量版，附带雷霆文化衫1件、1号线1副和GP3000手胶1盒，礼盒不带编号，限量2000套；\n【外观设计】老宁迷们应该不难发现，雷霆80是李宁首款“不对称设计”的球拍，整体颜色以暗色为主，比较符合谌龙沉稳的球风和性格，通过在拍框和中杆添加亮色点缀，明暗相融，也凸出谌龙在此次比赛中突击变化的球路。\n【材料】李宁新生代碳素材料、结合超导纳米材料，提升球拍的弹性，在进攻发力时获得到成倍的弹性势能，增强进攻势能。\n【科技配置】\n拍框加入“高复合密度减震系统”，提升球拍吸震性能，并搭载6.6mm纤细高强度仿生中杆，提高球拍弯曲点，增加进攻性能。\n在雷霆80球拍上将会首发雷霆平台专属科技系统——增压动能系统FRTPTECH，结合材料、结构等等特性，通过选手实测不断优化升级，优化雷霆球拍的独特属性。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G5', '适中', 31.0, 31.0, '303mm', 'https://www.badmintoncn.com/cbo_eq/view_9856.html');
insert into detail values('羽毛球拍', '李宁Lining', '火系列', 'AYPE018N502N50II', 2010, '2010年，N50二代的推出，使得N50更加增加了对业余选手的吸引力。灵控内锥新科技的应用，使得中管的弯曲点前移，球拍的灵活性更高，提高了控球的手感，使得选手的意图更能清晰完美地表达。\n\n复位弹性扭角新科技的应用，可以保证球拍的高弹性在击球的瞬间，即便击球点偏移中心复位弹性扭角技术也可以协助创造高质量的回球。\n\n创新性的70孔设计，还有球拍技术中经典的波浪型内框增加了击球甜区，同时让球拍更加精确的传递力量手感。N50二代，值得收入囊中！', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2/S3', '偏软', 30.0, 18.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2796.html');
