insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '乌缺J20ZD004ZD0052BD2162004E2BD2162005E', 2018, '球拍属性：攻击拍\n适合球员：专业选手\n球拍特点：\n●框型：波力破风式框型，挥拍时将空气快速导流，降低空气阻力，提高扣杀速度。\n●中管：高弹性细中管6.5mm直径，采用全新超韧性树脂材料，弹性更强，刚性更刚。\n●二次成型，使用高刚性碳素原料制成：(1)提升拍框刚性→A.从容承受高磅数网压B.有效提升攻击系数C.强化拍框控制性，控球效能佳(2)有效提升拍框及中管之抗扭力系数→A.强化控球效能。B.提升击球手感。\n●乌纹：整支1.5KWoven,有效提升球拍抗扭力效果与弹性，并显现高档质感。\n●平衡：平衡点±0mm(未穿线)设定，击球手感佳。', '高刚性碳纤维', '高弹性中管+Woven', 89.0, 80.0, 675.0, 'G4', '适中', 30.0, 30.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_6931.html');
