insert into detail values('羽毛球拍', '李宁Lining', '立体风刃', '3DCALIBAR900C', Null, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、中管弹性复位系统、热熔胶、立方锁、复位弹性扭角、新生代碳素', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2（82.5mm)', '偏硬', 32.0, 32.0, '302mm', 'https://www.badmintoncn.com/cbo_eq/view_6758.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88SPAX88S-PAX88SP88SPROAX88SPRO', Null, '广受欢迎的ASTROX88S和ASTROX88D在2021年3月推出进化版，其中采用了新的创新技术和精心制作的材料以提高性能。ASTROX88SPRO和ASTROX88DPRO旨在配合不断发展的更快节奏的双打比赛，它需要选手更快的反应和连续有力的进攻。与PRO一同上市的还有大众化的ASTROX88S/DTOUR和GAME，它们的使用了相同的设计理念，带来同等性能表现。\n\n进化的重量分布设计使球拍回转力得到提升。本次全新升级了天斧系列球拍的重量分布。通过在全拍框使用高强度新材料体积压缩树脂，实现了更为细致的重量分配，为连续强攻提供必要的回转力。为高速进化的双打，实现更顺畅的操控性。\n\n全新打孔设计，通过使用高强度新材料体积压缩树脂，在拍框两侧首次使用粗孔设计。提升拍线的可形变范围，同时提高击球时的拍面接触时间，增强持球性。根据S版和D版各自的特性，在最合适的位置配置了最佳数量的粗孔，发挥符合前后场选手的性能。\n\n全新拍框设计提升拍框刚性，使甜区扩大。与旧款相比,拍框更接近四边形，通过搭载升级后的YONEX独家拍框设计方型拍头，使甜区扩大。拍框侧面更厚提升拍框刚性，使出球速度提高。', '高弹性碳素+体积压缩树脂+钨', '高弹性碳素+新次元碳素', 89.0, 80.0, 669.0, 'G4,G5', '硬', 4.0, 20.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_8874.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '极速系列', 'JS12FTD极速12FTDJS-12FTD', 2020, '承袭了JS-12F的优秀科技。颜值清新实力出众，轻盈中更添弹韧提供灵巧瞬发力。适合球路多变，击球细腻的女性选手。流体破风框结合PYROFIL百洛碳素纤维，专为女性球友设定，手感柔韧舒适。', '高弹性碳纤维+HARDCOREDTECHNOLOGY', '高弹性碳纤维+PYROFIL+6.8SHAFT', 89.0, 80.0, 675.0, 'G5、G6', '适中', 4.0, 11.5, '-', 'https://www.badmintoncn.com/cbo_eq/view_8181.html');
