insert into detail values('羽毛球拍', '李宁Lining', '林系列', 'N902N90IIAYPE016', 2010, 'N90II二代比N90羽拍的改进之处：\n\n1，使用了李宁公司最新研发的，业内最顶级的中管技术--灵控内锥，这样使得中管的弯曲点前移，使得球拍的灵活性更高，并且提高了控球的手感，使得选手的意图更能清晰完美地表达。\n\n2，复位弹性扭角：可以保证球拍的高弹性。在击球的瞬间，即便击球点偏移中心，复位弹性扭角技术也可以协助创造高质量的回球。', '超刚性碳纤维+超导纳米', '超刚性碳纤维+超导纳米', 89.0, 85.0, 675.0, 'S2/S3', '中', 30.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2795.html');
