insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', 'J20-46W', 2022, 'bonny/波力羽毛球拍J2046W周年纪念进攻拍碳纤维白玉紫晶变色\n1框型:破风框，挥拍时将空气快速导流，降低空气阻力，提高扣杀速度。窄框，风阻小，提高挥拍速度。小平头拍面，增加击球带。\n2中管:46T高弹性细中管，弹性更强，强化中杆弹性回复力。\n3、星空漆，球拍采用变色星空漆，不同角度呈现不同颜色，如同紫色星空。4、二次成型，使用高刚性碳素原料制成:\n(1)提升拍框刚性→A从容承受高磅数网压B有效提升攻击系数C强化拍框控制性，控球效能佳\n(2)有效提升拍框及中管之抗扭力系数→A强化控球效能。B提升击球手感。\n5、乌缺工艺：不补土，结构更坚固。', '高刚性碳纤维+乌缺', '46T碳中杆', 89.0, 80.0, 675.0, 'G5', 'M', 30.0, 22.0, '305±0mm', 'https://www.badmintoncn.com/cbo_eq/view_10945.html');
