insert into detail values('羽毛球拍', '波力Bonny', 'BONNY1982系列', '波力1982B142', 2019, 'BONNY波力1982系列2020年新款，高刚性碳纤维+碳T头+乌缺+高分子填充+四轴中管，可攻可守！\n低风阻拍框，降低挥拍时的空气阻力，提高扣杀速度。\n三段式成型：头框，碳T头，中管。\n高分子填充，有效提升球拍力量传递速度\n四轴中管：提升中管弹性，提升抗扭力，提升击球速度。\n弹性：中管歪曲后回直时间较短。\n平衡：295±0，平衡点精确到±0。\n乌缺工艺：原料100%严格筛选。\n头框：2/5/7/10点多排钉，保护拍框和线的使用寿命。\n外观：数据魔方设计外观，很有现代科技感。', '高刚性碳纤维+碳T头+乌缺+高分子填充+四轴中管', '高刚性碳纤维+碳T头+乌缺+高分子填充+四轴中管', 89.0, 80.0, 675.0, '2#', 'G4', 30.0, 30.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_7551.html');
