insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧77ASTROX77AX77YXAX77', Null, '金属蓝(074)、亮黄色(402)\n新内置T形接头\n球拍框及中杆漆水的涂装，为非对称设计。拍框漆水的涂装，一面与另一面垂直方向基本相同，或理解为，当转拍翻面，拍框漆水为反相对称（球拍一面右侧与另一面的左侧对称）。\n拍框4（8）点位置，涂装有HEADHEAVYBALANCE/LONGSIZE，及HIGHMODULUSGRAPHITE/SUPERSLIMSHAFT；3（9）点，RotationalGeneratorSystem；11（1）点附近，ISOMETRIC，尤尼克斯球拍技术及设计理念的标示。', '高弹性碳素；钨；致密型纳米碳素', '高弹性碳素；新次元碳素', 93.0, 85.0, 674.0, 'G4、G5', '中等', 28.0, 20.0, '298mm', 'https://www.badmintoncn.com/cbo_eq/view_6627.html');
