insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', 'J20-008', 2021, 'A:破风式框型:破风框，风阻小，挥拍速度快,提高扣杀速度。\nB:中管:高弹性细中管1.5KWoven6.5mm直径,采用全新性树脂材料,弹性更强，更韧，有效提升球拍抗扭力效果与弹性,回弹速度更快\nC:二次成型,使用高刚性碳素从容承受30磅高磅数网压，抗扭性效果佳，拍框稳定性高，控球稳（中后场表现非常出色，重杀点杀速度快）\nD：软弹的中杆，在防守端也可以借力打力，轻松防守，控球稳', '高刚性碳纤维', '高弹性中管+WOVEN', 84.0, 80.0, 675.0, 'G5', 'M', 30.0, 30.0, '300±5mm', 'https://www.badmintoncn.com/cbo_eq/view_10630.html');
insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', Null, 2022, '采用了含碳量95%以上的碳纤维，这是一种常被选为制造航天航空等高科技器材的优良材料，碳纤维密度相较于普通碳纤维更高，确保球拍兼具重量和绝杀的威力，通过将纳米sio2颗粒均匀分散到树脂材料中，使球拍更加强韧，工匠们针对球拍不同部位精准地控制碳纱的层叠方向和大小，让球拍具备出色的进攻与防守效果，无论是进攻性还是防守型的选手都能找到适合的打法。', '高模量碳素纤维', '高模量碳素纤维', 86.0, 82.0, 675.0, 'G5（#2）', '适中8.5±0.2mm', 30.0, 30.0, '293±3mm', 'https://www.badmintoncn.com/cbo_eq/view_11313.html');
