insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88DASTROX88DAX88D', Null, '全新配色的ASTROX88S和ASTROX88D采用红色、黑色和米白色，这些颜色旨在体现运动员的热血与斗志。除了男双组合苏卡穆约/吉迪恩将使用ASTROX88S/D全新配色亮相，男双组合嘉村健士/园田启悟，以及女双组合福岛由纪/广田彩花也将使用新色球拍。', '致密型纳米碳素；高弹性碳素', '高弹性碳素；新次元碳素', 89.0, 80.0, 674.0, 'G4,G5', '硬', 4.0, 20.0, '308mm', 'https://www.badmintoncn.com/cbo_eq/view_8107.html');
