insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '8DXARC8DXARC-8DX弓箭8DX弓剑8DX', 2010, '2010年最新款球拍ARC8DX，是拥有更强拍框反弹力的ARCSABER新成员，是与ARC7，ARC9同档次的高端拍，据悉此拍拍头重量与ARC10类似，但中杆更硬，YY标明磅数到了28lbs，前所未有的高。\n尤尼克斯YONEXARC8DX新品研发概念也和以往不同，这次主要是考虑到使用状况及比赛的战略战术，尽量以击球速度作为得分手段赢得比赛，对抗节奏越来愉快，降低失误成为取胜关键。\nYONEXARC8DX是拥有更大反弹性能的ARCSABER新品，挥拍速度是提升扣杀球速的关键，拍框承载能力是拍框驱动力的关键，尤尼克斯YONEXARC8DX采用纳米技术线孔钉条，整个拍框横截面加粗5%，承载能力增加5%，极力提高了拍框的承载能力，球速提升3%。和传统球拍的球速相比，YONEXARC8DX的球速增加了3%及6KM/H，传统球拍球速为200KM/H，ARC8DX球速为206KM/H。\n尤尼克斯YONEXARC8DX是YY历史上第一支质保突破25磅的球拍，因为它采用纳米技术钉条和提高拍框承载能力，使之适应高张力拉线：该球拍3U推荐张力是27磅，2U推荐张力是28磅，都比普通球拍的张力提高3磅。\n尤尼克斯YONEXARC8DX是一款非常适合高张力的高端球拍，推荐强攻型球员使用。其四种规格：3U4、3U5、2U4、2U5。', '高弹性碳素、叠杯碳素纳米官', '高弹性碳素、超级聚乙烯纤维、内置T型接头', 94.0, 85.0, 674.0, 'G4,5', '特硬', 3.0, 19.0, '293mm', 'https://www.badmintoncn.com/cbo_eq/view_2886.html');
