insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANOFLARE疾光系列', 'NF-800LTYXNF800LT疾光800LT', 2020, '新品NANOFLARE800LIGHT是NANOFLARE800的轻量版本，将于8月发布全新设计，并计划于2020年9月17日全球上市。\nNANOFLARE800系列是为注重速度的高水平爱好者而设计的头轻型球拍。该系列利用的疾锋拍框和超细拍杆减少了空气阻力。搭载了音速闪击系统，拍框底部大范围使用了新型碳素材料“东丽卡®M40X”，这一材料同时兼备高强度和高弹性，进一步提升了球拍的稳定性和反弹性。\n由于对NANOFLARE800轻量化的需求，NANOFLARE800LT的规格为5U（平均78克）。轻巧的球拍通常在控制性和稳定性方面有所欠缺，此次通过在拍框顶部加入减震网布（VDM），实现了更好的控制。NANOFLARE800LT在维持操控性的情况下，实现其最大的挥拍速度。', '高弹性碳素；致密型纳米碳素', 'EX-高弹性碳素；高弹性碳素；M40X', 79.0, 75.0, 675.0, 'G5、G6', '硬', 27.0, 19.0, '310mm', 'https://www.badmintoncn.com/cbo_eq/view_8397.html');
