insert into detail values('羽毛球拍', '聚将GGEM', Null, '朗基努斯之枪', Null, '拍采用三合一框型开山鼻祖台湾工厂已经相当成熟的第3代框型，第一代是萌芽阶段的X80，第二代是X90，第三代是高神的神枪系列。三合一框型的优点是很突出的，T头附近箱型的稳定性加上拍头的破风，使得三合一的框型十分符合双打的要求，快速稳定。拍框的孔数设计为80孔，适合采用单线双节点的穿线方法保磅效果好并且拍面线压高，甜区面积大，这些都是有利于快速的打法。', '日本1kwoven成品碳布+30T日本东丽碳布', '40T三菱材质中杆', 89.0, 85.0, 675.0, 'G5', '硬', 30.0, 30.0, '295-297mm', 'https://www.badmintoncn.com/cbo_eq/view_8338.html');
