insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'Ti10Ti10一代', 1999, '作为YONEX1999年的经典代表作品，为Ti系列羽拍中的顶级产品，大凡业余羽球高手，无不为拥有Ti-10羽拍而自豪，至今仍为众多职业球员首选致胜法宝：\n\n1、在拍框上采用了新型钛金属网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛金属网眼部位范围最宽：四个线孔范围；\n\n2、采用了新型MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更高的羽线拉力，使击球感更硬、爆发力更强；\n\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n\n4、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n\n5、拍框中部采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n\n6、拍框端部和靠近接头部分采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n\n7、拍杆加长10毫米，接球面加大32%，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，达到锐角落点以产生强而有力之高角度杀球；\n\n8、球拍拍框、拍杆采用超高强模数碳素纤维制造，加强了球拍攻击力及提高了球拍寿命。\n\n9、直径7毫米超细拍杆，弹性好，攻击力极强，防守及进攻的效果极佳。', '超高强碳素纤维、钛金属网眼结构、MusclePower弧形筋力结构拍框线槽设计', '超高强碳素纤维', 94.0, 85.0, 674.0, 'G3G4G5', '超硬', 22.0, 18.0, '290±3mm', 'https://www.badmintoncn.com/cbo_eq/view_448.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS-8000NS8000', 2005, '平衡性头重型\n\n握把尺寸3U：G4（周长86mm）、G5（周长83mm）\n\n2U：G4（周长86mm）、G5（周长83mm）\n\n推荐拉力2U：20-25lbs；\u30003U：19-24lbs\n\n推荐用线进攻型：BG-65/65Ti/70/80；控球型：BG-65/68Ti/85/66', '高强碳素纤维+纳米碳素', '高强碳素纤维+纳米碳素', 94.0, 85.0, 674.0, 'G3G4G5', '特硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2149.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR900AHNR900SE', 2016, '2016年奥运限量版，NR900SE白色亨德拉战拍，NR900AH红色阿山战拍继承NR900速度取胜，更快更精准，扣杀角度更尖锐，增添两色限量', '高弹性碳素；高张力碳素；致密型纳米碳素；超级高弹性碳素', 'X链富勒烯纳米碳素；高弹性碳素；超级聚乙烯纤维', 89.0, 85.0, 675.0, 'G4,5', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7691.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT80PG', Null, 'VT80PG盖得白金签名限量版\n见证盖德职业生涯最后一站的另外一支纯白色的球拍，\n一支具备高贵血统，翩翩君子的进攻型羽毛球拍，\n喜欢盖德的VT80PG羽毛球拍，\n不仅仅是因为VT80的手感，\n更多得是一种纪念意义，\n一种追求像盖德那样在球场英姿煞爽的风采；\n全拍白色的涂装，\n延续ARC-10PG的经典，\n拍框上印有盖德的亲笔签名和盖德的座右铭\n全力以赴（GOWITHYOURHEART）\nVT80PG，不是一支单单给你快意扣杀的球拍，\n如果你仅仅需要一支快意扣杀的球拍，\nVT80VTZF已经足够了；\nVT80PG,一支让你全力以赴的白色球拍，\n给你球场上更多道理的羽毛球拍，\n这种球拍，已经在某种程度上超越了球拍本身，\n这是一种体会，一种历练，一种智慧。', '高弹性碳素、音频滤清器、钨', '高弹性碳素、多官能键碳素纳米管', 89.9, 80.0, 675.0, 'G4、G5', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6666.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NRZSPBP', Null, 'BP为日本羽毛球协会，定制的YONEX球拍，日本本土地区发售。', '碳纤维高弹性碳素；音效金属；高硬度超级高弹性碳素', '高弹性碳素；致密型纳米碳素；X链富勒烯纳米碳素', 94.0, 84.0, 675.0, 'G5', '特硬', 27.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7373.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'AT系列', 'AT900PAT-900Power', 2008, '1、复合拍框顶部的“gForceTi”特殊钛装甲合金，相对于碳素纤维能产生更大的重力效应，提升球拍击球能量。gForceTi是特殊金属复合物，能产生2倍于碳素纤维的重力效应。将gForceTi配置于羽拍前三分之一的拍框顶端，使球拍挥动时的惯性力矩获得提升，击打羽毛球的能量随之增加。\n\nYONEXARMORTEC钛装甲技术\n\n2、创新的拍头边缘压缩结构，增强3%的拍面稳定性。gForceTi是特殊金属复合钛装甲，再配合拍框顶端的边缘压缩结构，能有效抵抗拍框的扭曲形变和提高控球能力。在增强3%的拍面稳定性的同时，更带来清脆扎实的“金属撞击之感觉”。\n\n3、更高的拉线张力。通过对拍框承载耐久能力的反复改良，ARMORTEC羽拍的拍线推荐张力已大为提升，以满足为当今部分球员喜爱高张力的需求。但必须注意：拍线的高张力会对球员的手腕、肘部和肩部造成不良隐患甚至伤害。\n\n4、拍头的钛装甲合增强重力效应，提高极限扣杀球速4%。运用了gForceTi的钛装甲技术再结合拍框顶部独特的横断面压缩结构，既抑制了拍框在高负荷下的扭曲变形，又强化了拍框的轻量及灵活性，造就了一支拥有独特“头重效应”的球拍，使扣杀速度提高4%。更高的速度与更灵活的操控性能，特点鲜明的钛装甲系列已经成为当今羽坛快速打法的最佳武器。\n\n5、YONEX通过对顶尖双打球员特殊握拍方式的分析，研发出新型的C.S.CAP精确制导拍柄锥盖，为球员提供更迅捷的挥拍灵活性，适应愈来愈快速的双打对抗。ARMORTEC羽拍的新型拍柄锥盖平面比传统的羽拍拍柄锥盖扩大了88%的实用面积。创新的锥盖形状和更宽大的接触平面，让拇指更易于握紧和控制球拍，使高速反手挥拍变得更迅捷、精确。\n\n6、拍框形状为ISO方形，扩大了拍面的击球甜点区域。与传统球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度：\n\n7、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能：', '超高弹性碳素+软钛合金+细网状钛装甲', '高弹性碳素+弹性钛', 89.0, 80.0, 674.0, 'G3G4G5', '超硬', 4.0, 19.0, '304mm', 'https://www.badmintoncn.com/cbo_eq/view_472.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'arc11弓箭11弓11弓剑11', 2013, 'YONEX尤尼克斯ARC-11（弓箭11）羽毛球拍。外观结合了ARC10的经典颜色和ARC-ZS的霹雳旋风风格，视觉上更具冲击，更时尚，ARC-11的使用球星是印尼名将陶菲克。材料上的革新是大的卖点，弓剑11结合了YONEX其他系列，如VT系列、NR系列以及弓剑系列本身的一些代表性元素。富勒烯的加入让弓箭系列球拍拍框较软的问题得到解决，叠杯纳米碳素，PEF减震，带来爽快的手感，更强的高远球能力！ARC-11的击球声音，是一种金属爆破的声音，会让您有听觉上的享受。更快的速度，更悦耳的炫音爆破效果，更扎实稳定的手感！暴力不能解决所有问题，拒绝纯力量，弓剑11传承弓剑系列控球性能佳的血统，加上其他系列的亮点元素，真正是准确点杀，掌控的典范！追求快速准确落点的球友不能错过！', '高弹性碳素、高塑性叠杯碳素纳米管、音效金属', '高弹性碳素、超级聚乙烯纤维、锚状内置接头', 94.0, 85.0, 675.0, 'G4,G5', '硬', 3.0, 19.0, '295～300mm', 'https://www.badmintoncn.com/cbo_eq/view_5842.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'vt80ltd', 2011, 'YONEX2011年最新上市顶级产品，拍杆采用YONEX最新材料“多官能键碳素纳米管（NANOPREME）”，使拍杆强度和韧性同时大幅提升，与标准碳素材料相比，弯曲强度提升14%，弯曲弹性提升21%，耐冲击强度提升24%。运用NANOPREME技术，拍杆做到更纤细，实现前所未有的高性能。', '高弹性碳素、音频滤清器、钨', '高弹性碳素、多官能键碳素纳米管', 89.0, 85.0, 674.0, '-', '硬', 27.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7613.html');
