insert into detail values('羽毛球拍', '李宁Lining', '风动导流', '风动8000D', 2017, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、中管弹性复位系统、热熔胶、立方锁、复位弹性扭角、锥体速弹科技', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S1（79.3mm)', '适中', 32.0, 32.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_6820.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88SASTROX88SAX88S', Null, '全新配色的ASTROX88S和ASTROX88D采用红色、黑色和米白色，这些颜色旨在体现运动员的热血与斗志。除了男双组合苏卡穆约/吉迪恩将使用ASTROX88S/D全新配色亮相，男双组合嘉村健士/园田启悟，以及女双组合福岛由纪/广田彩花也将使用新色球拍。', '致密型纳米碳素；高弹性碳素;钨。', '高弹性碳素；新次元碳素', 89.0, 80.0, 669.0, 'G4,G5', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8106.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC100LTD弓箭100ltd弓剑100ltd', 2010, '见证羽毛球辉煌历史的全英公开赛于2010年3月迎来了她备受瞩目的第100届盛事，YONEX更荣膺连续27次冠名赞助该赛事。为此YONEX用心呈献第100届YONEX全英公开赛纪念拍ARC-100LTD，百年精华荟萃，见证历史时刻，极具收藏价值。\n\n1、纳米科技（NanoScience）：采用YONEX纳米科技，将球拍材料的工艺和功能控制至分子级别，制造出更纤细、更强韧的球拍，使球拍挥动时更具威力和速度。\n\n2、叠杯碳素纳米管技术（Cup-StackCarbonNanotube）：叠杯碳素纳米管是特殊结构的碳素材料，其结构就像多个杯子上下重叠在一起的样子，拥有比标准碳素纳米管更高的力学性能；更重要的是，叠杯碳素纳米管拥有更高的韧性，让受压变形的拍框能更快复原；添加了叠杯碳素纳米管的复合树脂应用于拍框两侧，拍框变得更有“韧劲”，能让击球时羽毛球在线床上的驻留时间延长，从而提升球拍对击球落点的控制能力。\n\n3、超级聚乙烯纤维技术（UltraPEF）：超级聚乙烯纤维拥有优异的粘性和吸震性，重量之轻足以浮于水面；将其用于球拍拍杆中，使扣杀变得更有效，同时也获得出乎预料的吸震效果。\n\n4、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。\n\n5、新型轻质内置T形接头（NewBuilt-inT-Joint）：新型T形接头不再采用金属材料，而是改用由特殊环氧树脂制成的新型轻质T形接头；这种新型环氧树脂制造的接头使拍框拥有更高的稳定性，击球威力更强大。\n\n6、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩展击球甜区，即使是非甜区中心击球也能保持足够的精度和速度。', '高系数碳素+叠杯碳素纳米管', '高系数碳素纤维', 89.0, 85.0, 674.0, 'G4,5', '中硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2887.html');
