insert into detail values('羽毛球拍', '李宁Lining', '能量聚合', 'AYPM424TC75D能量75D', Null, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、中管弹性复位系统、热熔胶、复位弹性扭角、锥体速弹科技', '碳纤维', '碳纤维', 94.0, 90.0, 675.0, 'S2（82.5mm)', '偏硬', 32.0, 32.0, '302mm', 'https://www.badmintoncn.com/cbo_eq/view_6839.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '白金利爪LTDTK-FCLTDTKFCLTD', Null, 'VICTOR胜利羽毛球拍进攻型白金利爪隼戴资颖签名拍TK-FCLTD\nTK-FCLTD平装版非礼盒版', '高强韧碳纤维+TR增韧纳米碳管+HARDCOREDTECHNOLOGY', '高强韧碳纤维+PYTOFIL+6.5SHAFT', 84.0, 80.0, 675.0, 'G5', '稍硬', 31.0, 31.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9732.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '脉动系列', '钛99Ti-99脉动99ART-99Ti99', Null, '特\u3000\u3000性：\n1.内框凹槽技术设计；顶框1/3处配重E.Titanium提升惯性力矩，搭配超轻重量，使球拍具有更为强大力量和更迅捷灵敏性。\n2.均等化方头能提供多32%的有效击球甜区，即使羽毛球偏离线床中心区的连续式扣杀，也能保持响应的精确和速度。\n3.特殊方形框面结构设计，提高击球时稳定性和较小的扭矩，可承受较高的拉线磅数。\n4.由航太钛合金和高刚性碳素纤维编制合成的先进高弹性中管，在击球瞬间，航太钛合金释放极大反弹能量，产生更大的爆发力。\n5.位于拍框三点钟和九点钟位置，采用特殊材质单粒钉，降低击球震动。\n适合攻击型球员。', '超高钢性碳纤维+E.TITANIUM+钠米', '高钢性碳纤维+SUPERTi+钠米', 89.0, 80.0, 675.0, 'G5', '硬', 4.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_871.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC-ZSARCZS弓箭ZS弓剑ZS', Null, 'JP版限量纪念拍，无需赘言其令人爱不释手的精细漆工，与商业版AZ明快童真的风格迥异，陶肥版AZ将原拍LaserGreen的主色滴换成了深沉的黑色，使得其外观上原本具有的强烈跳动感得到了彻底的收敛。T头附近一代宗师陶肥的签名，中杆红黑相间类似缎状纹的格调透露出些许古典主义气质，让人很容易联想到这是惟独在限量版器材上才适合采用的设计。', '超高弹性碳素，高张力碳素，叠杯碳素纳米管', '高弹性碳素，超高弹性碳素，超级聚乙烯纤维', 89.0, 85.0, 674.0, 'G5', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3194.html');
