insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT-80ETNVT80ETN', 2015, 'YONEX尤尼克斯VT80羽毛球拍曾今风靡一时，成为很多球友心目中的暴力进攻神拍。VT80停产后，E-tune七重能量调配这一新颖科技，让VT80重见光彩，经典重生！\nYONEX尤尼克斯继VT-70ETN之后的第二款可调配配重羽毛球拍盛大上市！\nVOLTRIC80E-Tune（VT80ETN）羽毛球拍，七重配重让VT80ETN羽毛球拍拥有更多性能的手感。新款VT80ETN羽毛球拍将强大的威力三角系统与线槽套件相结合，赋予它更强的力量。与VT80相比，升级版VT80ETN减少了能量消耗，提升了3%的进攻威力。此外，随着E-tune能量套件的引入，威力三角系统将被提升到一个新的层次。\nVT80ETN最大特点是可以通过加装附属配件，新结构“EnergyTune”，来调节球拍性能。根据附属配件装在拍框的上部/下部/上下两部的不同情况，可以来选择力量情况。', '高弹性碳素+音频虑音器+钨', '高弹性碳素+夺冠能键碳素纳米管', 89.0, 85.0, 675.0, 'G4，G5', '偏硬', 4.0, 25.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6355.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP99MP-99', Null, '1、镍钛合金UltimumTi\nYONEX的UltimumTi是由镍太合金构成的极端先进的弹性金属（记忆合金），其强度是纯钛金属的3倍，弹性是碳纤维的2倍。YONEX将UltimumTi合金丝压铸于拍杆中，其功能类似于一个强力电容器，能有效地储存能量，并在击球瞬间利用“瞬态反弹效应”，将能量释放为羽毛球的爆发性速度\n\n2、盒式Box\n拍框采用盒式截面设计，提供稳定的击球表面及较小的扭矩，从而提升选手的操控能力；同时，盒状截面形状设计可给拍框带来更好的耐用性。\n\n3、防震孔SG\n拍框两侧中部采用了新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳。\n\n4、拍框MusclePower结构\n传统球拍的承线系统中，拍线被直接支撑在尖锐的线孔胶粒边缘上，拉线后拍线与胶粒的两个接触点会产生应力集中现象，导致拍线疲劳，张力严重下降。新的MP结构系统将拍线支撑在圆拱形的线槽上，两个接触点被连接为一段接触弧面，不但有效消除应力，而且形成的紧密接触弧面大大增强了拍线与拍框的整体效应，从而增强了拍线与拍框的整体效应，从而增强球拍的整体稳定性和力量性能。\n\n5、方形拍头ISOMETRIC\n与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。YONEX研发的这种IsometricHeadShape大甜区球拍，让进攻型球员在当今激烈竞争的国际羽坛一直保持明显的领先优势。\n\n6、钛金属网TitanmumMesh\n由YONEX的工程师们研发的钛金属网状配重，其强度和重量分别是碳素纤维的2.5倍和2.3倍。在球拍的3点钟和9点钟位置对称地采用这种TitaniumMesh配重，用以增加球拍的轴向惯量，提高拍面在击球时的搞扭性能（拍面稳定性），同时也提高拍头攻击力。\n\n7、内置合金接头Built-inT-Joint\n深深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能。\n\n8、7毫米超细拍杆(slimshaft)\n传统拍杆直径是9毫米，而此拍拍杆只有7毫米，超细的拍杆，减少了风阻，增强了攻击力，提升了操控能力。', '高强碳素纤维+钛镍精炼太空金属', '高强碳素纤维+高反弹性钛镍精炼太空金属', 94.0, 85.0, 674.0, 'G3G4G5', '超硬', 23.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_462.html');
