insert into detail values('羽毛球拍', '李宁Lining', '火系列', 'AYPD224N501N50一代', 2009, '炫雷火FlameN50傅海峰用拍\n拍框纤细，风阻直降，发力倍增；拍头边缘，以稳定的“方盒结构”打造；线槽内运用“波浪结构”，拉线张力增强，击球震动消减；高硬度中管，攻击凶猛强劲。匹配球风雄悍爆发力强的选手，为国羽双打主力傅海峰专属。强势弹跳，爆发迅雷侵袭，炫动整个赛场，正是炫雷火FlameN50', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2、S3', '适中', 30.0, 24.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_1892.html');
