insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88SASTROX88SAX88SYX', Null, '拍框整体的柔韧设计提高持球性，5mm加长，提升操控性\n88球拍拍框为盒式框，88S、D外观框型基本一致，但比早期的盒式框略有不同，周边更圆滑一些。两款球拍总长度不一样，设计上有明显差别，官方称分别为5mm和10mm加长。此外，称之为力量转化的新型锥盖，其外形与本家其他的球拍锥盖大有不同，正、背面上部低凹，而且表面有明显下沉；两侧面高，圆弧形过渡。\n\n关于球拍的球线选配。官方推荐：追求力量，建议搭配80P球线；追求控制，建议选用子母线-AEROBITE。手中的3U4的88球拍，均选取80P球线体验。同一穿线师，同台穿线机，前后接续穿线，YY4节，同为28/30磅。\n\n详见：\n前后协同相得益彰--尤尼克斯天斧88（S、D）球拍试打（测评）体会-神兵利器中羽在线社区http://bbs.badmintoncn.com/forum.php?mod=viewthread&tid=867347', '致密型纳米碳素；高弹性碳素', '高弹性碳素；新次元碳素', 89.0, 80.0, 669.0, 'G4,5', '硬', 4.0, 20.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_6686.html');
