insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'vt70etnvt70', Null, '作为VT系列的进攻型球拍，\n第一个革新之处在于，独特的T形接头，\n把拍框12点钟位置的部分重量转移至6点钟的区域，\n消除头重拍框的不平衡感，\n和VT-70比起来，\n手感更好，\n操控更加自由顺滑！\n\nVT-70ETN羽拍拍框的另外一个明显革新，\n就是将球拍三部分的比例做了调整，\n拍框、中杆和拍柄的大致比例是255：220：200，\n这种设计使球拍攻击力比弓10更强大，\n减少由于甜区小而引起的的不顺感。\n\n传统球拍重量在穿好线绑好手胶就已经固定，\n而VT-70ETN突破了这一瓶颈，\n而与VT70最大的不同在于，\n您可以根据您的需求，\n调换您的能量。\n这也是VT-70ETN第三个革新之处，\n也是世界首款！\nVT-70ENT配有独特定制的能量套件，\n橙色“力量”套件和紫色“速度”套件，\n七种模式可选，\n能够变换出七重能量组合，\n七七归一，\n套件增加线床的驻留时间，\n能够减少能量消耗，\n比VT-70提高了3%的进攻威力！\n\n上部可DIY的长条状线槽套件，\n力量性能增加6%，\n可以加强头重效应，\n实现大力扣杀。\n下部使用的小飞机状的线槽套件，\n力量性能增加4%，\n可以加快连续多拍的操纵性能！\n上下均使用，\n威力剧增10%！\n威力三角效果增强明显，更大程度激发力量！\n这绝对是球拍重量的私人订制，\n绝对流弊的设计，\n对那些对拍平衡点和拍重要求苛刻的球友来说，\n可谓喜大普奔！', '高弹性碳素+致密性纳米碳素+钨', '高弹性碳纤维+超级聚乙烯纤维+锚状内置接头', 89.0, 85.0, 675.0, 'G4G5', '中等', 9.0, 11.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6354.html');
