insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'DUORA双刃系列', 'DUORA10阴阳拍双刃10双刃十', Null, 'DUORA10—双刃10的特殊设计让使用者的正手和反手同时提高攻击力，搭载尤尼克斯‘DUALOPTIMUMSYSTEM’，正手是强劲击球的盒式拍框，加强杀球威力，反手则是快速敏捷，尖锐高弹的流体拍框，让防守更迅速。有了双面异型框，选手在比赛中能更有效的发挥正反手。\n\nDUORA10使用世界首创的东丽集团公司（TORAY）次时代航空用材料，并结合尤尼克斯独有的“NANOSCIENCE”技术开发出的新型“NANOMETRICDR”碳素材料。在球拍中体现了更高的坚韧性和反弹性。无论是正手击球或是反手推挡都威力十足。', '新型DR致密性纳米碳素、高弹性碳素、镍钛合金纤维', '致密性纳米碳素、高弹性碳素', 94.0, 85.0, 675.0, 'G4、G5、G6', '硬', 3.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6343.html');
insert into detail values('羽毛球拍', '李宁Lining', '蓄力突袭', '突袭7C', Null, '采用外经7.0mm的细中管设计,配合独特的弹性材料和制成工艺,使中杆的反弹。性能和抗扭性能达到有效平衡,准确传导力量，精确反应选手的意图。高刚性细中杆，既降低了空气阻力，又可使力量精准传导。', '碳纤维', '碳纤维', 85.0, 85.0, 675.0, 'S1', '适中', 32.0, 32.0, '305mm', 'https://www.badmintoncn.com/cbo_eq/view_8291.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓箭fbARCFBARC-FB弓剑FB', 2013, '外观颜色鲜艳亮丽，哑光漆耐看，有个性\n弹性弹性较好，回弹速度较快\n重量整体重量非常轻，平衡点适中，挥拍舒适\n杀球后场重杀无威力，中前场抽杀下压有一定的威胁，需要选手充分使用自身的手腕力量\n控球感控球感较好，出球指向性较好\n舒适性手感舒适，减震不错，但需要主动发力，长时间使用对手腕负荷较大', '高弹性碳素、叠杯碳素纳米管', '高弹性碳素、致密型纳米碳素、轻质内置T型接头', 73.0, 73.0, 675.0, 'G5/G6', '中硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5866.html');
