insert into detail values('羽毛球拍', '波力Bonny', Null, '1982至尊版1982旗舰版1982Flagship1982Supreme', Null, 'Bonny波力1982Flagship(旗舰版）和1982Supreme(至尊版），采用高刚性碳纤维46T+碳T头+乌缺+高分子填充+新树脂超弹中管，1982Supreme2U(90克)，重杀利器，1982Flagship3U和4U设计，攻防偏进攻，可攻可守！\n低风阻拍框，降低挥拍时的空气阻力，提高扣杀速度。\n三段式成型：头框，碳T头，中管。\n高分子填充，有效提升球拍力量传递速度\n新树脂超弹中管：提升中管弹性，提升抗扭力，提升击球速度。\n弹性：中管歪曲后回直时间较短。\n平衡：1982Flagship295±0mm，平衡点精确到±0，1982Supreme295±5mm。\n乌缺工艺：原料100%严格筛选。\n头框：单孔设计，保护拍框和线的使用寿命。\n外观：区别于以往传统设计，简介大气。', '高刚性碳纤维46T+高分子填充+T头', '树脂高弹中杆', 94.0, 80.0, 675.0, 'G4、G5', '适中', 30.0, 30.0, '290-295mm', 'https://www.badmintoncn.com/cbo_eq/view_10223.html');
