insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANOFLARE疾光系列', 'NF-700LYXNF700L疾光700L', Null, 'YONEX将于2020年7月下旬限量发售疾光系列NF700的全新设计（颜色：黑/亮黑）——NANOFLARE700LIMITD。我们将日本的传统工品艺品作为设计主题，采用带有金箔漆器形象的别致黑色和多彩的金色来强调特殊设计感。\n\nNF700L能够兼顾高速的挥拍和轻松的出球能力，因此满足了广大爱好者的需求。将传统拍框形状重新设计的同时，开发了全新的高性能流体拍框，提升拍面弹性并降低空气阻力，并减轻对手部造成的冲击。带来了挥拍速度的提升，并实现优秀的操控性和反弹性，打出畅快的击球感。', '高弹性碳素；M40X；Super高弹性碳素', '高弹性碳素', 84.0, 75.0, 675.0, 'G4,G5', '中等', 5.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8323.html');
