insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MX90尖峰90MX-90', 2014, 'METEORX90\n介于尖锋80和尖锋70的中杆硬度，\n对于球友的发力的要求稍微低一点，\n八面刀锋拍框，\n胜利品牌首创的稳定型框形，\n兼顾速度和准度的最完美的框形，\n让尖锋90球拍的每一次击球，\n都惊人的精准，\n每一拍都会有不错的表现。\n击球感上，\n偏硬+偏重的双重参数模式，\n打造出业余球友最爱的球拍性能，', '复方聚合纤维+纳米树脂+强化叠织碳纤维', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 89.0, 80.0, 675.0, '拍柄粗细:G5', '拍杆硬度:硬', 30.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6115.html');
