insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧99GAMEAX99GEXASTROX99GAMEAX99GAME', Null, '接头：内置T型接头白虎纹（825）、日耀红（826）\n在YONEX深受世界顶尖选手信赖的天斧系列中，将推出全新天斧99系列，带来更强的杀球力量与持球性。天斧99GAME面向中等水平球友，预计将于2021年9月下旬上市。\n就近年来的羽毛球发展而言，除了赢得快节奏对抗所需要的连续强攻能力，还需要从容不迫赢得多拍拉锯的快速挥拍性能。此次，天斧全系列所搭载的创新技术“回转力生成系统”得到升级。PRO/TOUR/GAME版本在拍框整体使用了高强度体积压缩树脂，实现超致密的重量分布，使挥拍更顺畅，提升连续强攻。\n在拍框顶部搭载含钨连钉，相比传统的单体护线管有所增重，为回转力生成系统实现增强，使击球力量快速传递至球头。并在拍框两侧采用了全新大孔径线孔设计，通过扩大拍线的可动范围，提升击球时拍面与球头的接触时长。\n除此之外，PRO/TOUR版本为标志性的方型拍头进行升级，形成更大且更具容错率的甜区。拍框侧面的加厚设计提升了拍框刚性。拍杆采用相对旧款更细的EXTRASLIMSHAFT，挥拍感受更佳。并且采用力量转化锥盖PLUS，带来更好的拍杆弯曲度与回弹。这些技术改变使扣杀更具威力，挥拍更加流畅，为高水平选手带来更优的球拍性能。\n创新\n1.超致密重量分布设计实现更顺畅的挥拍（运用于PRO·TOUR·GAME）\n通过在拍框使用高强度的体积压缩树脂，带来超致密的重量分布设计，使挥拍更顺畅的同时，提升连续进攻的能力。另外，在拍框顶部搭载含钨连钉，相比传统的单体护线管有所增重，为回转力生成系统提供了增强，使击球力量快速传递至球头。\n为回转力生成系统带来升级，实现更高层次的重量分布设计\n2.全新线孔设计提升了持球性（运用于PRO·TOUR·GAME）\n在拍框中加入体积压缩树脂后，拍框的强度得到了提升，因此拍框两侧使用大孔径线孔也不会影响拍框强度。通过扩大拍线的可动范围，提升了击球时拍面与球头的接触时长。', '高弹性碳素+纳米网状树脂NEO+体积压缩树脂+钨', '高弹性碳素+纳米网状树脂NEO', 89.0, 80.0, 675.0, 'G5', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10123.html');
