insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '2BD102044E2013L', 2018, '乌缺2013L，轻量级控球神器，再造乌缺系列不朽经典\n\n波力乌缺系列经典羽毛球拍，\n以其精湛的工艺，完美的手感，细腻的纹路而闻名。\n清水出芙蓉，自然去雕饰，\n乌缺系列的球拍，还原了球拍最真实的面目，\n呈现最完美的手感，偏控球的技术风格，\n非常适合各级球友的需求。\n\n2013年，在乌缺1982的基础上，\n波力公司新出品了两款性价比更好的球拍，\n乌缺2013P和2013L，\nP以进攻为主，L以轻量化的控球技术为主，\n力图让乌缺系列球拍成为经典中的经典。\n\n乌缺2013L，一款低调的控球神器，\n它就像球场的魔术师一样，\n有着变幻莫测的手感。\n太多的进阶球友都会感慨与为什么有些人的手感会那么好呢？\n再能跑的球友都抵挡不了对面一位持有精准控球利器的球友，\n那种指向性落点的球拍，\n实在是太神奇了，\n精准的4方球，\n匹配灵活的操控手感，\n不是扣杀，却永胜单纯扣杀型球拍。\n\n隽秀的乌缺纹路，\n拍框大部分的全碳纤维XT编织纹路，\n精致的手感，细腻的纹路，完全是艺术的风范，\n从拍头到三通处，\n拍框逐渐变厚，\n厚实的三通处，增强了球拍的精准性能，\n全磨砂的漆水，不耀眼，却非常耐看，\n仔细品味一番，一番喜悦油然而生。\n\n好的球拍，本身是有灵魂的，\n魂魄根源于中杆的碳纤维材质，\n乌缺2013L球拍，一支绝对不会让您失望的球拍，\n纳米级碳素管材料，\n来自日本最顶级的碳纤维材料，\n碳纤维，羽毛球拍材质最重要的元素，\n也是波力公司的核心，\n作为一家以专业加工冰球装备的公司，\n在碳纤维领域的应用上，\n波力公司可谓是轻车熟路。\n\n与之前的乌缺系列球拍相比，\n2013L球拍在拍锥上做了一些改进，\n握起来会更加舒服一些，\n尤其在反手发球的时候，\n2013L球拍的指向性更出色。\n\n乌缺2013L球拍，\n轻量化的拍重，结合295mm上下的平衡点，\n绝对是一把低调的全能型球拍。', '30T高刚性纳米树脂碳布+1.5KWOVEN', '40T高刚性纳米树脂碳布', 86.0, 82.0, 675.0, '2#/G4', '中', 30.0, 30.0, '295±5mm', 'https://www.badmintoncn.com/cbo_eq/view_5987.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT-7LDVT7LD', Null, '全方位型球拍，提供良好的回击力和操控性！\n为表彰林丹重回尤尼克斯后再夺得日本公开赛的冠军，尤尼克斯公司推出了林丹精选系列第二代。此次一共推出了29款新品其中球拍共有5款，VT7LD便是其中一款。球拍采用独创的ISOMETRIC方形拍头设计。增加线床的有效区域扩展击球甜区。威力三角系统结合重头拍，弹性拍框和流体力学的优点，使球拍具有无人能敌的破坏力又不失击球的细腻手感。', '高弹性碳素钨', '碳素', 89.0, 79.0, 674.0, 'G4', '中等', 4.0, 19.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6445.html');
