insert into detail values('羽毛球拍', '聚将GGEM', Null, '风之力三WindForce3', Null, '风之力3（后面简称风3），的定位是速度型的进攻拍。追求的是速度及连续输出。所采用的是破风框形的结构，并且是该系列里非常经典的亮剑型破风框，结合拍框内测的MusclePower波浪设计，保证了高挥速的同时拍框的稳定性也很出色。\n\n球拍采用日本东丽30T高弹性碳纤维及三菱的40T高弹性碳纤维作为拍框及中杆的材料，这两款材料在做拍框及中杆的时候都有非常优异的表现，是业界公认的最优选择，材料的选用方面风3对于大部分品牌来说，应该是有过之而无不及。', '30T日本东丽弹性碳纤维', '40T高弹性碳纤维', 87.0, 85.0, 675.0, '-', '稍硬', 0, 0, '295-299mm', 'https://www.badmintoncn.com/cbo_eq/view_8304.html');
