insert into detail values('羽毛球拍', '富力特FLEET', Null, Null, 2013, '1.72孔小平头拍框，强化材质，击球感更稳定。\n2.八面刃截面框型，结合破风框与盒型框，兼具稳定性与挥击速度提升，特殊八面刃框型可使击球音更响亮。\n3.中管采用日本M40超高系数碳纤维+CNT奈米碳中管+1.5K碳纤woven叠织，稳定性及强韧性超高\n4.拍框采用日本M40超高系数碳纤维+T-1000强化+1.5K碳纤woven叠织，钢性与耐用性、稳定性均大幅提升！\n5.架桥式侧框，提高击球音，更具震撼力\n6.纯正台湾血统，晴明设计监制，fleet签约制造，超级品质！\n产地：台湾', '40吨超高刚性碳纤维+奈米树脂+Woven+T-1000', '40吨超高弹性碳纤维+奈米树脂+Woven+CNT中管', 94.0, 85.0, 675.0, '-', '适中', 35.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8477.html');
