insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧88dAX88D-G88DG', Null, '广受欢迎的ASTROX88S和ASTROX88D在2021年3月推出进化版，其中采用了新的创新技术和精心制作的材料以提高性能。ASTROX88SPRO和ASTROX88DPRO旨在配合不断发展的更快节奏的双打比赛，它需要选手更快的反应和连续有力的进攻。与PRO一同上市的还有大众化的ASTROX88S/DTOUR和GAME，它们的使用了相同的设计理念，带来同等性能表现。', '高弹性碳素+体积压缩树脂+钨', '高弹性碳素+纳米网状树脂NEO', 89.0, 80.0, 674.0, 'G4,G5', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8877.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '超级纳米系列', '超级纳米09SN09SN-09', Null, '威克多超级纳米系列拍SN-09控球型(防守兼备\n高科技纳米技术的应用，使得球拍的强度，反弹性能以及轻量化都有了飞跃性的提升。', '碳纤维+纳米树脂', '碳纤维+树脂', 89.0, 80.0, 675.0, '-', '适中', 4.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3023.html');
insert into detail values('羽毛球拍', '李宁Lining', '钛系列', 'AYPD140-1', Null, 'LI-NING李宁AYPD140-1羽毛球拍，从标价来看此款是定位高于入门级别的球拍，攻守兼备型，略偏进攻。拍身整体采用碳纤维材质，添加钛金属，使得形变恢复速度更快，并稳定球拍；球拍外框为波浪形设计，缓解球线与拍框之间的摩擦，延长使用寿命；平头设计有利于增大甜区面积，使击球更加容易；空气动力系统使空气快速通过拍框，从而降低风阻，提高挥拍速度。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '硬', 30.0, 30.0, '≤295mm', 'https://www.badmintoncn.com/cbo_eq/view_2071.html');
