insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'DUORA双刃系列', 'duora10lcw双刃10LCW', 2017, '李宗伟败者为王电影纪念款，全国限量2000把\nYONEX双刃10羽毛球拍以强劲的正手击球和敏捷快速的反手击球统治比赛，适合强力进攻型选手。\n1、双面异型框（DURLOPTIMUMSYSTEM）：搭载双面异型框技术，让你的正手和反手同时提高攻击力。双刃系列球拍的特殊设计让使用者的正手和反手同时提高攻击力，搭载尤尼克斯“双面异型框”(DURLOPTIMUMSYSTEM),正手是强劲击球的盒式拍框，加强杀球威力，反手则是快速敏捷，尖锐高弹的流体拍框，让防守更迅速。有了双面异型框，选手在比赛中能更有效的发挥正反手。\n2、新型DR致密型纳米碳素（NANOMETRICDR）：世界首创的东丽集团公司（TORAY)次时代航空用材料，并结合尤尼克斯独有的“纳米科技”（NANOSCIENCE)技术开发出新型“DR致密型纳米碳素”（NANOMETRICDR）碳素材料。这也标志着将这种材料应用在球拍中，体现了更高的坚韧性和反弹性，无论是正手击球或是反手推挡都威力十足。\n3、镍钛合金纤维：双刃10流体拍框的外边缘加入镍钛合金纤维，增加了拍框的韧度，让推挡更迅速。\n4、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度；\n5、新型单通道线孔（NewGrommetSystem）：改变传统的交叉位羽线共用线孔，为每一条羽线安排独立的线孔，获得高性能的线床效果。\n6、实感框芯（SolidFeelCore)：通过在拍框空洞结构内部加注实感填充物，阻断击球时冲击造成的有害震动。（所有日本制造的球拍都有此功能）\n7、流体形盒式拍框（AeroBoxlFrame)：同时实用流体形拍框及盒式形拍框截面设计两种特性，兼具挥拍速度快与扎实的效果。\n8、新型轻质内置T形接头（NewBuilt-inT-Joint）：新型T形接头不再采用金属材料，而是改用由特殊环氧树脂制成的新型轻质T形接头；这种新型环氧树脂制造的接头使拍框拥有更高的稳定性，击球威力更强大。\n9、致密型纳米碳素：\n10、超纤细加长拍杆：致密型纳米碳素科技，制造出纤细、强韧的拍杆，使击球更具威力，缔造出至轻至强的挥拍体验。\n11、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '高弹性碳素；新型DR致密型纳米碳素；镍钛合金纤维', '高弹性碳素；致密型纳米碳素', 89.0, 85.0, 674.0, '-', '硬', 26.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10273.html');
