insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', Null, 2019, '全能型球拍\n1：拍框断面采用新型钻石断面结构，加强头框的稳定性。球拍的整体强度得到较大的提高，同时也增强了击球威力与控球性。\n2：中管采用40T高刚性碳素纤维精制而成，增强整支球拍的强度优势，同时提升球拍中管的抗扭性能，在进攻方面得到更好的表现。', '超高刚性纤维碳纱与NANO材料', '40T高刚性碳素纤维', 84.0, 80.0, 675.0, 'G5（2#）', '适中', 30.0, 26.0, '290±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7902.html');
