insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'TI10TI10三代', Null, 'TI-10第三代\n性能特点：\nTi-10（紫色三代）羽拍和Ti-10（黄色二代、红色一代）的主要区别是拍头比后者轻，属于HeadLight（头轻型）设计。\n1、在拍框上采用了新型钛金属网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛金属网眼部位范围最宽：四个线孔范围；\n2、采用了MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更高的羽线拉力，使击球感更硬、爆发力更强；\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n4、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n5、拍框中部采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n6、拍框端部和靠近接头部分采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n7、拍杆加长10毫米，接球面加大32%，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，达到锐角落点以产生强而有力之高角度杀球；\n8、球拍拍框、拍杆采用超高强模数碳素纤维制造，加强了球拍攻击力及提高了球拍寿命。\n9、直径7毫米超细拍杆，弹性好，攻击力强，防守及进攻的效果好。', '超高弹性碳素纤维', '超高弹性碳素纤维', 89.0, 85.0, 674.0, 'G4', '特硬', 22.0, 22.0, '285mm±3mm', 'https://www.badmintoncn.com/cbo_eq/view_7823.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MX60MX-60', 2012, 'METEORX60\n球拍科技：八面刀锋技术+碳纤维强化叠织技术+外悬波浪+80孔穿线模式\n2012年胜利最新尖峰系列羽毛球拍，延续了X70和X80的八面刀锋结构拍框，拍面稳定性提升22%，表现出卓越的结构稳定性能，同时有效减少挥拍时的空气阻力，确保球拍稳定性的同时，将击球威力发挥到最大。\n创新7.2Φ中杆，保证更强扭力的同时，也焕发出更高的弹性！采用纳米树脂材质添加技术，能使nano级微细颗粒均匀分布在碳纤维的空隙，增加碳纤维复合材质的整体强度，使球拍的结构更优异，有效减少拍框变形几率，利于进攻型选手发挥强大力量！', '超高刚性碳纤维+纳米树脂+强化叠织碳纤维', '超高弹性碳纤维+纳米树脂+7.2SHAFT', 89.0, 85.0, 675.0, 'G4', '适中', 30.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5247.html');
