insert into detail values('羽毛球拍', '李宁Lining', '山系列', '纤仞山N30谢杏芳', Null, '纤敏的手感，强韧的球风，打出荡气回肠的消耗战，正是纤仞山RocksN30。国羽顶尖高手谢杏芳专属\n\n拍身平衡点高，扣杀犀利无比；拍头边缘，以“压缩结构”打造，令拍框抗扭指数，与拍面稳定指数，全面升级；柔韧的中管，拉吊高远，落点精准，瞬间化被动为主动。\n\n纤仞山RocksN30，匹配拉吊打法中力量反击型选手，为国羽顶尖高手谢杏芳专属。纤敏的手感，强韧的球风，打出荡气回肠的消耗战，正是纤仞山RocksN30。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2（32/8英寸）、S3（33/8英寸）', '-', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1890.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPF288', Null, '李宁“MC控系列”，专为擅长防守和拉吊打法的选手设计。“MC控系列”采用适中的拍框头部设计，配合较柔和的中管弹性，结合李宁的力学优化拍框技术带来的超大甜区，使球拍具有拉吊稳定、扣杀力量大的特性，在拉锯战中不急不躁，以不变应万变，伺机进攻，稳操胜券！', '超导纳米', '碳纤维', 85.0, 85.0, 675.0, 'S2', '较硬', 30.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5377.html');
insert into detail values('羽毛球拍', '李宁Lining', '风系列', Null, Null, '李宁N65羽拍风格体验：\n\n1速度型球友，非暴力型球友；\n\n2双打男性球友，绝对给力；', '超细高强度拍框', '超细高强度仿生中管', 90.0, 89.0, 675.0, '200mm', '中', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5443.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, Null, 2011, '李宁WindStormN60羽毛球拍属于最受欢迎的李宁“US锐系列”，特别适合快速进攻、快速反击打法的使用者。利用高反弹力中管及较轻的球拍重量，表现出挥拍速度快、反弹力量大的特性。结合力学优化拍框、空气动力学拍框截面系统等李宁独有科技的支持，“US锐系列”可在瞬间向对手全面展开攻击，摧枯拉朽之势，令对手粹不及防！2011李宁推出的最新高端女士用拍，是王仪涵和王适娴用拍的新涂装版本，温柔魅力的粉红色，是专属于女生的标志。超细的拍框和中杆设计，超轻的拍身重量，使其拥有更快的挥拍速度，更迅猛的反弹力，更快速的反击对手！', '碳素', '碳素', 89.9, 85.0, 675.0, 'S2', '中等', 30.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5639.html');
insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, 2011, '独有时尚酷炫双面双色涂装（一面紫罗兰色一面镀铬），细拍杆，平衡点适中、拍杆柔韧度适中，适合进攻型球员。', '40T超刚性CNT碳素纤维N-body超力量型', '40T超刚性CNT碳素纤维', 87.0, 87.0, 674.0, 'G5', '适中（3）', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4957.html');
insert into detail values('羽毛球拍', '李宁Lining', '能量聚合', '能量72LN72LAYPL162', Null, '李宁N7IILight在外观上尤其是漆水工艺，以及整体质量品控依然领先；软框软中管还要同时在拍框和拍杆都搭载了减震系统(拍框填充发泡，中管填充芳纶纤维)，击球感非常柔和舒适，震动极低，上手没有压力；适合主打中前半场，灵活迅捷出球干脆体力消耗低，若爆发力好在后场进攻也有着上佳表现；', '全碳素', '全碳素', 0, 0, 675.0, 'S1', '偏软', 32.0, 24.0, '306mm', 'https://www.badmintoncn.com/cbo_eq/view_6633.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPF292', 2011, 'N10羽拍，是一款专门根据王仪涵技术特点设计的羽毛球拍，力量大，进攻型打法，一直是王仪涵傲立与世界第一的资本，尽管她的脚步和基本功不是最好的，但是进攻，力量在国羽女队里面绝对是最好的，所以选择N10羽毛球拍的球友，一定得对自己的力量有清晰的认识，如果你的力量稍微差一点，没有关系，多练习，永远是人去适应球拍，而不是球拍去适应人。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '硬', 30.0, 24.0, '292mm', 'https://www.badmintoncn.com/cbo_eq/view_7079.html');
