insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '恶鬼之锤乌缺F35A白金版', 2022, 'Bonny/波力羽毛球拍恶鬼之锤F35A白金版。\nA:破风式框型:破风框，风阻小，挥拍速度快,提高扣杀速度。\nB:中管:46T高弹性细中管6.5mm直径,采用全新性树脂材料,弹性更强，更韧，有效提升球拍抗扭力效果与弹性,回弹速度更快\nC:二次成型,使用高刚性碳素从容承受30磅高磅数网压，抗扭性效果佳，拍框稳定性高，控球稳（中后场表现非常出色，重杀点杀速度快）\nD：软弹的中杆，在防守端也可以借力打力，轻松防守，控球稳\nE：甜区大，容错率低\nF：速度型球拍，攻守兼备偏进攻\nG：2021年8月开始设计涂装，9-12月份在上海进行了接近20场试打。调整了3次拍杆的软硬度。试打人数接近100人次。最后总结试打结果，整理参数上线生产了这款F35A', '高刚性碳纤维', '46T高刚性碳纤维', 84.0, 80.0, 675.0, 'G5', '适中（M）', 30.0, 30.0, '300±5mm', 'https://www.badmintoncn.com/cbo_eq/view_11193.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT60VT-60', Null, '尤尼克斯VT60羽毛球拍，\n2011年下半年最新款羽拍，\n一款AT600最完美的升级版羽拍。', '高弹性碳素+轻感碳素+钨', '高弹性碳素+超级聚乙烯纤维', 89.0, 80.0, 674.0, 'G4G5', '稍软', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5254.html');
