insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'DUORA双刃系列', '双刃6Duora6', Null, '双刃6球拍的颜色，以香槟粉作为主色调，辅以粉红、白，黑等颜色，颜色很是鲜嫩。拍杆和拍框体现了双面的特征，平行于拍面的两侧，主基色外，颜色则有所不同。\n特殊考虑女士球友力量偏弱，纤细的手臂对振动更加敏感。她沿用了“双刃”系列特有的“双面异型框科技”，还采用了新型的“减震碳素”技术。\n拍子上手，手感并不像介绍的超软，中杆不是很软，感觉挺扎实。球拍使用过程中，感觉到拍面很稳定，击球有力，中杆反弹速度不慢。尤其是在中前场，正反手杀球，推球，防守反击效果都不错，尤其是破风框拍面击球，手感拍面及拍杆，反弹助力很明显。杀后场，及后场打击对方后场高点，球拍比较轻，要求球速及力度时比较困难。\n球拍的灵活及稳定，网前非常给力。后场吊球落点也比较尖。\n关于正反面。按她的“双刃”设计，正手拍面采用了更易持球、逐步提升挥速的盒式拍框设计，能够轻松打出线路更好的高远球；反手拍面采用了破风流体型拍框设计，不给对手创造进攻机会，并能够增加击球时的拍框弹性，提升接球质量。\n但是，在准备接球，接发球时，你还是可以选择第一次或前几次，用哪个拍面击球，多回合后，球拍在手中的位置变换调整，也就很难感知出了。\n击球过程中，很难感知在正手或反手是你是用的盒试框，还是破风框拍面方向把球击出的，以为球拍在手中是有转动的，如果击完球尤其是在腰部或下手，反手，你可以用非持拍手去感知一下。哦，这次是用破风框击的球，或反之。', '高弹性碳素；DR致密型纳米碳素；减震碳素', '高弹性碳素；致密型纳米碳素', 83.0, 83.0, 675.0, '4U5', '超软（官方标注）', 4.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6535.html');
