insert into detail values('羽毛球拍', '索牌SOTX', Null, Null, Null, '全球三大碳纤维厂商之一，日本TORAY航天级高刚性碳纤维，赋予球拍更强抗扭性能、更高强度和更扎实的手感体验。\n\nNANO科技环氧树脂，增强碳纤维结合力和强度，实力提升球拍抗冲击强度和耐用度。\n\n超细火山断面内框结构拍框，采用超细尺寸设计，减少挥拍风阻，扩大击球甜区。同时，也带来更佳的挥拍灵活性和速度。\n\n悉心调较的纤细中杆，优异的高反弹力表现。配合STC50超抗扭中杆技术，兼具高抗扭力。杀起球来粗犷强劲，绝不手软。\n\n扭角被控制在更小角度的STC50超抗扭中杆，较之传统球拍中杆的高扭角，全面提升抗扭性能。手感舒适，击球落点精准，助你打出令人叫绝的好球。\n\n球拍中杆单独制造，二次成型工艺，确保球拍中杆壁厚更为均匀，更好的真圆度，参数规格准确可控，优秀的手感保证。', '高刚碳纤维', '高刚碳纤维', 88.0, 84.0, 675.0, '-', '7.8-8.2', 29.0, 29.0, '298-302mm', 'https://www.badmintoncn.com/cbo_eq/view_9543.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '探险家系列', 'EXP-6250EXP6250探险家6250', 2011, '从入门级到中级水平的羽毛球爱好者，都在追求更大操控灵活性来寻求平衡，探险家系列利用复合空气运动力学原理的AERODYNAMIC低风阻中平头拍框设计，结合SHAFT7.0MM超细中管，在提升球拍灵活性的同时，提供更准确敏锐的控球性能，带来近乎完美的操控感觉。', '碳纤维+树脂', '碳纤维+树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G2G4,5', '软', 24.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6923.html');
