insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB21SCAB-21SPECIAL', Null, 'YONEXCAB系列羽拍中最具代表性的产品，也是YONEX中最经典的羽拍之一。球拍做工精美，独特的亮光面中略带金属光泽，手感绝佳。\n\n1、传统圆头拍框，古朴耐用；\n2、拍框和拍杆内部连接处采用YONEX专利T型接头连接结构，以传送更大击球力量；\n3、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性，同时提高抗扭性能；\n4、拍框由多重石墨积聚而成，无论杀球或抽击都效果极佳。', '高强碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, 'G5', '硬', 22.0, 22.0, '288±3mm', 'https://www.badmintoncn.com/cbo_eq/view_10096.html');
