insert into detail values('羽毛球拍', '迪卡侬Decathlon', Null, 'BR930P/S/C', Null, 'DECATHLON迪卡侬PERFLY930V羽毛球拍，平衡点居中，单打双打都适合的控制性球拍，适合经常打羽毛球的中高阶水平人群使用。\n银紫色、黑白色、蓝色、深蓝色', '碳纤维', '碳纤维', 83.0, 83.0, 675.0, '-', '-', 0, 0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_9864.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'cab35CAB-35', 2009, '性能特点：\n1.ELASTICTI软钛合金\n纳米级的软钛合金ELASTICTI兼具金属的高强度和橡胶般的高弹性，其性能超越传统碳素材料。在击球一霎，软钛合金ELASTICTI先以变形来储存能量，紧接着以瞬间形态恢复将能量精确地完整反弹。\n2.MUSCLEPOWERFRAME拱形线槽系统\n拱形线槽系统将拍线支撑在圆拱形的湖面上，消除触点应力，拍线不易疲劳，并增强了拍框的整体效应，从而增强了球拍的稳定性和力量性能。\n3.ULTIMUMTI镍钛合金\n埋藏于球拍内部的镍钛合金，其功能就像一个能量电容器，能有效储存能量，在击球瞬间利用瞬态反弹效应将能量装化为羽毛球的爆发性速度。\n产地：日本', 'ELASTICTI软钛合金', 'ELASTICTI软钛合金', 89.9, 85.0, 665.0, 'G4,5', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2657.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT70', 2011, '科技说明\n(a)拍框结构经过优化：2点钟和10点钟位置，加强结构强化拍头的力量性。\n(b)两侧纤细拍框增加柔韧性，两部分同时作用使扣球力量大增！\n(c)12点钟位置的部分重量转移至6点钟的T形接头区域，消除头重拍框的不平衡感，操控自由顺滑！\n(d)声音滤清器\n击球声音响亮结实，不但手感舒适，更会激励你积极进攻。在拍框2点钟和10点钟位置，钉条采用新型热转换减震材料，将刺耳和沉闷的噪音隔离，创造出既舒适又结实响亮的击球声音，让你在运动中获得更大的愉悦！\n(e)威力无比，操控顺滑，来自威力三角系列的愉悦！\n\n三角能量系统TRI-VOLTAGESYSTEM：能击出重扣，头重但不失操控性，就是三角能量系统TRI-VOLTAGESYSTEM新技术\n\n头重设计虽然能增强力量，但是会减弱操控性能。反之，头轻设计可以提高操控性能，但是会减弱力量。三角能量系统“TRI-VOLTAGESYSTEM”可以成功地将“力量”和“操控性”这两个对立的性能并存。', '高弹性碳素、音频滤清器、钨', '高弹性碳素、超级聚乙烯纤维', 89.9, 80.0, 674.0, '-', '硬', 25.0, 19.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3452.html');
