insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYRK216-4', Null, '此款球拍性能稳定，骨架纤细，更强韧，手感更好。是一款攻防兼备的球拍，对于娱乐型及初学者使用会体会到更好的畅快感，使技术稳步提升，而对于那些职业比赛的选手这款球拍也能达到优越的手感，也能得到更好的发挥。拍框为碳纤维材质，柄布聚氨酯与不织布材质。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '适中', 26.0, 20.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_8540.html');
