insert into detail values('羽毛球拍', '凯胜KASON', '汤仙虎系列', 'FYPD030-1tsf300A', Null, '特点：强弓框型、单打进攻\n力量系列对于主动出击，善于以力量压制对手的使用者，凯胜“力量系列”通过合理调整球拍平衡点、加强中管刚性，使球拍击球力量得到最大程度的\n\n释放。配合凯胜独有的强弓科技或波浪形外框设计，张力增强的同时更可使回球力提高5%以上。“力量系列”产品借助球拍力量上的优势，使\n\n进攻更具威力，彰显王者之气势。\n\n适用人士：\n\n1、高水平、灵活、技术全面的选手；\n\n2、力量不大，但进攻欲望强烈、掌控性强的单打选手\n\n3、渴望突破的中级进阶级选手', '超细高碳纤维', '超细高碳纤维', 89.0, 85.0, 675.0, 'NG5', '硬', 24.0, 22.0, '290-295mm', 'https://www.badmintoncn.com/cbo_eq/view_23.html');
