insert into detail values('羽毛球拍', '李宁Lining', '风动导流', '风动8000', Null, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、中管弹性复位系统、热熔胶、立方锁、复位弹性扭角、灵控内锥', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2（82.5mm)', '偏软', 32.0, 32.0, '298mm', 'https://www.badmintoncn.com/cbo_eq/view_6850.html');
insert into detail values('羽毛球拍', '川崎Kawasaki', 'Speed系列', '幻影880', Null, '川崎SPEEDER880(幻影880)，采用“石墨烯科技“，球拍的抗扭性得到了强化。突击，拉吊，扣杀，迅猛精准。同时搭配破风型的六边形框型，是一款非常适合速度型选手使用球拍。', '30T+40T高刚性碳素纤维', '46T高刚性碳素纤维', 86.0, 84.0, 675.0, 'G1', '硬', 32.0, 18.0, '288±2mm', 'https://www.badmintoncn.com/cbo_eq/view_9476.html');
