insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR800', 2017, '新色的NR800今年在上半年国内上市，颜色一改原来的“亮”，由黑混色出场，也被称之为暗黑色的“剑客”。\n\n球拍首线，上YY-AB子母线，磅数较高，上好线之后，球拍没发现异常。用球拍平颠AS-7球，手感球拍均衡，甜区面积大，颠球拍线声音很清脆.\n球拍上手第一场实战，正手高远，平高，及反手回平高球，出球顺畅，回球到位并不费劲。球拍很稳定，回球线路受球拍中杆及拍框变形产生的偏差小。并不像开始预想的球拍轻，借力不容易。\n中前场的平抽，推档，出球快，出球速度也很快，前压感很强。推档之中，压住对方，之后抢高点，网上，球拍非常容易上手，出球灵活准确，取胜率很高。\n杀球，出球速度快，中前场杀球力度速度准确性都不错。后场高点杀球，虽然出球速度快，但打击强度不够，点杀效果要远好于重杀。\n网前，或许是首次很正式的对比同款球拍，及首次使用子母线，开始的几局球，手感球线很涩，按以往惯性用力发网前球，好几次下网，力度掌握不太好。在球拍使用初期的吊球中也有觉得可以过网，却没有过网。可能是子母线结合新球拍的双影响所致，习惯后就没问题了。\n虽然球拍是4U5，除了重力杀球，力度感觉不足外，其他方面，比我预想的要好得多。拍框中杆很稳定，出球速度很快，抢上网优势明显。\n\n多场球下来，在没有球拍碰撞的情况下，漆水基本保持完好。未发现明显崩漆、塌陷。', '高弹性碳素；音效金属', 'X链富勒烯纳米碳素；高弹性碳素', 84.0, 80.0, 674.0, 'G4,5', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6600.html');
