insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', '装甲99', 2019, '进攻型球拍\n1：线槽部分：球拍在框体受力最大2.10.5.7.四个点进行了加粗处理，从结构设计上保障承受35磅的可能', '超高刚性纤维碳纱', '超高刚性纤维碳纱', 84.0, 80.0, 675.0, 'G5（2#）', '偏硬', 35.0, 26.0, '290±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7908.html');
