insert into detail values('羽毛球拍', '波力Bonny', Null, 'BM027BM0282BD2161021E2BD2161020E', Null, '波力Bonny大师BM027028羽毛球拍攻防全碳纤维40周年虎啸生风\n破风式拍框，窄边小平头挥拍时将空气快速导流，降低空气阻力，提高扣杀速度。\n二次成型，使用高刚性碳素原料制成,提升拍框刚性，及中管抗扭力系数。\n1.5k碳Wowen中杆，有效提升球拍抗扭力效果与弹性。高弹性细中管6.5mm直径，采用超韧性树脂材料，弹性更强，刚性更刚。\n采用虎啸元素，加入烫金烫银，中杆标记“师”字和40周年纪念logo。', '高刚性碳纤维', '高刚性碳纤维+1.5k碳Wowen', 89.0, 80.0, 675.0, 'G5', '适中', 30.0, 30.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_10792.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VTZF88VT88VT-ZF88', 2012, '米山稔的88岁生日限量纪念版。“88”的创意来源于尤尼克斯创始人米山稔的88岁生日，这是为了表彰米山稔先生对羽毛球拍届所做的贡献。除此之外，VT-ZF88是复刻1973年经典的木头球拍B-9100的涂装，为的就是向传奇致敬。在那个以木头球拍为主的年代里，B-9100绝对是球星们的最爱。复古不仅是现在时尚界的潮流趋势，羽毛球拍届当然也不能幸免。\n\n多官能键碳素纳米管（Nanopreme)：是一种长度不超过“10亿分之一米”大小的碳素粒子，属于纳米级别的碳素材料。将这种碳素材料和环氧树脂混合使用，可以使碳素纤维形成异常坚固的结构。当多官能键碳素纳米管作为环氧树脂的增进剂运用到拍杆中，可使拍杆的硬度，弹性，柔韧性都大幅提升，更好的满足高级球员对高性能球拍的苛刻要求。\n\n1、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度；\n\n2、新型轻质内置T形接头（NewBuilt-inT-Joint）：新型T形接头不再采用金属材料，而是改用由特殊环氧树脂制成的新型轻质T形接头；这种新型环氧树脂制造的接头使拍框拥有更高的稳定性，击球威力更强大；\n\n3、威力三角系统（Tri-VoltageSystem)：一般来说，在拍头增加重量会加强拍头的攻击力，但同时也会降低球拍的操作性。相反，拍头较轻的球拍会更加灵活，但爆发力明显不足。全新的威力三角系统成功地将强大爆发性能和卓越的操控性能，这两个截然相反的特性完美地结合在一起。能击出重扣，头重但不失操控性能，就是威力三角系统新技术；\n\n4、音频滤清器：音频滤清器在2点钟和10点钟位置采用了新材料，只减少了高频和低频音波。使击球时发出更大，更响亮的声音以干扰对手，为攻击性强的比赛增强了挑衅的气氛；\n\n5、极纤细加长拍杆：拍杆是所有羽毛球拍的灵魂，因为拍杆的性能直接影响着球拍整体的性能，包括力量，速度，控制性能。纤细拍杆可以实现良好的弯曲性，但复原性就会减弱；更硬拍杆可以实现良好的复原性，但是柔韧性就会降低。在这种情况下，能实现高反弹，高强度的新材料“多官能键碳素纳米管”在拍杆上使用，完成了能同时实现“弯曲性”和“复原性”的对立统一。首次运用NANOPREME的球拍就是VT80！不仅具有最纤细的拍杆，也能发挥强韧的弯曲，爆发出前所未有的力量。与常规球拍相比，当同等的压力下释放已经弯曲的球拍，在0.018秒的瞬间，VT80的回弹幅度提升了一倍。VT80所产生的回弹力比常规球拍高出10%；\n\n6、实感框芯（SolidFeelCore)：通过在拍框空洞结构内部加注实感填充物，阻断击球时冲击造成的有害震动；\n\n7、流体形盒式拍框：结合扎实手感和挥拍速度快的特点；\n\n8、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '高弹性碳素+音频滤清器+高硬度超级高弹性碳素+钨', '高弹性碳素+多官能键碳素纳米管', 89.9, 80.0, 674.0, 'G4、G5', '超硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6557.html');
insert into detail values('羽毛球拍', '高神Gosen', 'ROOTSGAVUN', Null, Null, '品名：GOSEN/高神(日本)ROOTSGAVUNAERMET6000PRO\n球拍特性：R2X系列的最高峰版本，採用M30碳素增加了弹性，拍框较窄，控制性佳。\n重量：3U86+/-2g\n手柄尺寸：G5\n建议磅数：20-25磅\n颜色：青铜色\n材料：高系数碳素，AERMET，M30\n框架：圆头\n产地：日本', 'M30碳素纤维与GOSEN专用的AERMET合金网料', '高系数碳素，AERMET，M30', 88.0, 84.0, 675.0, 'G5', '硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4286.html');
