insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击66GTK66GTK-66G', Null, '箱形结构\n拍框断面采用箱形结构设计，有效提高击球时稳定性和抗扭力，可承受较高的拉线磅数。\n\n强叠层系统\n透过全新碳纤维叠层设计，强化拍框刚性，可耐高磅数乘载力，提供扎实击球手感。\n\n纳米材质\n采用纳米级树脂材质添加技术，能使Nano微细颗粒均匀分布于碳纤维束间的空隙，增加碳纤维复合材质的整体刚性与强度，减少拍框变形。', '高弹性碳纤维+纳米树脂+强叠层系统(FRS)', '高弹性碳纤维+纳米树脂+7.0SHAFT', 68.0, 64.0, 0, 'G6', '-', 30.0, 13.5, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_9117.html');
insert into detail values('羽毛球拍', '李宁Lining', '能量聚合', 'AYPN306TC70能量70', Null, '科技：机翼恒定系统、多点复合碳纤维强化系统、力学优化拍框、空气动力学截面系统、超导纳米、中管弹性复位系统、热熔胶、复位弹性扭角、锥体速弹科技', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2（82.5mm)', '偏硬', 32.0, 32.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_6846.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPF004N502S', 2011, '李宁N50-IIS-TYPE羽毛球拍，与N50II一样的涂装，相同的科技亮点，却是一款更适合业余爱好者的高端毛球拍。\n利刃，恐怖利刃，速度均衡型恐怖利刃，绝对是这款N50IIS-TYPE的最好诠释，提起N50II羽拍，可谓是是鼎鼎大名，如雷贯耳，四届世锦赛冠军付海峰，奥运会，世锦赛冠军于洋，江浙美女王琳，国羽第二双打主将郭振东……扎实的手感，出色的抗扭性能，攻守兼备，均衡利器，流畅的操控感，使这款N50II羽拍可谓是经典流传，有人说它是后场利器，下压感强悍，而不震手，有些人，它似乎速度感稍微逊色了一点，如果能再有一点速度上的疾风骤雨，那绝对是一把最完美最优秀的兵器。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '偏软', 30.0, 24.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_5050.html');
