insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'cab25CAB-25', Null, '适合球员类型中高级型，单双打、进攻防守均宜\n性能特点YONEXCAB系列羽拍中早期最具代表性的产品，和CAB-20性能接近，拍框由多重石墨积聚而成，无论杀球或抽击都效果极佳，性价比极高，是喜欢圆头球拍选手的最佳选择：\n\n1、拍框和拍杆内部连接处采用T型接头连接结构，以传送更大击球力量；\n\n2、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量。', '高强碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 9.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_914.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓11THARC11TH弓箭11TH弓剑11TH', Null, 'ARC-11在几个月前就已经发行，并在全球掀起一股追逐热潮。陶菲克选择了“鸽子灰”作为其特别限量版球拍的主色，因为这与他的签名以及镶嵌其上闪闪发亮的座右铭“想赢是一种态度”相互辉映。\n\nARC-11，这个特别限量版球拍将在2013年5月的苏迪曼杯上亮相。在2013年6月的印尼公开赛上，陶菲克将在他的祖国，他梦开始的地方，举行告别赛，这也将是他在职业羽坛的最后一次比赛。', '高弹性碳素、高塑性叠杯碳素纳米管、音效金属', '高弹性碳素、超级聚乙烯纤维、锚状内置接头', 94.0, 85.0, 675.0, 'G4、G5', '硬', 3.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5989.html');
