insert into detail values('羽毛球拍', '索牌SOTX', Null, Null, 2019, 'SOTX索牌羽毛球拍大师系列PR4900全碳素进攻型单拍碳纤维\n大师之作为大师。\n全球三大碳纤维厂商之一，日本TORAY航天级高刚性碳纤维，赋予球拍更强抗扭性能、更高强度和更扎实的手感体验。\nNANO科技环氧树脂，增强碳纤维结合力和强度，实力提升球拍抗冲击强度和耐用度。\n超细火山断面内框结构拍框，采用超细尺寸设计，减少挥拍风阻，扩大击球甜区。同时，也带来更佳的挥拍灵活性和速度。\n悉心调较的纤细中杆，优异的高反弹力表现。配合STC50超抗扭中杆技术，兼具高抗扭力。杀起球来粗犷强劲，绝不手软。\n扭角被控制在更小角度的STC50超抗扭中杆，较之传统球拍中杆的高扭角，全面提升抗扭性能。手感舒适，击球落点精准，助你打出令人叫绝的好球。\n代表胜利的三圆环。大师系列独具的三圆环标识，选手级装备的工艺和调校，输出优秀全面的整体性能和手感体验。\n球拍中杆单独制造，二次成型工艺，确保球拍中杆壁厚更为均匀，更好的真圆度，参数规格准确可控，优秀的手感保证。', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, 'G5', '硬', 30.0, 30.0, '296-300mm', 'https://www.badmintoncn.com/cbo_eq/view_10153.html');
