insert into detail values('羽毛球拍', '威克多VICTOR', '传奇系列', '赵剑华纪念版球拍', 2011, '产品介绍：Legend配合“赵剑华”式善于变速的打法特点，拍框采用AERODYNAMIC椭圆形结构设计，有效减少挥拍时的空气阻力并提升抗扭力，带来强悍敏捷的回球速度的同时，大幅强化对球拍的控制能力；内拱型加强结构，甜区面积增加5%，提高球拍击球点和拍面的反弹力，迅捷反击对手的锐利扣球，发挥强劲攻击力量。', '超高刚性碳纤维+纳米树脂+钛', '超高刚性碳纤维+纳米树脂+7.5SHAFT', 94.0, 80.0, 675.0, '-', '硬', 34.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3903.html');
