insert into detail values('羽毛球拍', '威克多VICTOR', '探险家系列', '探险家6500', Null, '特性：破风结构拍框+7.0mm细中杆+中平头\n1.将拍框由原来的断面高度12.4mm降为11mm,让拍框明显感觉细致、秀气、轻巧.\n2.拍框截面为椭圆形,此框型结构能减小挥拍时空气阻力并提高拍框的扭力性能,更利于击出高速度的大力回球.\n3.球拍中管外径7.0mm设计,其纤细的拍身,使挥拍动作更加迅捷灵敏.\n4.均等化方形拍头能提供额外多32%的有效击球甜区,即使羽球偏离线床中心区的连续式扣杀,也能保持相应的精确和速度.', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G2', '适中', 26.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2336.html');
