insert into detail values('羽毛球拍', '威克多VICTOR', 'HYPERNANOX系列', 'hx100HX-100', 2018, Null, '高刚性碳纤维+纳米树脂+强韧纤维+HARDCOREDTECHNOLOGY', '高强韧碳纤维+NANOTUBE+6.8SHAFT', 89.0, 80.0, 675.0, 'G5、G6', '稍软', 29.0, 29.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7516.html');
insert into detail values('羽毛球拍', '邓禄普Dunlop', Null, 'AEROGEL6000', Null, 'Aerogel（气凝胶），世上最轻固体，因其甚似空气（比空气重三倍），故又被称作“冻结的烟”。气凝胶具有异常强大的隔热功能，一块一寸厚的气凝胶造，相当20至30块普通玻璃的隔热功能，如将气凝胶放在玫瑰与火焰之间，玫瑰丝毫无损。气凝胶在航天探测上也有多种用途，在俄罗斯“和平”号空间站和美国“火星探路者”的探测器上都有用到这种材料。\n\nAerogel（气凝胶）尽管其密度最低.重量最轻,却能轻松地承受其自身重量4000倍的压力,并同时具有最高的绝缘性能和高温稳定性.Aerogel（气凝胶）真正的太空材料.\n\n邓禄普DUNLOP是将Aerogel（气凝胶)运用于网.羽拍生产的第一家公司.从而使Aerogel（气凝胶）真正为其所有.其运用的这种技术不仅加强了拍框头部的硬度,而且将框振动减至最小,从而使球拍更具威力.在拍头底部的Aerogel（气凝胶）使球拍更稳固,从而使高级选手在打球时能更好地操控球', 'Aerogel（气凝胶）+100%高级碳纤', '高强碳素纤维', 87.0, 83.0, 665.0, '-', '中等弹性', 28.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1217.html');
