insert into detail values('羽毛球拍', '威尔胜Wilson', Null, 'WR009811S+CX9000JCV', 2019, 'FIERCECX9000JCV松友美佐纪用拍新搭载在手掌的抓握部分，“反冲”去除身体产生的微小振动，更加细腻准确地捕捉穿梭。新的轴内部结构“EX-ZONE”确保操作所需的范围，如手臂的肘部，并提供灵活的变化，实现灵活性和稳定性。松友美佐纪把一切托付在一起的FIERCE的最终形态。', '碳纤维', '碳纤维', 81.0, 77.0, 675.0, 'G5、G6', '硬', 26.0, 26.0, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_9480.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '挑战者系列', '挑战者pro878', Null, '性能特点:1.均等化方头能提供多32%的有效击球甜区，即使羽毛球偏离线床中心区的连续式扣杀，也能保持响应的精确和速度。\n2.特殊方形框面结构设计，提高击球时稳定性和较小的扭矩，可承受较高的拉线磅数。', '超高刚性碳纤维+E.titanium', '超高刚性碳纤维+E.titanium', 94.0, 85.0, 675.0, '-', '软', 28.0, 20.0, '285±3mm', 'https://www.badmintoncn.com/cbo_eq/view_8644.html');
