insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓剑FDARCFDEX弓箭FDarcfdARCSABERFDARC-FD', 2016, '红色、蓝色、橙色\nARCSABER系列球拍采用独特的纳米分子结构，新型杯状碳素纳米管能让拍框在击球后迅速的恢复原状。ARCSABER系列球拍带给你精准、细腻的控球手感，提升球拍对击球落点的控制能力,准确征服每一次击球。', '高弹性碳素，纳米气弹簧', '碳素；致密型纳米碳素β', 79.0, 75.0, 675.0, 'G4、G5', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6637.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '脉动系列', 'Ti98', Null, '特性：1.ArteryTec特殊框形，内框凹槽技术设计，使甜点区向上扩展10mm扣球有力；顶框1/3处配重E.Titanium提升惯性力矩，搭配超轻重量，使球拍具有更为强大力量和更迅捷灵敏性。2.均等化方头能提供多32%的有效击球甜区，即使羽毛球偏离线床中心区的连续式扣杀，也能保持响应的精确和速度。3.特殊方形框面结构设计，提高击球时稳定性和较小的扭矩，可承受较高的拉线磅数。4.由航太钛合金和高刚性碳素纤维编制合成的先进高弹性中管，在击球瞬间，航太钛合金释放极大反弹能量，产生更大的爆发力。5.位于拍框三点钟和九点钟位置，采用特殊材质单粒钉，降低击球震动。适合单打攻击型球员。', '超高钢性碳纤维+E.titanium', '超高钢性碳纤维+E.titanium', 89.0, 80.0, 675.0, '-', '-', 30.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1261.html');
