insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT7', Null, '三角形威力拍框：符合空气动力学原理的三角形威力拍框（DeltaPowerFrame），能在不减小拍框威力的前提下提供扎实、稳定的击球拍面。\n方形拍头：YONEX原创的方形拍头设计（Isometric），增加构成线床有效区域的横线和竖线数量，扩展击球甜区，即使是非甜区中心击球也能保持足够的精度和速度。\n内置T形接头：深藏于拍框和拍杆连接处碳素纤维底层的内置T形接头，使球拍真正高强度一体化。此YONEX专利技术让球拍兼具强大的力量性能和精确的控制性能。', '高性能碳素', '碳素', 79.0, 75.0, 675.0, '4U(85.0-89.0g)G5', '偏硬', 4.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4830.html');
