insert into detail values('羽毛球拍', '李宁Lining', '风动导流', 'AYPH148AYPH162N55三代N553N55Ⅲ', Null, 'LINING/李宁羽毛球拍MP力系列N55-III\nN55III使用的是第三代风动导流科技，相比于第二代风动导流科技5、7点各自的两个导流孔，N55III还在1点和11点各增加一个导流孔，总导流孔数量为6个。拍头位置内外都设置了压槽，以增加拍框稳定性，在穿线过程中可以明显感受到拍框的稳定性很高。官方数据显示其中杆偏软，而实际击球感却一点都不软，甚至有点偏硬，启动速度较慢但是加速很流畅，控球相当精确。下压感很强，连续进攻中杆形变很少所以能量损失少，是一款进攻利器！', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '适中', 30.0, 24.0, '303mm', 'https://www.badmintoncn.com/cbo_eq/view_6710.html');
