insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'TI10TI10二代', Null, 'YONEXTI-10第二代羽毛球拍与第一代相比在外观、材料等方面都有了改进。在外观上：拍头改为白色，新款丁头两侧有两个双连钉；在材料方面：新款拍杆上写的是HIGHMODULUSGRAPHITE（高弹性石墨），拍杆随机抽测的平衡点为283毫米，没有113款的硬，头也变轻，更适合大多数爱好者使用。传统拍杆直径是8毫米，而新款拍杆只有7毫米，超细的拍杆，减少了风阻。', '超高强碳素纤维', '超高强碳素纤维', 94.0, 85.0, 674.0, 'G4', '硬', 9.0, 10.0, '285mm', 'https://www.badmintoncn.com/cbo_eq/view_7824.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', '其它系列', 'AR-110AR110', Null, '1、球拍拍头较一般球拍重一号，但球拍总重量不变，增强击球及扣杀力度；\n2、采用破风式设计之宽体球拍，拍框为空心而形似流线型飞机翼，以减小风之阻力，拍框设计较薄而宽，比传统球拍薄11%，宽26%，造成破风式之效果；\n3、破风式设计宽体球拍可增加22%的攻击力。', '高强碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 9.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10737.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT9VT-9', 2012, '尤尼克斯YONEXVT-9羽毛球拍，热卖的一款中端进攻拍，球拍科技：威力三角系统；音频滤清器；方形拍头；三角形威力拍框；内置T形接头；低风阻锥盖。符合空气动力学原理的三角形威力拍框，能在不减小拍框威力的前提下提供扎实、稳定的击球拍面，强大爆发性和卓越操控性完美结合，在拍头重，可以击出大力扣杀的同时，又不失操控性！音频滤清器的加入，使击球声音更加悦耳！', '高弹性碳素、高频滤清器、钨', '高弹性碳素', 89.0, 85.0, 672.0, 'G4、G5', '-', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11045.html');
