insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT55VT-55', 2011, '黄色、银色、橙黄\nonexVoltric55羽毛球拍框架由HM石墨和钨制成，本质上特别坚硬。此球拍的重量为3U（85至89.9克），握把尺寸为G4。该球拍有白色，带HM石墨杆。该球拍旨在提供更多的排斥力和快速的球拍处理能力。Voltric55羽毛球拍适合激进的羽毛球运动员。', '高弹性碳素+钨', '高弹性碳素', 89.0, 80.0, 675.0, 'G4', '中硬', 4.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5092.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VTLD100', Null, 'YONEXVoltricLD100、ExtremePower和最新的LD系列球拍\n这款球拍配备了升级的三电压系统和等距框架。采用三电压系统，球员获得头重拍感觉的力量（头重的框架，可以在击球时施加更大的力量）。头重的框架适合那些想要更大的击球力量的球员（更大的力量，球员可以轻松地清除第3线击球并击出破坏性的扣球。此外，为了提高球拍整体的空气动力学性能，在框架下部采用了最新的横截面。这个新版本的球拍框架有助于提高球拍的挥拍速度。（因此球员可以获得强大的扣球和快速的球拍处理的好处）YonexVoltricLD100是中等弹性球拍，旨在为您提供进攻性排斥。它的框架由石墨和钨制成。它的杆身由石墨材料制成。', '碳纤维+钨', '碳纤维', 84.0, 80.0, 675.0, 'G5', '适中', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9983.html');
