insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'AT系列', 'AT700LTDAT700', Null, '1、复合拍框顶部的“gForceTi”特殊钛装甲合金，相对于碳素纤维能产生更大的重力效应，提升球拍击球能量。gForceTi是特殊金属复合物，能产生2倍于碳素纤维的重力效应。将gForceTi配置于羽拍前三分之一的拍框顶端，使球拍挥动时的惯性力矩获得提升，击打羽毛球的能量随之增加。\n\n2、创新的拍头边缘压缩结构，增强3%的拍面稳定性。gForceTi是特殊金属复合钛装甲，再配合拍框顶端的边缘压缩结构，能有效抵抗拍框的扭曲形变和提高控球能力。在增强3%的拍面稳定性的同时，更带来清脆扎实的“金属撞击之感觉”。\n\n3、更高的拉线张力。通过对拍框承载耐久能力的反复改良，ARMORTEC羽拍的拍线推荐张力已大为提升，以满足为当今部分球员喜爱高张力的需求。但必须注意：拍线的高张力会对球员的手腕、肘部和肩部造成不良隐患甚至伤害。\n4、拍头的钛装甲合增强重力效应，提高极限扣杀球速4%。', 'gForceTi特殊钛装甲合金', 'gForceTi特殊钛装甲合金', 89.0, 85.0, 674.0, 'G3G4G5', '硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_674.html');
