insert into detail values('羽毛球拍', '威克多VICTOR', '探险家系列', 'EXP-6550EXP6550探险家6550', 2011, '探险家6550羽毛球拍，\n2011年下半年以来销量最火的入门级羽拍，\n更多的科技概念打造，更性价比的入门级风范，\n铸就了销售炙手可热的销售量。\n不一样的探险家系列，\n一样的7.0mm的中杆外径，\n全新盒式拍框设计，\n更多考虑到入门级球友的需要，\n更稳定的拍面，更好的抗扭性能，\n打造出一款出球精准类型的羽毛球拍。\n最弹性的中杆，韧度十足，\n一样的力量，更好的高远球和接杀球效果，\n稍微偏重一点点的头重参数，\n提升扣杀点的高度，', '炭纤维+树脂', '炭纤维+树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G5,4', '稍软', 4.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7852.html');
