insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', '2BD2161011EZD011011J20', 2021, 'ClassicCarbonJ20-011\n专业羽拍：反弹速度快、落点准\n烫金属标：提升外观质感，球拍更加赏心悦目\n二次成型：提升拍框刚性、提升拍框及中杆抗扭\n乌缺工艺：高弹中管+破风拍框+线槽设计+舒适手柄\n乌纹：中管1.5KWoven，提升球拍抗扭与弹性，显现高档质感\n破风框型：挥拍时将空气快速导流，降低空气阻力，提高扣杀速度\n蓝色(ZD011)：随性的风格使你在厮杀时更显魅力', '高刚性碳纤维', '高弹性中管+Woven', 89.0, 80.0, 675.0, 'G5', '适中', 30.0, 30.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_10803.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, Null, Null, '性能特点：攻守兼备偏进攻\n一句话推荐：低风阻，高强度，大甜区，性能全面\n球拍科技说明：（注1-3点是球拍的重点卖点。）\n1.刚性碳纤维；\n2.力学优化拍框；\n3.空气动力学拍框截面系统；\n4.高刚性超细中管；\n5.平头', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '偏硬', 26.0, 20.0, '288mm', 'https://www.badmintoncn.com/cbo_eq/view_7191.html');
insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPM264N904N90Ⅳ', 2017, '新款球拍采用了非炫彩的漆水颜色，亚光的冰红+冷铁灰色涂装，而且漆色结构对称。初见，给人以沉稳低调的视感，不是很引人眼球。球拍外观漆水质量，延续了李宁球拍光滑细腻的特色，风采依旧。\n\n拍框为立体风刃框型。中杆上端，与拍框结合部之下，约3CM长，为近似于六面棱体的中杆结构，与众不同。拍框框型，及与其结合后的接近六方体中杆，有较强的立体感。受棱面结构影响，球拍“T”型处的李宁标，头尾较圆中杆有比较明显弯折，不圆滑。\n球拍的防伪，仍延续采用了光学磁变技术的水标。\n\n握拍手感，球拍不很重。无击球挥拍，拍头并不是特别重。中杆硬度，手感不是很硬。\n在室内，用球拍平颠档次比较高的球，球拍线击球音回馈比较清晰、清脆。\n\n测评参见：\n低调沉稳增速前行--李宁90系列之N90Ⅳ球拍试体验-神兵利器中羽在线社区http://bbs.badmintoncn.com/forum.php?mod=viewthread&tid=822807&extra=', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '适中', 32.0, 32.0, '292mm', 'https://www.badmintoncn.com/cbo_eq/view_6660.html');
