insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '天斧00ASTROX00AX00', 2020, 'Yonex推出其历史以来最轻便的球拍-天斧Axtrox00（DoubleZero）。它的重量仅仅为68克。\n\n天斧Axtrox00将继续沿用天斧系列的规格-由新次元碳素（Namd）打造的拍杆，回转力生成系统，方形拍头等等。此球拍更适合双打球员。', '高弹性碳素；钨；', '高弹性碳素+Namd', 70.0, 66.0, 675.0, '-', '适中', 23.0, 18.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7794.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR-GZ', Null, '材料科技方面，NR-GZ延续了YONEX尤尼克斯(YY)NR系列的低风阻拍锥，以及VT-ZF2的极细加长拍杆，轻质T头。NR-GZ采用还采用了X链富勒烯纳米碳素和致密纳米碳管，抗弯强度反弹力以及硬度都比普通富勒烯和常规碳素明显上一个档次！光有这些还不够，YONEX尤尼克斯(YY)在NR-GZ羽毛球拍上，亮出了新科技材料REXILFIBER,这种新型纤维，使得NR-GZ的吸震性能和硬度明显上升！', '高弹性碳素致密型纳米碳素X链富勒烯纳米碳素', '高弹性碳素REXILFIBER致密型纳米碳素', 90.0, 78.0, 675.0, '-', '-', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6558.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR700RPNR-700RP', 2011, 'NR-700RP：运用富勒烯树脂的新型流体雕塑拍框对抗中敏捷的出击。\n\n1、NANORAY纳米锐速系列拥有更加灵活的操控性，更高的反弹力，在当今闪电般的对攻中发挥光束般的快速优势！\n\n2、拍框中部运用了TOUGHLEX强韧树脂提高拍框两侧的柔韧性，延长羽毛球在甜区的驻留时间从而提升控球性能，帮助球员打出快速又精妙的底角推挡球，令对手防不胜防。\n\n3、全新AEROFrame拍框：高反弹型与高舒适性之间的极佳平衡，全新AEROFrame拍框采用独特的拍框结构，拍框沿框边从顶部到底部不同的厚度。顶部的薄边结构降低空气阻力从而提升拍头挥速，底部的厚边结构结合高硬度产生极高的反弹力。\n\n4、X-FULLERENE纳米技术：拍杆运用X链富勒烯，比纳米系列更有弹性，NANORAY纳米锐速系列的拍杆运用富勒烯的升级材料X链富勒烯，提升拍杆的总体抗弯能力，硬度提升6%，反弹力提升4%。更高的反弹性能可以让球员在中前场激烈的争抢中，即使短促的推挡拦截动作也能将球深深的推到对手的底角。X链富勒烯能使球拍“瞬间反弹”，使新系列球拍打出光速般的击球。\n\n5、球拍拍框采用YONEX独特的三角形威力拍框（DeltaPowerFrame）：符合空气动力学原理的三角形威力拍框，能在不减低拍框威力的前提下提供扎实、稳定的击球拍面。\n\n6、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n7、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '高弹性碳素强韧树脂', '高弹性碳素X富勒烯纳米碳素', 89.0, 85.0, 674.0, 'G4（周长86mm）、G5（周长83mm）', '中等', 4.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6349.html');
