insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR6000I', Null, '尤尼克斯锐速系列NR6000i，初学者推荐用拍，成品拍，尤尼克斯拍线，送专用手胶和两支塑料羽球，锐速拍框有效减少挥拍时的空气阻力，方形拍头设计，增大甜点区，击球更有力道，内置T型头，结构稳定拍身更轻。', '钢合金', '铝合金', 98.0, 98.0, 675.0, '-', '适中', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9241.html');
