insert into detail values('羽毛球拍', '威尔胜Wilson', Null, 'WR039411S2PX7000WR039410F2', 2020, 'econPX7000是一款来自Wilson的优雅羽毛球拍，可供多种类型的球员使用。\n这是一款头部较重的羽毛球拍，杆身更硬，因此我们会向想要高质量进攻性羽毛球拍的玩家推荐它。\n使用Wilson的这款羽毛球拍，您可以获得多项技术：\n四重配重系统\nWilson选择在车架上增加4处配重，以最大限度地提高转弯的速度和稳定性。\n超高模量碳纤维\n使用这种材料，您可以获得更耐用的车架和良好的挥杆效果。\nUltraHighTension\nReconPX7000TWS可以承受高达15.4公斤的拉弦重量，这使得这款羽毛球拍对想要拉紧球拍的您很有吸引力。\n当我们测试这款羽毛球拍时，我们体验到这款球拍在扣球时速度快，并且在整场比赛中都具有良好的控制和稳定性。\n这款羽毛球拍交付时带有一个覆盖轴和球拍头的外壳。', '碳纤维', '碳纤维', 84.0, 80.0, 675.0, '-', '适中', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10352.html');
insert into detail values('羽毛球拍', '凯胜KASON', '汤仙虎系列', 'FYPE002-2', 2010, '强弓二代：以突破性扇形拍框设计降低风阻，大幅提高挥拍速度。\n低扭角中管设计：提升回球精准度，进攻更加有的放矢。\n超细高系数碳纤维：24000条碳丝的超细高系数碳纤维让球拍强度与弹性成倍提升，打击效果与耐久性卓尔不凡。\n低风阻拍框：超低风阻截面设计助球拍破风而过，完美诠释凌厉攻击。\n方形拍头设计：扩大球拍甜区，灵动收发，控球自如。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'NG5', '偏软', 30.0, 24.0, '297.5mm', 'https://www.badmintoncn.com/cbo_eq/view_2760.html');
