insert into detail values('羽毛球拍', '高神Gosen', '凌驾RYOGA', 'RYOGAISSEN', 2010, '抗扭性比普通碳杆提升64%带有最新科技稳定核心T头，武士般的非常力量。拍杆由日本制造，拍杆中空，内径呈锥形，直径6.7mm的极细拍杆。', 'M40碳素纤维加上GOSEN专用的Aermet合金网料', 'M40碳素纤维加上GOSEN专用的Aermet合金网料', 87.0, 83.0, 670.7, '平头', '硬', 30.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3107.html');
