insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPF286AYPH166AYPF294TBN120TB120', Null, '李宁TBNano120金羽毛球拍属于李宁“MP力系列”，是李宁TBNANOTAKEDOWN版本羽毛球拍，同时也是省队用拍。价格非常亲民，让普通业余选手也能体验国手装备带来的震撼。\n\n李宁TBNANO的TAKEDOWN版有三款颜色：金色、银色、青色。每一款拍身上暗藏都有李宁的logo光影，是仿版不可能仿造出来的技术，有一种专属于你的感觉，非常值得细细品味。此款为金色款，拍身散发出金色的光芒，美不胜收！\n\n球拍科技：超导纳米+机翼恒定系统+力学优化拍框\n\n运用李宁力学优化拍框技术，除了将甜区面积在方形拍框基础上，进一步增大，更着力令甜区向上扩展，从而提高了球拍击球点。面对凌厉扣球，扩大有效防守面积；抓住瞬息机会，发挥扣杀力量。击球速度，也因为线床面积扩大，拍面反弹力增加，而显著提升。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '偏软', 28.0, 20.0, '288-295mm', 'https://www.badmintoncn.com/cbo_eq/view_10433.html');
