insert into detail values('羽毛球拍', '美津浓Mizuno', 'TETRACROSS系列', 'TC700', 2006, '四轴长柄搭载特硬攻击型\n紧凑的拍杆设计，重视在高速多拍平抽平挡中的击球安定感。\n最适合于双打选手。', '高弹性碳素、碳素、纳米碳粒子、四轴织物', '高弹性碳素、碳素、纳米碳粒子、四轴织物', 95.0, 85.0, 675.0, '2U5，3U4，3U5', '-', 25.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_757.html');
