insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击7UTK7Utk7uf', Null, Null, '高弹性碳纤维+纳米树脂+强叠层系统(FRS)', '高弹性碳纤维+纳米树脂+7.0SHAFT', 69.0, 65.0, 675.0, 'G6', '适中', 30.0, 13.5, '-', 'https://www.badmintoncn.com/cbo_eq/view_9618.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC10LVARC10弓剑10LV红弓1LVARC-10THLVARC10LTH', 2015, '王者之志四大天王签名版陶菲克\n叠杯碳素纳米管技术（Cup-StackCarbonNanotube）：叠杯碳素纳米管是特殊结构的碳素材料，其结构就像多个杯子上下重叠在一起的样子，拥有比标准碳素纳米管更高的力学性能；更重要的是，叠杯碳素纳米管拥有更高的韧性，让受压变形的拍框能更快复原；添加了叠杯碳素纳米管的复合树脂应用于拍框两侧，拍框变得更有“韧劲”，能让击球时羽毛球在线床上的驻留时间延长，从而提升球拍对击球落点的控制能力。\n\n纳米碳素管技术（NanoScience）：在拍杆的制造过程中，将小至纳米级别的气泡混合在固话树脂当中，提升了拍杆的硬度、弹性、柔韧性。\n\n超高弹性碳素纤维技术（SuperHMG）：在拍框外侧运用了超高弹性碳素纤维，用以提供更高的弹性。\n\n超级聚乙烯纤维技术（UltraPEF）：超级聚乙烯纤维拥有优异的粘性和吸震性，重量之轻足以浮于水面；将其用于球拍拍杆中，使扣杀变得更有效，弹性之高也出乎预料。\n\n新型单通道线孔（NewGrommetSystem）：改变传统的交叉位羽线共用线孔，为每一条羽线安排独立的线孔，获得高性能的线床效果。\n\n方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n新型轻质内置T形接头（NewBuilt-inT-Joint）：新型T形接头不再采用金属材料，而是改用由特殊环氧树脂制成的新型轻质T形接头；这种新型环氧树脂制造的接头使拍框拥有更高的稳定性，击球威力更强大。\n\n低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G4、G5', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9026.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓箭1TOURARC-1TOUR弓剑1ARC1TOURARC1TR', 2013, 'YONEXARC-1Tour是叠杯碳素纳米管拍框，咬球深，控球精准。\n\n1、叠杯碳素纳米管技术（Cup-StackCarbonNanotube）：叠杯碳素纳米管是特殊结构的碳素材料，其结构就像多个杯子上下重叠在一起的样子，拥有比标准碳素纳米管更高的力学性能；更重要的是，叠杯碳素纳米管拥有更高的韧性，让受压变形的拍框能更快复原；添加了叠杯碳素纳米管的复合树脂应用于拍框两侧，拍框变得更有“韧劲”，能让击球时羽毛球在线床上的驻留时间延长，从而提升球拍对击球落点的控制能力。\n\n2、新型单通道线孔（NewGrommetSystem）：改变传统的交叉位羽线共用线孔，为每一条羽线安排独立的线孔，获得高性能的线床效果。\n\n3、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。\n\n4、新型轻质内置T形接头（NewBuilt-inT-Joint）：新型T形接头不再采用金属材料，而是改用由特殊环氧树脂制成的新型轻质T形接头；这种新型环氧树脂制造的接头使拍框拥有更高的稳定性，击球威力更强大。\n\n5、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩展击球甜区，即使是非甜区中心击球也能保持足够的精度和速度。', '高弹性碳纤维', '碳素+叠杯碳素纳米管', 89.0, 85.0, 675.0, 'G4', '适中', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8029.html');
