insert into detail values('羽毛球拍', '李宁Lining', Null, 'AYPG122N80LTD', 2012, '颜色：金色+银色\n握把长度：200mm\n球拍科技：超导纳米+机翼恒定系统+力学优化拍框+空气动力学科技拍框截面系统+多点复合碳纤维强化系统+灵控内锥+高复合密度减震系统\n产品介绍：\nN80-LTD的性能与N80一样，运用了新科技——3DBREAKING-FREE，立体风刃拍框！瞬间切割气流，扣杀强劲，疾如闪电！\n这种拍框的厚薄变化非常罕见，N80的拍框设计灵感来源于兰博基尼跑车，创新切割感框形设计，使风阻降到更低。头部风阻小，击球时头部弯曲向前，使扣杀更迅猛有力。回弹时间缩短5%，符合近来流行快速打法。\n李宁的王牌科技灵控内椎中管也是一大卖点，使球拍弯曲点上移，显著加强球拍扣杀力。N80的线控是用的方形单粒钉和碳纤维前套的材质，同时有备用替换的护线孔，对球线的保护更好，球拍的整体也更加轻质化。\n此款羽毛球拍属于李宁“MP力系列”，适合进攻凶猛的力量型使用者。“MP力系列”球拍都拥有高平衡点、重拍头的特性，打击力量强。利用李宁独有的“多点复合碳纤维强化系统”，对拍框进行多角度碳纱加固及多层补强，不仅提升球拍中管弹性力量，更加强球拍的强度和耐打度，犹如凝聚万众之力，使进攻更为迅猛、凌厉！\n据李宁设计总监介绍，N80不仅仅受到约根森的喜爱，林丹也试打了三次这款球拍，并且给予了好评！\n李宁N80-LTD的涂装堪称精致绝美！金色为主，银色呼应，搭配龙形图案，拍杆处若隐若现的“CHINA”水印彰显大气，漆水做工十分出色，工艺精细程度令人惊叹！', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '适中', 30.0, 24.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_11261.html');
