insert into detail values('羽毛球拍', '威克多VICTOR', Null, '幻影500', Null, '胜利/VICTOR/威克多羽毛球拍幻影500\n基本信息ASIN:B008MQYX4I商品描述胜利MIRAGE500黑蓝相间，均等化方形排头甜区增加22%，使击球能保证相应速度和精准性！\n拍框三点钟和九点钟位置采用，特殊材质单粒钉，降低击球时的震动，使落球点更加精准！\n创新螺旋缠绕技术球拍中杆，抗扭性提高12%耐冲击力提升15%抗疲劳性提升35%\nG4常用拍柄，适应广泛拍柄独特的防滑排气孔重量更轻挥拍更加强劲、迅捷、精准！', '铝合金拍框', '碳纤维', 94.0, 90.0, 665.0, 'G4', '-', 24.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9770.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB21CAB-21', Null, '钢号类型:\n拍杆：7位光刻钢号\n拍柄：8位光刻钢号\n性能特点：\n1、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n2、拍框还采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n3、直径7毫米超细拍杆，弹性好，攻击力极强，防守及进攻的效果极佳。\n备注：此拍带全拍拍套', '高强碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 9.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1347.html');
