insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO-Lite-2', Null, 'ISO-Lite-2：是一款入门级的羽毛球拍。\n\n1、新型流体雕塑拍框：NANORAY纳米锐速系列优异性能背后的秘密--新型流体雕塑拍框采用独特的拍框结构，拍框沿框边从顶部到底部运用不同厚度。顶部的薄边结构降低空气阻力从而提升拍头挥速，底部的厚边结构结合高硬度材料产生极高的反弹力。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳纤维', '碳纤维', 89.0, 85.0, 674.0, '-', '中等', 22.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7408.html');
