insert into detail values('羽毛球拍', '波力Bonny', '乌缺Infinity系列', '未来之境VR虚拟', 2022, '英菲尼迪未来之境-科技\n两侧隐藏VR·虚拟人像，数字编码符号搭配半透明排钉。\n头框：头框全线导流槽设计，所有线钉藏入框中，增加整支球拍的美感，同时平抽和网前小球更加稳定，力量更加集中。拍面顶部比传统圆头框宽，理想击球带也因而较大，位置也提高。\n成型方式：三段式组合成型\n拍框:采用高分子填充材料\n碳T头:三通处植入碳纤维,有效提升球拍抗扭力效果及挥拍力度的均匀传导，强化剂强化击球效能。', '高刚性碳纤维+乌缺+碳T头+高分子填充中', '高弹性中管+乌缺', 89.0, 80.0, 675.0, 'G5', 'M', 30.0, 22.0, '295±0mm', 'https://www.badmintoncn.com/cbo_eq/view_10798.html');
