insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP100', Null, '1.在拍杆上采用了新型UTi高反弹性钛镍精炼太空金属技术，使球拍具有超弹性；\n2、在拍框上采用了钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：两个线孔范围；\n3、采用了新型弧形拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n4、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n5、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n6、拍柄加长10mm，有助于增强球员攻击性，适合大力杀球、增加快速反击性能。', '高弹性碳素纤维、钛金属网眼结构、MusclePower弧形筋力结构拍框线槽设计', '高弹性碳素纤维、钛镍记忆合金', 94.0, 85.0, 674.0, '2U/3U：G4（周长86mm）、G5（周长83mm）', '超硬', 3.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_463.html');
