insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR750NR-750', Null, '尤尼克斯YONEXNR750羽毛球拍的拍框材料上采用了最新的致密型纳米碳素，目前可能是YONEX史上拍头最轻的羽毛球拍。主打的是最轻的平衡点概念，能够带来快速流畅的进攻节奏。与NR800一样，都是以轻质为主题，以速度为卖点，反弹非常好。\nNR750头轻的平衡点，使其成为拍头加速最快的羽拍，可让球员即使在失位、被动的状态下都能打出轻松的回击，攻防转移易如反掌，定位于中、高级球员。', '高弹性碳素、致密型纳米碳素', '高弹性碳素、X链富勒烯纳米碳素', 89.9, 80.0, 674.0, 'G4,5,6', '适中', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6023.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, 'kepotASL', 2018, 'ASL采用HESR6.4②代中杆(Zx的6.4中杆是第一代)，添加和调整了角度纱，在增加抗扭的基础上也提升了韧性，从而提升控球精度和出球干脆度！同时拍框也添加30T碳布和内发泡。', '高刚性碳纤维+纳米树脂+T型稳定器+内热发泡', '高刚性碳纤维+纳米树脂+T型稳定器+内热发泡', 89.0, 75.0, 675.0, 'G5', '直径6.4mm偏硬', 32.0, 22.0, '295+-3mm', 'https://www.badmintoncn.com/cbo_eq/view_11232.html');
