insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP29LTMP-29LT', Null, '性能特点:\n一、内置合金接头Built-inT-Joint\n用力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能\n\n二、方形拍头ISOMETRIC\n与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。YONEX研发的这种IsometricHeadShape大甜区球拍，让进攻型球员在当今激烈竞争的国际羽坛一直保持明显的领先优势。\n\n三、钛网配重\n由YONEX的工程师们研发的钛网配重，强度和重量分别是碳素纤维的2.5倍和2.3倍。在拍框的3点钟和9点钟位置对称地采用钛网配重，用以增加球拍的轴向惯性矩，提高拍面在击球时的抗扭性能（稳定性），同时也提高拍头攻击力。\n\n四、MP结构\n拱形线槽系统让拍线处于攻击的有利位置,拱形线槽系统将拍线支撑在圆拱形的线槽上，两个接触点被连接为一段接触弧面，不但消除应力，拍线不易疲劳，而且形成的紧密接触弧面大大增强了拍线与拍框的整体效应，从而增强球拍的整体稳定性和力量性能。拍线张力保持在颠峰状态与YONEX的MP结构球拍相比，其他球拍的拍线张力在拉线后的很短时间内就出现明显下降，但MP球拍却仍然保持良好的张力状态即使在拉线后七天，MP结构球拍的线床仍然能够为扣杀提供强韧的反弹力。\n\n五、球拍加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。', '碳素纤维、减震线孔胶粒MusclePower弧形筋力结构拍框线槽设计', '碳素纤维', 89.0, 85.0, 674.0, 'G3G4G5', '适中', 22.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_457.html');
