insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', 'J200122BD2161012E', 2021, 'ClassicCarbonJ20-J012\n专业羽拍：反弹速度快、落点准\n烫金属标：提升外观质感，球拍更加赏心悦目\n二次成型：提升拍框刚性、提升拍框及中杆抗扭\n乌缺工艺：高弹中管+破风拍框+线槽设计+舒适手柄\n乌纹：中管1.5KWoven，提升球拍抗扭与弹性，显现高档质感\n破风框型：挥拍时将空气快速导流，降低空气阻力，提高扣杀速度\n黑色(ZD012)：涂鸦的袭击让你在球场上更显傲气', '高刚性碳纤维', '高弹性中管+Woven', 89.0, 80.0, 675.0, 'G5', 'M', 30.0, 30.0, '300±0MM', 'https://www.badmintoncn.com/cbo_eq/view_9187.html');
