insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击8000TK8000', 2013, 'TK-8000羽毛球拍最大的特点还是在于材料上的革新，尖峰JJS羽毛球拍首次采用了军工级材料石墨烯强化科技材料，为了是让球拍在进攻的时候强度更强，这款TK-8000同样沿用了这个胜利公司的顶级材料，可见此款羽拍的进攻性能必然会相当出色。\n胜利TK-8000羽毛球拍，另外一个特点就是在三通处的附近搭载了“加力槽”，全面提升球拍攻击力，给予使用者最强大的“火力”支持。', '石墨烯+纳米树脂', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G5', '适中', 30.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5942.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'Slim10', 1997, '性能特点1、拍框和拍杆由高密度碳素纤维经高度压缩而成，使其强而有力；\n2、崭新之纤细拍框设计，能减低10%之风阻及增加5%之击球速度，只需轻轻拍击，便可有极强之攻击力；\n3、拍框只有9mm阔及5.5mm厚，从横切面来看，比传统拍框纤细了25%，堪称世界上最纤细之羽拍拍框；\n4、内置T形连接设计能减小拍面之震荡，及有高度之稳定性，同时增强了其准确性及力量；\n5、经YONEX顶级球员对该崭新独有之设计概念所进行的大规模试验研究，得出以下结论：“拍头重而拍框纤细之球拍无须付出太大力量已能破风而出”，从而产生高速之效果，使全部力量集中于一击中。', '高强碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '中硬', 9.0, 16.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1346.html');
