insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP-77MP77', 2001, 'MP-77是YONEX公司2001年产品，采用YONEX最新技术——UltimumTitaniumShaft羽拍技术（高反弹性钛镍精炼太空金属、力量转移设计）、弧形筋力结构拍框线槽。特征如下：\n\n1、采用了新型弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更佳、爆发力更强；\n\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n\n4、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n\n5、拍杆加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。', '高强碳素纤维', '高强碳素纤维、高反弹性钛镍精炼太空金属', 89.0, 85.0, 675.0, 'G4', '较硬', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1038.html');
