insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB20CAB-20', Null, 'YONEXCAB系列羽拍中早期最具代表性的产品，也是YONEX中最经典的羽拍之一。球拍做工精美，独特的亮光面中略带金属光泽，手感绝佳，曾被众多球星选用，至今仍有球星在用。\n\n1、传统圆头拍框，古朴耐用；\n2、拍框和拍杆内部连接处采用YONEX专利T型接头连接结构，以传送更大击球力量；\n3、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性，同时提高抗扭性能；\n4、独特黑底金字握把底盖，经典CAB20系列标志；\n5、拍框由多重石墨积聚而成，无论杀球或抽击都效果极佳。', '碳素纤维', '碳素纤维', 89.9, 85.0, 664.0, 'G4,5', '硬', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_197.html');
