insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '2T', Null, '日本产。\n领先的中管设计，赋予极限强度，掌控加倍自如。--YY官网\n应用技术：方型拍头、实感框芯、单通道线孔、流体形盒式拍框、内置T形接头、超细加长拍杆、低风阻锥盖。\n个人感觉：弓10的大众版，击球扎实，控制见长，反震较弱，容易上手。缺点就是上不了高磅。非常适合新手进阶使用的一款平衡拍', '碳素+叠杯纳米管', '高弹性碳素+内置T型接头', 89.0, 85.0, 674.0, 'G4、G5', '软', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6465.html');
