insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ASTROX天斧系列', '88SGAME天斧88sgAX88S-G88SG', Null, '广受欢迎的ASTROX88S和ASTROX88D在2021年3月推出进化版，其中采用了新的创新技术和精心制作的材料以提高性能。ASTROX88SPRO和ASTROX88DPRO旨在配合不断发展的更快节奏的双打比赛，它需要选手更快的反应和连续有力的进攻。与PRO一同上市的还有大众化的ASTROX88S/DTOUR和GAME，它们的使用了相同的设计理念，带来同等性能表现。', '高弹性碳素+体积压缩树脂+钨', '高弹性碳素+纳米网状树脂NEO', 89.0, 80.0, 669.0, 'G4,G5', '硬', 4.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8876.html');
