insert into detail values('羽毛球拍', '美津浓Mizuno', Null, Null, Null, '美津浓CALIBERVSTOUR羽毛球拍，作为早川贤一2016年新款羽毛球拍，在业余球友里面还是有一定的知名度的。美津浓CALIBERVSTOUR羽毛球拍，整体参数适中，手感偏控球，非常适合单打和双打使用，', '高弹性固态碳纤维+RF炭汞金属+HGResin高强度树脂', '高弹性固态碳纤维+RF炭汞金属+HGResin高强度树脂', 84.0, 80.0, 675.0, 'G5', '适中', 27.0, 23.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8337.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '探险家系列', '探险家630EXP-630', Null, '技术应用：\nAERODYNAMIC：拍框截面采用椭圆形结构设计，能有效减少挥拍时的空气阻力并提升抗扭力，带来强悍敏捷的回球速度的同时，大幅强化对球拍的控制能力。\nNANOTEC：采用纳米树脂材质添加技术，能使nano级微细颗粒均匀分布在碳纤维的空隙，增加碳纤维复合材质的整体强度，使球拍的结构更优异，有效减少拍框变形，利于进攻型选手发挥强大的力量。', '高刚性碳纤维+纳米树脂', '高刚性碳纤维+纳米树脂+7.0SHAFT', 89.0, 85.0, 675.0, 'G2', '适中', 4.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8726.html');
