insert into detail values('羽毛球拍', '李宁Lining', '超导纳米系列', 'AYPD116', 2009, '李宁超导纳米系列，TB200A拍杆略软，手感轻弹性好，适合灵活拉吊型打法\n\n蓝色拍身，像极了蓝色兰博基尼跑车的颜色\n\n快、灵、动力十足\n\n应用了众多羽拍顶级技术，使用超导纳米碳纤维材料\n\n具有更稳定、更纤细、更强韧的球拍，\n\n是选手追求更强大打击力度的保证。\n\n“李宁”独创的TBNano材料科学与工程技术，令其成为可能。\n\n推进至纳米级的工艺科技，令球拍中碳纤维与树脂的结合程度，突破既往，天衣无缝。\n\n一款至为理想球拍诞生的同时，打击力度随之提升20%。', '超刚性碳纤维+超导纳米', '超刚性碳纤维+超导纳米', 97.0, 91.0, 675.0, '22-28', '稍硬', 28.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4870.html');
