insert into detail values('羽毛球拍', '尤尼克斯YONEX', Null, 'MP-27MP27', Null, '1、采用了新型弧形拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n2、在拍框内侧采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n3、拍框两侧中部采用了新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳；\n4、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n5、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力；\n6、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性；\n7、拍框T型部位两侧特殊双连钉护线管设计，避震效果好，更好地控制击球的准确性，保持拍面的稳定性和拍身的平衡性。', '碳素纤维+钛网眼', '碳素纤维', 89.0, 85.0, 664.0, '-', '适中', 18.0, 18.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11527.html');
