insert into detail values('羽毛球拍', '美津浓Mizuno', Null, '73JTB02145', 2020, 'FORTIUS20\n採用BEYONDFORCESYSTEM，击球瞬间挥拍速度UP！\n此外，5U轻量设计＋薄型截面造型，打造出挥拍更迅速敏捷的日本製拍款！\n品名：FORTIUS20\n型号：73JTB02145', '高强度树酯+高弹性碳纤维', '高强度树酯+高弹性碳纤维', 85.0, 73.0, 675.0, 'G6', '硬', 27.0, 23.0, '297±1mm', 'https://www.badmintoncn.com/cbo_eq/view_8847.html');
