insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium7系列', '7900', 2007, Null, '超高弹性碳素纤维溶入钛粉+3P钛', '超高弹性碳素纤维溶入钛粉+3P钛', 89.0, 87.0, 675.0, 'G4G5', '中硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_712.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'DIAMOND钻石', Null, Null, '亚狮龙RSLX5-GOLD金色羽毛球拍采用特别高碳素纤维，是目前最高级的高碳素纤维之一。加强特硬，应用于球拍中杆，扭力击球速度迅速提升21%。更灵敏，更容易操控，手感更佳。精确的设计能同时保持最佳的弹力及减低了回旋转力。手发出的力量通过球拍更有效地传递到羽毛球上。\n\n采用了T-区域技术，在TJOINT位置处额外增加了一组特殊结构性的强化力量技术，增强了手感，提高了控制以及击球的准确性，而且透过增加T区域的硬度结构，更容易感受每一次击球的信息，做出更有效的判断，击出更准确的回球。就算击球点有偏差都能够即使作出反应，作出更快的修正。“T-区域技术”配合“反回旋转力技术”及“特强高碳素纤维”，进一步加强了球拍反回旋转力的硬度。\n\n加强了额外的扭力控制，尤其在对场攻击时，能更准确地改变方向。额外的扭力控制，尤其在快速平抽快打攻击同时，能更准确地进行多方向攻击。', '钻石冈技术骨架', '特强高碳素纤维', 88.0, 86.0, 675.0, 'G5', '硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4918.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium8系列', '8900', Null, '8900是RSL里面拍杆最硬的一个球拍。稳定性好，适合上高磅。跟YY的AT900比的话：拉吊不如900T。杀球界乎于T跟P之间。跟TI-10比的话控制差于TI-10。是款不容易上手的单打进攻型球拍。\n\n平衡点：295±2mm\n拍杆直径：6.5-7.5mm', '碳素纤维溶入钛粉', '超高弹性碳素', 88.0, 86.0, 675.0, 'G4,G5', '渐近硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_831.html');
