insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', Null, Null, 'Carbonex系列为羽毛球经典圆头款型。造就了一代又一代的世界职业冠军。采有盒式横断面拍框设计，拥有极佳的拍面稳定性和极高的承载耐久性。当在准确的甜区中心击球时，能产生响亮清脆的击球声和反馈扎实的击球手感，为球员提供落点极其精确的回球。拍杠和拍杆连接处碳素纤维内层的内置T形合金接头为闻名遐尔的Build-inT-Joint世界性独家专利，让球拍同时兼具强大的反弹性能和精确的控球性能。超轻的3U设计同时配合使用，使CAB球拍能经久不衰的活跃在世界各大职业赛场。', '碳素纤维', '碳素纤维', 89.0, 85.0, 664.0, 'G3G4G5', '特软', 20.0, 17.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_199.html');
