insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO045', Null, '性能特点一、盒式Box拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩。\n\n\n二、方形拍头ISOMETRIC\n\n与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。YONEX研发的这种IsometricHeadShape大甜区球拍，让进攻型球员在当今激烈竞争的国际羽坛一直保持明显的领先优势。\n\n\n三、内置合金接头Built-inT-Joint\n\n深深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能。\n\n\n四、ISO轻型设计球拍只有85-89克，是专为高速度球员而制造，球员使用轻型设计之球拍，比使用传统之球拍，更易得到最佳效果，球员之击球力量能发挥至极限。', '碳素纤维', '碳素纤维', 89.0, 85.0, 664.0, 'G4（周长86mm）、G5（周长83mm）', '特软', 18.0, 16.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_436.html');
