insert into detail values('羽毛球拍', '薰风kumpoo', '超轻系列', Null, 2019, '全能型球拍\n1：中管采用高刚性碳素纤维材料单独成型，有效加强球拍抗扭力，7.0中管软硬适中，灵活性强。\n2：整支手柄采用镂空设计，独创薰风专利碳柄，手柄可装入专用配套硅胶，随意调配重量，加上管内采用精湛PU发泡工艺，起到了减震的功效。', '超高刚性纤维碳纱与NANO材料', '超高刚性纤维碳纱与NANO材料', 59.0, 55.0, 670.0, 'G5（2#）', '偏软', 30.0, 26.0, '330±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7905.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓10ARC-10P弓箭10弓剑10', 2012, 'YONEX尤尼克斯弓剑10，自2008年上市以来就成为了YONEX最“长寿”的产品之一作为弓剑系列的集大成之作其优良的品质、出色的手感和全面的性能让广大的球员和消费者都爱不释手。2012年，YONEX公司继白色盖得签名版之后再次以弓剑10为原型推出了弓剑10premium2012。Premium，意为优质的比弓剑10更完美的存在？\n是的，弓剑10premium2012采用了最新的贴漆技术，提升了球拍的质感，显示了弓剑10premium2012的高贵血统，性能一如既往的无可挑剔，在任何方面都可圈可点，要说它最大的缺点，可能就是他几乎没有缺点，全面、控制，就是他要带给世人的印象，弓剑10premium2012，超越经典的经典再现。', '超高弹性碳素叠杯碳素纳米管，同时具备高强度和柔软性的新材料叠杯纳米管', '高弹性碳素超级聚乙烯纤维', 89.9, 85.0, 674.0, 'G4G5', '硬', 3.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5660.html');
