insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR70LNR-70L', Null, 'YonexNANORAY70日本开发，中国制造。\n这是一个新的和技术上的球拍，提供快速处理和高斥力，响应高速集会与闪电般的快速运动。\n机箱框架有助于将空气阻力降到最低，使空气在摆动时更快地流过曲面，加速头部速度，并将更多的速度和力量转化为命中。巨大的潜力，作为一个全面和完美的球拍双球员，因为它很容易操纵，因为它的重量和长度。\n纳米+碳纳米管用于快速处理，增加强度和功率。\n方形等距框架形状的设计是为了保持垂直字符串的相似长度，以及水平字符串，以产生一个扩展的甜点在各个方向。\n机架顶部的气动轮廓最小化了空气阻力，使空气在摆动时更快地流过曲面，加速了头部速度，并将更多的速度和动力转化为命中。此结构以高稳定性、低扭矩性能和更高的精度成为Yonex箱体的中段形状。\n深入到石墨层，框架与轴连接，Yonex内置T-接头创造了一个耐用和高强度的整体框架，是无扭矩。', '碳纤维', '碳纤维', 79.0, 75.0, 675.0, 'G4', '-', 30.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11067.html');
