insert into detail values('羽毛球拍', '第三局The3rdGame', Null, 'REDDEVILS', Null, '使用三段变化式拍框，比较窄而宽扁的拍头尖锐带棱破风，\n中段圆润稳实椭圆，底部大截面厚实菱形。这种框型在保证低风阻的前提下尽可能地提高拍框受到冲击时的稳定性，搭载6.8毫米纤薄钛筋中杆，使用内热发泡成型精工制造。红魔出球快而狠，操控精准，回馈清晰，后场进攻也毫不逊色，随心所驭！', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, '-', '适中、偏硬', 0, 0, '3U/285-290mm，4U/290-295mm，4U/295-300mm', 'https://www.badmintoncn.com/cbo_eq/view_8676.html');
