insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS200NS-200', 2009, '这是YONEX推出的NS系列低成本高性能的羽毛球拍，一个极好的球拍，特别适合攻守兼备全面型打法的球员，进攻性和防御性兼备。\n该NanoSpeed系列是尤尼克斯新的低成本高性能羽毛球球拍，采用最新的纳米技术。采用纳米技术后，使得NanoSpeed系列羽毛球球拍的中管能做到更细，更强，以实现长期以来羽毛球运动员的梦想：那就是更薄和强有力的框架，以便提高快速挥拍的机动性。\n工厂的测试表明，纳米动力羽毛球框架提高了30％的耐冲击性，10％以上的耐久性和。', '碳素', '碳素纳米管', 84.0, 80.0, 664.0, 'G4', '中硬', 22.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2628.html');
