insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR700FXNR-700FX', 2011, '新型流体形的光速摆动。适合以速度制约对手的球员使用。拍框两边的厚度是采用从上而下，逐渐扩大的新型流体形。拍框上部减少客气阻力，下部具有高强度，高反弹的性能。另外，配合X链富勒烯纳米碳素的拍杆，可以实现头轻设计的减轻拍框晃动和在强烈恢复力下的高速反弹。', '高弹性碳素、强韧树脂', '高弹性碳素、X链富勒烯纳米碳素', 89.9, 80.0, 674.0, 'G4（周长86mm）、G5（周长83mm）', '适中', 4.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6350.html');
