insert into detail values('羽毛球拍', 'FZFORZA', Null, 'power8000', 2011, '88孔空气动力学拍框设计，比普通球拍增加30%以上击球力量，平衡点适中（290mm），中杆较硬，综合能力强。', '40T凯夫拉加强型超刚性CNT碳素纤维，宽体，超力量型，半CF', '40T凯夫拉加强型超刚性CNT碳素纤维', 87.0, 87.0, 674.0, 'G5', '硬（4）', 30.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4952.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NSD3NS-D3', Null, '1、碳素纳米管：在拍杆的制造过程中，将小至纳米级别的气泡混合在固话树脂当中，提升了拍杆的硬度、弹性、柔韧性。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。\n在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳素', '碳素+碳素纳米管', 89.0, 85.0, 674.0, 'G4', '偏软', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11491.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, 'Y3008', 2008, 'Y-3，这个由世界顶级设计师山本耀（YohjiYamamoto）担任创意总监与adidas合作的全新品牌正式于2006春夏进入中国。品牌的Y代表YohjiYamamoto，而3则代表adidas三条线的logo。创意总监山本耀司将其个人品牌的简洁、极具设计感的风格融入Y-3，完美地给我们展现一个高档时尚的运动品牌形象。朴实与冷静是Y-3的基本形象概念。Y-3的时尚本质是运动的，从品牌上市后引起的全球抢购，亚洲更是面临严重缺货的盛况，可以说Y-3已经开启新的时尚主义。\n被誉为"黑色魔法师"的山本耀司使传统运动品牌adidas赫然跃上了Fashion的版面，运动装从此也登上大雅之堂。这一季，在舞蹈潮流的影响下，山本耀司与阿迪达斯总部品牌设计总监MichealMichalsky合力推出了一组独特的Y-3设计新款。从纽约的迪斯科到优雅的阿根廷探戈，Y-3以它特殊的理念将服装，鞋类和饰品，做了全新的阐释。\n特性：\nA:吸震系统FlexonSystem\nB:6.5极细纳米钛中竿、两段式真空成型，加力效应明显，弹力极佳！\nC:加装新一代进口硅胶威力软前套，手感极好！\nD:纳米钛雷溶式拍框，能承受高达30磅的拉力！', '纳米钛雷溶', '纳米钛', 84.0, 84.0, 670.0, 'G5', '中度', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1735.html');
