insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '卡林KLINTFORCEEDGEX12羽毛球拍亮剑破风框极速暴力\n三菱中杆高钢性碳纤维，硬度适合，亮剑破风框架，\n3U/G5平衡点295-297RA：8.0-8.3\n4U/G5平衡点297-300RA：8.0-8.3\n5U/G6平衡点300-303RA：8.0-8.3', '高钢性碳纤维+纳米树脂', '高钢性碳纤维+纳米树脂+7.0SHAFT', 89.0, 75.0, 675.0, 'G6', '-', 30.0, 18.0, '295-303', 'https://www.badmintoncn.com/cbo_eq/view_9086.html');
