insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'Tour', Null, '适合球员等级初中级\n性能介绍1、采用了新型弧形拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n\n2、拍框两侧中部采用了新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳；\n\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n\n4、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力；\n\n5、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性；\n\n6、拍框T型部位两侧特殊双连钉护线管设计，避震效果好，更好地控制击球的准确性，保持拍面的稳定性和拍身的平衡性。', '碳素纤维+MusclePower弧形筋力结构拍框线槽设计', '碳素纤维', 89.0, 85.0, 674.0, '-', '中硬', 9.0, 10.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1064.html');
