insert into detail values('羽毛球拍', '李宁Lining', 'US锐系列', 'AYPE120-2', Null, '性能特点；攻守兼备\n一句话推荐：低风阻，攻击速度迅猛，灵巧\n球拍科技说明：（注1-3点是球拍的重点卖点。）\n1.细拍框；\n2.导纳米；\n3.空气动力学拍框截面系统；\n4.细高强度仿生中管；\n5.力学优化拍框；\n6.高刚性超细中管；\n7.平头设计，可增大甜区', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '中', 26.0, 20.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_6988.html');
