insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', 'TK9000突击9000', Null, '石墨烯材料运用在了TK9000拍框3、9点的重要部位上，可强化拍框刚性，提升拍框强度，击球感更加扎实。经由多层“石墨烯”的添加，有助于使用者将挥拍力量高效率的转至击球能量，减少传递损耗，造就了TK9000的绝杀威力与扎实手感，增强球拍整体攻击性能。\n\nTK9000拍框的5、7点位置添加了加力槽，加力槽独特的渐变凹槽设计，能储存甩拍动力，提升9.75%的能量（来自于胜利官方数据），轻松挥拍瞬间应报甩鞭攻击效应。\nTK系列高端拍中杆都采用超高刚性碳纤维+7.0SHAFT，具有低风阻高强度的特性，有效减少击球时的震动，使挥拍和出球更加稳定。在此基础上，TK9000的中管添加了最新研发的NANOFORTIFY增韧纳米碳管科技，重量轻、抗扭性佳、拥有良好的柔韧性，增韧纳米材料应用于球拍中管，能使中管富有良好的刚性、韧性以及抗扭性。击球时造成的中管弯曲恢复速度提升10%，能更快为下一拍做好准备，并在回击过程中产生爆发性的能量！\n\n增韧纳米碳管材料\n增韧纳米碳管是由管状碳分子结构组成，硬度强，却拥有良好的柔韧性，因此被物理学家称做为“超级纤维”！增韧纳米碳管科技具有极高的韧性，在形变后产生强大的反作用力，将挥拍力量充分转为击球能量，强化击球时的瞬发力。NANOFORTIFY增韧纳米材料“长径比”一般在1000:1以上。等同于几万根增韧纳米碳管合并起来只有一根发丝的宽度，是理想的高强度纤维材料，在相同体积比较下，增韧纳米碳管强度比钢铁的强度高出100倍但重量却只有钢铁的15%。\n加力槽\n独创沟槽结构设计，储存运动员甩拍时的施力，于击球时放大释出，创造更大破坏力。', '石墨烯＋纳米树脂', '超高刚性碳纤维+NANOFORTIFY增韧纳米碳管科技+7.0SHAFT', 89.0, 80.0, 675.0, 'G5', '-', 4.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6441.html');
