insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NSX-3NSX3', Null, 'nanospeedX-3\n制造场地：中国台湾\n主要科技：方形拍头内置T形接头\n1、碳素纳米管：在拍杆的制造过程中，将小至纳米级别的气泡混合在固话树脂当中，提升了拍杆的硬度、弹性、柔韧性。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。\n在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳素', '碳素+碳素纳米管', 89.0, 85.0, 675.0, 'G4、G5', '软', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10390.html');
