insert into detail values('羽毛球拍', '其它品牌Other', Null, 'TI9900', Null, '型号：Ti-ARMOR9900power\n\n拍框材质：高刚性高弹性碳纤维+纳米树脂+内发泡技术\n\n穿线模式：全新80孔穿线模式\n\n中杆材质：日本进口三菱46T碳纤维+纳米树脂\n\n中杆粗细：6.8mm细中管\n\n中杆硬度：偏硬\n\n球拍长度：675mm\n\n推荐磅数：22-32LBS\n\n拍柄规格：G5\n\n颜色：金色/玫瑰红\n\n平衡点：295±2mm\n\n重量：84±2g\n\n产地：中国\n\n执行标准：QB/T2770-2006', '高刚性高弹性碳纤维+纳米树脂+内发泡技术', '日本进口三菱46T碳纤维+纳米树脂', 86.0, 82.0, 675.0, 'G5', '6.8mm细中管', 32.0, 22.0, '295±2mm', 'https://www.badmintoncn.com/cbo_eq/view_11245.html');
