insert into detail values('羽毛球拍', '美津浓Mizuno', Null, '73MTB90403', Null, '美津浓mizunospeedflex7.0超轻5U全碳素羽毛球拍speedflex7.0\n特点：超级轻型圆锥轴是一种革命性的轴结构，它从顶部盖的7.5mm缩小到T-接头的6.5mm，使撞击时能产生很大的弯曲，对手腕的冲击最小，恢复力是平均轴的两倍，从而产生更好的弹性，产生更高的斥力和回跳速度。-Nano加强了纳米树脂的使用，将其与碳纤维结合在一起，达到非常高的水平，几乎接近完美。它升级网球拍的制造过程，使它有一个更大的打击强度增加超过20%。-为减少阻力而设计的航空箱，既能保持传统箱体框架的结构完整性，又能产生更快的摆动速度。', '碳纤维', '碳纤维', 79.0, 75.0, 675.0, 'G5', '适中', 30.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11171.html');
