insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', Null, 2000, '作为YONEX2000年的新产品，结合了Ti系列和ISO-Swing-Power系列羽拍在性能特点上的优点，不愧为当今羽拍至尊：\n\n1、在拍框上采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n\n2、不同的重量、柔韧性、平衡点位置，适合不同类型的球员；\n\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n\n4、拍框和拍杆内部采用T型接头连接结构，以传送更大的击球力量；\n\n5、拍框还采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n\n6、球拍采用轻型设计，仅重81/87克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限。\n\n7、球拍加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。', '高强碳素纤维，钛金属网眼结构', '超高强碳素纤维', 87.0, 81.0, 674.0, '-', 'SX型：超硬，SS型：硬，SR型：中柔，SA型：柔', 9.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2842.html');
