insert into detail values('羽毛球拍', '肯尼士Kennex', Null, Null, 2009, '手感：清晰手感＋高速反应＋超级抗扭力＋强悍攻击力.适合拉高磅。\n设计突出点：拍框2点、10点位置的两个内岛设计，官方的说法是增强局部的强度，可以明显感觉到拉高磅后甜区有适当范围外沿，放球时可以感觉。中杆扭力适中，杀球有力量，速度快。适当控制球拍，后场及高远相当轻松，配合高弹羽线，出球轻松。\n但拍子重量稍沉，双打平推快挡抽有些吃力。建议单打使用。', '40T热熔碳纤维（TORAYT700CF）＋纳米技术', '碳纤维', 89.0, 80.0, 675.0, 'G2', 'stiff:7.5/Regular:8.0', 32.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3284.html');
