insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT100LTLCW', Null, '李宗伟限量版。经典外观和动态性能。\nYonexVoltric100LightLCW是羽毛球史上最伟大的球员之一，专为希望从球场各个部分获得动态表现的球员而设计。该球拍结合了头枕平衡和灵活的杆身，非常适合希望他们的球拍提供尽可能多动力的初学者，使您能够击打长距离净空球和锐利的粉碎物，而5U的重量确保您在球网，让您轻松应对球击和粉碎。\n与Voltric100LinDan相比，Voltric100LightLCW是一款轻巧的球拍，可为您提供更快的速度和机动性，可用于投掷投篮，净距比赛和防守。', '碳纤维', '碳纤维', 79.0, 75.0, 675.0, 'G4', '-', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8893.html');
