insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, Null, 'FZForzaTitanium11000SLTD羽毛球拍是为经验丰富的球员设计的，他们喜欢进攻性的比赛方式。\n\n新型826空气动力学框架用于提高功率和速度。球拍头相对较重，可以使球拍更坚固，更准确。对于希望在准确性和力量之间取得平衡的技术精湛的进攻球员而言，这是一个绝佳选择。比赛和精英球拍。\n\n用过的钛是一种非常轻便且柔软的材料，耐腐蚀。机械强度与重量轻的比例最高是众所周知的。抗拉强度与钢类似，但钛轻了45％！与石墨结合使用，可以提高球拍的耐用性并提供更好的控制力。', '碳纤维', '碳纤维', 89.0, 85.0, 672.0, 'G3', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8582.html');
