insert into detail values('羽毛球拍', '美津浓Mizuno', Null, 'XYST0273MTB90102', Null, '革命性的钛T型接头\n将框架连接至轴的精密工具钛制枪管内嵌有碳颗粒，可减少振动并加强两者的融合。这种结构减少了偏心镜头中来自框架和轴的扭矩，以及框架的横向扭曲，从而更好地传递了动力和控制力。\n\n-AeroDelta\nAeroDelta镜架具有精美宝石形状的结构坚固轮廓，可减少阻力并将更多的速度和力量传递给镜头。\n\n-肌肉波浪上衣\n在羽毛球撞击时，设计中的波浪能够产生极大量的能量传递。根据复合弓箭的原理，波浪形特征收缩并吸收了羽毛球的全部冲击力，并释放出高辛烷值的能量，从而产生爆炸性的能量。\n\n-热熔技术\n在初始制造过程中，以较高温度加热的石墨片可进一步消除杂质。这样可以形成更光滑，更一致的涂层，不仅可以增强框架，而且可以提高石墨的空气动力学性能，从而提高球拍的速度。', '高弹性碳纤维', '高弹性碳纤维', 89.0, 85.0, 675.0, 'G5、G6', '硬', 32.0, 32.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8696.html');
