insert into detail values('羽毛球拍', '川崎Kawasaki', '其它系列', '战狼WarWolf90', Null, '川崎战狼WarWolf90\n\n核芯科技·精确操控\n\n采用国际专利技术“XENECORE”核芯科技，利用“蜂巢气囊”材质经过高温膨胀成型，它在球拍内部形成类似“蜂巢”的无数个气囊结构，可吸收击球时线床对拍框的震动，气囊间的相互作用可使球拍在击球后迅速恢复，有效提升球拍的击球精准度。球拍性能针对控制性选手设计，攻击时强劲有力，回防时游刃有余，攻守兼备，稳定性能使得球拍适合高级别的选手使用。', '30T+40T高刚性碳素纤维', '46T高刚性碳素纤维', 89.0, 87.0, 675.0, 'G1', '硬', 30.0, 18.0, '290±2', 'https://www.badmintoncn.com/cbo_eq/view_9121.html');
