insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MX1000MX-1000', Null, 'MeteorX1000新拍框使用八面刀锋结构，搭配CarbonXT碳纤维强化叠加技术，除了提供更稳定拍面稳定性外，能有效的減少挥拍空气阻力、提升击球威力与增加中管抗扭性，以独特80孔穿线模式与外凹槽设计增加线与拍框服帖性，減少拍框对于拍线磨损，延长拍线寿命。性能全面，拍杆偏硬，适合力量稍好球友快速进攻。', '碳纤维+树脂', '碳纤维+树脂+7.2SHAFT', 89.0, 80.0, 675.0, 'G4、G5', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8447.html');
