insert into detail values('羽毛球拍', '高神Gosen', 'ROOTSGAVUN', Null, Null, '球拍实际数据：\n球拍线：雅沙维Zymax62Fire。\n磅数：28张人拉线。\n手胶：YY102黄色，包裹至锥柄。\n平衡点：约285MM。\n重：约95.3克。\n拍柄：周长80MM，拍柄长度：锥柄高处192MM，低处190MM。\n锥柄上端中杆直径：7.0MM。\n雅文中杆直径：上端：6.6MM，下端：6.58MM。\n实际操练，球拍轻，手感并不压手，容易上手。体验了单打及双打，总体感觉球拍比较中庸，或称之为“糖水”。出球线路比较准，速度不是很快。感觉中杆并不是很硬，也不是很弹，尤其是杀球非暴力。高点反手回球似乎效果还不错，平推球效果好于杀球，网前比较灵活。\n拍框款型类似“白金”，但拍框厚度及宽度要大于白金拍。漆水很亮，目前没有磕碰，还没有崩漆出现。', '高钢碳素纤维加上GOSEN专用的Aermet合金网料。', '采用日本M40碳纱，6.8mm高弹性中管', 95.0, 95.0, 675.0, 'G6', '中', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6522.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO-TR1', 2016, 'jp版YONEX尤尼克斯专业日本提高身体耐力型训练羽毛球拍ISO-TR1\n专业训练球拍，平均118g，G5手柄，较重的克数，以达到锻炼身体耐力的作用。\n产地：中国', '碳纤维', '碳纤维', 118.0, 118.0, 675.0, 'G5', '硬', 30.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9143.html');
