insert into detail values('羽毛球拍', '李宁Lining', '山系列', '云动山蔡贇', 2009, '国羽双打高手蔡贇专属\n\n打出高天流云般球风，层峦叠嶂般球路，正是云动山RocksN33。\n\n流线型，低风阻，外型灵逸，手感灵敏，挥击灵动；拍身轻盈，平衡点低，拉吊出精准球路，放网前不失毫厘，勾底线毫厘不失。\n\n\n\n云动山RocksN33，匹配拉吊打法中灵活d钻型选手，为国羽双打高手蔡贇专属。打出高天流云般球风，层峦叠嶂般球路，正是云动山RocksN33。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 675.0, 'S2（32/8英寸）、S3（33/8英寸）', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1893.html');
