insert into detail values('羽毛球拍', '辉厉FELET', '弹弓/TJ系列', '乌纹TJ-1000', Null, '4和1组合型拍框包含：弹弓T型接头，力量传动设计，储蓄力量击打，超低风阻，一体成型技术系统；\n\nFELET设计师让WOVENTJ-1000拥有最薄的编织球拍中杆—6.5毫米，同时使用纳米增压管(NBT+)与可承受46吨的日本热熔碳纤维技术完美组合，使整个球拍更加耐用，能让你快速反应，并提供额外的强度；\n同时采用FELET的力量传动设计，L.A.D.破风框型，产生额外的爆炸力，以快速回弹；\n事实上，这项技术是强大和高度耐用的，并提高使用者的击球准确性；\nusedby:ShesarHirenRhustavito', '高弹性碳素；钨；46T日本高刚性碳纤维', '高弹性碳素', 89.0, 80.0, 675.0, 'G1', '中等偏硬', 35.0, 35.0, '295±2mm', 'https://www.badmintoncn.com/cbo_eq/view_8783.html');
