insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT9VT9LTDvt-9', Null, '三角能量系统TRI-VOLTAGESYSTEM\n能击出重扣，头重但不失操控性，就是三角能量系统TRI-VOLTAGESYSTEM新技术\n\n头重设计虽然能增强力量，但是会减弱操控性能。反之，头轻设计可以提高操控性能，但是会减弱力量。三角能量系统“TRI-VOLTAGESYSTEM”可以成功地将“力量”和“操控性”这两个对立的性能并存。\n\n拍框结构经过优化：2点钟和10点钟位置的加强结构强化拍头的力量性。\n\n两侧纤细拍框增加柔韧性，两部分同时作用使扣球力量大增！\n\n12点钟位置的部分重量转移至6点钟的T形接头区域，消除头重拍框的不平衡感，操控自由顺滑！', '高弹性碳素，音频滤清器，钨', '高弹性碳素', 89.9, 85.0, 674.0, 'G4', '硬', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5533.html');
