insert into detail values('羽毛球拍', '其它品牌Other', Null, 'Yanfei阳飞', Null, '特性：\n1，特制手柄，最细最长实芯，有极高手感辨识度；\n2，供应链过硬，驭八K的框，尖峰80的参数（仅首批，后拍头调轻，改速度拍定位）；\n3，适合贴球发力，即更适合寸杀/霸王杀等引拍类型的打法。', '碳纤维', '碳纤维', 84.0, 80.0, 675.0, 'G6', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11164.html');
