insert into detail values('羽毛球拍', '李宁Lining', '能量聚合', '能量9TDAYPL008N9TD9TD', Null, '全新超导纳米材料，新能量转换科技，MP力系列中端拍——李宁TurboCharging9TD羽毛球拍。\n继承了N9羽毛球拍的能量聚合科技，绝命扣杀，一击必中，暴力的扣杀，迅捷的出球速度。框形也是同样继承了N9的破风速度框，唯一的区别就是能量聚合转化点的变化上，不同于N7N9在框3，9点的拍框反转，9TD的反转点则在于5，7点位置，中杆相对软一点，使得9TD在进攻上比N9会稍微差一些，但是足够用了。\n钟情于N9羽毛球拍，但又对它的价格望而却步的球友，可以入手9TD，让您的杀气无所顾忌！', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '中', 26.0, 20.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_6503.html');
