insert into detail values('羽毛球拍', '李宁Lining', 'ES灵系列', 'AYPE032风暴690WS690', Null, '李宁WingStorm690超轻羽毛球拍属于李宁“ES灵系列”，是“智斗者”的利器。ES灵系列大多采用较轻的拍框设计，搭配较柔和的中管硬度，使球拍的灵活性更高，结合超细高强度仿生中管和空气动力学拍框截面系统，降低球拍风阻系数，提升拍头灵活度。前场后场皆能灵活控制，百样球风皆能随心所欲、变幻如风。\n\n李宁的空气动力学科技拍框横截面系统，使WingStorm690拥有低风阻、高强度的拍框截面结构及造型。立足空气动力学设计，通过海量实测，针对不同打法特点，累积完备数据支持，从而建立起李宁拍框截面设计系统，满足不同打法要求。\n\n球拍外框采用波浪形设计使球线与球拍之间的摩擦得到缓解，减少球拍对线的磨损，延长球线的使用寿命。', '碳纤维', '碳纤维', 80.0, 78.0, 675.0, 'S3', '软', 26.0, 20.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_4219.html');
