insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'Ti6', Null, '1、在拍框上采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n4、拍框还采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n5、拍杆加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。', '高强碳素纤维、钛金属网眼结构', '碳素纤维', 89.0, 85.0, 674.0, '-', '适中', 9.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9429.html');
