insert into detail values('羽毛球拍', '美津浓Mizuno', Null, '73MTB10002JPX8.9', Null, 'Mizuno美津浓新款JPX8.9全碳素轻量化进攻型羽毛球拍\nJPX8.9采用日本30T碳素，最高可拉30磅，拍框上半部采用盒式框，用以增加稳定性及杀球威力，下半部采用六边形破风框，用以增加挥拍速度，拍框同时使用工字型结构设计，用以增强拍框强度，中杆采用独特的菱形中杆', '30T碳素', '30T碳素', 84.0, 80.0, 675.0, 'G5', '稍硬', 30.0, 30.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_10796.html');
