insert into detail values('羽毛球拍', '威克多VICTOR', '挑战者系列', '挑战者Ti70', Null, '平衡点：285±3mm\n特性：1.顶框1/3处配重E.Titanium提升惯性力矩，搭配超轻重量，使球拍具有更为强大力量和更迅捷灵敏性。2.均等化方头能提供多32%的有效击球甜区，即使羽毛球偏离线床中心区的连续式扣杀，也能保持响应的精确和速度。3.特殊方形框面结构设计，提高击球时稳定性和较小的扭矩，可承受较高的拉线磅数。4.沟槽下延设计，将一般框形沟槽有三九点钟位置延伸至五七点钟位置设计，其作用在于增加拍面之均衡受力及抗扭性。适合攻击型球员。', '超高钢性碳纤维+E.TITANIUM+纳米', '超高钢性碳纤维+E.TITANIUM+纳米', 89.0, 80.0, 675.0, '-', '-', 28.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_675.html');
