insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓剑X6ARC-X6', Null, 'YONEXARC-X6羽毛球拍利用纳米气弹簧拍框延长线床驻留时间，提升控球精准度。\n\n1、纳米气弹簧：在拍框的制造过程中，将小至纳米级别的气泡混合在固话树脂当中。使拍框成品在使用时，微观结构的弹性类似弹簧的形式，使线床对羽毛球传递的能量更充分，击球威力更大。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。\n\n4、在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。\n\n5、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '碳素+纳米气弹簧', '碳素', 89.0, 85.0, 674.0, 'G4、G5', '软', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11217.html');
