insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT2VT-2', 2014, 'YONEXVT-2是操控灵活的威力三角型号的球拍。\n1、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度；\n\n2、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能；\n\n3、威力三角系统（Tri-VoltageSystem)：一般来说，在拍头增加重量会加强拍头的攻击力，但同时也会降低球拍的操作性。相反，拍头较轻的球拍会更加灵活，但爆发力明显不足。全新的威力三角系统成功地将强大爆发性能和卓越的操控性能，这两个截然相反的特性完美地结合在一起。能击出重扣，头重但不失操控性能，就是威力三角系统新技术；\n\n4、低风阻锥盖（ControlSupportCap）：将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '碳素纤维+钨', '碳素纤维', 84.0, 80.0, 674.0, 'G4', '中等', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10058.html');
insert into detail values('羽毛球拍', '凯胜KASON', '汤仙虎系列', 'FYPE002-1', 2010, '使用这款球拍出球的速度比较快，包括杀球，推球。球拍的拍头并不是很重，但也不算轻，比较均衡。球拍杆软，如果发力及方式得当使用的好，注重随鞭打发力趋势用力，边打效果会更好；后场吊球，会更贴网，或许这也是杆软的效果吧。感觉对发力和手法要求比较高。', '超细碳纤维', '超细碳纤维', 87.55, 87.55, 675.0, 'NG5', '偏软', 30.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5949.html');
