insert into detail values('羽毛球拍', '威克多VICTOR', '极速系列', '极速8PSJS-8PS', 2014, '极速双子星使用的奈米科技与胜利目前的NANOTEC不同，JETSPEEDS在拍框中管都加入了纳米碳管"Nanotube"，同時是Arc7中管所使用的材料。\n而以往NANOTEC則是在中管加入Fullerene.同時是NS9900中管所使用的材料。\nJETSPEEDS系列采用先进的拍框结构和技术，提供畅快的挥拍和灵巧的瞬发力。\n在快速来往的对阵中轻松取得最佳优势，享受极速的比赛节奏。\nJETSPEEDS8PS透过ZXION纤维有效减震\n并采用先进鲨鱼扰流科技的新型拍框，是追求敏捷重击者的上乘之选', '赛昂纤维+纳米树脂+超刚性碳纤维', '超刚性碳纤维+纳米树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G5', '较硬', 4.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6102.html');
