insert into detail values('羽毛球拍', '阿迪达斯adidas', 'precision(精准)', Null, Null, '推荐适用类型：单打-力量进攻/控制型打法-男子球员\n中杆科技：\n-纯纳米碳\n-本能感应柄盖\n拍框科技：\n-双重加强型拍框\n-振动控制系统\n-力量拱槽\n-精准76孔', '纯纳米碳、ZYLON超纤维、超精钛', '纯纳米碳', 90.0, 86.0, 675.0, 'G4、G5', '中等', 28.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6046.html');
