insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, 'HeadPowerHelix7000+铁氟龙羽毛球拍融合了许多技术，这些技术使Head在过去几年中成为羽毛球领域的领导力量。PowerHelixPowerHelix是整个轴上独特的螺旋结构，与传统的碳纤维部件相比，可确保高达56％的灵活性。这产生了巨大的动力释放，可提供令人难以置信的快速拍摄，同时仍提供最大的控制力。Metallix技术HEADMetallix由专门设计的碳纤维基质和结晶金属合金组成。合金的较小晶粒尺寸可以转化为更坚固的材料，从而提高性能。Metallix被并入石墨层和T型接头。能量体EnergyBody是独特的车架设计，带有超薄的球拍头。它最大程度地减少了空气阻力，从而提高了可操纵性，提高了速度并提高了动力。铁氟龙摩擦是力量的最大敌人。这是限制琴弦运动的力，导致冲击能量泄漏。为了解决这个问题，HEAD发明了具有降低摩擦力的Teflon聚合物的索环。在12、6、3和9点钟的位置，特富龙在琴弦和索眼之间提供了低摩擦的表面，从而使琴弦床上的张力稳定，扩大了最佳听音点，并几乎消除了冲击能量的损失。主要特点技术：HEADYouTek-PowerHelix/特氟龙聚合物/Metallix/能量体头部形状：头部动力架系统床头面积：360平方厘米/56平方英寸车架：高模量石墨50％，石墨50％轴：热熔石墨，两件式模制重量（未拧紧）：', '碳纤维', '碳纤维', 86.0, 86.0, 675.0, 'G2', '-', 28.0, 24.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_9046.html');
