insert into detail values('羽毛球拍', '李宁Lining', '超导纳米系列', Null, 2012, '李宁TBNano120金羽毛球拍属于李宁“MC控系列”，专为擅长防守和拉吊打法的选手设计。“MC控系列”采用适中的拍框头部设计，配合较柔和的中管弹性，结合李宁的力学优化拍框技术带来的超大甜区，使球拍具有拉吊稳定、扣杀力量大的特性，在拉锯战中不急不躁，以不变应万变，伺机进攻，稳操胜券！\n\n李宁TBNANO的TAKEDOWN版有三款颜色：金色、银色、青色。每一款拍身上暗藏都有李宁的logo光影，是仿版不可能仿造出来的技术，有一种专属于你的感觉，非常值得细细品味。此款为青色款，拍身为青铜色，幽幽的光芒如一把幻影宝剑！\n\n球拍科技：超导纳米+机翼恒定系统+力学优化拍框\n\n\n运用李宁力学优化拍框技术，除了将甜区面积在方形拍框基础上，进一步增大，更着力令甜区向上扩展，从而提高了球拍击球点。面对凌厉扣球，扩大有效防守面积；抓住瞬息机会，发挥极限扣杀力量。击球速度，也因为线床面积扩大，拍面反弹力增加，而显著提升。', '超高碳', '超高碳', 89.0, 85.0, 675.0, 'S2', '中', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5566.html');
