insert into detail values('羽毛球拍', '李宁Lining', '风系列', 'N77疾影风杜靖于洋', Null, '后场劈吊，变化如疾旋风；前场封网，灵活如无影手，正是疾影风StormN77。\n\n头框轻，平衡点低，拉吊更得心应手，反击更灵动迅捷；拍头边缘，以“方盒结构”打造，拍面稳定扎实，控球精准，无懈可击。取《孙子兵法》四如真言中，“风”字命名。\n\n疾影风StormN77，匹配拉吊突击型打法中擅长拉吊的选手，为国羽双打高手杜靖、于洋专属。后场劈吊，变化如疾旋风；前场封网，灵活如无影手，正是疾影风StormN77。', '超刚性碳纤维+超导纳米+钛', '超刚性碳纤维+超导纳米+钛', 89.0, 85.0, 0, 'S2（32/8英寸）、S3（33/8英寸）', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1891.html');
insert into detail values('羽毛球拍', '李宁Lining', '超导纳米系列', Null, Null, '李宁2013最新球拍科技，来自于神奇的“麦比乌斯圈”的不对称聚合结构，能有效将球拍力量传导至甜区，挥拍势能增加3%和球速增加3.5%，可以让击球时对于球的控制更加清晰，藉由框型带来的力量分配模式，可以让甜区部分的击球发挥更大的威力。', '超导纳米', '碳纤维', 89.0, 85.0, 675.0, 'S2', '偏软', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5954.html');
