insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'AT系列', 'AT50AT-50', 2009, '1、复合拍框顶部的薄膜钛装甲合，相对于碳素纤维能产生更大的重力效应，提升球拍击球能量；\n2、更高的拉线张力。通过对拍框承载耐久能力的反复改良，ARMORTEC羽拍的拍线推荐张力已大为提升，以满足为当今部分球员喜爱高张力的需求。但必须注意：拍线的高张力会对球员的手腕、肘部和肩部造成不良隐患甚至伤害；\n3、拍头的薄膜状钛装甲合增强重力效应，提高极限扣杀球速4%；\n4、球拍的抗震性能比传统的球拍更好，以满足业余选手的力量需要；\n5、采用了“新型内置T形接头”（NewBuilt-inT-Joint）；内藏在拍框和拍杆连接部位的“内置T形接头”，强抗变形性提高了拍面的稳定性，实现高精度的控制性能，是YONEX羽毛球拍的“原创技术”。“新内置T形接头”把合金材料改为轻量的特殊塑料材料，结合了新型的环氧树脂。精度和品质都有进一步的提高，拍框、拍杆更加一体化。而且更能避免打球时产生的变形，拍面更加稳定，进一步提高对拉高远球的控制性能。扣杀速度加快，发挥无与伦比的威力；\n\n6、拍框形状为ISO方形，扩大了拍面的击球甜点区域。与传统球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度；\n\n7、球拍加长10毫米，接球面加大32%，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，达到锐角落点以产生强而有力之高角度杀球。', '碳素薄膜状钛装甲', '碳素', 89.0, 85.0, 674.0, 'G4/5', '硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3710.html');
