insert into detail values('羽毛球拍', '美津浓Mizuno', Null, 'SPEEDFLEX7', Null, '美津浓Mizuno羽毛球拍Speedflex7.3\nSpeedflex球拍中的另类之选。Speedflex系列羽毛球拍，美津浓Performancep专业系列的经典作品，主打快速进攻结合弹性的中杆，立志打造出疾如闪电、快如旋风的球拍，不同于Speedflex系列中的7.0和7.1这两款型号；Speedflex7.3打造得是另外一种风格；不是纤薄的拍框和Areo椭圆形的拍框截面，Speedflex7.3打造的是快速的机翼型破风拍框，犹如兰博基尼跑车的空气动力学原理，目的只为快速的速度制胜。\n压缩凹槽边框设计，结合Speedflex系列锥形中杆的技术特点，不同于市面上大多数的球拍中杆，锥形中杆的球拍内径不是统一的，从三通处6.5mm到拍锥部分的7.5mm的过度，此设计，一方面能很好提高球拍的扣杀弯曲点，另外一方面，还能有效增强球拍的中杆弹性，带来较快的回复力。\n球拍适合：\n1力量偏小的球友；\n2快速进攻打法的球友；\n3喜欢低调的球友；\n4追求球拍比较弹性的球友。', '碳纤维', '碳纤维', 84.0, 80.0, 675.0, 'G5', '适中', 0, 0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_7124.html');
