insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MX30LMX-30L', 2013, 'METEORX30L\nVictor尖锋30L胜利MX-30L纳米女士专用羽拍\n尖锋系列拍框采用八面刀锋断面设计比起一般框型提升22%，碳纤维强化叠织技术能够显著提升拍面的刚性与抗扭力。80孔穿线模式，世界独创的80孔穿线模式，改善横竖线之间及相互摩擦情况，最带限度的保护线。采用了纳米树脂材质添加技术，有效减少拍框变形，利于进攻型选手发挥强大的力量。外框采用外悬波浪技术与双连钉结合创造出竖线稳定系统，比起一般拍线结构减少7%拍线磅数损失，并提升拍面稳定性，不仅线与拍框服帖性增加，也能减少拍线磨损机会保护线，延长拍线使用寿命.', '超高刚性碳纤维+强化叠织碳纤维+纳米树脂', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 84.0, 80.0, 675.0, 'G6', 'S○○○●○F', 28.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6135.html');
