insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NSX-4NSX4', Null, '1、碳素纳米管：在拍杆的制造过程中，将小至纳米级别的气泡混合在固话树脂当中，提升了拍杆的硬度、弹性、柔韧性。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。\n在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳素', '碳素+碳素纳米管', 89.0, 85.0, 674.0, '-', '软', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10952.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '脉动系列', 'ART-920ART920', Null, 'ARCTECH：球拍内框位置采用内拱型结构设计，使甜区面积增加5%，提高球拍击球点和拍面的反弹力，迅捷反击对手的锐利扣球，发挥强劲攻击力量。\nPOWERBOX：拍框断面采箱型结构设计，有效提高击球时稳定性和抗扭力，可承受较高的拉线磅数。\nNANOTEC：采用纳米树脂材质添加技术，能使nano级微细颗粒均匀分布在碳纤维的空隙，增加碳纤维复合材质的整体强度，使球拍的结构更优异，有效减少拍框变形，利于进攻型选手发挥强大的力量。', '高刚性碳纤维+树脂', '高刚性碳纤维+树脂+7.0SHAFT', 89.0, 85.0, 675.0, 'G2', '稍硬', 3.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8701.html');
