insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS800NS-800', 2009, '纳米速度800远离传统球拍结构的想法。通常，为了提高车架的强度、刚度，从而提高机身的强度和手感，增加车架厚度，增加石墨或碳纤维的层数，从而增加车架的重量，使球拍难以操纵。\n\n革命性的Yonex纳米科学将框架设计带回到分子水平，使用纳米级富勒烯和碳颗粒在更薄、更轻的框架中创造同样的性能。这一过程提供了一个高性能的分子键，使球拍的头部更轻，但更强。其结果是一个非常快的头部速度创造了最大的力量。\n\n由于框架纳米科学结构，刚性弯曲轴和多种技术包涵的结合，这种Yonex羽毛球拍非常适合一个俱乐部/联赛标准的力量球员谁创造了许多自然的手臂速度和力量。\n\n这种球拍将给你带来真正的好处，增加力量，并使YonexNano羽毛球球拍比同类球拍的冲击力提高30%，耐冲击性提高10%，强度提高5%。', '高弹性碳素纤维', '碳素纤维', 89.0, 85.0, 674.0, 'G4G5', '适中', 25.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_36.html');
