insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', 'MXJJSMX-JJS', Null, 'METEORXJJS李龙大专属签名拍亮剑-LYD成为2012年度人气最高的器材装备后，VICTOR又倾力打造属于李龙大双打搭档郑在成的专属装备——尖锋-JJS（7月上市）。这不仅仅是一支普通的球员签名球拍，更是尖锋系列的革命性突破。除了延续尖锋系列家族八面刀锋结构拍框以及80孔独家穿线模式外，MX-JJS在球拍三通位置加入了石墨烯强化科技。', '石墨烯强化+纳米树脂+强化叠织碳纤维', '超高弹性碳纤维+纳米树脂+7.2Shaft', 89.0, 80.0, 675.0, 'G2G3', 'So=ooofHHo=oooHL', 4.0, 26.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5480.html');
