insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', '2300II2300二代', 2019, 'powershotnanohexagon2300III\n1.管内PU：采用前沿的管内PU发泡技术，让框体材料碳纱间结合更为紧密，强度更有保障，且PU有明显的减震功能。\n2.高抗拉3MM窄浅曹设计，再配上专用单粒钉，合其头框强度较普通球拍提升30%以上，从力学解析入手，将碳素球拍的抗拉力提升至接近40磅。\n3.中管部分，HEXAGON系列球拍的核心特点是前套上端5CM内为六面锥体构造。此极大的提升中管的抗扭性能，且整支咱家的锥体设计，让击球弯曲点前移，反应更为迅速。', '超高刚性纤维碳纱与NANO材料', '超高刚性纤维碳纱与NANO材料', 90.0, 88.0, 675.0, 'G5（2#）', '偏硬', 35.0, 28.0, '290±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7901.html');
