insert into detail values('羽毛球拍', '波力Bonny', '天行者系列', '天行者SkyWalker', Null, '●拍框设计：中边小平头设计，拍框采用刀刃式破风结构，在保证拍框强度前提下，将拍框做尖锐，扣杀时可大幅度降低挥拍所产生之风阻。提高扣杀速度，增加扣杀时的破坏力。\n●成型设计：整支球拍二次成型，使用日本高刚性碳布制成：1.提升拍框刚性。2.有效提升拍框及中管之抗扭力系数。球拍内框3.9点内凹设计，增大甜区面积，扩大有效攻击区域，提升球拍的攻击力。\n●平衡：平衡点±0mm(未穿线)设定，击球手感佳。同型号球拍挥拍舒适度手感一至。\n■教练试打反馈：虽是290±0mm的平衡点，但是后场杀球扎实，网前小球又不失灵活，是一款轻量进攻型的球拍。', '高刚性碳纤维', '高抗扭力中管', 89.0, 80.0, 675.0, '7.0mm', '适中', 28.0, 28.0, '290±0mm', 'https://www.badmintoncn.com/cbo_eq/view_9454.html');
