insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1.中边框较硬增加击球稳定性，挥拍顺畅，反应灵敏。\n\n2.中边框大平头，拍面大，加大击球区，攻击、防守兼顾，是一支很好的大众拍。\n\n3.挥拍更顺手，不吃力。\n\n4.适合所有选手。', '碳纤维', '碳纤维', 90.0, 84.0, 674.0, 'G4', '适中', 26.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2370.html');
