insert into detail values('羽毛球拍', '李宁Lining', Null, Null, Null, '这款定位中端羽毛球拍\n在参数上略微调整\n平衡点偏低(290mm)\n中杆也相对偏软\n但是沿袭了李宁N903羽毛球拍的高贵血统\n沿用了N903羽毛球拍的大多数科技\n是一把相对糖水的速度型球拍\n十分适合进阶球友初级球友', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '偏软', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6644.html');
