insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', '波力小钢炮88孔88X', Null, '拍框材质：高刚性碳纤维\n中管材质：高刚性碳纤维\n重量（未穿线）：82±3g（4U）\n平衡（未穿线）：290±5mm\n长度：675±1mm（中管212mm）\n柄号：2#/G4\n拍框：宽边大平头\n中管硬度：M\n质保网压：28磅\n球拍属性：攻防拍/控制型\n适合球员：业余高手/双打防守\n产品保固：12个月\n产品说明：\n1、较一般球拍（72孔）多16个孔位，增加了穿线的密度，在不增加拍面面积的情况下，有效扩大了击球的甜区。\n2、球拍采用二次成型，使用高刚性碳素原料制成；提升拍框刚性，有效提升拍框和中管的抗扭力系数。\n3、小钢炮技术，波力公司经过计算，排列与测试，开发出小钢炮技术，利用小钢炮技术搭载高刚性碳纤维，使球拍的性能和手感有很好的提升。', '高刚性碳纤维', '高刚性碳纤维', 87.0, 81.0, 675.0, '2#/G4', 'M', 28.0, 28.0, '290±5mm', 'https://www.badmintoncn.com/cbo_eq/view_7552.html');
