insert into detail values('羽毛球拍', '亚狮龙RSL', 'DIAMOND钻石', Null, 2009, '（反向增容技术2）Extender2是Extender1（反向增容技术1）的改良版，专为DiamondX3特别设计，以令PulseTech（钻石型拍框技术）得到最佳发挥，PulseTech（钻石型拍框技术）令X2成为市场上其中一个最强的硬拍框。加上全新的Extender2（反向增容技术2）设计，不但保持了拍框的特质，更为这原已魅力非凡的球拍注入了更大的能量。\n钻石网技术骨架加强20%的坚硬度，更好感觉掌握力量性和操控性，支持更高的张力。\n超幼拍杆由于高密度多层石墨结构，RSL拍子的杆能更幼细，这不但能使重量变轻、增加拍子的韧性，同时也提高了拍子的力量和耐久性。\n反回旋力技术因为高密度多层石墨结构，因此成份的数量和位置的选择就很重要了。太多=扩张力与承受力降低太少=缺乏力量与承受冲力在拍杆增加适当的反回旋力设计，能令拍子更耐久、更有伸缩力和防止拍杆回旋。\n新科技组合不同结构的基层性碳素纤维及高碳素纤维，令球拍的抵御力大大增强19%，发挥更佳的能量及准确性。', '复合涂层碳素纤维', '超高弹性碳素', 89.0, 85.0, 675.0, 'G5', '偏硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2245.html');
