insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB-50CAB50', Null, '性能特点：\n1.ELASTICTI软钛合金\n纳米级的软钛合金ELASTICTI兼具金属的高强度和橡胶般的高弹性，其性能超越传统碳素材料。在击球一霎，软钛合金ELASTICTI先以变形来储存能量，紧接着以瞬间形态恢复将能量精确地完整反弹。\n2.MUSCLEPOWERFRAME拱形线槽系统\n拱形线槽系统将拍线支撑在圆拱形的湖面上，消除触点应力，拍线不易疲劳，并增强了拍框的整体效应，从而增强了球拍的稳定性和力量性能。\n3.ULTIMUMTI镍钛合金\n埋藏于球拍内部的镍钛合金，其功能就像一个能量电容器，能有效储存能量，在击球瞬间利用瞬态反弹效应将能量装化为羽毛球的爆发性速度。', '超强化碳纤维/ElasticTi', '强化碳纤维/超聚乙烯纤维', 95.0, 85.0, 664.0, 'G5', '硬硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6016.html');
