insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', Null, Null, '1.破風式拍框，在保證拍框強度前提下，將拍框斷面做到最鋒利，更進一步降低揮拍時的空氣阻力，並提高扣殺速度，增加扣殺時的攻擊力。\n2.球拍採用二次成型，使用日本高剛性碳素原料製成：\n（1）提升拍框剛性→A.從容承受高磅數網壓\nB.有效提升攻擊係數\nC.強化拍框控制性，強化控球效能\n（2）有效提升拍框及中管之抗扭力係數→A.強化控球效能\nB.提升擊球手感\n3.烏缺工藝，100%嚴格篩選：不做任何補土、色漆噴塗，不經修飾，完整呈現無瑕疵的碳纖維紋路，堅持挑選成型優良的高檔。\n4.納米科技：採用波力最新納米材料，使球拍有超強韌性，為球拍高新科技材料的應用帶來革命的突破。強化球拍的減震和平衡性及其它性能與材料更均勻分佈的特性，使用者更加體會球質和球速的奧妙。耐用度增加50%以上。\n5.整支頭框線孔採用金字塔結構，增強頭框剛性強度，讓羽線力量分佈更加均勻。\n6.1K碳編織強化拍框強度並提升質感。\n7.1K碳Woven中管設計，有效提升球拍抗扭力效果與彈性，並顯現高檔質感。\n8.單線孔設計+雙連釘使用，提升線的耐久性，減緩掉磅。\n9.採用特殊透明漆及炫彩水標設計，呈現高品味的經典質感。', '超高剛性40T碳素纖維+納米樹脂+烏缺工藝', 'Woven高剛性中管+高抗扭力碳素納米管+烏缺工藝', 90.0, 88.0, 675.0, '2#', 'M', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3540.html');
insert into detail values('羽毛球拍', '美津浓Mizuno', 'FX系列', 'FX-04', Null, '柔软的击球感和优越的反弹力！\n搭载软杆纳米钛，提高击球安定性和反弹力。\n充分发挥防守和高远球威力。', '高弹性碳素、碳素、纳米钛', '高弹性碳素、碳素、纳米钛', 90.0, 85.0, 675.0, '3U5', '偏软', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_754.html');
insert into detail values('羽毛球拍', '百宝力Babolat', Null, Null, 2014, '2014年版的BabolatSatelite6.5Brio羽毛球拍对于那些寻求控制但要比Synchro强大得多的球手来说是完美的拍子。\n\n主要特点：\nMetriflex技术-一种革命性的轴，根据角度不同，具有不同的灵活性，可以在保持最佳控制的同时最大程度地提高动力。\n飞行员系统-握柄顶部的两个模制条纹使您获得自然而直接的印记，从而提高了决定性射击的准确性和速度。\n6.5轴-超薄轴比以往任何时候都更好地切入空气，以实现更快，更强劲的击球。\n细轴-超细轴可以更好地在空气中切成薄片，使击球更快，更有力。\nGT技术-结合了高密度碳纤维，为球拍头提供了最佳强度，从而具有更大的动力和控制力。\n20x21弦线模式-Babolat的创新技术：20个主电源交叉线代替了传统的弦线模式中的22和23，可以改善手感并允许更多旋转。', '碳纤维', '碳纤维', 89.0, 89.0, 675.0, '-', '适中', 0, 0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_9120.html');
