insert into detail values('羽毛球拍', '摩亚MMOA', Null, 'MBR6001', Null, '最新專利設計88線孔.紅黃二款.耐高磅數\n小平頭.內框採用nano二點鈦纖維.側框Muscle,上框跳孔Muscle加強擊球穩定性,弧型截面提高迴拍速.\n拍框及中管採用30噸高纖維材質.即有耐高磅數拉線.\n爆發力強,穩定性高,中管韌性佳,摩亞2006最新鉅作！！\n單線單孔設計.擊球時拍線較為緊實紅/黃二款\n评价:中杆采用美国7.5钛丝杆,扣球极为凶狠,摩亚近年来最受欢迎的球拍。', '高單位碳纖維+鈦合金纖維', '內框採用nano二點鈦纖維.側框Muscle', 0, 0, 0, '-', '-', 26.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_833.html');
