insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB-15CAB15', 1982, '1982，在长期畅销的CAB-8面市的4年后，YONEX推出了全碳素拍框及拍杆的CAB-15，这意味着世界上第一支全碳素球拍终于诞生了。当时被称为“黑豹”的印度尼西亚选手林水镜出演广告的主角，极具压倒性的弹跳扣球掀起了羽毛球运动的高潮。', '碳素纤维', '碳素纤维', 94.0, 90.0, 664.0, 'G3、G4、G5', '硬', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4045.html');
insert into detail values('羽毛球拍', '阿迪达斯adidas', 'adipower(力量)', 'RK215501', Null, '推荐适用类型：单/双打-侵略进攻/防守型打法-男/女子球员\n中杆科技：\n-超轻科技\n-锥形快速中杆\n-纯纳米碳\n拍框科技：\n-双重加强型拍框\n-振动控制系统\n-力量拱槽\n-终极精准78孔\n-ZYLON超纤维', '纯纳米碳、ZYLON超纤维、超精钛', '纯纳米碳', 82.0, 78.0, 675.0, 'G5', '中等', 28.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6039.html');
