insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'AT系列', 'ATSB', Null, 'YONEX公司2004年限量版纪念拍，采用YONEX最新羽拍技术——Carbon+gForceTi=ARMORTEC钛装甲技术，一如既往，引领同行！全球产量仅5000支，每拍序列号唯一，极具收藏价值。\n\n1、复合拍框顶部的“gForceTi”特殊钛装甲合金，相对于碳素纤维能产生更大的重力效应，提升球拍击球能量。gForceTi是特殊金属复合物，能产生2倍于碳素纤维的重力效应。将gForceTi配置于羽拍前三分之一的拍框顶端，使球拍挥动时的惯性力矩获得提升，击打羽毛球的能量随之增加。\n\n2、创新的拍头边缘压缩结构，增强3%的拍面稳定性。gForceTi是特殊金属复合钛装甲，再配合拍框顶端的边缘压缩结构，能有效抵抗拍框的扭曲形变和提高控球能力。在增强3%的拍面稳定性的同时，更带来清脆扎实的“金属撞击之感觉”。\n\n3、更高的拉线张力。通过对拍框承载耐久能力的反复改良，ARMORTEC羽拍的拍线推荐张力已大为提升，以满足为当今部分球员喜爱高张力的需求。但必须注意：拍线的高张力会对球员的手腕、肘部和肩部造成不良隐患甚至伤害。\n\n4、拍头的钛装甲合增强重力效应，提高极限扣杀球速4%。运用了gForceTi的钛装甲技术再结合拍框顶部独特的横断面压缩结构，既抑制了拍框在高负荷下的扭曲变形，又强化了拍框的轻量及灵活性，造就了一支拥有独特“头重效应”的球拍，使扣杀速度提高4%。更高的速度与更灵活的操控性能，特点鲜明的钛装甲系列已经成为当今羽坛快速打法的最佳武器。\n\n5、YONEX通过对顶尖双打球员特殊握拍方式的分析，研发出新型的C.S.CAP精确制导拍柄锥盖，为球员提供更迅捷的挥拍灵活性，适应愈来愈快速的双打对抗。ARMORTEC羽拍的新型拍柄锥盖平面比传统的羽拍拍柄锥盖扩大了88%的实用面积。创新的锥盖形状和更宽大的接触平面，让拇指更易于握紧和控制球拍，使高速反手挥拍变得更迅捷、精确。\n\n6、拍框采用盒式截面设计，更适合进攻型打法。\n\n7、更轻的拍杆和拍柄重量。轻量化的UltimumTi镍钛记忆合金拍杆和更轻巧的拍身净重，使更灵活的身体动作和更轻盈的步法移动得以实现。\n\n8、拍杆材料采用高强碳素纤维及镍钛记忆合金（超钛/UltimumTi），强度及弹性极佳。\n\n9、拍框形状为ISO方型，扩大了拍面的击球甜点区域。', '超高强碳素纤维+gForceTi复合钛装甲合金', '高强碳素纤维+镍钛记忆合金（超钛/UltimumTi）', 89.0, 85.0, 674.0, 'G4', '超硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6119.html');
