insert into detail values('羽毛球拍', '威克多VICTOR', Null, 'TR-80TORNADO80', Null, '【拍头】：【ISO方形拍头】拍框正面采用方形设计提高拍身的扭力，从而使得球拍的弹性更强，稳定性更为出色，落球点更为精确！拍框三九点用水滴形内圆设计，增大球拍的触球面积，从而增强球拍拍线的弹力，能在进攻中释放出更大的力量，大大增强了球拍的反作用力，使球飞行的更快。\n【T形头】：【内置T形接头】拍框和拍杆连接处深藏T形接头，使球拍真正高强度一体化。此技术让球拍极具强大的力量性能和精确的控制性能。重磅强攻配合惯性加速，让选手的进攻气势如虹，锐不可挡。\n【拍框】:【椭圆形破风结构】拍框截面采用椭圆形结构设计，能够有效减少挥拍时的空气阻力并提升抗扭力，带来强悍敏捷的回球速度的同时，大幅强化对球拍的控制能力。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G5', '适中', 24.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8533.html');
