insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium6系列', '6130', Null, '拍身重量:3U（85±1克）\n拍杆韧度：中硬\n拍柄尺寸：G4,G5\n最高拉力：25磅\n长度：670mm（加长5mm）\n拍杆直径：7mm\n适合使用范围：进攻型球员\n点评：采用最高级的碳纱编织而成，全拍框溶入钛粉，造就结实耐用，手感扎实的球拍。免皱折高碳素纤维技术使球拍使用更少的材料达到承受高磅的要求,反回旋转力技术使球拍稳定易于操控。拍框五点、七点方位嵌入钛片，增强球拍的操控性。加长5mm拍身,既增加了控制范围,还保持了速度。', '超高弹性碳素纤维溶入钛粉+2P钛', '超高弹性碳素纤维溶入钛粉+2P钛', 90.0, 88.0, 670.0, 'G4,G5', '中硬', 25.0, 25.0, '297mm', 'https://www.badmintoncn.com/cbo_eq/view_1421.html');
