insert into detail values('羽毛球拍', '奥立弗OLIVER', 'FLOW', Null, Null, '高科技性能参数：\n一.Metacarbon是OLIVER专利权所有：优点：\n1.重量超轻\n2.扭力值低\n3.稳定性强\n4.刚性更高\n以高科技材质制造出的重量更轻，仍能维持低扭力值的球拍，在效能上，采用Metacarbon材质所制造的球拍，除了能够高档球拍应有的水准之外更高的刚性（Higherrigiditv)及力道传输更能够充分提升选手运用的高爆发力及高动能的球技发挥。\nMetacarbon系新一代科技开发下的优质复合材料运用。\nMetacarbon可以和编织性材料（Braided）、克维拉（Kevler）相互搭配使用。更可以使球拍的效能充分发挥到极致。\n\n二.FLEXON（强力消震）是OLIVER针对羽球拍突破性发展功能，在球拍甜区外侧装置的消震弹性片，能提升网线弹力效能，增强回作用力，阻断不该有的回震干扰，增进操作稳定性，不仅深受一般运动员喜爱，更是专业选手在竞技球场运用自如的利器。\n\n三.编织钛纤维，细Golfschaft(Golf中管）', '高钢性钛碳纤维Metacarbon', '高钢性钛碳纤维Metacarbon', 87.0, 81.0, 668.0, '-', '高', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_145.html');
insert into detail values('羽毛球拍', '奥立弗OLIVER', Null, Null, 2007, '老款T-XXX的改良版，增加了钛装甲和防震设计\n平衡：290\n\n2007年上市，OLIVER新一代高科技产品，采用全球最新羽拍技术，超钛/UltimumTitaniumFrame/Shaft。超钛UTi（高反弹性钛镍精炼太空金属、力量转移设计）拍框、拍杆、MS弧形筋力结构拍框线槽、高强韧性、超弹性', '高强碳素纤维+高反弹性钛镍精炼太空金属（超钛/UltimumTi）+MusclePower弧形筋力结构拍框线槽设计', '高强碳素纤维+高反弹性钛镍精炼太空金属（超钛/UltimumTi）', 84.0, 84.0, 670.0, '-', '中', 28.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_353.html');
