insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC69LT弓剑69ltARC-69LITE', Null, 'YONEXARC69LT印尼著名华裔羽毛球运动员梁海量签名版羽毛球拍\nYonexArcsaber69Light是特别版，向羽毛球界最具标志性的面孔之一RudyHartono致敬。\n他获得了8项全英格兰冠军头衔，其中7项是在1968年-1974年之间连续获得的，而最后一次是在1976年。\n该Arcsaber69轻型羽毛球球拍在日本开发并在中国制造的。这是一款技术先进的新型球拍，可提供快速处理和高排斥力，以闪电般的快速移动响应高速集会。\n航空箱框架有助于最大程度地减少空气阻力，从而使空气在挥杆过程中更快地流过曲面，从而加快杆头速度并将更多的速度和动力传递给击球。双重重量的全能和完美球拍具有巨大的潜力，因为它的重量和长度很容易操纵。', '碳纤维', '碳纤维', 79.0, 75.0, 665.0, 'G5', '适中', 30.0, 30.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_8835.html');
