insert into detail values('羽毛球拍', '威尔胜Wilson', Null, 'WRT880120+', 2017, '日本女双、混双运动员松友美佐纪于2017.3–2019.2使用的球拍，发售价格为24200日元（含税）。\n\nWilson官方页面介绍信息：\nFIERCE＜CONTROL−技の頂点を操る。＞瞬時の判断力で空間を制し敵も味方も自分の意のままに操る高いゲームメイク力を得る為に必要なのは、一点を射抜く精密さとコート内すべてを狙える飛行性能の両立。寸分狂わぬ高次元のコントロールを武器に相手の強打をも逆手に取れるカウンター力さえも併せ持つ、松友美佐紀の願いを叶えた新時代を築くコントロールプレーヤーの選択。[松友美佐紀使用モデル]', 'CONTROLXGEOMETRY', '碳纤维', 81.0, 77.0, 675.0, 'G5', '偏软', 0, 0, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_11343.html');
insert into detail values('羽毛球拍', '威尔胜Wilson', Null, 'WR002210S+', Null, 'MisakiMatsutomoSetting日本女双、混双运动员松友美佐纪参与设计的里约奥运夺冠纪念球拍，限量819只，日本限定发售。Wilson宣称其参数设定、自带手胶和拍线与球员本人使用的完全相同。发售价格为26400日元（含税）。', 'CONTROLXGEOMETRY', '-', 81.0, 77.0, 675.0, 'G5', '偏软', 0, 0, '315mm', 'https://www.badmintoncn.com/cbo_eq/view_11345.html');
