insert into detail values('羽毛球拍', '波力Bonny', 'AK系列', 'blackmanba', Null, '1.破风式拍框，在保证拍框强度前提下，将拍框断面做到最锋利，更进一步降低挥拍时的空气阻力，并提高扣杀速度，增加扣杀时的攻击力。\n\n2.球拍采用二次成型，使用日本高刚性碳素原料制成：\n（1）提升拍框刚性\nA.从容承受高磅数网压\nB.有效提升攻击系数\nC.强化拍框控制性，强化控球效能\n\n（2）有效提升拍框及中管之抗扭力系数\nA.强化控球效能\nB.提升击球手感\n\n3.1.5KWOVEN工艺，100%严格筛选：不做任何补土、色漆喷涂，不经修饰，完整呈现无瑕疵的碳乌纹，坚持挑选成型优良的高档；1.5K碳编织强化拍框强度并提升质感\n\n4.纳米科技：采用波力新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上。\n\n5.整支头框线孔采用金字塔结构，增强头框刚性强度，让羽线力量分布更加均匀。\n\n6.1.5K碳WOVEN中管设计，有效提升球拍抗扭力效果与弹性，并显现高档质感。\n\n7.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。', '30T超刚性纳米级碳布+1.5KWOVEN工艺', '30T超刚性纳米级碳布+1.5KWOVEN工艺', 91.0, 87.0, 675.0, '2#/G4', 'M', 30.0, 30.0, '290+5mm', 'https://www.badmintoncn.com/cbo_eq/view_9108.html');
