insert into detail values('羽毛球拍', '凯胜KASON', '汤仙虎系列', 'FYPE014-1', 2010, '凯胜KASONTSF190羽毛球拍科技点:\n1钛金属(TitaniumTech)\n2低扭角中管(LowTorsionAngleShaft)\n4超细高系数碳纤维(HighModulusUltra-thinCarbonFiber)\n5低风阻拍框(LowWind-resistanceFrame)\n6方形拍头(IsometricRacquetHead)\n对于强调落点,擅长控球的使用者,凯胜的“精准系列”是最佳选择。“精准系列”利用高系数碳纤维使球拍保持最稳定状态,在击球的瞬间球拍产生的形变能够快速复原。稳定的性能发挥更能适应球场上的快速变换,无论进攻或者防守,都能可以将球的落点控制到指定的区域,使得战术的发挥更加出色,以不变应万变。', '超细高系数碳纤维', '超细高系数碳纤维', 89.0, 85.0, 675.0, 'NG5', '软', 28.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5252.html');
