insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', 'THRUSTERitouri-tour智能拍', 2017, 'VICTOR智能拍，一体化的设计。将智能传感器，置于中端球拍拍柄上，不改变球拍原有平衡点，拍柄外观依旧，无异物手感，使用方便。某种意义上，也体现了设计者对智能球拍技术的自信，及对市场需求的适应。\n本次体验的这款智能球拍--THRUSTERiTOUR，为TK系列球拍，也称为突击iTOUR。官网介绍，为进攻类的糖水拍。\n\n球拍白色漆水基底配宝石红、灰色，外观素雅。球拍拍框箱式、全线槽。T头左右1-4孔，各有两个双线钉，5-8孔为四连钉。细中杆，约6.7MM。\n球拍搭配VBS-66N活力粉色线，28磅，首线。手里只有这个颜色的了，本来准备换个颜色。遗憾，当时专卖店里没有66这款线。连续绷这款球线，希望体验过不同球拍、同款线，再次体验，以核实上次体会的结果。\n底胶上加手胶后，平衡点及质量：约302MM，96.31克（手胶包裹全部锥柄，加半条封口条。）\n与普通球拍显著不同的是，需上线、手胶之外，还需充电。与手机APP配合，实现智能功能。\n\n测评参见：\n快乐的传递与分享--VICTOR智能拍TK-iTOUR之体验及体会-神兵利器中羽在线社区http://bbs.badmintoncn.com/forum.php?mod=viewthread&tid=827129&extra=', '高刚性碳纤维', '高刚性碳纤维++树脂', 89.0, 80.0, 675.0, 'G5', '中', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6661.html');
