insert into detail values('羽毛球拍', '佛雷斯FLEX', '刀剑羽拍系列', Null, 2008, '1.竹节式拍颈（获得2008年欧洲设计球拍大奖）\n羽毛球拍拍颈采用了竹节式设计（术语：可弹性弹道）使抗弹性形变提高50%，提前复位时间可以缩短50%！使球拍攻击提高15%！\n2、．GOLFSHAFT高尔夫中管GOLFSHAFT中管内壁厚度均匀.更有效发挥击球,平衡更佳.\n3．采用最新科技HQ4树脂技术,使拍框更坚固,拍面更稳定.增加拍框强度同时保持球拍重量.击球更有效能.更准备,击球速度更快!实验室证明:使用HQ4树脂技术技术,与传统拍比较,使拍框增加了30%的抗击能力.耐用度强化14%.\n4.用高弹性碳纤维为原料的拍子重量更轻，仍能维持低扭力值的球拍，在效能上采用高弹性碳纤维所制造的球拍，除了能维持高档球拍所应有的特性之外，更高的钢性及力道传输更能充分提升选手运用的高爆发力及高技能的球技发挥；\n5.窄边方头低断面设边设计.让球拍击球甜点区增加5%6.这款球拍高级坚实的头框加框外缘的WAVE波浪系统，它提供球拍线更好的传送力，增加其POWER及扭力稳定性\n7.ISO方型拍头与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积(击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。\n8.拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量\n9.拱形线槽\u3000传统球拍的承线系统中，拍线被直接支撑在尖锐的线孔胶粒边缘上，拉线后拍线与胶粒的两个接触点会产生应力集中现象，导致拍线疲劳，张力严重下降。新的波浪形结构系统将拍线支撑在圆拱形的线槽上，两个接触点被连接为一段接触弧面，不但有效消除应力，而且形成的紧密接触弧面大大增强了拍线与拍框的整体效应，从而增强了拍线与拍框的整体效应，从而使击球感更硬、爆发力更强', '高弹性碳纤维+树脂', '高弹性碳纤维', 84.0, 84.0, 670.0, 'G2-G5', '适中', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2793.html');
