insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1.窄边框减小风阻,挥拍顺畅,反应灵敏。\n2.窄边大平头，拍面大，加大击球区，防守性较强。\n3.挥拍更顺手,不吃力\n4.适合所有选手', '100%碳纤维', '100%碳纤维', 85.0, 79.0, 665.0, 'G4', 'M（主结构）、H、S', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2335.html');
