insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT3VT-3', Null, '框架头部顶部的YonexVoltric3坚硬球拍结构允许头部以非常可控的方式弯曲，并在弦床上更长时间地保持梭子。较薄的框架侧边允许框架更多地弯曲并将更多的能量传递给梭子。这种组合可以让您以瞬间的力量粉碎。\nVoltric设计旨在提供无与伦比的敏捷性。这是通过创建和保持框架顶部与关节区域之间的微妙平衡来实现的。它有助于正确处理，同时确保播放器保留所需的功率。代表拍框侧面特征的薄侧面与拍头侧面一起可减少空气阻力，从而改善球员在比赛中处理球拍的方式。更重要的是，即使在短距离反弹的游戏中，玩家也能够全力以赴。\n\nVoltric设计几乎是出色音质的代名词。这是Yonex品牌独有的又一创新。该技术利用了声音过滤器。简单地说，允许这样做的材料被放置在两个不同的位置，分别是10点钟位置和2点钟位置。结果是随着产生更大的噪音而大大降低了高音调噪音。这让您在对手上占了上风，并且是开始获胜的好地方。正是这种侵略性使其成为许多有抱负和专业的羽毛球运动员的最爱。', '碳纤维，钨', '碳纤维', 89.0, 85.0, 675.0, 'G4', '-', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9561.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', '弓箭3FLARC3FL弓3FL弓剑3FL', 2011, 'YONEX原创的方形拍头设计（Isometric），增加构成线床有效区域的横线和竖线数量，扩展击球甜区，即使是非甜区中心击球也能保持足够的精度和速度。\n纳米气弹簧:在拍框的制造过程中，将小至纳米级别的气泡混合到固化树脂当中。使拍框成品在使用时，微观结构的弹性类似弹簧的形式，使线床对羽毛球传递的能量更充分，击球威力更大。\n复合截面拍框:拍框上部可以减少挥拍空气阻力，拍框下部可以增加控球能力，让球拍攻防兼备。\nYONEX在五年前已经开始创建一个纳米级分子复合材料体系，将球拍原材料的工艺和功能控制推进至分子级别。运用以富勒烯（Fullerene）为代表的高性能纳米级碳素材料，YONEX能制造出超轻球拍，与普通球拍相比，不但更纤细、更强韧、更稳定，而且易用性更高，轻松就能获得更快的速度和更大的威力。\n低风阻锥盖\n将专为双打球员设计的宽面锥盖（C.S.CAP）适当削尖，在保证拇指控制面积的前提下，减少挥拍时的空气阻力，又确保网前控制有足够的灵活性。', '碳素、叠杯碳素纳米管', '高弹性碳素', 85.0, 80.0, 674.0, 'G5', '适中', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5640.html');
insert into detail values('羽毛球拍', '李宁Lining', '立体编织系列', Null, Null, '平衡点:295±4mm\n三大技术，成就李宁立体编织碳系列超凡脱俗的实力：\n\n亮点一：免钉孔技术：拍框3点和9点位置，采用线孔与拍框一体成型，去除了传统护线钉之后，网线与拍框直接接触，令力量反馈更直接、更清晰，击球更快速、更强劲！\n\n亮点二：机翼恒定系统：以超弹性3G钛合金打造拍框3、9点及以上部分。其卓著的记忆金属性质，将使拍框形变迅速复位，抗扭性也大大增强！\n\n亮点三：立体编织碳纤维：球拍本身采用的立体编织碳纤维，比一般碳纤维具有更高强度和刚性，经久耐用！据说从编制到加工，除了端点，中间绝不截断任何一束纤维，从而消除了拍身的接缝。藉此制造的球拍，让你真正得心应手，如臂使指。', '立体编织碳+超导纳米科技', '碳纤维', 94.0, 81.0, 675.0, 'S2/S3', '适中', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2611.html');
