insert into detail values('羽毛球拍', '高神Gosen', '风云系列', Null, 2014, '使用的播放机的存在感与其他绝对不同球拍彩色。\n20米远的观众席为时嫌晚,播放机的球拍,能以\nゴーセン独自的荧光+艳没有涂装加工。\n日本ユニシス佐伯选手、垰田选手和1年的共同开发出的“世界服役的新一代的球拍。”\n在后→兜风→推的快攻,使对方接球,看不清楚。\n进入近代显著拉里”速度出色的表现,羽毛球,仍无法申请专利得到许可,\n良好的趋势相反的特征,拥有这样的球拍性能。\n现有的广场形状的框架中在交友面积加重,原来如此。\n击球时的空气阻力变大,没有变差的课题拥有的。\n这一问题在x类型的跳跃定制的特徵3个以下,具备完善的性能。\n1.框架的边缘,则将根据击球时的空气阻力,大幅减少。\n→区间的力量的陷入不增多,夺得了冠军。\n2.帧腕表了时的4时和8时的部分、鲨鱼皮肤的效果エアロダイナミクス加工。\n→对此表示不满,没有得到恢复,高速旋转球反弹的最大优势,发挥效果。\n3.比以往平均5克轻4u规格(80.9%-86(g)是最大27英镑的弹性涂抹。\n→轻球拍特有的操作性的张力的经济效益,精密而生气地控制实现。\n风割下球拍至今为止的声音和完全不同。', '百分百高密度碳素纤维，AERMET，M40', 'ZYLON', 83.0, 83.0, 675.0, 'G5', '硬', 27.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6103.html');
insert into detail values('羽毛球拍', '高神Gosen', Null, Null, Null, '性能介绍\nGOSENRootsGavunAermet2100羽毛球拍增大的甜区提供更好的稳定性。\n1、DELTAJOINT（三角形接头）：独特的倒三角的三通在打球时可增加拍框面得稳定，击球时球稍离拍面的击球界面也能打正确的击球；\n2、AERMET（镍钴合金钢）：增加拍框的强度和稳定性。AERMET是一种极高强度的马氏体合金钢。其主要合金成分为钴和镍，并加有铬、钼和碳。它在硬度、抗张强度、断裂韧度以及柔软性等方面有着非凡的特性。被用于装甲车、飞机起落架、喷气发动机转轴等尖端领域；\n3、GAVUNSHAFT（雅文中杆）：以发明者雅文名字命名的GOSEN专利。中杆上为球拍设置了相当于人体手腕作用的第二弹性部，与相当于人体肘关节的第一弹性部结合，提高了反弹力，可以打出角度d钻的球；\n4、LONG（加长）：比传统长度，增加10毫米，有效地增加击球范围。', '高钢碳素纤维+Aermet', '高钢碳素纤维+Aermet', 89.0, 85.0, 675.0, '-', '偏硬', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9838.html');
insert into detail values('羽毛球拍', '高神Gosen', 'ROOTSGAVUN', 'ROOTS十周年白金纪念', 2009, 'ROOTS十周年白金纪念系列：材质使用百分百高系数碳纤维加上GOSEN专用的Aermet合金滤网而成。中管较硬，须自发足够力量，提供最佳控球性。适合攻击型的高级选手。科技：1.钢铜合金：专利的Aermet钢铜合金，与百分百高系数碳纤维，增加框架的力量和稳定2.三角型接口：专利的三角型头，通过接头的加宽，支持框架增加及加大甜区，并增加防扭功效3.捷杀中管：专利的二节式设计，使中管产生捷杀威力（减少杀球角度）及提供足够的威力4.平垫片前套：特有新式扁平垫片前套，让球员更容易掌握，增加击球的反应及力量5.吸震护套：双连钉加上矽胶避震片，充分吸收了线的击球震荡，并且避免震手臂受伤机会6.加长科技', '材质使用百分百高系数碳纤维加上GOSEN专用的Aermet合金滤网而成', '1.钢铜合金：专利的Aermet钢铜合金，与百分百高系数碳纤维', 87.0, 83.0, 675.0, 'G5', '中管较硬，须自发足够力量，提供最佳控球性', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2466.html');
