insert into detail values('羽毛球拍', '高神Gosen', 'ROOTSGAVUN', Null, Null, '航空级减震树脂+高碳+钴镍合金层+SUPERPOWER拍框（小破风）平头扁形拍锥LOGO橡胶触点碳纤维手柄平衡点285+-3MM三点九点减震线孔深邃蓝色拍漆底色很有质感\n\n拍子涂装一改白金的委婉，显得很刚毅。亮银色的金属贴片很耀眼，比BLAZE稍微硬一点，拍框结构和击球手感如出一辙。很好的均横了速度力量，控球与下压。只在部分地区特别推出，中国没有引进。', 'HOTMELTCARBON高熔碳纤维', '加长碳素中杆多轴编织', 87.0, 83.0, 675.0, 'G6G5', 'MEDIUMHARD偏硬', 30.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4241.html');
