insert into detail values('羽毛球拍', '波力Bonny', Null, 'IF009IF0102BD215A1009E2BD215A1010E', 2020, '小平头拍面，头框全线导流槽设计，所有线钉藏入框中，增加整支拍的美感，减小风风阻，同时平抽和网前小球更加稳定，力量更加集中。3次成型使球拍品质更稳定。拍框采用高分子填充材料发泡紧跟一线品牌工艺。三通处植入轻质碳T头，有效果提升球拍抗扭和挥拍力度的传递，强化击球的效果。中杆采用了波力6.5MM超细全新韧性弹性刚性更好中杆！', '高刚性碳纤维+乌缺+碳T头+高分子填充', '6.5MM高弹波力中杆', 89.0, 80.0, 675.0, 'G5', 'M适中', 30.0, 30.0, '295士0MM', 'https://www.badmintoncn.com/cbo_eq/view_9701.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '挑战者系列', '挑战者9700', Null, '平衡点:285±3mm\n适合球员类型:攻击型球员\n球拍性能特点\n1、宽边小平头，低断面设计。中管弹性好，控球灵活性好；\n2、特殊握把材料，耐磨，粘度佳，吸水性特强；\n3、高磅数，属攻击型球拍', '碳素纤维', '碳素纤维', 89.0, 85.0, 675.0, '-', '-', 28.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_1686.html');
