insert into detail values('羽毛球拍', '泰迪Tactic', '轻装甲系列', 'AT700', Null, '扭力：低\n类型：大平头\n平衡点:295mm\n颜色:银色/红色\n\n特性：全新的碳素纤维与特殊金属复合钛装甲结构（CarBornFiber+UForceTi=AMORTIC装甲技术)“UForceTi”是特殊金属复合物，能产生2倍于碳素纤维的地心引力，将UForceTi配置于羽毛球拍前三分之一的拍框顶端，使球拍挥动时的惯性力得到提升，击打羽毛球的能量获得增强。\n全新的拍头边缘压缩型结构设计，增强3%的拍面稳定性，能有效抵抗拍框扭曲变形的机会和有效提高击球能力，带来“金属式”般质感的击球感觉。创新的T形护线钉和通过对拍框承载能力的反复改良，ANORTIC球拍的拍线保护能力大为提高，以满足球员喜欢高张力的要求。为双打球员提供新型的C.S.CAP精确制导拍柄锥(ControlSupportCap)AMORTIC羽毛球拍的新型拍柄锥盖平面比传统的羽毛球拍柄锥盖扩大88%的实用面积，创新的锥盖形状和更宽大接确面积，让拇指更易于握紧和控制球拍，使高速反手挥拍便得迅捷、精确。\n\n更轻量化的Ultimumti镍钛记忆合金拍杆（AT-700）和更轻巧的拍身净重（4U级别），使更灵活的身体动作和更轻盈的步法移动得以实现。\n备注：不穿线，附带单支球拍袋。', '100%强化高密度碳纤维+复合钛', '100%强化高密度碳纤维+复合钛', 85.0, 85.0, 674.0, '-', '8.5度', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_226.html');
