insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VTD38VT-D38', Null, 'VOLTRIC集强大的力量和快速的首次球拍处理能力于一身，是寻求出色“全面”表现的球员的理想拍子。VOLTRIC独有的三通系统实现了强劲的打击和快速的球拍处理的结合，这是有史以来的第一次。VoltricD38是由Yonex根据Voltric系列球拍的技术和材料生产的中档球拍，以其在使用者和球拍的坚固性之间发挥威力的能力而闻名。较重的VoltricD38使得攻击更加有效，具有中等柔韧性的球拍主体赋予了中杆更大的力量，在杀球时落点更锐，更深，球拍的重量也很沉重。和稳定的抓地力。当球拍受到使用者挥拍的强烈冲击时，球拍不太容易振动，当球拍不与甜区接触时，几乎不会晃动或形变。球拍的设计非常醒目，令人印象深刻的红色和白色配色，球拍的顶部为浅金色，使球拍的红色和黑色更加突出。球拍适用于许多中阶选手，普通选手，均衡选手，半职业选手。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G4', '适中', 24.0, 24.0, '300±3mm', 'https://www.badmintoncn.com/cbo_eq/view_9254.html');
insert into detail values('羽毛球拍', '王子Prince', 'O3系列', Null, 2007, 'PRINCE的O3系列羽毛球拍使用的是同O3网球拍一样的技术，拍框用拱形设计的球框,减少了胶孔,增大了击球面积,减少空气阻力。\n图片中的是Red版，此外还有White，Blue，Pinke，Silver四种颜色。', '碳素纤维', '碳素纤维', 86.0, 86.0, 670.0, 'G5', '适中', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1613.html');
