insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS300', Null, 'MUSCLEPOWER---开启球拍的力量之门\nMUSCLEPOWER拱形线槽造就一体化效应，开启球拍的力量之门!\n拱形线槽结构系统将拍线支撑在圆拱形的线槽上，两个接触点被连接为一段接触弧面，不但有效消除应力，而且形成的紧密接触弧面大大增强了拍线与拍框的整体效应，从而增强球拍的整体稳定性和力量性能。\nMP结构\n拱形线槽系统让拍线处于攻击的有利位置，拱形线槽系统将拍线支撑在圆拱形的线槽上，两个接触点被连接为一段接触弧面，不但消除应力，拍线不易疲劳，而且形成的紧密接触弧面大大增强了拍线与拍框的整体效应，从而增强球拍的整体稳定性和力量性能。拍线张力保持在颠峰状态与YONEX的MP结构球拍相比，其他球拍的拍线张力在拉线后的很短时间内就出现明显下降，但MP球拍却仍然保持良好的张力状态即使在拉线后七天，MP结构球拍的线床仍然能够为扣杀提供强韧的反弹力。\n\n聚乙烯纤维：聚乙烯纤维拥有优异的粘性和吸震性，重量之轻足以浮于水面。将其用于ARCSABER10的拍杆中，使扣杀变得更有效，同时也获得出乎预料的吸震效果。\n\n镍钛合金：埋藏于球拍内部的镍钛合金丝，其功能就像一个能量电容器，能有效储存能量，在击球瞬间利用瞬态反弹效应将能量转化为羽毛球的爆发性速度。\n\n球拍加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。\n耐久拍框：盒式截面的拍框拥有很高的耐承载性，提供扎实的击球手感和精确的落地点', '高弹性碳素', '高弹性碳素', 89.9, 85.0, 675.0, 'G3,4,5', '中等', 22.0, 17.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3090.html');
