insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT50', Null, '在众多品牌球拍中都曾出现过的拍框护管，现在首次出现在了YONEX尤尼克斯的球拍上，搭载了威力三角护管的VT50，配以威力三角系统，巧妙的运用护线管构成的三角力体系，简单又有效的放大扣杀威力，给你双重攻击威力。\n同时，拍头处的威力三角护管，增加了拍框的重量和硬度，从而增加球拍挥拍势能，提升下压威力。\nVT系列纯正的威力三角系统，加上音频滤清器，能为球员提供扎实击球感，让你的杀球无比爽快。', '碳素+威力三角护管+音频滤清器+钨', '高弹性碳素+内置T形接头', 89.0, 80.0, 675.0, 'G4、G5', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10816.html');
insert into detail values('羽毛球拍', '佛雷斯FLEX', Null, 'Ti9', Null, '平衡：285±5\n特征：三、九点加TI网，加强强度、带MUSLE边框，能有效延长线的使用寿命．', '高系数碳素纤维', '高刚性碳纤维', 89.0, 85.0, 665.0, 'G2', '适中', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_857.html');
insert into detail values('羽毛球拍', '波力Bonny', '极限凤凰系列', Null, Null, '超窄边框：世界最细，超细边设计，边框最窄处达8.85mm，配合破风式框型设计，在保证拍框强度前提下，将拍框做到最纤细，挥拍时将空气快速导流，降低空气阻力，增加拍框灵活性于控制性，提高扣杀速度，增加球拍攻击力。超细边设计同时提升拍框密度，让挥拍快速，爆发力强劲，无沉重感。', '超高刚性40T碳纤维+纳米树脂', '超高弹性碳素+抗扭力碳素纳米管', 87.0, 85.0, 675.0, 'G4(常用)', 'M（主结构）适中', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5767.html');
