insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT9NEOVT-9NEO', 2014, 'ONEX尤尼克斯VT-9NEO羽毛球拍采用全新nanopreme科技，中杆弹性和强度的完美融合，拥有更细的拍杆，更灵活的操控性能，无与伦比！拍头的加强结构实现了将拍头弯曲在一个操控性极强的位置，使羽毛球跟线床接触时间更长，两侧纤细拍框更易弯曲让更多的能量传送到羽毛球上。这种组合让您在扣杀时体验瞬间爆发力。YONEX尤尼克斯VT-9NEO羽毛球拍采用加大拍框扩大甜区方形拍头设计：加大拍框，扩大甜区，在方形拍头的基础上再加上大拍框面积，可以进一步扩大甜区面积到34%，进一步改善非甜区击球的有效性。尤尼克斯原创的方形拍头，增加构成线床有效区域的横线和竖线数量，扩展击球甜区，即使是非甜区中心击球也能保持足够的精度和速度。YONEX尤尼克斯VT-9NEO羽毛球拍拥有攻击和操控完美结合三角威力系统：威力三角系统科技，很好解决了头重进攻好，但是防守的时候不够敏捷的问题，达到了进攻凶猛，出球灵活的特点，进攻的时候更加犀利，防守的时候游刃有余。全新的威力三角系统成功地将强大暴发性能和卓越的操控性能，这两个截然想法的特征完美地结合在一起，让您的技术得到充分的发挥。YONEX尤尼克斯VT-9NEO羽毛球拍采用单通道线孔设计，为每一条羽线安排独立的线孔，创造高性能的线床效果。YONEX尤尼克斯VT-9NEO羽毛球拍运用高强度一体化内置T型接头：深渊于拍框和拍杆链接处的内置T形接头，使球拍真正高强度一体化。此尤尼克斯专利技术让球拍兼备强大的力量性能和精确的控制性能。', '高弹性碳素', '高弹性碳素', 89.0, 80.0, 675.0, 'G4、G5', '硬', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8627.html');
