insert into detail values('羽毛球拍', '富力特FLEET', Null, 'F580', Null, '纳米树脂+高弹性系数碳纤维+编织碳纤维，塑造成了坚韧的拍框强度级操控性特佳的特征。\n低风阻L.A.D的超薄T型拍框以及超宽的顶框设计，除让球拍可快速挥击之外，更让杀球更具有威力。\n低风阻L.A.D采用新型NANOEPOTECHCOMPSTE纳米树脂材质与超高弹性系碳纤维，并结合T型拍框特殊设计，运用流体原理感念，更让球拍在快速挥击时，能降低拍面在空气中所受到的阻力，增加挥拍击球的速度。', '纳米树脂+高弹性系数碳纤维+编织碳纤维', '碳纤维', 84.0, 80.0, 675.0, 'G2', '-', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8873.html');
