insert into detail values('羽毛球拍', '久奈司JNICE', '弹力系列ELASTIC', Null, Null, 'ELASTICFORCE7000二代必买的理由…？\n升级2.0维持同级规格，却更易上手、更具宰制力\n核心三大特性，不容退让，一贯强悍的进攻特性！\n\n⭐️反重扭力X暴力提升\nY-TYPE强力支撑结构\n⭐️进攻小框X超立体边界\nOFFENSIVEXHYPERBOUND\n⭐️最狂吸震X高火力专用\nEXTRASLIM极细奈米层中杆\n⭐️借力反弹X遇强则更强\n奈米科技—NANOPEBBLE\n为强攻猛击而生的球拍，一击劈裂对手信心', '超高刚性碳纤维（H.M.Gaphite)/奈米珠plus树脂(NANOPEBBLE+)', '极致超细奈米层中杆(EXTRASLIM6.5mm)', 89.0, 80.0, 675.0, '-', 'Stiff(8.0~8.3)', 30.0, 30.0, '300±2mm', 'https://www.badmintoncn.com/cbo_eq/view_11287.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NRD28NR-D28', Null, '1、新型流体雕塑拍框：NANORAY纳米锐速系列优异性能背后的秘密--新型流体雕塑拍框采用独特的\n拍框结构，拍框沿框边从顶部到底部运用不同厚度。顶部的薄边结构降低空气阻力从而提升拍头\n挥速，底部的厚边结构结合高硬度材料产生极高的反弹力。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G4', '软', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10065.html');
