insert into detail values('羽毛球拍', '李宁Lining', '超导纳米系列', Null, Null, '个人购买这款球拍是在导购员的推荐下购买的，以前用的尤尼克斯的NS500，现在用这款感觉硬度也不错，速度比较快，我的力量还不错，打起来也不是很费力。这款球拍综合来说性能不错，性价比很好了。个人比较推荐这款！', '超刚性碳纤维+超导纳米', '超导纳米', 94.0, 85.0, 670.0, 'S2/S3', '软', 24.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4699.html');
