insert into detail values('羽毛球拍', '富力特FLEET', 'WOVEN', Null, Null, '除延续L.A.D.低风阻拍框设计外,WOVEN1000II更精细的调整了拍框侧面宽度,窄形顶框与T形部位保有灵活的操控特性,宽形的3,9点拍框则创造出比钛金属添加物更加沉稳的攻击下压力,精密的拍身比例与L.A.D.设计,再结合编织碳素(WOVENCARBONGRAPHITE)的强化,WOVEN1000II绝对是一支攻守俱佳的高张力球拍.', 'H+WOVENGRAPHITE', 'H.M.40T+WOVENGRAPHITE', 89.0, 85.0, 675.0, 'G2', '硬', 283032.0, 283032.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5844.html');
