insert into detail values('羽毛球拍', 'FZFORZA', Null, '302638', Null, 'FZFORZA不仅是高品质羽毛球装备制造商，也在羽毛球社群全球发展中扮演着重要的角色。Solibad和FZFORZA的理念互相影响，由此结成紧密的伙伴关系。Solibad的理念是推动羽毛球社群成立专项基金来支持包括世界各地儿童在内的羽毛球项目。\n\nFZFORZA通过一年提供1000支球拍和8%Solibad系列的销售收入来支持这个非营利组织的工作。', '碳纤维', '碳纤维+树脂', 86.0, 86.0, 675.0, '2', '适中', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10647.html');
