insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, 2009, '拍杆加长10mm\n拍杆加长10mm，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。\n\n3U轻型设计\n球拍采用轻型设计，仅重85-89克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限', '高碳+钨', '高碳+钨', 89.0, 85.0, 680.0, 'G4（周长86mm）', '较硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3528.html');
insert into detail values('羽毛球拍', '波力Bonny', '战神AE系列', Null, Null, '1.框采用刀刃式破风结构，在保证拍框强度前提下，将拍框做到刀刃般尖锐，扣杀时可大幅降低挥拍所产生之风阻。提高扣杀速度，增加扣杀时的破坏力。\n2.整支球拍二次成型，使用日本高刚性碳布制成：\n（1）提升拍框刚性→A.从容承受高磅数网压\nB.有效提升攻击系数\nC.提高击球瞬间，线的反弹能量\nD.强化拍框控制性，强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n3.高抗扭力中管：（1）提升中管扭力\n（2）强化中管弹性回复力\n4.拍内框3、9点内凹设计，增大甜区面积，扩大有效攻击区域，提升球拍的攻击力，同时单粒钉起到吸振效果，提高击球的稳定性。\n5.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n6.高档水晶后套，彰显球拍档次。', '高刚性40T碳素纤维+纳米树脂', '高弹性碳素纤维+抗扭力碳素纳米管', 88.0, 84.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3543.html');
