insert into detail values('羽毛球拍', '威克多VICTOR', '尖锋系列', '尖锋2012LONDONMX-2012', 2012, 'MX-2012球拍的拍框及中管材质\n采用Hybridcomposite复方聚合纤维技术，\n打破传统制程，\n结合物理特性相异的两种聚合物，\n创造刚韧并存的全新碳纤维拍框材质。\n\n奥运纪念礼盒套装内容：\n12G内存限量U盘，带有奥运会标志，彰显纪念价值。\n2GR240特制纪念握把胶，白色，市面上绝对买不到。\n3纪念绒布袋，更好的保护球拍，黑色的绒布套，带有2012LONDON标志。\n4NS-880TI羽毛球线，最新最好的胜利羽毛球线，硬度十足，进攻力度强。\n5时尚运动水壶，750ML的容量，蓝色款，很好看。\n6奥运会纪念毛巾，市面上买不到，绝对经典。', '复方聚合纤维+纳米树脂+强化叠织碳纤维', '超高弹性碳纤维+纳米树脂+7.2SHAFT', 89.0, 80.0, 675.0, '-', '偏硬', 4.0, 28.0, '偏重', 'https://www.badmintoncn.com/cbo_eq/view_8594.html');
