insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB10CAB-10', 2004, '1、在拍框上采用了YONEX专利技术MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n\n2、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量。', '高刚性碳素纤维', '高刚性碳素纤维', 94.0, 90.0, 664.0, 'G3/G4/G5', '硬', 22.0, 18.0, '288mm', 'https://www.badmintoncn.com/cbo_eq/view_8324.html');
