insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS-TOUR', 2009, 'YONEX2009年新品框型类似NS9000\n前沿新材料——X链富勒烯纳米碳素\n强大的吸引力源自产品本身。NANOSPEED纳米系列球拍的重要特色，是以不减少主要球拍物料的前提下，在保持拍框原有的高反弹性能的基础上，通过纳米工艺把球拍的重心后移，从而提升球拍的整体灵活性。而新一代纳米碳素材料“X链富勒烯”恰是把此原理的效能充分发挥，达到更优异的弹性和稳定度！\nX链富勒烯纳米碳素除了特有的球笼结构之外，更拥有四条放射状的碳链结构,形成碳素纤维之间的横向链结构，产生比以往传统粘结剂高10倍的分子结合力，使球拍增加5%的反弹性和提升了15%的稳定性。', '碳素', '高弹性碳素富勒烯纳米碳素', 89.0, 84.0, 674.0, 'G4', '硬', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2654.html');
