insert into detail values('羽毛球拍', '其它品牌Other', Null, 'kepotZX', Null, '新一代ZX-pro中杆抗扭提升了，拍框添加多一层碳布，工艺上去除原子灰，直接在碳素胚上上水标，减轻重量和免去原子灰和表漆干硬后对球拍弹性的削弱！球拍轻，弹性好，耐高磅能力强！\n框型：VT-ZF2框型', '碳纤维', '中杆46T角度纱提高抗扭', 89.0, 75.0, 675.0, 'G5', '6.4mm', 32.0, 32.0, '293-300mm', 'https://www.badmintoncn.com/cbo_eq/view_11233.html');
