insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '品牌:kepot系列:ULTIMATE型号:BT-70S材质:碳纤维颜色分类:黑拍版4UG5进攻型空拍送手胶黑拍版5UG5速度型空拍送手胶白色涂装版4UG5进攻型空拍送手胶白色涂装版5UG5进攻型空拍送手胶重量:80g(含)-84g(含)75g(含)-79g(含)拍柄粗细:G5拍杆硬度:硬适用对象:职业中高级(1000元以上)羽毛球打法分类:控球型(防守兼备)\n\n作为羽毛球器材的玩家和卖家，狄斯一直比较关注台湾生产的羽毛球拍，\n在观望5年、过手几百球拍样板之后，终于选定此款细中杆窄框型的球拍生产KEPOT品牌。\n选中这款的原因是其超乎想象的手感和超高的性价比', '高弹性碳纤维+纳米树脂', '碳纤维', 83.0, 75.0, 0, 'g5', '6.8mm硬', 30.0, 30.0, '295+-2mm', 'https://www.badmintoncn.com/cbo_eq/view_11247.html');
