insert into detail values('羽毛球拍', '威克多VICTOR', '亮剑系列', 'BRSDF60亮剑DF60', 2017, '菱形破风结构\n胜利BRS-DF60，拍框断面采用菱形结构设计，如利剑破风般的犀利，能有效的减少挥拍空气阻力提升击球灵巧性。\n7.0SHAFT中杆\n胜利BRS-DF60，采用7.0SHAFT中杆，材质采用碳纤维和树脂，具有低风阻，高强度的特性，减少羽球撞击羽线产生的震动，使挥拍更加迅速和稳定，提供高质量击球。', '碳纤维+树脂', '碳纤维+树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G4、G5', '偏软', 4.0, 23.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9917.html');
