insert into detail values('羽毛球拍', '威克多VICTOR', '亮剑系列', 'BRS09亮剑09', Null, '“狭路相逢，勇者胜！剑锋所指，所向披靡！！！”\n\n剑为百兵之君，是中国古代最传统的兵器，也代表着一种中国的文化，而亮剑精神则是胆识、勇气和拼搏的表现。VICTOR的“亮剑09”传承了中国古剑的理念，更重要的是它蕴含着这种中华民族的精神——逢敌必亮剑。\n剑走轻灵——快\n剑是一种讲究速度的武器，在中国，剑法一向以轻巧、灵动为主，轻而快是剑的特质。“亮剑09”继承了剑的这一特性，利用轻量化材质进行打造，并采用了如剑刃般边框的破风结构设计最大化降低了风阻，使球拍拥有更快的挥动速度。目前，羽毛球技术已经进入了速度的时代，快是克敌制胜的重要法宝，从反应到挥拍，都在在短短几秒的时间内完成，速度提高一分，击败对手的机会就更大一分。\n“亮剑09”的快不仅仅体现在挥动的速度上！该款球拍配备了加重的拍头和稍硬的中管并将平衡点前移，使其击球力度得到了最大化的提高，尤其在进攻时，结合高速挥拍产生的加速度，使扣杀球展现了速度与力量的完美结合。\n\n剑无虚发——准\n“小李飞刀，例无虚发”，在在古龙的小说中，李寻欢的飞刀之所以让人胆寒，靠的就是一个“准”字。羽毛球是一项技巧型很强的运动项目，在控制球的落点方面有着极高的要求，只有“准”，才能把握住场上的主动，形成有效的攻击。正如同高手对决，招招对人破绽，剑剑刺人要害，都是建立在“准确”的基础上。\n“亮剑09”的设计和材质，使球拍达到一种刚柔并济的境界，拥有着良好的扭力、韧度以及稳定性，从而使球手能够稳定准确的将球击打到预期位置。尤其在进攻中，准确的落点，加上犀利的杀球，让对手挡无可挡，防无可防。\n逢敌亮剑——狠\n面对比自己强大对手时，我们会如何选择？逃避？放弃？懦弱的消极比赛？还是亮出你手中之“剑”，与对手“决一死战”？\n赛场如战场，狭路相逢，勇者胜。李永波总教练总结的羽毛球技术的三字箴言中最后一个“狠”，不但是指球技打法要“狠”，更是对球员在场上气势的要求。\n当知道对立者不是自己的对手的时候，为出剑明知道自己不是对立者的对手的时候，为亮剑！人有气势，剑有剑气；人有气魄，剑有剑魂；人有气韵，剑有精神，在球场上，球拍就是你手中的长剑。每种球拍都有自己的独特气质，球拍与主人的气质相若，将发挥出惊人的力量。拍如其名，“亮剑09”就是这样一支以勇往直前的利器，如刀韧般的破风框型加之稍重拍头，能够制造出暴风骤雨般的攻势。此拍只适合球场上的勇者，如果你是一个在球场上敢于向对手“亮剑”的“剑客”，“亮剑09”绝对不会让你失望。\n古代剑客们在与对手狭路相逢时，无论对手有多么强大，就算对方是天下第一剑客，明知不敌，也要亮出自己的宝剑，即使倒在对手的剑下，也虽败尤荣。在球场上无论面对如何强大的对手，你只要敢于亮出手中这支勇者之剑，无论胜败，你都将是这个赛场上的英雄！\n\n后记——十年磨一剑\n2008年奥运会第一次在中国举办，而VICTOR也迎来了它40岁生日，“亮剑09”就在这个值得纪念的时刻“出鞘”了。\n和中国的羽毛球事业一样，VICTOR经过40年的风风雨雨，终于得到了蓬勃的发展。在这漫长的时间里，VICTOR经历了无数的苦难，但它总是勇敢的去面对，无论对手有多么强大，VICTOR始终都敢于亮出他们的“剑”。正式这种勇于“亮剑”的精神，陪伴这个品牌不断发展、壮大。\n“十年磨一剑”，“亮剑09”不但是VICTOR40年专业羽毛球装备设计、制造经验的结晶，还凝聚了这个品牌的文化，更体现出中华民族自强不息的精神。\n\n规格参数', '超高钢性碳纤维+纳米', '超高钢性碳纤维', 89.0, 80.0, 675.0, '-', '稍硬', 3.0, 2628.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1780.html');
