insert into detail values('羽毛球拍', '奥立弗OLIVER', Null, Null, 2007, '此拍是2007年6月OLIVER公司推出的新一代高科技产品。用METACARBON新一代高刚性碳纤维（进口）制造，METACARBON是OLIVER专利权所有，用METACARBON材料制造的球拍，除了具有高档球拍应有的水准之外，还有以下主要特色：1.重量超轻2.扭力值低3.稳定性佳4.刚性更高\n\n1.窄边方头低断面设计，甜区增大，两段式真空成型，加力效应明显；\n\n2.前套专利硅胶避震,减少25%震动；\n\n3.创新ConcaveTechnology增加球拍的稳定性,高钢性碳素纤维，拍结构更结实，中性拍，攻防兼备。技术含量高，材料精选配制，是攻击水平过渡期首选,业余高手之首选。', '高钢性钛碳纤维', '-', 85.0, 81.0, 670.0, 'G4（周长86mm)', '-', 30.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2947.html');
