insert into detail values('羽毛球拍', '高神Gosen', Null, Null, 2011, '配置：航空级复合树脂、碳纤维手柄、镍钴合金、三角形接口，雅文中杆，加长，M30。延续火红的设计,碳纤维增加手柄硬度,减轻球拍重量,专利三角型接口,加大甜区,增加防扭RO0STAERMET功效,专利镍钴合金和M30热敏碳素增加框架的硬度和稳定,提升球拍得爆发力,专利的二节式设计(雅文中杆),产生捷杀威力,减少杀球角度及提供足够的威力,中杆硬度适中,终极力量型与控球型球拍。購物節', '碳纤维', '碳纤维', 90.0, 86.0, 675.0, 'G5、G6', '-', 25.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10059.html');
