insert into detail values('羽毛球拍', '美津浓Mizuno', Null, 'XYST0173MTB90101', Null, '※TITANIUMTUBEJOINT(专利No.55919)拍框与中管接合处搭载钛金属管状装置抑制球拍框面变形，以提升操控性并减缓力量流失', '高弹性碳纤维', '高弹性碳纤维', 84.0, 80.0, 675.0, 'G5', '适中', 27.0, 23.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8693.html');
insert into detail values('羽毛球拍', '波力Bonny', '轻羽FT系列', Null, 2010, '1.超轻拍设计，体现波力工艺水平。\n2.特殊结构设计与搭配，在减轻重量同时兼顾耐用性与抗扭力，是一款工艺水平极高之球拍。\n3.超轻重量，搭配高平衡&加长中管特殊设计，让挥拍灵巧，又具有相当攻击性。\n4.中边框设计，击球有力，又不失轻巧。\n5.大平头拍面，增加击球面积。\n6.顶框波浪设计可延长球线的使用寿命，维持较久的网压、增加击球力量。\n7.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n8.外观采用最新开发镭射喷涂技术，让球拍底色透出镭射效果，靓丽新颖、提升质感，让球拍也成为装饰及搭配重点。\n9.闪银后套设计，让球拍更具活泼感。', '高质量碳纤维', '高质量碳纤维', 72.0, 72.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3057.html');
