insert into detail values('羽毛球拍', '亚狮龙RSL', Null, Null, 2011, '亚狮龙HEATM11-600羽毛球拍采用了T-区域技术，在TJOINT位置处额外增加了一组特殊结构性的强化力量技术，增强了手感，提高了控制以及击球的准确性，而且透过增加T区域的硬度结构，更容易感受每一次击球的信息，做出更有效的判断，击出更准确的回球。就算击球点有偏差都能够即使作出反应，作出更快的修正。“T-区域技术”配合“反回旋转力技术”及“特强高碳素纤维”，进一步加强了球拍反回旋转力的硬度。新科技组合不同机构的基层性碳素纤维及高碳素纤维，令球拍的抵御力大大增加19%，发挥更佳的能量及准确性。因为高密度多层石墨结构，因此成分的数量和位置的选择先得非常重要。太多会使球拍扩张力与承受力降低；太少会使球拍缺乏力量去承受冲力。在拍杆增加适当的反回旋力设计，能令拍子更耐久、更有伸缩力和回旋力。同时，球拍拍杆更细、拍子更轻巧，更增加了韧性，提高了力量和耐久性。伸缩扭力框是亚狮龙RSL品牌最新研究而成的一种特性设计，超幼柔韧性拍杆和适度平冲点的设计完美配合，令其在轻巧的拍杆中爆发更大的攻击力。（反向增容技术1）将X轴（横轴）及Z轴（前后轴）的击球点范围各增加了11%。X轴（横轴）上的改良加阔了最佳击球范围，击球时更容易达致最大限度的发挥。经过Z轴（前后轴）的改良后，加强了线原有的特性，令使用者在操控时能发出更大更强的力量。', '特强高碳素纤维', '特强高碳素纤维', 87.0, 85.0, 675.0, 'G5', '偏硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5039.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'VOLTRIC威力系列', 'VT200LTLCW', 2017, '2017年最新的YonexVoltric200轻型LCW：\nYonexVoltric200轻型LCW是2017年最新推出的。与VoltricLd200相似，这是一个更轻的版本。试想一下，如果使用TriVoltageSystem和头部较重的配置，则玩家只能获得75至79gms的球拍。球拍是采用LeeChongWei（LCW）的标志性风格开发的。与TriVoltageSystem一起开发，可以用稳定的球拍头为镜头提供令人难以置信的力量（感谢TankourJoint）。进一步地，改善了车架的空气动力学性能，从而减少了空气阻力，从而产生了致命的挥杆速度。YonexVoltric200LightLCW是功率和控制的独特组合。\nVoltric200LightLCW是一款头部重型配置球拍，其拍框由Hm石墨和钨制成，而杆身由石墨制成。它是一种可产生最佳推斥力和动力的柔性杆身球拍。球拍的主要USP是其重量。这是重量在75至79克之间的轻型羽毛球拍。想要使用最新球拍设计改进游戏的玩家可以尝试此Yonex球拍。\nYonexVoltric200轻型LCW的规格：\n1.球拍的重量约为75至79克。\n2.Tri-Voltage系统是Voltric系列的Yonex商标技术，旨在在粉碎时提供动力，同时玩家也可以快速处理球拍。\n3.Player可以承受19至24磅的弦张力（推荐的弦：YonexNBG99）。\n4.内置T型接头技术可提供稳定的T型接头截面，这有助于接头稳定性并确保准确的穿梭位置。\n5，球拍柔韧性好，可提供良好的斥力，可快速返回。\n6.Voltric200lightLCW具有等距框架形状。这种类型的形状可以扩大甜蜜点。我们都知道，扩大后的最佳位置球员可以发挥更大的力量击中中锋。\n7.车架横断面设计为Aero-Box车架。Aero-Box型形状的横截面可提供更好的空气动力学性能，从而提高摇摆速度。', '碳纤维+钨', '碳纤维', 79.0, 75.0, 675.0, 'G4', '-', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8894.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'DIAMOND钻石', Null, Null, '这是一支会腾云驾雾的羽毛球拍，如一只小白龙在惊涛骇浪里翻滚，时而又直冲云霄，看似轻巧的拍杆，却拥有无比的能量和攻击力！\n亚狮龙RSLX5--White白色羽毛球拍采用特别高碳素纤维，是目前最高级的高碳素纤维之一。加强特硬，应用于球拍中杆，扭力击球速度迅速提升21%。更灵敏，更容易操控，手感更佳。精确的设计能同时保持最佳的弹力及减低了回旋转力。手发出的力量通过球拍更有效地传递到羽毛球上。\n\n采用了T-区域技术，在TJOINT位置处额外增加了一组特殊结构性的强化力量技术，增强了手感，提高了控制以及击球的准确性，而且透过增加T区域的硬度结构，更容易感受每一次击球的信息，做出更有效的判断，击出更准确的回球。就算击球点有偏差都能够即使作出反应，作出更快的修正。“T-区域技术”配合“反回旋转力技术”及“特强高碳素纤维”，进一步加强了球拍反回旋转力的硬度。\n\n加强了额外的扭力控制，尤其在对场攻击时，能更准确地改变方向。额外的扭力控制，尤其在快速平抽快打攻击同时，能更准确地进行多方向攻击。', '-', '特强高碳素纤维', 88.0, 86.0, 675.0, 'G5', '硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4920.html');
