insert into detail values('羽毛球拍', '奥立弗OLIVER', 'AEROFIGHTER绝地战警', Null, Null, 'F-2羽毛球拍材料说明：\n\n一、整体：该球拍碳纤维采用100%进口原材料，世界一流碳纤维生产商----日本TORAY公司优质CARBON碳纤维。\n\n二、中管：40T高尔夫中管。“40T”是目前羽毛球拍行业最顶级的碳纤维，其主要应用于国防军事领域，民用配额极少，且成本高昂，生产技术要求高。因此目前也只有少数大品牌将其应用于羽毛球拍、网球拍，一些知名品牌的高端产品也逐步使用一定比例该材料。40T高尔夫中管，则是采用40T碳纤维+特殊配方之合成树脂，以电脑数控织纱设备，严密的专业技术精制成型，之后再经过严格筛选分类，最终用于羽毛球拍生产，工艺复杂而严谨。40T高尔夫中管管壁壁厚均匀、柔韧性特别好，故在击球瞬间，能够产生迅速反弹，借力使力，回球速度大幅提升！\n\n三、拍框：采用30T进口碳纤维+METACARBON钛碳纤维编织布，用采用最新内框整体波浪型拍框，框体扭力更好，更耐高磅，性能稳定，手感奇佳！\n\n四、其它配置：OLIVER二代矩阵聚能减震硅胶软前套；“T”型头两侧加装硬质加长型双连孔稳压护线钉；拍头两侧加装软质硅胶减震聚能稳压垫片，使球拍甜区的回球速度提升20%以上。', '高钢性钛碳纤维', '高钢性钛碳纤维', 83.0, 83.0, 670.0, 'G5', '适中', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3055.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', '突击100TK100', Null, 'victor胜利威克多羽毛球拍突击TK100单拍超轻碳素', '碳纤维+树脂', '碳纤维+树脂', 89.0, 80.0, 675.0, 'G4、G5', '偏软', 4.0, 23.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11189.html');
insert into detail values('羽毛球拍', '威尔胜Wilson', Null, Null, 2010, 'BLX的由来：BL代表玄武岩X代表9个非同凡响的专利科技BLX意为“完美手感”\n\n玄武岩是纯天然的火山岩，可被加工成极细的金色纤维。玄武岩纤维与Wilson威尔胜独有的KarophiteBlack纤维混合编制成业界最先进的球拍工艺。就像消音耳机消除不悦耳的噪音一样，玄武岩可将不合和谐的极端振动消解于矩阵过滤结构。Wilson威尔胜最新的球拍科技——BLX传递更清晰的反馈和更好的感觉。玄武岩融合其他9种因素，10项要素在BLX中融合成就完美手感。', '碳纤维', '碳纤维', 83.0, 83.0, 670.0, '29.3cm', '83g', 28.0, 23.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3146.html');
