insert into detail values('羽毛球拍', '傲仕RS', Null, 'RS3300', Null, '台湾傲仕RS三力系羽毛球拍精选------TP3300\n\n傲仕球拍是广东省省队专用球拍，台湾专业球拍.原装进口.这款经典tp-3300.材料是高弹性碳纤.外加镍钛合金/钛/克维拉纤维编织网.经广州多年的球迷使用.弹性与杀球一流.\n\n三力系(TRIPOWER)\n\n以全新研发的素材Tianium+Kelvar+NickleAlloy)钛+维克拉+镍合金纤维，编织成网料加在拍框的表层，提高及加强球拍的性能，发挥最佳效能。以高密度碳素制作，加入钛网强化球拍的抗扭力，加长的拍干及加大的平头拍面在拍型的设计造型上，优化球拍的机动性，利用高质量素材，制造产品的强攻性能。\n\n钛纤维---加速能量传输\n\n镍合金纤维---发挥能量记忆、动力回输\n\n维克拉纤维---加强动力反弹\n\n三者结合下，实验证明能达到：\n\n1．球拍强度-增加20%\n\n2．反弹力-增加18%\n\n3．抗扭力-增加15%', '高分子碳素外加镍合金/钛网/克维拉纤维编织网', '高分子碳素外加镍合金/钛网/克维拉纤维编织网', 89.0, 85.0, 674.0, 'G2', '硬', 28.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_883.html');
