insert into detail values('羽毛球拍', '艾迪宝ADIBO', Null, Null, Null, 'ADIBO艾迪宝高端球拍，采用全球复合材料顶级供应商日本三菱（Mitsubishi）提供的原材料，由记忆合金复杂的菱形晶体结构转变成简单的立方晶体结构，会发生形状回复的记忆，当记忆合金恢复原形时伴随产生极大的力，球拍的受力增强30%，扣杀力增强15%。', '镍+弹原装三菱钛丝', '镍+弹原装三菱钛丝中管', 86.0, 82.0, 675.0, '3u', '硬', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1902.html');
