insert into detail values('羽毛球拍', '美津浓Mizuno', Null, Null, 2017, 'PrototypesX-1是美津浓于2017年推出的全能手动，全重平衡球拍，也是公司的旗舰球拍，重85克，中等硬度球拍的身体和唯一略微沉重的头部，加上波浪形的斜角框架，PropotypeX-1因其全面性，良好的进攻性和缺乏防御能力而非常适合双打当击打单打时，X-1会支持很多背景力以及快速的桥梁切割和粉碎。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'G5', '-', 30.0, 30.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_9132.html');
