insert into detail values('羽毛球拍', '川崎Kawasaki', 'SUPERNANO系列', Null, Null, '适用类型：防守型\n轻盈、超控性又不失动力是球拍界一直追求的终极目标，超轻系列球拍采用流动的线条设计，尽可能的减少喷漆，尽可能保持碳素纤维原有的高性能物性，78克的超低极限重量，创造绝佳的手感。超轻系列：球拍重79克，非常轻，超控灵活，弹性佳，挥动不易疲劳。三角形破风三通，拍框更加稳定，同时降低风阻。1号小手柄，握感扎实舒适。T30主纱兼具硬度和更好的弹性，适合控制拉吊型选手。', '超高弹性碳素纤维+T40碳素纤维+纳米技术', '超高弹性碳素纤维+T40碳素纤维+纳米技术', 91.0, 87.0, 675.0, 'G1', '特软', 30.0, 28.0, '295±3mm', 'https://www.badmintoncn.com/cbo_eq/view_7398.html');
