insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP55MP-55', Null, '1、采用了新型弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更佳、爆发力更强；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n4、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩。', '高强碳素纤维MusclePower弧形筋力结构拍框线槽设计', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 9.0, 10.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9522.html');
