insert into detail values('羽毛球拍', '索牌SOTX', 'CP(宙斯盾)系列', Null, 2008, 'CP系列CP888（全球限量版）\n2008款全球限量个性独特，是现今最贵的羽毛球拍\nCOMMAXPOWER“宙斯盾”系列\n球拍抗冲击力强度比普通拍框增加5%，变形量增加20%\n独创波浪型内框设计\n推出forcepro原力减震技术\n为在保持SOTX球拍高拉磅数的特殊性能的前提下，最大可能保护使用者的身体健康，SOTX一直将减震、避震技术最为球拍研发的重点。该系列球拍，独创波浪型内框设计，改变了球拍受力时的波长和振动频率，通过forcepro原力减震技术，将大功率的振动频率，分散成更加容易被分解、消耗的小功率微集型震动，球拍受力更加平和、均匀，不仅使球拍的抗冲击力强度比普通拍框增加了15%，变形量增加了20%，更最大限度的缓解了拍线的高张力对使用者的影响，球员赛场拼杀无后顾之忧，挥洒更急自如。\n外层电镀\n该系列球拍采用最新电镀技术，用原本豪华汽车使用的高档金属漆来美化和装饰球拍，气度恢弘，卓尔不凡\n适用用人群:专业攻防型', '碳纤维', '碳纤维', 87.0, 83.0, 675.0, '2#3#', '8.5-9.0', 28.0, 28.0, '285-291mm', 'https://www.badmintoncn.com/cbo_eq/view_11071.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NANORAY锐速系列', 'NR7000LDNR-7000LD', Null, '这款尤尼克斯羽毛球拍采用优质石墨材料制成，可为您提供持久的性能。Yonexnanoray7000LD球拍结构增加了石墨或碳纤维层的厚度以获得高强度，这增加了框架的重量并使球拍难以操纵。这种工程过程让尤尼克斯能够在分子水平上灵敏地控制球拍材料的功能，从而建立高性能的分子键，创造出稳定、更薄、更坚固的大灯球拍。', '铝', '石墨、纳米网、碳纳米管', 94.0, 90.0, 675.0, 'G4', '-', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10163.html');
