insert into detail values('羽毛球拍', '波力Bonny', '战神AE系列', Null, Null, '拍框采用刀刃式破风结构，在保证拍框强度前提下，将拍框做到刀刃般尖锐，扣杀时可大幅降低挥拍所产生之风阻。提高扣杀速度，增加扣杀时的破坏力。\n拍内框3、9点内凹设计，增大甜区面积，扩大有效攻击区域，提升球拍的攻击力，同时单粒钉起到吸振效果，提高击球的稳定性。\n单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n高档水晶后套，彰显球拍档次。', '高刚性40T碳素纤维+纳米树脂', '高弹性碳素纤维+抗扭力碳素纳米管', 88.0, 84.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3542.html');
