insert into detail values('羽毛球拍', '川崎Kawasaki', Null, 'SABER2013', Null, '浮点止滑系统-球拍前套采用凸点设计，增加摩擦系数，辅助使用者精确控制网前球。纳米科技。\n超细结构，比一般拍框结构细20%，有效降低风阻，提高挥拍速度。\n40T高模数碳素纤维，密度是普通碳纤维额2倍，增加抗弯折性、韧性扭力指数有效提升28%以上可操作性。\n镍钛材料科技-具有形状记忆功能，耐磨抗腐大大减缓球拍疲劳延长使用寿命。', '40T超高刚性碳纤维+镍钛编织', '40T超高刚性碳纤维+镍钛编织', 90.0, 88.0, 675.0, 'G2', '适中', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6341.html');
