insert into detail values('羽毛球拍', '李宁Lining', Null, Null, Null, '流淌着蓝色高贵血统的羽毛球拍，它有一个绚丽的名字—李宁Flame火焰390。蓝色虽然不及黑色白色普及，却充满的沸腾的张力，注定将成为主流颜色。火焰系列羽毛球拍是李宁公司2010年上半年新推出的羽拍，可以说是李宁公司经历半年多时间在市场上的深入研究后，推出的重量级羽毛球拍，当然性价比也更加实在。此拍最大的科技亮点在于ASS风洞倒流增速系统，这完全是一次羽拍科技上的革新，这种技术不同于王子的Q3技术，而是李宁公司自己的专利，在球拍的5点和7点位置，增设ASS科技，降低风阻，提升挥拍速度。李宁公司对此拍的推荐语是：球拍挥动速度快，反映敏捷，适合速度快，擅长快攻的使用者。', '碳纤维', '立体编织碳', 89.0, 85.0, 675.0, 'S2', '偏软', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4255.html');
