insert into detail values('羽毛球拍', '艾迪宝ADIBO', Null, 'XT3000', Null, '艾迪宝ADIBO羽毛球拍X-TENACITY3000/航空钛杆\n(1)高拉力40磅：整支球拍可承受40磅高拉力的主要因素，采用了日本高T数碳纱，框型用窄线槽强韧结构设计，提升拍框强度，同时考虑到方形单粒钉的设计增加孔径强度及延长羽线寿命且不易退磅。\n(2)控制型球拍：平衡点靠中，拍框设计为流线型，低风阻，提升拉吊球精准度，使得网前球不失毫厘。\n(3)日本三菱钛丝中管：在中管中植入23根日本原装三菱钛丝，增加韧性及强度，提升抗扭力，提高回弹速度，使得选手攻击凶猛强劲，控制灵力精准。', '高碳纤维', '三菱钛丝中管', 84.0, 80.0, 675.0, 'G4', '硬', 40.0, 40.0, '290±2mm', 'https://www.badmintoncn.com/cbo_eq/view_10826.html');
insert into detail values('羽毛球拍', '美津浓Mizuno', Null, Null, Null, 'Mizuno美津浓Altrax81在拍框的3、9点位置，将拍框的破风面进行了两次扭转，形成了SwirlGeometry扭转拍框，特殊的碳素编织加工，使拍框稳定牢固，为暴力进攻提供了更大的张力和弹性。\nMizuno美津浓Altrax81的拍框采用了六边形破风拍框，兼顾了较好的破风速度手感，也兼顾了稳定扎实的控球型能，加强的T头连接处设计，搭配加大型的拍框设计，让球拍拥有更大甜区更稳定手感。', '日本超级炭', '日本超级炭', 84.0, 80.0, 675.0, 'G5', '适中', 30.0, 30.0, '295mm', 'https://www.badmintoncn.com/cbo_eq/view_6966.html');
