insert into detail values('羽毛球拍', '薰风kumpoo', '超轻系列', Null, 2019, '全能型球拍\n1：NANO材料，耐氧化，耐撞击性好。选用纳米级SIO2（二氧化硅），有效填充碳纱缝隙，提升耐磨能力，仅68g重量，薰风轻量化球拍。\n2：头框采用刃型断面设计，极大的提高球拍的稳定性和坚固度，提升对球拍扭力的支持，带来扎实沉稳的手感，大大增加使用者对球拍的操控感。', '超高刚性纤维碳纱与NANO材料', '超高刚性纤维碳纱与NANO材料', 70.0, 66.0, 675.0, 'G5（2#）', '适中', 28.0, 24.0, '300±5（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7919.html');
