insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS850', Null, '中端纳米系列球拍，拍杆硬，平衡型，无论单打还是双打都可使用。尤其适合那些提高级球友，攻守兼备，有利于掌握全面的技术，和NS800、500是同一系列和科技，性能上比NS800和NS500更偏向进攻，拍杆迎合和NS800基本一一致，但是比NS800平衡点高，有助于提高那些后场不足的球友的杀球手感', '高弹性碳素+纳米碳粒子', '碳素＋纳米技术', 89.0, 85.0, 674.0, 'G4（周长86mm）', '硬', 25.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2865.html');
