insert into detail values('羽毛球拍', '威克多VICTOR', '突击系列THRUSTER', 'TK50突击50', Null, '拍框采用复方聚合纤维＋纳米树脂，强化羽球拍材质，使球拍更轻、更坚固，有助于将挥拍力量高效率地转至击球能量，减少传递损耗。\n\n轻量化的材质，同时具有优异的坚硬特性，使挥拍更迅速。即使大力扣杀，也能保持拍框稳定，不变形，有效减少拍框晃动，提高击球质量\n，和扣杀威力，带来前所未有的攻击性能。', '复方聚合纤维＋纳米树脂', '高刚性碳纤维＋纳米树脂+7.0SHAFT', 89.0, 80.0, 675.0, '-', '适中', 28.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10686.html');
