insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NS2000NS-2000', Null, 'YONEXNS-2000羽毛球拍：拥有富勒烯碳素拍杆的纳米球拍。\n1、富勒烯纳米技术（NanoscaleFullerene）：在球拍中采用了富勒烯（Fullerene）纳米级树脂增进剂，将球拍材料的工艺和功能推进至分子级别；使用富勒烯可以构建起一个高性能的纳米级碳素复合材料体系，制造出比以往更稳定、更纤细、更强韧的球拍；轻松挥动NANOSPEED球拍，就能获得比普通球拍更快的速度和更大的威力。\n2、流体形拍框：降低拍框空气阻力，提高挥拍速度。\n3、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n4、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。\n5、实感框芯（SolidFeelCore)：通过在拍框空洞结构内部加注实感填充物，阻断击球时冲击造成的有害震动。', '碳素', '高弹性碳素+富勒烯纳米碳素', 89.0, 85.0, 674.0, '-', '适中', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10297.html');
