insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1、宽边拍框设计，适合攻击；小平头设计，在考虑风阻之余，增加拍面积\n2、小钢砲技术（CannonTechnique）：波力公司经过精密计算、排列与测试，开发出独家小钢砲技术，利用小钢砲技术搭配高刚性碳纤维的使用实现了球拍性能和手感完美结合。O88较一般球拍（72孔，竖线22排，横线23排）多16个孔位，使网线密度加大，增加击球甜区及提高网压紧度。经测算小钢砲技术有如下特点：\nA、羽线密度增加38.7%\nB、攻击力有效提升20%\nC、实际甜区增加20%\nD、有效提高网线紧度5~7磅\nE、网压有效维持时间增加20%，并同时增加羽线的使用寿命\nF、拍框重量减轻，增强控球性\nG、网线密度的增加能够显著提高网前球和切球处理效果', '高刚性碳纤维', '高刚性碳纤维', 84.0, 80.0, 675.0, '-', 'M（主结构）、H、S', 30.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2392.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO900ISO-900', Null, 'IsometricSwingPower900\n1、球拍采用了SPS摆动系统原理设计，不同的重量、击球感、平衡点位置，适合不同类型的球员；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大的击球力量；\n4、拍框还采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n5、球拍采用轻型设计，仅重81/87克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限；\n6、拍杆加长10mm，接球面加大32%，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球；\n7、拍杆采用超强模数碳素纤维制造，加强了球拍攻击力。', '高强碳素纤维', '超高强碳素纤维', 87.0, 81.0, 674.0, '-', '-', 20.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10429.html');
