insert into detail values('羽毛球拍', '其它品牌Other', Null, 'B2', Null, '以硼、碳、纤维二种质材不同的元素，运用传统基础工艺巧妙地溶入其中，此球拍为威尼克司研发团队最具经典之作。', '以硼、碳、纤维二种质材', '以硼、碳、纤维二种质材', 88.0, 84.0, 675.0, 'G', '中硬', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1705.html');
