insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'IOS65LIOS-65L', Null, '适合球员等级：适合攻防兼备的初、中级选手\n拍套：YonexISO系列全拍套\n产地：台湾\n\n一、破风Areo\n拍框采用流体力学形状设计，形似流线型飞机翼，可将空气阻力降至最低，挥拍时空气能更快地流过狐形表面，提高了挥拍的速度和击球的威力，适合防御打法\n\n二、方形拍头ISOMETRIC\n\n与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。YONEX研发的这种IsometricHeadShape大甜区球拍，让进攻型球员在当今激烈竞争的国际羽坛一直保持明显的领先优势。\n\n三、超大拍面\n在方形拍头球拍的基础上，再扩大拍框的设计，从而创制出MF超大拍面球拍。MF球拍比一般球拍拥有额外多34％有效击球面积，再配合特轻量和流体横断面拍框设计，从而为广大羽毛球爱好者量身定做了一种挥动更灵活，线床弹性更好的休闲娱乐型球拍。\n\n四、(内置合金接头Built-inT-Joint)\n用力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能\n\n五、3U轻型设计\n球拍采用轻型设计，仅重85-89克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限', '碳纤维', '碳纤维', 89.0, 85.0, 664.0, '-', '较软', 16.0, 14.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10850.html');
