insert into detail values('羽毛球拍', '阿迪达斯adidas', 'adipower(力量)', Null, Null, '推荐适用类型：单打-男子球员-力量进攻型打法\n中杆科技：\n-倒锥形威力中杆\n-纯纳米碳\n拍框科技：\n-双重加强型拍框\n-振动控制系统\n-控制性流线拍框\n-力量拱槽\n-终极精准78孔', '纯纳米碳、ZYLON超纤维、超精钛', '纯纳米碳', 94.0, 90.0, 675.0, 'G5', '偏硬', 28.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6037.html');
