insert into detail values('羽毛球拍', '波力Bonny', 'BONNY1982系列', 'LX82乌缺POWERLX82小龙虾', 2021, '空拍重量：86.5g\n线胶后重量：93.24g\n空拍平衡点：293mm\n线胶后平衡点：295mm\n球拍长度：675±1mm（中管212mm）\n中管粗细：7.22mm\n从波力经典乌缺1982一代基础修过来，手柄从G4变成了G5,中杆的的硬度从适中M改成了偏硬H-,拍框采用实心发泡填充。', '高刚性碳纤维+高分子填充', '40T高抗扭力中管，采用三次成型碳T头工艺', 91.0, 87.0, 675.0, 'G5', '偏硬', 30.0, 30.0, '295±5mm', 'https://www.badmintoncn.com/cbo_eq/view_9482.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '特色:快速+威力powerandspeed\n本拍由下列丹麥選手代言:A.Clark,P.Koukal,R.Vaughan\nPowerHelix\n让这项最快的运动变的更快速\n在球拍的中管上显眼的螺旋形PowerHelix科技结合HEAD验证过分布在拍头和T型接口部位的Metallix金刚材料，\n能提供更大的威力和操控。附加的能量框体科技确保最少空气阻力，使击球速度更快，威力和可操控性更强。\nPowerHelix独特的螺旋型结构与中管溶为一体，相较普通的碳素中管可增加56%的弹性。\n同时仍保持最大限度的操控性，PowerHelix提升弹性使得在快速击球时可以释放出极大的威力。\n由特殊设计成矩形排列的碳素材料结构和新型水晶金属合金制成。\nMetallix是目前最轻最坚固的一种新型材料，HEADMetallix的能量得到巨大的释放。\n新的微粒尺寸比普通金属威力小1000倍，进一步减小微粒间隔，提升球拍整体性能。\n高科技金属聚合物Metallix-新的微粒尺寸比普通金属微粒小一千倍，进一步减少微粒间隔，\n提升球拍整体性能-球拍材质变得更硬，更强和更轻，兼顾威力和舒适；\n在羽毛球拍产品中\n金刚科技由特殊设计的矩阵碳纤维和晶体金属合金组成。这种合金的威力转换成更坚韧的材料，提升性能。\n金刚的碳纤维夹层和T形接口部位融为一体。\nTopCap的握把顶部表面为平的，发球时提供绝佳的把持力，发挥最大的把手控制，还可以为快速反击提供最理想的操控。\nEnergyBody是一个把拍顶部11点钟到1点钟位置的拍框变细的结构设计，这样可以使减少空气阻力，加快速度，增强为例，操控性更灵活。', '70%高刚性碳纤维，30%碳纤维', '高钢性碳纤维，2件模具成型', 86.0, 86.0, 675.0, '55.89平方英寸', 'mediumflexible高弹性', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4278.html');
