insert into detail values('羽毛球拍', '李宁Lining', 'PM衡系列', 'AYPF030', Null, '正品李宁AYPF030-1PM衡系列高碳S2000羽毛球拍蓝色\n性能特点：李宁PM衡系列，是打法均衡的使用者的理想选择。采用适合的拍框和中管弹性，融合“李宁”独有的机翼恒定系统，使球拍性能在技巧型和力量型打法中都能保持本色，亦攻亦防，皆能发挥自如。', '碳纤维', '碳纤维', 94.0, 81.0, 670.0, 'S2（3.25英寸）', '适中', 26.0, 20.0, '300mm', 'https://www.badmintoncn.com/cbo_eq/view_10833.html');
