insert into detail values('羽毛球拍', '威尔胜Wilson', 'KFactor系列', Null, Null, '广告词：KFactor,KontourJoint,TopCap,方头，新全能型球拍，适用于对装备严格要求的球手的一款轻量型、高容错\n性能球拍，为寻求更多控球的单打球手而设计。\n\n个人体会：轻！290的平衡点，80g的重量，灵动性强，防守和网前小球的利器，软性中管非常适合初学者；发力差，后场球弱。', '石墨，碳纤维', '石墨，碳纤维', 83.0, 80.0, 674.0, 'G5', '软', 16.0, 16.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4366.html');
insert into detail values('羽毛球拍', '卡尔顿Carlton', Null, Null, 2008, '08年卡尔顿公司推出的新品球拍，参数可以用“强悍”来说明，与三菱公司共同开发的中杆，融合了现在尖端与传统的TIWIRE钛腕技术TI-line钛丝中管技术Woven航空编织技术，让其非常吸引别人注意力，相对于以前的型号，抗扭更可用纹丝不动来形容，真是一把难得的秀外慧中的球拍型号。\n平衡点：280-290mm', 'TIWIRE钛腕技术NanoResin纳米技术MP走线槽技术', '与三菱公司公同开发TIWIRE钛腕技术TI-line钛丝中管技术Woven航空编织技术', 87.0, 83.0, 675.0, 'G5', '硬', 30.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1276.html');
