insert into detail values('羽毛球拍', '李宁Lining', Null, Null, Null, '李宁UC3100羽毛球拍属于李宁“MP力系列”，适合进攻凶猛的力量型使用者。“MP力系列”球拍都拥有高平衡点、重拍头的特性，打击力量强。利用李宁独有的“多点复合碳纤维强化系统”，对拍框进行多角度碳纱加固及多层补强，不仅提升球拍中管弹性力量，更加强球拍的强度和耐打度，犹如凝聚万众之力，使进攻更为迅猛、凌厉！\n采用李宁独有的力学优化拍框和空气动力学截面拍框系统设计，经过力学优化的球拍，面对凌厉扣球，可扩大有效防守面积；击球速度也因为线床面积扩大、拍面反弹力增加而显著提升。李宁UC3100在涂装上神似N70二代和YY弓箭7，手感上也与N70二代相似，非常适合喜爱N70二代但又担心不能驾驭的球友！', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, 'S2', '中', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5112.html');
insert into detail values('羽毛球拍', '艾迪宝ADIBO', '碳素系列', Null, Null, '性价比非常高的CARBONPOWER碳拍系列，09年ADIBO主打系列，非常适合初学者。', '100%碳纤维', '100%碳纤维', 86.0, 84.0, 675.0, '3u', '硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1899.html');
insert into detail values('羽毛球拍', '阿迪达斯adidas', 'adipower(力量)', 'RK104501', Null, '中杆科技：\n-纯纳米碳\n拍框科技：\n-双重加强型拍框\n-振动控制系统\n-控制性流线拍框\n-力量拱槽\n-终极精准78孔', '纯纳米碳、ZYLON超纤维、超精钛', '纯纳米碳', 88.0, 84.0, 675.0, 'G5', '中等', 28.0, 20.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6038.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ARCSABER弓剑系列', 'ARC001JRARC-001JR儿童拍', Null, '儿童羽毛球拍\n\n1、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n2、实感框芯（SolidFeelCore)：通过在拍框空洞结构内部加注实感填充物，阻断击球时冲击造成的有害震动。（所有日本制造的球拍都有此功能）\n\n3、流体形拍框：降低拍框空气阻力，提高挥拍速度。\n\n4、内置T形接头（Built-inT-Joint）：深藏于拍框和拍杆连接处碳素纤维底层的内置T形接头，使球拍真正高强度一体化；此YONEX专利技术让球拍兼具强大的力量性能和精确的控制性能。', '碳素+纳米气弹簧', '碳素+内置T形接头', 79.9, 75.0, 620.0, 'G7', '软', 24.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10517.html');
insert into detail values('羽毛球拍', '肯尼士Kennex', Null, Null, Null, 'X39000SPEED羽毛球拍是HC2System技术球拍的拍子，其拍子设计与X39000PRO类似，带有柠檬黄色，看上去非常醒目。HC2System击败桥梁时，攻击强度提高6％，使玩家的攻击更加强大。\n这是一款综合性的手动球拍，具有中等头部重量（285+-3mm）\n重量仅为4U的X39000SPEED羽毛球拍重量仅为81-85克，非常合身，不太沉重，击打得很好，逃脱了。球拍的主体坚硬，纤细，因此在很好地处理球员和球员时，它非常灵活。\n球拍主体采用锥度轴技术，其直径从手柄到高踢点逐渐减小，因此从球员的手到球的力量将非常大。球拍非常棒且快速，保留了NanoAutoCure，NanoCarbonHotSpiral的动力辅助技术，因此消耗的能量更少。平衡球拍（平衡285+-3），但进攻能力（SMASH）很好。', 'CarbonHM+40TMicroCarbon热熔胶', 'CarbonHM+40TMicroCarbon热熔胶', 84.0, 80.0, 673.0, '-', '-', 30.0, 22.0, '283-288mm', 'https://www.badmintoncn.com/cbo_eq/view_8976.html');
