insert into detail values('羽毛球拍', '波力Bonny', '钛装甲系列', Null, Null, '1、宽边拍框设计，适于进攻；大平头设计，增加拍面积\n2、波力成功将“纯钛”加工成“纯钛片”，再与碳纤维做特殊贴合技术处理，首次将一般脆弱的顶框加上了“钛装甲”\n（1）顶框重量增加：力量与速度效能的显著提升\n（2）顶框刚性与强度大幅提升：增强线孔拉力，成功达到高穿线磅数要求\n（3）钛装甲的重量与质量的均匀分配：挥拍时增加拍框之稳定性，并强化扭力，减少翻机率\n3、拍框采用高刚性碳纤维：\n（1）大幅提升球拍扭力，使得击球与控制更加精准\n（2）大幅提升钛装甲之效能\n（3）提升击球手感\n4、采用独家最新喷镀技术，用原本豪华汽车使用的高档金属漆来美化和装饰球拍，气度恢弘，卓尔不凡', '高刚性碳纤维+Ti片', '高刚性碳纤维+Ti片', 90.0, 86.0, 675.0, '-', 'M（主结构）、H、S', 30.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2380.html');
