insert into detail values('羽毛球拍', '其它品牌Other', Null, '海德PowerHelix10000', 2009, '主要技术：PowerHelix\n在球拍的中管上显眼的螺旋形PowerHelix科技结合HEAD验证过分布在拍头和T型接口部位的Metallix金刚材料，能提供更大的威力和操控，增加57%的力量。附加的能量框体科技确保最少空气阻力，使击球速度更快，威力和可操控性更强。由特殊设计成矩形排列的碳素材料结构和新型水晶金属合金制成。Metallix是目前最轻最坚固的一种新型材料，HEADMetallix的能量得到巨大的释放。新的微粒尺寸比普通金属威力小1000倍，进一步减小微粒间隔，提升球拍整体性能。', '80%高刚性碳纤维，20%碳纤维', '高钢性碳纤维', 88.0, 88.0, 675.0, 'G0(31&#8260;8)G1(32&#8260;8)G2(33&#8260;8)G3(34&#8260;8)', '中硬', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3133.html');
