insert into detail values('羽毛球拍', '其它品牌Other', Null, 'AAADONEX亚多力斯', 2011, 'TRANSFORMTECW5百变系列球拍是全方位设计，球拍材质是采用纳米高碳素纤维+WOVEN编织碳纤维制造，塑成了坚韧的拍框强度及拉力，提高了扭力，使操控性特佳。配合可随时调整重量之专利球拍，拍框头重、头轻之特色，使球员更能强力快速攻击与稳定灵活回防。', '超高钢性碳纤维40吨+WOVEN', '超高钢性碳纤维40吨+WOVEN', 90.0, 88.0, 674.0, '160mm', '适中', 3.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5484.html');
