insert into detail values('羽毛球拍', '迪卡侬Decathlon', Null, 'BR900V', Null, '椭圆型空气动力球框\n这款创新的“椭圆型空气动力球框”可调整框架形状，使其更符合空气动力学，从而获得更好的击球速度。\n这款创新的"纤细拍杆"是一款符合空气动力学的球杆，可提升击球速度及力量。', '碳纤维', '碳纤维', 76.0, 76.0, 675.0, '-', '硬', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8604.html');
