insert into detail values('羽毛球拍', '尤尼克斯YONEX', '其它系列', 'AR77', Null, '1、球拍控制灵活性较好，击球及杀球效果极佳；\n\n2、采用破风式设计之宽体球拍，拍框为空心而形似流线型飞机翼，以减小风之阻力，拍框设计较薄而宽，比传统球拍薄11%，宽26%，造成破风式之效果；\n\n3、破风式设计宽体球拍可增加22%的攻击力。', '碳素纤维', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 18.0, 15.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9540.html');
