insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB-8400', Null, '由于是BOX拍框所以耐打，质量稳定，小拍面挥拍速度快，要求较高。\n产地:台湾\nCARBONEX系列---造就了一代又一代的职业冠军\nCarbonex系列球拍的盒式横断面拍框设计,拥有极佳的拍面稳定性和极高的承载耐久性。当准确的甜区中心击球时，能产生响亮的击球声和反馈扎实的击球手感，为球员提供落点极其精确的回球。现在，更增加了许多先进要素，更使其历久常新。因此，有众多的职业球员对Carbonex系列情有独钟。', '碳素纤维+镍钛合金', '碳素纤维', 94.0, 90.0, 664.0, 'G3,G4,G5', '中柔', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6481.html');
