insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'TI7', 2002, '作为YONEX2002年的新产品之一，在Ti系列中性能、结构、材料仅次于Ti-10，性价比较高。该拍采用了新型MusclePower弧形筋力结构拍框线槽设计，结合了Ti系列和MP系列的特点，有效地提高了拍框头部和羽线的耐久性，主色调为宝石蓝，手感轻而舒适，很适合喜欢轻型球拍的球友选用：\n\n1、在拍框上采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n\n2、采用了新型MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n\n4、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n\n5、拍框中部采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n\n6、拍框端部和靠近接头部分采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n\n7、直径7毫米超细拍杆，弹性好，攻击力极强，防守及进攻的效果极佳。', '碳素纤维+钛网配重', '碳素纤维', 89.0, 85.0, 664.0, '664mm(拍身长度+拍柄尺寸)', '中硬', 22.0, 17.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2962.html');
