insert into detail values('羽毛球拍', '波力Bonny', '火山系列', Null, Null, '1.整支球拍二次成型，使用日本高刚性碳素原料制成：\n（1）提升拍框刚性→\nA.从容承受高磅数网压\nB.有效提升攻击系数\nC.强化拍框控制性→强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n2.内框3、9点处采用火山锥凸粒设计：\n（1）提升拍框的刚性，承受更高穿线磅数\n（2）提高球拍抗扭力，提升击球时的稳定度\n（3）有效提升球拍耐冲击力\n3.箱型结构设计，提升球拍击球表面的稳定性，增强拍框抗扭能力，从而提升选手的控球性和击球精确性。\n4.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n5.雷射炫采设计，提升外观质感，不同角度看过去皆有不同雷射效果\n6.水晶后套，彰显球拍档次。', '高抗压性碳布头框+纳米树脂', '高弹性碳素纤维+抗扭力碳素中管', 91.0, 87.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3545.html');
