insert into detail values('羽毛球拍', '阿迪达斯adidas', 'precision(精准)', Null, Null, '推荐适用类型：全面型打法-女子/青少年球员\n中杆科技：纯纳米碳、本能感应柄盖\n拍框科技：\n-双重加强型拍框\n-振动控制系统\n-力量拱槽\n-精准76孔', '纯纳米碳、ZYLON超纤维、超精钛', '纯纳米碳', 85.0, 81.0, 675.0, 'G5', '偏软', 25.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6045.html');
