insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO90VFISO-90VF', 2002, 'ISO-90VF是YONEX2002年的新产品之一，是ISO-97VF的替代产品。VF即“Vari-Frame”，意为AR、CAB二合一拍框。\n1、在拍框内侧采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n4、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力；\n5、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性；\n6、球拍采用轻型设计，仅重85-89克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限。', '碳素纤维，钛金属网眼结构', '碳素纤维', 89.0, 85.0, 664.0, '-', '适中', 18.0, 14.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8345.html');
