insert into detail values('羽毛球拍', '肯尼士Kennex', Null, Null, Null, '独有的“动力技术系统”(Kineticsystemtechnology)\n拍子是加长杆，头加重，秆子比较软，最多是YY的硬。和AT700差不多。扭力很小，做工好。\n出球速度不算快也不算慢。和重头高端YY出球速度差不多，但是由于软，手感很柔和也很好借力，但是出球很利索很快。弹性好。\n拉后场分球很容易，指向性也很好。出球线路也容易控制。可以和YY分球和指向性最好的高端YY比。\n网前控制不错，速度也不错。\n进攻非常的猛，又快又重，和AT700一样狠，甚至更狠。可以达到YY最好的水平。但是很容易发力，点杀也好。没有一般软拍的发力上限。\n我认为Ti-Tanium-Xl的设计非常大众，性能好又容易使用。打的好的可以用，打的差的也可以用。力量大的可以用，力量小的可以用。双打可以用，单打也可以用。没有任何短板，各方面性能都好，可以达到YY的最好的水平。用起来一点也不累，不需要太多的发力。不错不错。价格便宜，才400。', '碳纤维', '碳纤维', 0, 0, 675.0, '31/4', '硬', 26.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3259.html');
