insert into detail values('羽毛球拍', '初应TRUEiin', '裸的拍系列', 'IN01A', Null, '为了让任何人都可以轻易上手使用，TRUEiin概念拍代号”IN01-A/全能”因此成型!消光白的设计，低调明确的当代风潮。#降低风阻系统双边引导风向的特殊双破风系统，增加挥拍速度!拍头局部加重，使挥拍更加稳定!#特殊中杆设计42T国防用超高刚性碳纤维+奈米树酯+强化编织纤维让挥拍的延展性及回复性大幅提升，超高扭力、打感倍增!#环保无水标概念无墨后套、去水标，环保诉求无印刷，一起减低自然负担', '碳纤维', '碳纤维', 89.0, 80.0, 675.0, 'G6', '-', 4.0, 28.0, '295-300', 'https://www.badmintoncn.com/cbo_eq/view_8085.html');
