insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, 2011, '最受欢迎的凯夫拉健将级球拍，88孔空气动力学拍框设计，比普通球拍增加30%以上击球力量，头重（平衡点295mm）杆特硬，进攻性超强，适合进攻型球员。', '40T凯夫拉加强型超刚性CNT碳素纤维，宽体，超力量型，半CF', '40T凯夫拉加强型超刚性CNT碳素纤维', 88.0, 88.0, 674.0, 'G5', '特硬（5）', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4950.html');
