insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP25MP-25', 2004, 'YONEX2004年产品，结合了ISO-80VFS、ISO-90VFS和MP系列产品的特点。\n1、采用了新型MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n\nYONEX羽球拍MPF波浪形拍框线槽\n2、在拍框内侧采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n\nYONEX羽球拍钛的特性\n\n3、拍框两侧中部采用了新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳；\n\n4、拍框形状为ISO方形，扩大了拍面的击球甜点区域。与传统球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度：\nISO方型\n\n5、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能：\n\n内置T型接头\n6、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力；\n\n破风式流线型设计拍框\n7、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性；\n\n盒式截面设计拍框\n8、拍杆加长10mm，有助于球员伸延其接球范围，并能击出强而有力的高角度杀球；\n\n9、拍框T型部位两侧特殊双连钉护线管设计，避震效果好，更好地控制击球的准确性，保持拍面的稳定性和拍身的平衡性。', '碳素纤维+钛网眼+MusclePower弧形筋力结构拍框线槽设计', '碳素纤维', 89.0, 85.0, 674.0, '-', '偏软', 18.0, 14.0, '295±3mm', 'https://www.badmintoncn.com/cbo_eq/view_9206.html');
