insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', 'MP24MP-24', Null, 'YONEX2003年产品，结合了ISO-90VFS和MP系列产品的特点。\n1、采用了新型弧形拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n2、在拍框内侧采用了新型钛网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n4、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力；\n5、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性；\n6、拍杆加长10mm，有助于球员伸延其接球范围，并能击出强而有力的高角度杀球；\n7、拍框T型部位两侧特殊双连钉护线管设计，避震效果好，更好地控制击球的准确性，保持拍面的稳定性和拍身的平衡性。', '碳纤维', '碳纤维', 89.0, 85.0, 674.0, '-', '中柔', 8.0, 14.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7556.html');
