insert into detail values('羽毛球拍', '威克多VICTOR', '旋风系列', '旋风21', Null, '球拍特征：创新无间断螺旋缠绕技术的新一代SPIRALWIND球拍中管，制程全计算机程序控制，稳定性更优于一般中管，抗扭性能提升12%，抗压强度提升9%，耐冲击性能提升15%，耐疲劳性能提升35%以上,抗震性能和反弹性能得到极大提升，打感更扎实，响应更灵敏。搭配超低截面破风拍框，极大减小空气阻力;均等化SQUAREHEADSHAPE方形拍头技术的76孔穿线模式，将击球甜区面积再增加10%，挥拍更劲力、迅捷、精准。', '超高刚性碳纤维+纳米技术', '超高刚性碳纤维+SLIMSHAFT+纳米', 89.0, 80.0, 675.0, '-', '硬', 4.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2766.html');
