insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, 'HEADMetallix是目前最轻最坚固的一种新型材料，由特殊设计成矩形排列的碳素材料结构和晶体金属合金制成，新的微粒尺寸比普通金属微粒小1000倍，进一步减小微粒间隙，提升球拍整体性能，更小的密度，更强的材质\n\nHEADMetallix被填充在羽毛球的拍头和T-joint位置，和Metallix10000tour8000tour和6000tour的拍头2.5.7和10点钟位置和Metallix4000Tour和8000TOur的2点和10点钟位置，结果是非常坚硬，耐用和抗扭力强的拍框，从而提升速度，威力和准确度\n\nEnergyBody是一个把球拍顶部11点钟到1点钟位置的拍框变细的结构设计，这样可使减少空气的阻力，加快速度，增强威力，操控更灵活。\n\nTopcap的握把顶部表面为平的，发球时提供绝佳的把持力，发挥最大的把手控制，还可以为快速反击提供最理想的操控', 'metallix，HMG', 'metallix，HMG', 94.0, 80.0, 675.0, 'G3—G5', '中软', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2320.html');
