insert into detail values('羽毛球拍', '肯尼士Kennex', Null, Null, Null, '此拍连续11年赞助国家青少年羽毛球队、福建羽毛球队、江苏羽毛球队、四川羽毛球队、广西羽毛球队。\n此拍带全拍拍套。\n制作：80年代PROKENNEX787原版毛胚＋原班技术人员制作，使用当今顶级的碳素材料，在最先进的羽拍生产线上，用最严格的技术指标制作，力求复刻当年的经典手感。', 'TORAY特供高密度碳素纤维', 'TORAY特供高密度碳素纤维', 89.0, 85.0, 664.0, 'G2(约合日本标准G4-5)', '-', 9.0, 10.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1720.html');
