insert into detail values('羽毛球拍', '威克多VICTOR', '脉动系列', Null, Null, '超高刚性碳纤维加WOVEN编织钛精心打造的SUPERTi系列球拍，最大限度地发挥了钛金属所具有的高强度和高硬度性能。不仅提高了球拍的耐打性，还把瞬间击球对球框产生的冲击力消弱到最低限度。有效的平衡冲击扭力控制拍面的稳定性和落球点的准确性。当球未打在甜区时，球拍不会有较大的扭曲也不需要用很大的力量控制球拍，这样回球的速度和方向就不会有很大的偏离。\n\n1、宽边传统圆头框型，特殊断面设计，中管加航空钛，抗扭力强；\n\n2、特殊握把材料，耐磨，粘度佳，吸汗性特强；\n\n3、新式橡胶环握把胶，3D立体材料，防脱落后套设计；\n\n4、拍框T型部位两侧特殊双连钉设计，避震效果好，更好地控制击球的准确性，保持拍面的稳定性和拍身的平衡性；\n\n5、适合高磅数，属攻击型球拍。\n\n\n拍框T头三通两侧部位采用双连钉护线管设计当击球回应时，产生的瞬间冲击力大多通过中间竖线传递到拍框，对拍面的稳定性产生影响，双连钉设计有效的避免这总冲击现象。就象在棚紧的网线与框架间垫加了橡胶皮圈，将冲击力分散转化，有效减少震动，没有双连钉的的球拍将网线拉力承托在孔边上，击球时的震动直接作用在球框，对拍面的稳定性和拍身的平衡产生影响。而带双连钉设计的球拍，使拍线和球框之间的接触面积增大，减少拍线在使用过程中有害应力，将击球的冲击力有效的分散转化，并使拍线和拍框形成一个整体。', '超刚性碳纤维+WOVEN编织钛（航空材料）', '超刚性碳纤维+WOVEN编织钛（航空材料）', 94.0, 80.0, 665.0, '-', '硬', 9.0, 12.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_52.html');
