insert into detail values('羽毛球拍', '迪卡侬Decathlon', Null, Null, Null, '杆身硬度适中，完美结合球拍的力量性和精准性操控性\n球拍轻盈，仅89g，平衡点居中力量\n平衡点居中,完美结合球拍的力量性和操控性', '碳素', '碳素', 89.0, 89.0, 665.0, 'G2', '适中', 22.0, 19.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4185.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, 'SILIKFALCON/猎鹰6000头重设计高性能的羽毛球拍，打控球和网前球尤其出色，适合职业级、中高级、力量较大的或者对进攻有偏好的选手。采用德国最新的纳米技术。球拍的强度以及轻量化都有了飞跃性的提高。手柄处，超柔、防滑、吸汗；让你不仅能够有效地避免运动损伤外，还能有一个舒适的竞技体验。', '全碳素', '全碳素', 89.0, 85.0, 675.0, '-', '偏硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10292.html');
