insert into detail values('羽毛球拍', '威尔胜Wilson', 'N系列', 'N2T8652', Null, '球拍推荐：进攻型羽拍.本款球拍适合高级水平的男女球员。\n\n重要科技：\n\n1、NCODE科技：Wilson运用纳米技术制造羽毛球拍，球拍经过NCODE制程，纳米级的二氧化硅晶体渗透到超钢性碳纤维的空隙间。这种在碳纤维的分子键基准上进行的调整，巩固和增强了碳素纤维的稳定性和强度，因此，NCODE科技的球拍比一般球拍多2倍的耐用性，2倍的稳定性和增加22%的威力。\n\n2、nTurboZones拍框设计其优点：*、增加2.8%较大穿线区（56.37*s54.28平方英寸）。B、更均衡的线床弹性，控球性更佳。C、非甜区击球更具威力；穿线孔较小、较小重复线孔（8vs20-24）让拍框更耐用且可穿较高磅数。\n\n3、Iso-sorbEvelet组合型护线管，能有效调节球线的张力，使球拍最佳击球区的弹性更均衡！\n\n4、包覆式三通设计：使球拍抗扭力更佳、控球更好，非甜区击球威力更大。\n\n5、改良“火山型”威力前套：最新专利科技！提供了中管更低的反折点，更长的反折距离（力臂），从而增加球拍的反弹速度和威力。\n\n6、THERMOGUARD隔热防潮科技：在高温下可以降低湿度及温度，保护球拍。', '超钢性碳纤维/碳纤维', '超钢性碳纤维/碳纤维', 90.0, 86.0, 674.0, '-', '中等弹性', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1442.html');
