insert into detail values('羽毛球拍', '佛雷斯FLEX', '刀剑羽拍系列', 'sp21', Null, '采用科技\n一、拍框采用减震舒适型球拍头框:1、犹如汽车悬吊系统设计保护头框2、能使球线反弹加快球速加快3、球拍减少震幅手感更舒适4、增加羽毛球拍及羽线的使用期限\n二、拍杆采用非常特殊椭圆管与圆形管的结合，外观特点明显，易反弹且反弹力强，使击球时的速度加快，提高抗扭力道，使球的落点更精确，采用刀剑结合设计，拥有更好的控球性！\n三、握柄采用模具化设计，电脑规化制作，手感舒服。', '超高刚性碳素纤维', '高刚性碳素纤维', 89.0, 85.0, 675.0, '5g', '软', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6830.html');
