insert into detail values('羽毛球拍', '索牌SOTX', 'TI(钛)系列', 'Ti7', Null, '平衡:288±5mm\n\nTI系列特点：\n1.索牌TI系列两点回应支点：一处是与传统球拍相同的位于中管的回应支点，另一处则提升至份更为接近拍框处，钛金属处使球拍的控球稳定性及精准度得到提高，从而令球员的水平获得更充分的发挥。\n\n2.索牌TI系列/真正意义上的钛动力：传统羽毛球拍通常以钛网的形式运用于拍框或中管，对球拍仅起点缀作用，而SOTX的TI则在三通处实实在在的采用整块钛金属,使球拍的制作工序由二段成型变成三段成型,提高了球拍的稳定性和击球的准确度。\n\n3.索牌TI系列二次击球，钛金属的屈服极限与弹性模量比值大，驱使钛成型时的回弹力较其他金属大。加之钛的记忆功能，从而使索牌TI系列球拍在击球瞬间做到二次发力，二次击球，使球拍的击球威力成倍数增加。', '碳+TI', '碳+TI', 86.0, 82.0, 665.0, '-', '8.5-9.0', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_524.html');
