insert into detail values('羽毛球拍', '红双喜DHS', Null, Null, 2017, '红双喜CQ10采用黑色亮光烤漆，灵动顺滑、手感细腻；搭配淡蓝色镭射水标，炫彩夺目。球拍整体气质高雅沉稳，散发着深邃的质感和科技感。超轻5U、6U级克重，速度更快，轻松掌控全局；经典的76孔设计，适合攻防型打法的流体框型，攻守兼备，有助于快速挥拍，提升击球效果；方形拍头增加线床有效面积，扩大击球甜区。拍体采用高弹性碳纤维（24T+30T），提供更好的回弹性能，击球后迅速恢复形状，让你击球时获得更多借力。添加热熔树脂材料，树脂分布均匀，碳纱排列精密，增加拍体韧性，击球手感更佳。', '高弹性碳纤维', '高弹性碳纤维', 79.0, 75.0, 675.0, 'G2', '硬', 26.0, 22.0, '290-295mm', 'https://www.badmintoncn.com/cbo_eq/view_10099.html');
