insert into detail values('羽毛球拍', '红双喜DHS', Null, Null, Null, '记忆性碳纤维是红双喜在碳纤维成型树脂配方上的又一个功能性突破。传统的碳纤维成型树脂配方往往过分重于对“硬度”性能的提高，而忽视了“韧度”性能，以至造成碳纤维抗击能力的脆弱性。M390(记忆性碳纤维)正是通过对碳纤维成型树脂配方的优化改良，增强碳纤维成型后的“韧度”性能，使其在受到外部冲击市能迅速缓冲压力并迅速还原。实验证明，记忆性碳纤维能有效增强25%的韧度(更耐用、更高反弹)', '记忆性碳纤维', '记忆性碳纤维', 89.0, 80.0, 674.0, 'G2', '软', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2362.html');
