insert into detail values('羽毛球拍', '波力Bonny', Null, Null, 2006, '1、中边框拍框较硬增加击球稳定性,挥拍顺畅,反应灵敏。\n2、中边框大平头，拍面大，加大击球区\n3、顶框波浪设计可延长球线的使用寿命，维持较久网压，增加击球力量。\n4、采用独家最新炫彩设计，使球拍在满足使用功能的同时满足使用者的审美需求。', '高质量羽拍专用碳纤维', '高质量羽拍专用碳纤维', 87.0, 83.0, 670.0, '-', 'M（主结构）、H、S', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2377.html');
