insert into detail values('羽毛球拍', '亚狮龙RSL', Null, Null, 2007, '钻石冈技术骨架加强20%坚硬度\n增加更多力量拍打杀球点\n特大杀球范围\n更好控拍感觉\n加强球线张力', '高密度碳素', '高密度碳素', 86.0, 84.0, 675.0, 'G5,G3', '渐进中硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2151.html');
insert into detail values('羽毛球拍', '波力Bonny', '扣杀系列', Null, 2010, '1.破风式框型，利用空气动力学原理设计，降低球拍挥拍风阻，提高球拍击球速度和击球爆发力。\n2.顶框与3、9点波浪设计可延长球线的使用寿命，维持较久的网压、增加击球力量。\n3.中边框设计，击球有力，又不失轻巧。\n4.小平头设计，在考虑风阻之余，增加拍面积。\n5.中管加长，增加力臂，加强攻击力。\n6.适合攻守平衡型打法选手选用。\n7.闪银后套设计，让球拍更具活泼感。', '高质量碳纤维', '高质量碳纤维', 84.0, 84.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3059.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'Ti系列', 'TI2', Null, '1、在拍框内侧采用了新型钛金属网眼结构技术，由于新型材料钛比碳素纤维强度硬度都高出许多，给大力击球提供了更高的稳定性和较小的扭矩。钛网眼部位长度：三个线孔范围；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n4、拍框还采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力。', '碳素纤维，钛金属网眼结构', '碳素纤维', 89.0, 85.0, 664.0, '-', '适中', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9339.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '脉动系列', '998', Null, '.拍框顶部特殊钛合金，球拍内框凹槽结构2.均等化方头能提供多32%的有效击球甜区，即使羽毛球偏离线床中心区的连续式扣杀，也能保持响应的精确和速度。3.特殊方形框面结构设计', '高钢性碳纤维+纳米', '高钢性碳纤维+纳米', 89.0, 80.0, 675.0, '285±5mm', '适中', 26.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1857.html');
