insert into detail values('羽毛球拍', '鹰牌EAGLE', '兵器系列', 'E77', 2012, '专业级的比赛、训练拍-鹰牌的E77：2012互联网特供羽球装备，攻守兼备，扣杀有力，简约大气外型，轻便结实，高刚性碳纤维，增强球拍强度、抗扭性，世界顶尖羽拍工艺生产线。\n\n七天退换货，1年保修，可拉20-30磅。\n\n\n1.高钢性碳纤维、DNA纳米科技模具成型：增加拍框强度、拍杆抗扭性能\n2.配合高弹力风管，增强拍框承受更强拉力\n3.台湾原装泡桐木，环抱结实\n4.静电喷漆技术，不易损坏\n5.超炫外型，轻松帅气挥拍', '高钢性碳纤维', '高钢性碳纤维', 0, 0, 675.0, 'g3', '9.2', 30.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5087.html');
