insert into detail values('羽毛球拍', '薰风kumpoo', '推广拍系列', 'E58', 2019, '全能型球拍\n1：头框部分，采用碳素纤维材料可以在控制球拍重量的同时保持拍框的强度和拉力，使用拍在高磅拉力下不变形，经久耐用.\n2：低风阻锥盖，前套锥体设计，保证拇指控制面积适合，减少挥拍时的\n空气阻力，又确保网前控制又足够的灵活性。', '全碳素纤维', '全碳素纤维', 84.0, 80.0, 675.0, 'G5（2#）', '适中', 28.0, 24.0, '290±5（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7915.html');
