insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', 'WINGEDDRAGON', Null, '平衡（未穿线）：287±4mm\n球拍属性：攻击拍\n产品保固：18个月\n\n1.加大击球甜区，较一般球拍（72孔）多16个孔位，些微增加了穿线密度，在不增加拍面的情况下，有效的扩大了击球区，及延长羽线的使用寿命。\n2.88孔的设计可因个人的喜好，适用不同磅数的网压，故此设计可适用初学者至专业选手各个层次之消费者。\n3.沿拍框360°分布88个线孔，纵向22排线，横向22排线。\n4.整支球拍二次成型。\n5.高档的水晶后套。', '高抗压性40T碳布头框', '高弹性碳素纤维+抗扭力碳素纳米管', 86.0, 82.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4200.html');
insert into detail values('羽毛球拍', '美津浓Mizuno', Null, 'SPEEDFLEX7', Null, '扁平拍框结合（AntitwistFrame）结合锥形中杆（TaperedShaft），打造出一把快速挥拍，回弹出色的Performance战拍。\n\nSpeedflex7.1羽毛球拍，一把以速度见长，弹性出色的球拍。根据空气动力学优化的Aero拍框，提供灵活的击球感觉，不同于传统的AERO拍框，Speedflex7.1采用的是如刀刃般纤薄的拍框厚度，拍子的整体拍框厚道一直保持在5mm到6mm之间，这种厚度，追求的是一种极致的流体力学手感。\n\n拍框，羽毛球拍的发展一直就是一部拍框框型的发展史，Speedflex7.1的拍框虽然说不是革新的或者划时代的意义，却明显有带有自己的特征，如果说纤细代表的是一种速度，整体拍框的厚度，却很中和，讲究的是一种适可而止。\n材料上，美津浓羽毛球拍的好用的特色之处，因为美津浓的拳头产品就在于高尔夫球等品类，所以碳纤维的研发和应用上，毫无疑问，美津浓是行业内的领先者，从最早的四轴编织材料到最新的NanoPef，不论是强度还是反弹力上，美津浓都力求做到完美。\n\n作为一款定位与Performance级别的专业球拍，虽然Speedflex7.1的球拍材料不是业内最顶级的碳纤维，但也是相当赞的，中杆和拍框都采用的是T30的日本碳纤维，NanoReinforced材料，将碳纤维和树脂完美地融合在一起，拍框强度提升20%，这也就是Speedflex7.1球拍可以拉30lbs的原因。\n\n锥形中杆设计，现在球拍的流行设计趋势，与传统球拍相比，锥形中杆，很好地提升了球拍的扣杀弯曲点，在中杆的回复力和对球场两边的击球准度上，有很好的帮助。\n\n速度，运动中最重要的一个元素，谁能占据速度上的优势，谁就能掌控球场上的节奏，唯有节奏，才能运筹帷幄，把握赢球的关键点，美津浓SPEEDFLEX7.1羽毛球拍，一把很容易上手的4U球拍，弹性相当出色的球拍，最重要的是，球拍原滋原味，保留初胚时候纹路细腻的特点，非常耐看，尤其是接头的位置，这种清晰的纹路，带来最古典的球拍美感，纯正，速度，超弹，MizunoSpeedflex7.1，用速度和古典诠释羽毛球拍的另外一种美感。', '日本碳纤维', '日本碳纤维', 84.0, 84.0, 0, 'G5', '偏软', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6444.html');
