insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB10TOURCAB10', Null, '作为YONEX2000年的新产品之一，在性能上直逼CAB-20：\n\n1、采用了新型MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n\n2、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；\n\n3、拍框还采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩。', '碳素纤维、MusclePower弧形筋力结构拍框线槽设计', '高强碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 22.0, 18.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9691.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, '绿巨人超级浩克', Null, '波力绿巨人拍框采用的是行业内极细的拍框设计，也是目前羽毛球拍比较流程的设计方式，结合290mm左右的平衡点，使得这把球拍在挥拍和前场有非常好的优势，平抽，防守和推球性能优异，波力轨道能量槽设计，顶框位置的凸槽设计和下框位置的凹槽设计，一方面有效提升球拍的甜区，同时也可以减少球拍的吊磅，提升打球的快感。球拍外观采用醒目的绿巨人设计，拍框上和中杆的部分采用了鲨鱼点状的设计，整体质感更强。', '高刚性碳纤维', '40T高抗扭中管', 87.0, 83.0, 675.0, 'G4', '适中', 28.0, 28.0, '290±5mm', 'https://www.badmintoncn.com/cbo_eq/view_8282.html');
insert into detail values('羽毛球拍', '威克多VICTOR', Null, 'BRS-11RBRS11', Null, Null, '超高刚性碳纤维+纳米树脂+HARDCOREDTECHNOLOGY', '超高刚性碳纤维+纳米树脂+7.0SHAFT', 89.0, 80.0, 675.0, 'G4G5', '-', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6768.html');
insert into detail values('羽毛球拍', '李宁Lining', '立体编织系列', Null, Null, '平衡点:295±4mm\n三大技术，成就李宁立体编织碳系列超凡脱俗的实力：\n\n亮点一：免钉孔技术：拍框3点和9点位置，采用线孔与拍框一体成型，去除了传统护线钉之后，网线与拍框直接接触，令力量反馈更直接、更清晰，击球更快速、更强劲！\n\n亮点二：机翼恒定系统：以超弹性3G钛合金打造拍框3、9点及以上部分。其卓著的记忆金属性质，将使拍框形变迅速复位，抗扭性也大大增强！\n\n亮点三：立体编织碳纤维：球拍本身采用的立体编织碳纤维，比一般碳纤维具有更高强度和刚性，经久耐用！据说从编制到加工，除了端点，中间绝不截断任何一束纤维，从而消除了拍身的接缝。藉此制造的球拍，让你真正得心应手，如臂使指。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, '-', '偏硬', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2315.html');
