insert into detail values('羽毛球拍', '川崎Kawasaki', '其它系列', '矛9', 2010, '星级Starrating:★★★★★\n\n适合球员类型Type:专业进攻型\n\n特点：超高刚性碳素纤维+T40的碳素纤维+纳米中管+钨纹+能量桥+牛角三通+T形框\n\n１、既具有碳纤维的强度高，又具有玻璃纤维的韧性。\n\n２、成９０度编织，结构更稳定。\n\n３、异于传统设计，完全不含溶剂，使各点达到均衡。\n\n矛系列特点：\n\n1.T形框-降低风阻，结构稳定\n\n2.NTC纳米管-强度高，结构稳定（是传统碳管5倍强度）\n\n3.能量桥-迅速将球拍中管折返点提升至能量桥，提升瞬间击球爆发力\n\n4.牛角三通-T40碳纱扩大与拍框受力面，结构稳定，提高抗扭力', '超高刚性碳素纤维+T40的碳素纤维+NTC碳管', '超高刚性碳素纤维+T40的碳素纤维+NTC碳管', 94.0, 90.0, 675.0, 'G2', '中硬', 30.0, 18.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_4288.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, Null, 2009, '1、窄边窄边框风阻小，挥拍顺畅，反应灵敏，挥拍更顺手，不吃力\n2、大平头设计，增加击球面积\n3、中管底部加钛编织设计：\n（1）增加中管扭力，减少翻拍、抖动比例\n（2）提升击球攻击力\n4、一支攻守兼备的好球拍', '高质量羽拍专用碳纤维，中管加钛编织', '高质量羽拍专用碳纤维，中管加钛编织', 89.0, 85.0, 675.0, '-', 'M（主结构）、H、S', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2388.html');
