insert into detail values('羽毛球拍', '索牌SOTX', 'JEDI(绝地)系列', 'JEDI077', Null, '平衡点285-294mm\n\nJEDI系列的介绍\n1、拍框结合空气动力学的设计，有效降低风阻系数，挥拍速度更快，进攻更具有杀伤力，独特受力角度设计，有效传导击球的回震力：拍线张力保持峰值状态，使球拍受力更加均衡，球拍稳定性更佳。\n2、平头拍头技术使横竖长度均等，不仅增大了球拍的甜区面积，更有效地提升了击球威力，使运动者控球更加轻松自如。\n3、新型高强度碳纤维制作，最大限度提高了迫身强度，球拍承磅系数更高。\n4、具备吸震功能功能的立体开摸拍套，有效加强球拍平衡。', '100%碳', '100%碳', 87.0, 81.0, 675.0, '2#/3#', '9.0-9.3', 26.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_510.html');
