insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium8系列', '8070', Null, '平衡点：295±2mm\n拍杆直径：6.5-7.5mm\n\n点评：采用最高级的碳纱编织而成，全拍框溶入钛粉，造就结实耐用，手感扎实的球拍。免皱折高碳素纤维技术使球拍使用更少的材料达到承受高磅的要求,反回旋转力技术使球拍稳定易于操控,钻石网技术骨架加强20%的坚硬度，更好感觉掌握力量性和操控性，支持更高的张力,创新渐纤细式拍杆设计，无论在柔韧度、准确性、力度、能量、扣杀、释放感觉，都有更出众的表现。轻盈的拍身,头重型平衡,使操控者能迅速挥拍并有强大攻击力。昂贵的表层铬银技术，眩目的外表凸显球场上的尊贵。', '碳素纤维溶入钛粉', '超高弹性碳素', 90.0, 86.0, 670.0, 'G4,G5', '中柔韧', 25.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1664.html');
