insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB018CAB-018', Null, '位于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使球拍完美地连接成一支高强度的一体式球拍。让球拍同时兼具强大的力量性能和精确的控球性能。T型合金接头，柔韧适中的拍杆，让球拍同时兼具强大的力量性能和精确的控球性能，使初中级球鞋员也能自如的挥拍。均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式击球也能保持相应的精确和速度。', '碳素纤维', '碳素纤维', 89.9, 85.0, 674.0, 'G3,G4,G5', '柔韧', 20.0, 15.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_196.html');
