insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', Null, Null, '盒式横断面拍框设计,拥有极佳的拍面稳定性和极高的承载耐久性。位于拍框和拍杆连接处碳素纤维内层的内置T形合金接头，使球拍完美地连接成一支高强度的一体式球拍。让球拍同时兼具强大的力量性能和精确的控球性能。', '碳素纤维', '碳素纤维', 89.9, 85.0, 664.0, 'G3,G4,G5', '特软', 20.0, 15.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_198.html');
