insert into detail values('羽毛球拍', '威尔胜Wilson', Null, 'WRT8005', Null, 'Wilson生产的加强控制性的[K]ontrol球拍，采用全球首创的碳丝矩编原理，开发出含有纳米碳纤维及稀有金属[K]Factor材料，并根据运动力学原理对球拍框架进行工程创新处理，生产出各种类型[Kontrol球拍。', '纳米碳纤维', '纳米碳纤维', 88.0, 84.0, 670.0, '-', '适中', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5412.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'DIAMOND钻石', Null, Null, '充满时代感的银色X5，全镜面拍身闪闪发亮，散发钻石般的光泽。张扬的个性，犀利的进攻，在刀光剑影中打败对手！\n\n亚狮龙RSLX5-Silver银色羽毛球拍采用特别高碳素纤维，是目前最高级的高碳素纤维之一。加强特硬，应用于球拍中杆，扭力击球速度迅速提升21%。更灵敏，更容易操控，手感更佳。精确的设计能同时保持最佳的弹力及减低了回旋转力。手发出的力量通过球拍更有效地传递到羽毛球上。\n\n采用了T-区域技术，在TJOINT位置处额外增加了一组特殊结构性的强化力量技术，增强了手感，提高了控制以及击球的准确性，而且透过增加T区域的硬度结构，更容易感受每一次击球的信息，做出更有效的判断，击出更准确的回球。就算击球点有偏差都能够即使作出反应，作出更快的修正。“T-区域技术”配合“反回旋转力技术”及“特强高碳素纤维”，进一步加强了球拍反回旋转力的硬度。\n\n加强了额外的扭力控制，尤其在对场攻击时，能更准确地改变方向。额外的扭力控制，尤其在快速平抽快打攻击同时，能更准确地进行多方向攻击。', '-', '特强高碳素纤维', 88.0, 86.0, 675.0, 'G5', '硬', 28.0, 28.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_4919.html');
