insert into detail values('羽毛球拍', '波力Bonny', '极限凤凰系列', '2BDPT0060108B', Null, '世界最细，超细边设计，12点处最窄达8.85mm，配合破风式框型设计，在保证拍框强度前提下，将拍框做到最纤细，挥拍时将空气快速导流，降低空气阻力，增加拍框灵活性与控制性，提高扣杀速度，增加球拍攻击力。超细边设计同时提升拍框密度，让挥拍快速，爆发力强劲，同时无沉重感。', '超高刚性40T碳素纤维+纳米树脂', '超高弹性碳素+高抗扭力碳素纳米管', 90.0, 88.0, 675.0, '2#', '适中', 28.0, 28.0, '282-288mm', 'https://www.badmintoncn.com/cbo_eq/view_3722.html');
