insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', Null, Null, '1.低风阻拍框，在保证拍框强度前提下，将拍框做到最纤细，进一步降低挥拍时的\n2.整支球拍使用日本高刚性碳纤维制成：\n（1）提升拍框刚性→\nA.从容承受高磅数网压\nB.有效提升攻击系数\nC.强化拍框控制性→强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n3.乌缺工艺，100%严格筛选：不做任何补土、色漆喷涂，不经修饰，完整呈现无瑕疵的碳纤维纹路，坚持挑选成型优良的高档拍！\n4.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上。\n5.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n6.三通处植入最新碳纤维T头：\n（1）加强拍框与中管之连接性\n（2）提升球拍抗扭力效果\n（3）提升球拍拍框之稳定性\n（4）超轻碳T头，不影响球拍质量分布，提升击球效能\n7.特殊高刚性材料中管，软硬度之精准度提升，抗扭力提升。\n8.采用特殊透明漆及炫彩水标设计，呈现高品味的经典质感。\n9.高档水晶后套，彰显球拍档次。\n10.特殊钛柄皮，防滑耐磨效果加倍，提升手感与质感。\n11.纳米技术专利证号：XL03149232.0。', '高刚性碳纤维+纳米技术+碳T头+乌缺+高刚性中管', '40T外购中管，采用三次成型碳T头工艺', 86.0, 82.0, 675.0, '2#', 'M', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3721.html');
