insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'IOSPOWER600', Null, 'isometricpower600\nISOPOWER系列球拍是采用强化攻击力概念（SPT）而发明的，专为进攻型球员而设计：\n\n1、独家专利内置T形连接设计可减轻球拍之重量；\n\n2、较薄之T形连接设计能把重量平均分配到拍框之顶部以至拍柄；\n\n3、球拍顶部较重，进攻效果极佳；\n\n4、T形连接设计之额外重量附加于拍柄上；\n\n5、拍框形状为ISO方型，扩大了拍面的击球甜点区域。\n\n总体说来，为一全面而攻击力强之球拍。\n\n一、方形拍头ISOMETRIC\n与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。YONEX研发的这种IsometricHeadShape大甜区球拍，让进攻型球员在当今激烈竞争的国际羽坛一直保持明显的领先优势。\n\n二、内置合金接头Built-inT-Joint\n深深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能。\n\n三、盒式Box\n拍框采用盒式截面设计，提供稳定的击球表面及较小的扭矩，从而提升选手的操控能力；同时，盒状截面形状设计可给拍框带来更好的耐用性，适合进攻打法。', '碳素纤维', '碳素纤维', 94.0, 90.0, 664.0, '-', '硬', 20.0, 18.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3016.html');
