insert into detail values('羽毛球拍', '邓禄普Dunlop', Null, Null, Null, 'Aerogel1000是DunlopAerogel系列里最具杀伤力的球拍。\n\n高硬度的中管，能最直接的传递球员的力量。对球的落点有着最精确的控制。\n\n头重的平衡，让你的击球更具威力。\n\n拍头为小平头的设计让球拍在击中甜点时有更好的聚力。\n\n拍框2侧都采用了凹凸框型的设计，让球框有了良好的弹性。\n\n如果你是一个喜欢暴力扣杀，体力充沛的高级球员，建议你选择这块球拍，它能帮助你拥有更犀利的进攻，更暴力的杀球。\n\n如果你并非一个力量型或者不是一个崇尚进攻的球员，并不建议你选择它，因为完全进攻型的设计，在你处于被动防守或者多拍僵持时，并不能发挥这块球拍的性能。', 'M-FIL,Aerogel（气凝胶）,100%高级碳纤维', 'M-FIL,Aerogel（气凝胶）,100%高级碳纤维', 87.0, 87.0, 670.0, '3,1/4英寸', '低', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3450.html');
