insert into detail values('羽毛球拍', '翰文HANWEN', Null, '翰文龙拍（电镀中国红）', 2014, '拍框内建龙骨（翰文专利），硬度提升30%，可拉更高的磅数（30-32lbs）\n中管扭角范围26-30°，能够更好地控球。', '30T日本高碳素纤维', '40THM日本高碳素纤维', 86.0, 84.0, 675.0, 'G2', '8.5', 32.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6176.html');
