insert into detail values('羽毛球拍', '阿尔法Alpha', Null, Null, Null, '1、KEVLAR是一种芳纶复合材料，密度低，强度超高，韧性好，耐高温，易加工成型，用它与碳纤维结合的球拍强度更高，稳定性更好，是高级球拍的理想材料；整支球拍以KEVLAR碳纤维材料编织而成，能够增强击球瞬间的稳定性，使球的落点更为精确;提升球拍击球惯性，挥拍过程中增加球拍力度；杀球有力，弹速快，适用于进攻型选手；\n2、采用ALPHA公司专利技术纳米环氧树脂技术，通过超声波分散和偶联剂处理的方法使纳米粒子在环氧树脂中充分分散，制得纳米级环氧树脂复合材料。使用纳米环氧树脂技术制作的球拍，可加强拍框耐久能力和拍线张力，增强6%抗拉强度、4%拉伸指数；\n3、十二点钟、三点钟、九点钟附近采用MUSCLEPOWER设计，减少球线拉力的流失，更好地保持击球的手感；\n4、\u3000方形拍头，增大击球甜区，增加有效击球；\n5、ALPHA公司独特的超大后盖，球拍挥动中有效防止滑落', 'KEVLAR编织', 'KEVLAR编织', 94.0, 80.0, 674.0, 'G2', '高', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2727.html');
