insert into detail values('羽毛球拍', '佛雷斯FLEX', '钻石羽拍系列', Null, Null, '科技特点：\n钻石凸粒原理\n1、内框采用钻石凸粒设计，并采用纳米技术，将纳米分子渗入其中。使球拍框体的刚性更强，抗扭性更好，耐冲击力更高，且能承受更高的穿线磅数。\n2、甜区与其它球拍相比，提供了更多的有效击球面积，即使是偏离还需拍线床中心区的连续式扣杀，也能保持相应的精确和速度。\n3、拍框用高刚性航空材料+HOT-MET超刚性特殊纤维溶入分子互相结合，使拍框硬度提升16%，且扭力提升14%。\n\n球拍科技特点\n\n1、将流体横断面和盒式横断面之优完美结合；上部分是流体横断面，减少挥拍时的阻力，更好的提高扣杀速度，下部分是盒式横断面，增强拍框抗扭能力，提供击球的精确度；是进攻与防守的完美结合。\n2、中管直径6.5mm，小管直径7.5mm，使球拍框体抗压强度提升8%，拍框体耐冲击性能提升30%。\n\n高尔夫杆式设计\n拍杆采用高尔夫杆式的锥形设计，运用二次成型技术，使拍杆在击球时产生的折曲点向上提升20-30mm，让扣杀更具威力，更加华丽。\n\n特殊纤维材料\n\n拍杆采用40THOT-MELT特殊纤维材质，可以使抗扭力提升5%，弹性增加8%。', '超高碳素纤维', '高钢性碳纤维', 84.0, 80.0, 666.0, '675MM', '中硬', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1508.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, Null, 2010, '1.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上\n2.1.5K碳Woven中管设计，有效提升球拍抗扭力效果，并显现高档质感\n3.中边框拍框较硬增加击球稳定性，挥拍顺畅，反应灵敏。\n4.小平头设计，在考虑风阻之余，增加拍面积。\n5.吸震软前套能有效降低震动带来的不适。\n6.闪银后套设计，让球拍更具活泼感。\n7.双色柄皮设计，羽球拍涂装做搭配，提升球拍整体美观\n8.适合攻击型进阶选手选用。', '-', '-', 85.0, 85.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3069.html');
