insert into detail values('羽毛球拍', '艾迪宝ADIBO', '镍钛系列', Null, Null, 'NITI（镍钛系列）羽毛球拍，是以最先进的科技用于球拍制造工艺，采用日本TOKAY（东丽）T-700高级碳砂，融合镍元素，经过高温高压（热融技术）使球拍拍框增加硬度：使其能承受更高磅数球弦所产生的张力，使中杆有更强的韧性，使击球更有威力，能有效防止震荡、解决传统木柄因木纹引起的震荡。', '100%高弹性碳纤维+镍钛', '100%高弹性碳纤维+镍钛', 86.0, 82.0, 665.0, '3u', '中等', 25.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1915.html');
