insert into detail values('羽毛球拍', '初应TRUEiin', '裸的拍系列', 'FOREVER0无限', Null, '特化的攻击速度拍(Angriff)，纯粹为快攻而生，让您打出更快的杀球。\n铁黑灰黑消光的纯色设计，与众不同，高贵而深沉。\n\n#ReduzierterWindwiderstand(风阻降低系统)\n专利大波浪拍框，特殊破风系统，降低风阻，加快挥拍速度。\n拍头局部加重，出球更加快速稳定。\n\n#ElastischerKohlefaserstab(超弹力碳纤维中杆)\n42T国防用超高刚性碳纤维+石磨烯+钛+奈米树酯+强化编织纤维\n延展性及回弹性大幅提升，连贯运动更加流畅，力道传导更加迅捷。\n超弹力中杆，经过测试，连挥五千下，中杆不会因疲劳而降低弹力。\n\n#KeinLabel(裸拍无水标概念)\n裸拍概念设计，让碳纤维延展性完全发挥。\n环保诉求无水标印刷，减低自然负担。', '国防用超高刚性碳纤维+石磨烯+钛+奈米树酯+强化编织纤维', '国防用超高刚性碳纤维+石磨烯+钛+奈米树酯+强化编织纤维', 89.0, 84.0, 675.0, 'G6', '7.8-8.2(硬)', 33.0, 27.0, '300-305', 'https://www.badmintoncn.com/cbo_eq/view_8117.html');
insert into detail values('羽毛球拍', '奥立弗OLIVER', Null, 'EXPLORER10', 2014, '适合球员：业余初中技术阶段，休闲竞技，攻防一体型，中级、进阶级技术阶段男女球员皆适用\n框体特点：高性价比的智慧优选全碳素球拍。进口METRACARBONTM高刚性碳纤维材质，窄边超薄流线型框结构，低风阻、高弹性、轻巧灵活、攻守自如。配置独家METRIC减震前套，握感舒适！\nOLIVEREXPLORER10为初学者设计的球拍，帮助新手轻松驾驭\nTHETUBE纤细中管，提升高爆发力及高动能球的发挥，融合HigherRigiditv材质制造出的球拍，拥有更高刚性和稳定表现，力道传输过程中不易减损，充分提升高爆发力及高动能球的发挥。\nLOGICCUBE框体，让拉吊挑扣更加流畅自如，从空气动力学出发，优化截面破风结构，增大框体弧面范围，降低空气阻尼系数，使球拍拥有稳定的操控性能，获得更加流畅自如的挥拍速度。\nMETRIC矩阵锥盖，驾驭球拍更加灵活精准，METRIC矩阵锥盖加强抑制中管反折点，其中环装收束结构形成能量逆道传播系统，减低球拍震幅，从而聚拢能量，提升球拍反应速度和击球准确性。', '高钢性碳纤维METACARBON', '高钢性碳纤维', 84.0, 80.0, 675.0, 'G5', '软', 28.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_8761.html');
