insert into detail values('羽毛球拍', '初应TRUEiin', Null, '小小', Null, '在不断的测试中杆反折点与软硬度下，\n终于开发出了一支合适大童的儿童拍，\nTRUEiin概念拍代号”IN01-K/小小”诞生!\n首次推出「黄色」与「青色」两色，诠释小小拍的可爱清新，\n一次满足小朋友的喜爱，完美的定义孩童的欢乐，\n献给所有的孩童。\n\n#日本材料\n#速度拍框设计\n#短中杆设计\n#无墨后套', '超高刚性碳纤维+奈米树酯+强化编织纤维', '超高刚性碳纤维+奈米树酯+强化编织纤维', 79.0, 75.0, 630.0, 'G6', '-', 26.0, 26.0, '280-285', 'https://www.badmintoncn.com/cbo_eq/view_8115.html');
