insert into detail values('羽毛球拍', '傲仕RS', Null, Null, 2009, '宽顶加入纯钛片，增强宽的耐度及重量，能量传输加快球速增加20%', '超高钢性碳纤+高纯度钛片，中平头', '超高钢性碳纤+高纯度钛片', 89.0, 85.0, 674.0, 'G4', '偏硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3548.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1.窄边蛋头拍框设计，整支球拍用高刚性WOVEN碳布制成，增加拍框刚性，加强击球性和控球性。\n2.纳米科技\n采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上。\n3.适合专业选手使用的专业拍。\n4.100%严格筛选：不做任何补土、色漆喷涂，不经修饰，坚持挑选无瑕疵的高档拍！\n\n高刚性Woven编织碳布：\n（1）拍框：采用0°、90°编织之Woven\nA.强度提升→从容承受高磅数网压\n→有效提升攻击性\nB.拍匡扭力提升→有效提升拍框稳定性→强化控球效能\n（2）中管：采用45°编织之Woven\nA.中管扭力提升→有效提升拍匡稳定性→强化控球效能\n\n采用二次成型：\n（1）中管真圆度误差率≦0.03％→平衡球拍质量分布→保持最佳质量、充分发挥球拍性能。\n（2）中管软硬度稳定度大幅提升→充分发挥球拍性能。\n\n\n整支球拍采用WOVEN编织结构，碳纱密度更高', '高刚性碳纤维+WOVEN编织', '高刚性碳纤维+WOVEN编织', 90.0, 85.0, 665.0, '-', '硬', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2384.html');
