insert into detail values('羽毛球拍', '久奈司JNICE', Null, '久奈司夜斧', Null, '专为双打选手量身打造的进攻型球拍。现今双打进攻趋势以连贯与速度为主流，选手来回争抢主动，逆转被动，争取更多回合的连续攻击，以创造下一拍的扣杀得分，击溃对手。', '46TReinforcedU-HMNanoGraphite', '46TReinforcedU-HMNanoGraphite/6.5mm', 89.0, 80.0, 674.0, 'G2', 'VeryStiff(7.9~8.2)', 30.0, 30.0, '3U(290~295mm)、4U(300~305mm)', 'https://www.badmintoncn.com/cbo_eq/view_6952.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, 'JNICE轻羽刃', 2018, '超薄拍框『ELASTICAIR73轻羽刃』是JNICE品牌目前最轻的球拍，只有73g，超轻的重量配合适中的拍杆，提供超好的弹性，平衡点300mm，保证球拍的击球威力，网前封网会感觉无比轻松，随心所欲。此球拍非常适合追求快速的选手，同时也是女士们的不二之选！', 'TORAY46TNanoGraphite', 'TORAY46TNanoGraphite/7.0mm', 74.0, 70.0, 674.0, 'G6', 'Stiff(8.0~8.3)', 0, 0, '300-305mm', 'https://www.badmintoncn.com/cbo_eq/view_6953.html');
