insert into detail values('羽毛球拍', '富力特FLEET', 'WOVEN', Null, Null, '台湾第一羽毛球论坛羽毛球共和国上很多资深玩家备受肯定的fleet攻击力最高的球拍，手感类似AT系，但是中杆的弹性韧性更加加大，给人一种前所未有的破坏感！\n結合T型拍框特殊設計，運用流體原理概念，\n讓球拍在快速揮擊時，降低拍面的空氣阻力，\n增加揮拍擊球速度。\n中平頭寬體設計，殺球更具威力!\n加長型前套輔助雙打時前排截球的速度!', 'H.M+WOVENGRAPHITE', 'H.M+WOVENGRAPHITE', 94.0, 80.0, 674.0, 'G2', 'U.H.M.GRAPHITE', 30.0, 23.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2285.html');
