insert into detail values('羽毛球拍', '骏邦joobong', Null, 'TP505', Null, 'TP505采用了获得国际专利的锥塔中杆技术，大幅调高了中杆弯曲点，最大限度提升了球拍的杀球性能。硬度适中，长度比一般中杆短5mm，在降低对使用者的力量要求的同时也弥补了适中中杆在力量的反应速度上的不足，并因此获得了良好的拉吊性能\n设计科技：大方头、大榔头、超薄椭圆破风框管、加高拍框、锥塔高敏中杆、超低风阻锥盖、减震垫圈。\n材料/工艺：超高刚性碳素纤维、X形错叠编织技术、纳米环氧树脂。\n打法特点：速度快、甜区大、杀球和拉吊性能突出、发动要求低、适合进攻型单打', '碳纤维', '超高刚性碳素纤维、纳米环氧树脂', 87.0, 83.0, 680.0, 'G2', '适中', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5213.html');
