insert into detail values('羽毛球拍', '波力Bonny', Null, Null, 2010, '1.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上\n2.1.5K碳Woven中管设计，有效提升球拍抗扭力效果，并显现高档质感\n3.中边框拍框较硬增加击球稳定性，挥拍顺畅，反应灵敏。\n4.小平头设计，在考虑风阻之余，增加拍面积。\n5.吸震软前套能有效降低震动带来的不适。\n6.闪银后套设计，让球拍更具活泼感。\n7.双色柄皮设计，羽球拍涂装做搭配，提升球拍整体美观\n8.适合攻击型进阶选手选用。', '-', '-', 85.0, 85.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3068.html');
