insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, 2009, '1、高尔夫球杆中管设计采用21条金属TI丝强化中管强度2.提高球拍扭力操控性精准手感出类拔萃兼具美观高雅3、窄线槽方粒钉40磅高拉力\n进攻拍杀球速度快威力大控球性优异适合球龄高力量型及高手级球员', '高系数碳纤维', '钛丝中管', 88.0, 88.0, 675.0, 'G2', '8.5+/-0.1（适中）', 35.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4365.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, '2BD7102028E', Null, '拥有25年历史的中国Bonny品牌专利技术数量居同行业之首，产品质量紧跟世界水平，同时世界冠军谢杏芳为其形象代言人，它宣扬的是智慧和健康的理念，追求的是无极限的境界，打造的是亚洲乃至世界的民族品牌。\n\n1、窄边框风阻小，挥拍顺畅，反应灵敏，挥拍更顺手，不吃力2、大平头设计，增加击球面积', '高质量羽拍专用碳纤维', '高质量羽拍专用碳纤维', 89.0, 85.0, 670.0, '-', 'S（主结构）、H、M；', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5298.html');
insert into detail values('羽毛球拍', '肯尼士Kennex', Null, 'CB-64253', Null, '这款羽毛球拍才用独特的动力学技术、热熔科技有助于预防手臂受伤。使用螺旋技术碳纤维和高模量石墨结合纯纳米环氧树脂,增加了球拍的稳定性、强度以及控制力，从而增加了击球手感。八角形的头部形状添加稳定，还使用了锥形轴技术，使球拍不容易变形，此款球拍具有较好的机动性。', '高弹性碳纤维', '高弹性碳纤维', 85.0, 80.0, 673.0, '-', '适中', 32.0, 22.0, '287+-3mm', 'https://www.badmintoncn.com/cbo_eq/view_7729.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '平头版本的B3，依然延续着B2的优良传统，以高弹性高精度为主，而不同之处在于小平头，2~10点钟加了mp凹槽，加大了甜区，增加了出球的扎实感！', '以硼、碳、纤维二种质材', '以硼、碳、纤维二种质材', 94.0, 80.0, 674.0, 'G2（台湾标准）', '偏硬', 4.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2246.html');
