insert into detail values('羽毛球拍', '泰迪Tactic', '交叉穿线系列', Null, Null, '扭力：低\n类型：圆头\n平衡点:295mm\n颜色:蓝/银\n特性：专利交叉穿线，加强最大弹力，主干加长，适合于后排助攻。\n1)泰迪球拍采用交叉穿线技术，应用于拍框中部以下，增强球拍在击球过程中的能量传递效率，有效提高扣杀能量5%。\n2)立体的穿线方式，令每根拍弦储备了一定的能量。\n3)泰迪交叉穿线系列球拍增强12%的反弹力\n备注：不穿线，附带单支球拍袋。', '强化高密度碳纤维', '强化高密度碳纤维', 85.0, 85.0, 674.0, '-', '6-7度', 24.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_235.html');
