insert into detail values('羽毛球拍', '百宝力Babolat', Null, Null, 2008, '1.Satelite技术：全新的空气动力学拍框设计与独特的圆锥形护线孔为线床提供更大威力，更高灵敏度\n2.ZylonMatrix技术：由于加固Zylon，拍头更硬，更加有力量，更具有稳定性\n3.V型结构设计：在拍框和拍杆连接处采用了克拉维V型设计，使球拍扭距降至最低指数3，控制精准\n4.Pilot稳定系统：在握柄顶端有特殊的固定胶设计，帮助您在发球的时候更好的控制落点，以及在网前扣球时迅速得分。', '热融碳素＋克维拉纤维', '热融碳素＋克维拉纤维', 86.0, 86.0, 675.0, 'G4', '中度', 32.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2546.html');
insert into detail values('羽毛球拍', '索牌SOTX', Null, 'WGNS07', Null, 'WGNS系列\n新型高强度碳纤维制作**提高了拍身强度，球拍承磅系数更高；在遭受强力冲击时的抗扭转性与稳定性均为同类型球拍中的佼佼者。拍框结合空气动力学设计，有效降低风阻系数，挥拍速度更快，进攻更具杀伤力。\n适用人群:专业攻防型', '碳纤维', '碳纤维', 84.0, 78.0, 675.0, 'G4', '8.5-9.0', 26.0, 26.0, '280-290mm', 'https://www.badmintoncn.com/cbo_eq/view_8158.html');
