insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO028', Null, '特点：ISO系列球拍采用YONEX最先采用的方形拍头方形拍头ISOMETRIC与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积（击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。拍框采用流体力学形状设计，形似流线型飞机翼，可将空气阻力降至最低，提高了挥拍的速度和击球的威力。内置合金接头Built-inT-Joint用力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，而深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能。整支球拍采用轻型设计，仅重85-89克，特别适合追求高速击球之球员，球员使用轻型设计球拍，球员的击球力量能发挥至极限。', '碳素纤维', '碳素纤维', 89.0, 85.0, 664.0, 'G3G4G5', '软', 20.0, 17.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_435.html');
