insert into detail values('羽毛球拍', '艾迪宝ADIBO', 'PEACOCK', Null, Null, '第二代精准环行中管技术：与传统相比，此中管属第二次成型，所有面受力限度均匀，更利于对球拍力度、弹性的把握。', '100%carboncraphite', '100%carboncraphite', 84.0, 82.0, 665.0, '3u', '中等', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1920.html');
insert into detail values('羽毛球拍', '艾迪宝ADIBO', Null, Null, Null, 'ADIBO艾迪宝高端球拍，采用全球复合材料顶级供应商日本三菱（Mitsubishi）提供的原材料，由记忆合金复杂的菱形晶体结构转变成简单的立方晶体结构，会发生形状回复的记忆，当记忆合金恢复原形时伴随产生极大的力，球拍的受力增强30%，扣杀力增强15%。', '100%高弹性碳素+弹性钛纤维', '100%高弹性碳素+弹性钛纤维', 89.0, 85.0, 675.0, '3u', '特硬', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1904.html');
