insert into detail values('羽毛球拍', '威克多VICTOR', '其它系列', Null, Null, '嶄新設計的球拍風格，以大黃蜂的黃黑相間鮮明色調為概念，搭配蜂巢狀的閃耀塗裝使整體視覺更潮流時尚。兩支不同特色的球拍，攻擊型小平頭的BUMBLEBEE01和操控型中平頭的BUMBLEBEE02，是您球場競技的夢幻選擇。', '超高剛性碳纖維+奈米樹脂', '超高剛性碳纖維+奈米樹脂+7.5shaft', 89.0, 80.0, 675.0, 'G2', 'S○●○○○F', 4.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3288.html');
