insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, 2010, '源自加拿大，blackknight黑骑士以球拍品质为第一追求，打造的Votex顶级球拍系列之一，KryptonXL！KryptonXLKRYPTONXL拍框：Nano-CarbonSL,eXtremeModulusGraphite(XMG),PowerMatrix,andXtensionGeometry.拍线：售出时未上线.拍线磅数:21-30lbs使用羽毛球时的最佳建议磅数;21-24使用尼龙球时的最佳磅数。硬度：86Medium平均拍框重量:82grams线床面积：352sq.cm.拍长：68cm.设计应用：高阶俱乐部活动参与者，到国际级比赛选手特性：KryptonXL设计的偏向轻的拍重和更具有弹性，以及加长的拍框，但平衡点依然是偏向拍头，从而是力量较弱的选手可以获得很高的拍头速度。尽管通常概念来讲，该款球拍足够轻，可以在防守型的比赛节奏中表现优异，很适合单打选手使用。但对进攻型的双打选手来说，还是打出很有爆发力的击球感觉。', '碳纤维', '碳纤维', 84.0, 80.0, 680.0, 'G3(常用)', '86', 30.0, 21.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3605.html');
insert into detail values('羽毛球拍', '索牌SOTX', Null, Null, 2013, 'SWIFT&#160;AURORA&#160;A7/A9是2013年上市的新品，作为迎合中国羽毛球队在伦敦奥运会取得骄人战绩带来的羽毛球市场持续上升的趋势，深圳索德士公司打造了两款高品质球拍。&#160;\n拍杆采用了航天级高刚性碳素纤维，兼具高强度和高弹性，能在击球瞬间释放出极大的反弹力量，产生极强的爆发力，使击出的羽毛球充满威力地从线床反射回对场，攻其不备，迅捷反击。SWIFT&#160;AURORA&#160;A7/A9采用超细尺寸，超细拍框比普通球拍截面高度减少15%，宽度减少5%，超细高强度拍框比普通球拍减少9%&#160;的风阻，扩大甜区的同时也带来绝佳的挥拍灵活性和速度感。通过此断面设计可有效减少挥拍时的空气阻力，让使用者挥拍更灵活，提升出球速度。在等同的框截面有效提高抗扭性及抗形变，使挥拍出球的稳定性更好，球的落点控制更精准。', 'HM&#160;CARBON&#160;高碳', 'HM&#160;CARBON&#160;高碳', 88.0, 84.0, 675.0, 'G5', '8.3-8.7', 28.0, 160.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6195.html');
