insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', Null, 2008, '1、宽边拍框设计，适合攻击；小平头设计，在考虑风阻之余，增加拍面积\n2、小钢砲技术（CannonTechnique）：波力公司经过精密计算、排列与测试，开发出独家小钢砲技术，利用小钢砲技术搭配高刚性碳纤维的使用实现了球拍性能和手感完美结合。O88较一般球拍（72孔，竖线22排，横线23排）多16个孔位，使网线密度加大，增加击球甜区及提高网压紧度。经测算小钢砲技术有如下特点：\nA、羽线密度增加38.7%\nB、攻击力有效提升20%\nC、实际甜区增加20%\nD、有效提高网线紧度5~7磅\nE、网压有效维持时间增加20%，并同时增加羽线的使用寿命\nF、拍框重量减轻，增强控球性\nG、网线密度的增加能够显著提高网前球和切球处理效果\n3、中国专利编号：2007201189586\n4、球线长度需要12M\n5﹑奥运概念新型设计\n6、是一支全新的功守兼备的佳品', '高刚性碳纤维', '高刚性碳纤维', 84.0, 80.0, 675.0, '-', 'S（主结构）、H、M', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2387.html');
