insert into detail values('羽毛球拍', '波力Bonny', '奈米竞技CB系列', Null, 2010, '1.整支球拍使用日本高刚性碳纤维制成：\n（1）提升拍框刚性→\nA.从容承受高磅数网压\nB.有效提升攻击系数\nC.强化拍框控制性→强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n2.特殊高刚性材料中管，软硬度之精准度提升，抗扭力提升\n3.三通处植入最新碳纤维T头：\n（1）加强拍框与中管之连接性\n（2）提升球拍抗扭力效果\n（3）提升球拍拍框之稳定性\n（4）超轻碳T头，不影响球拍质量分布，提升击球效能\n4.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上\n5.侧框使用1.5K碳编织强化拍框强度并提升质感\n6.顶框波浪设计可延长球线的使用寿命，维持较久的网压、增加击球力量\n7.大平头拍面，增加击球面积\n8.中边框拍框较硬增加击球稳定性，挥拍顺畅，反应灵敏\n9.采用特殊水纹漆及炫彩水标设计，呈现高品味的经典质感\n10.采用2次成型技术：\n（1）有极佳抗扭力效果\n（2）击球时，力量由中管传递至拍框时，会产生力量延伸效果\n（3）大幅提升中管软硬度之稳定性，充分发挥球拍效能\n（4）手感更好\n11.高档水晶后套，彰显球拍档次', '高刚性碳纤维', '高刚性碳纤维', 86.0, 86.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3113.html');
