insert into detail values('羽毛球拍', '艾迪宝ADIBO', Null, Null, Null, '采用原装进口三菱钛丝（TI）中管。21条金属钛互相支撑中管，强化中管强度，使球拍扭动幅度更小，操控性能精准，手感更优异。第二代超刚性碳纤维-极大的提升球拍的', '超刚性碳素纤维+原装三菱钛丝', '超刚性碳素纤维+原装三菱钛丝中管', 85.0, 81.0, 670.0, '3u', '中等', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1905.html');
insert into detail values('羽毛球拍', '百宝力Babolat', Null, Null, Null, '1.Satelite技术：全新的空气动力学拍框设计与独特的圆锥形护线孔为线床提供更大威力，更高灵敏度\n\n2.ZylonMatrix技术：由于加固Zylon，拍头更硬，更加有力量，更具有稳定性\n\n3.V型结构设计：在拍框和拍杆连接处采用了克拉维V型设计，使球拍扭距降至最低指数3，控制精准\n\n4.Pilot稳定系统：在握柄顶端有特殊的固定胶设计，帮助您在发球的时候更好的控制落点，以及在网前扣球时迅速得分。\n\n平衡：290毫米', '热融碳素＋克维拉纤维', '热融碳素＋克维拉纤维', 88.0, 84.0, 0, 'G3', '中等', 32.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1813.html');
