insert into detail values('羽毛球拍', '摩亚MMOA', Null, Null, 2010, '1、头框盒式与破风设计相结合，减少杀球阻力，扣杀更有力\n2、钛丝强化中杆强度，抗扭更强；woven＋竹节设计弯点前移，产生更快的反应速度，减弱传到手臂的震感', 'M30纳米科技碳砂纤维', '中杆钛丝＋woven＋竹节设计', 88.0, 84.0, 675.0, 'g2', '极硬', 25.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4658.html');
insert into detail values('羽毛球拍', '李宁Lining', 'ES灵系列', Null, Null, '高科技轻型减震材料，填充拍框，提升击球手感，降低运动手感，降低运动伤害。\n跨界应用航空科技原理而独创的李宁机翼稳定系统，在击球瞬间，拍框保持平衡，使回球更精准。', '碳纤维', '超刚性碳纤维', 94.0, 80.0, 675.0, 's2/s3', '适中', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5765.html');
insert into detail values('羽毛球拍', '傲仕RS', Null, Null, Null, '傲仕的科研新品，全新96孔球拍设计，超高密度的网线张力。甜点区再增大，振度再降低，平抽球速度加倍，高远球后场不易出界，根据物理原理，欲提高球拍表面的张力，只要在网目中提高经线和纬线密度，就可以达到拉低磅数而有高张力的效果。此款高网压羽拍穿线张力25Ibs=传统72孔的30lbs，这样也延长了球拍的使用寿命。96孔拍有两个规格，这个是细杆的，还有一支是正常杆的', '特殊钛镍网织碳纤维+高钢性碳纤', '特殊钛镍网织碳纤维+高钢性碳纤', 89.0, 85.0, 674.0, 'G2', '中', 30.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2765.html');
