insert into detail values('羽毛球拍', '波力Bonny', '闪电LT系列', Null, Null, '1、窄边框风阻小，挥拍顺畅，反应灵敏，挥拍更顺手，不吃力\n2、大平头设计，增加击球面积\n3、2、5、7、10点波浪设计，可延长球线的寿命，维持较久的网压，增加击球力量。\n4、涂装采用镜面漆技术，提高球拍档次的同时增强了球拍美感。', '高质量羽拍专用碳纤维', '高质量羽拍专用碳纤维', 87.0, 83.0, 675.0, '-', 'S（主结构）、H、M', 26.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2372.html');
