insert into detail values('羽毛球拍', '艾迪宝ADIBO', '碳素系列', Null, Null, 'CARBONPOWER碳素加强系列：碳素系列羽毛球拍，是将碳素复合材料科技用于球拍制造工艺。采用世界最大纤维生产商TORAY生产的高强度碳素纤维，经过数百道工序精制而成。球拍结构经全面测试显示，球拍强度比一般球拍提升20%，球拍耐打性更久。', '高级碳素纤维', '高级碳素纤维', 85.0, 81.0, 670.0, '3u', '中等', 25.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1930.html');
