insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', Null, Null, '产品说明：\n1加大击球甜区，较一般球拍（72孔）多16个孔位，增加了穿线密度，在不增加拍面积的情况下，有效扩大了击球甜区。\n2球拍采用二次成型，使用日本高刚性碳素原料制成：\n(1)提升拍框刚性。\n(2)有效提升拍框及中管之抗扭力系数。\n3小钢炮技术(CannonTcchnique)：波力公司经过精密计算、排列与测试，开发出独家小钢炮技术，利用小钢炮技术搭配高刚性碳纤维的使用实现了球拍性能和手感完美结台。较一般球拍(72孔，竖线22排，横线23排)多l6个孔位，使网线密度加大，增加击球甜区及提高网压紧度。\n4小钢炮专利编号：ZL200720118958.6\n5纳米科技专利编号:ZL03149232.0', '高刚性碳纤维+纳米树脂', '高刚性碳纤维+纳米树脂', 87.0, 81.0, 675.0, 'G4', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6391.html');
