insert into detail values('羽毛球拍', '泰迪Tactic', '纳米系列', Null, Null, '扭力：低\n类型：纳米拍框\n平衡点:295mm\n颜色:蓝/黑\n特性：NAMIBLADE采用了新的技术和纳米材料做成，成功地实现了拍框强度的突出，是目前为止，高科技结构和高科技原材料的完美组合。\n备注：不穿线，附带单支球拍袋', '100%TORAY强化高密碳素纤维+热熔超强炭纤维', '100%TORAY强化高密碳素纤维+热熔超强炭纤维', 85.0, 85.0, 674.0, '-', '8度', 24.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_269.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium4系列', '4300', Null, '中管直径：7mm\n◎崭新设计恰当位置加入钛片\n◎轻盈设计\n◎纤幼中管\n◎优质，强劲及耐用', '钛粉末/石墨碳纤', '钛粉末/石墨碳纤', 89.0, 85.0, 675.0, '-', '柔韧', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_777.html');
insert into detail values('羽毛球拍', '凯胜KASON', '征服者系列', Null, Null, '颜色：红色(RE)/黄色(YE)/蓝色(BL)\n平衡点：290-295mm', '100%HiModulusGraphite+Titanium', '100%HiModulusGraphite+Titanium', 89.0, 85.0, 675.0, '-', '中度', 9.0, 10.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_83.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '窄边框风阻小，挥拍顺畅，反应灵敏，挥拍更顺手，不吃力；传统圆头框，击球扎实；波浪线槽设计，延长球线的寿命，维持较久的网压；增加击球力量；中杆硬度中等，合适中场平抽，控球', '高质量羽拍专用碳纤维', '高质量羽拍专用碳纤维', 91.0, 87.0, 675.0, 'G3(常用)', '中等', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4363.html');
insert into detail values('羽毛球拍', '佛雷斯FLEX', '钻石羽拍系列', Null, Null, '科技特点：\n钻石凸粒原理\n1、内框采用钻石凸粒设计，并采用纳米技术，将纳米分子渗入其中。使球拍框体的刚性更强，抗扭性更好，耐冲击力更高，且能承受更高的穿线磅数。\n2、甜区与其它球拍相比，提供了更多的有效击球面积，即使是偏离还需拍线床中心区的连续式扣杀，也能保持相应的精确和速度。\n3、拍框用高刚性航空材料+HOT-MET超刚性特殊纤维溶入分子互相结合，使拍框硬度提升16%，且扭力提升14%。\n\n球拍科技特点\n\n1、将流体横断面和盒式横断面之优完美结合；上部分是流体横断面，减少挥拍时的阻力，更好的提高扣杀速度，下部分是盒式横断面，增强拍框抗扭能力，提供击球的精确度；是进攻与防守的完美结合。\n2、中管直径6.5mm，小管直径7.5mm，使球拍框体抗压强度提升8%，拍框体耐冲击性能提升30%。\n\n高尔夫杆式设计\n拍杆采用高尔夫杆式的锥形设计，运用二次成型技术，使拍杆在击球时产生的折曲点向上提升20-30mm，让扣杀更具威力，更加华丽。\n\n特殊纤维材料\n\n拍杆采用40THOT-MELT特殊纤维材质，可以使抗扭力提升5%，弹性增加8%。', '超高碳素纤维', '高钢性碳纤维', 89.0, 85.0, 675.0, 'g2', '硬', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1507.html');
insert into detail values('羽毛球拍', '泰迪Tactic', '纳米系列', Null, Null, '扭力：低\n类型：纳米拍框\n平衡点:295mm\n颜色:红/白/灰\n特性：NAMIBLADE采用了新的技术和纳米材料做成，成功地实现了拍框强度的突出，是目前为止，高科技结构和高科技原材料的完美组合。\n备注：不穿线，附带单支球拍袋', '100%TORAY强化高密碳素纤维+热熔超强炭纤维', '100%TORAY强化高密碳素纤维+热熔超强炭纤维', 85.0, 85.0, 674.0, '-', '8度', 24.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_275.html');
insert into detail values('羽毛球拍', '波力Bonny', '扣杀系列', Null, Null, '1.破风式框型，利用空气动力学原理设计，降低球拍挥拍风阻，提高球拍击球速度和击球爆发力。\n2.顶框与3、9点波浪设计可延长球线的使用寿命，维持较久的网压、增加击球力量。\n3.中边框设计，击球有力，又不失轻巧。\n4.小平头设计，在考虑风阻之余，增加拍面积。\n5.中管加长，增加力臂，加强攻击力。\n6.适合攻击型打法选手选用。\n7.闪银后套设计，让球拍更具活泼感。', '高质量碳纤维', '高质量碳纤维', 84.0, 84.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3060.html');
insert into detail values('羽毛球拍', '波力Bonny', '维纳斯系列', Null, 2010, '1.特别针对女性选手属性设计，推出符合女性使用之规格与外观\n2.小平头设计，在考虑风阻之余，增加拍面积，轻盈灵巧，适合女性选手使用\n3.中边框设计，击球有力，又不失轻巧\n4.考虑女性身体素质，进行轻量化设计，强化球拍操控性能\n5.2、5、7、10点supermuscle设计，延长球线的使用寿命，维持较久的网压增加击球力量。\n6.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n7.5、7点Ti编织，加强拍框强度。\n8.外观采用最新开发镭射喷涂技术，让球拍底色透出镭射效果，靓丽新颖、提升质感，让球拍也成为装饰及搭配重点。\n9.闪银后套设计，让球拍更具活泼感。', '高质量碳纤维', '高质量碳纤维', 82.0, 82.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3114.html');
insert into detail values('羽毛球拍', '波力Bonny', '轻羽FT系列', Null, 2010, '1.超轻拍设计，体现波力工艺水平。\n2.特殊结构设计与搭配，在减轻重量同时兼顾耐用性与抗扭力，是一款工艺水平极高之球拍。\n3.超轻重量，搭配高平衡&加长中管特殊设计，让挥拍灵巧，又具有相当攻击性。\n4.中边框设计，击球有力，又不失轻巧。\n5.大平头拍面，增加击球面积。\n6.顶框波浪设计可延长球线的使用寿命，维持较久的网压、增加击球力量。\n7.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n8.外观采用最新开发镭射喷涂技术，让球拍底色透出镭射效果，靓丽新颖、提升质感，让球拍也成为装饰及搭配重点。\n9.闪银后套设计，让球拍更具活泼感。', '高质量碳纤维', '高质量碳纤维', 72.0, 72.0, 675.0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3058.html');
insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', Null, Null, '1.加大击球甜区，较一般球拍（72孔）多16个孔位，增加了穿线密度，在不增加拍面的情况下，有效的扩大了击球区。\n2.88孔的设计可因个人的喜好，适用不同磅数的网压，故此设计可适用初学者至专业选手各个层次之消费者。\n3.沿拍框360°分布88个线孔，纵向26排线，横向27排线，增加羽线的使用寿命。\n4.整支球拍二次成型。\n5.高档的水晶后套。', '高抗压性碳布头框', '高抗扭力30T碳纤维', 88.0, 82.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3723.html');
insert into detail values('羽毛球拍', '波力Bonny', '小钢炮SG系列', Null, Null, '1.加大击球甜区，较一般球拍（72孔）多16个孔位，些微增加了穿线密度，在不增加拍面的情况下，有效的扩大了击球区，及延长羽线的使用寿命。\n2.88孔的设计可因个人的喜好，适用不同磅数的网压，故此设计可适用初学者至专业选手各个层次之消费者。\n3.沿拍框360°分布88个线孔，纵向22排线，横向22排线。\n4.整支球拍二次成型。\n5.高档的水晶后套。', '高抗压性40T碳布头框', '高弹性碳素纤维+抗扭力碳素纳米管', 86.0, 82.0, 675.0, '2#', 'M', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3726.html');
insert into detail values('羽毛球拍', '波力Bonny', '纳米系列', Null, Null, '1.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。\n2.整支球拍二次成型：（1）提升拍框与中管结合性\n（2）扭力提升\n3.Woven中管：在软硬度维持一致的状况下，采用碳Woven材质，增加中管硬度，可提升扭力与弹性\n4.小平头窄边设计，在考虑球拍强度之余降低风阻增加挥拍的灵活度及攻击性。\n5.专利避震软前套设计：吸收球拍挥击时产生的震动，避免运动伤害产生。\n6.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n7.闪银后套设计，让球拍更具活泼感。', '高刚性头框+纳米材料', '碳Woven中管', 91.0, 87.0, 675.0, '2#', 'S', 26.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3546.html');
insert into detail values('羽毛球拍', '波力Bonny', '战神AE系列', Null, Null, '1.拍框采用刀刃式破风结构，在保证拍框强度前提下，将拍框做到刀刃般尖锐，扣杀时可大幅降低挥拍所产生之风阻。提高扣杀速度，增加扣杀时的破坏力。\n2.整支球拍二次成型，使用日本高刚性碳布制成：\n（1）提升拍框刚性→A.从容承受高磅数网压\nB.有效提升攻击系数\nC.提高击球瞬间，线的反弹能量\nD.强化拍框控制性，强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n3.高抗扭力中管：（1）提升中管扭力\n（2）强化中管弹性回复力\n4.拍内框3、9点内凹设计，增大甜区面积，扩大有效攻击区域，提升球拍的攻击力，同时单粒钉起到吸振效果，提高击球的稳定性。\n5.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n6.高档水晶后套，彰显球拍档次。', '高刚性40T碳素纤维+纳米树脂', '高弹性碳素纤维+抗扭力碳素纳米管', 88.0, 84.0, 675.0, '2#', 'H', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3544.html');
