insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium6系列', '6900', Null, '中管直径：聚焦型拍杆6.5mm-7.0mm\n轻盈设计\\崭新的渐进式独特设计中管优质\\强劲而耐用\n适合使用范围：（专业运动员）单打进攻型\n\nLaser6900采用黑、红两种主配色，乍看起来和6800很像，6800的图案以圆角为主，而6900以尖角为主。重量是RSL球拍一般采用的3U（85±1克），握把则是比较少见的G4规格。\n\nLaser6900羽毛球拍是RSL(亚狮龙)千禧六系列中，最顶级的Laser系列球拍中的单打拍，适合进攻型选手。延续了千禧系列的崭新轻盈设计\\恰当位置加入钛片\\纤幼中管\\进攻型优质\\强劲而耐用等优点。并应用了新型的聚焦型独特拍杆设计：从三通处往下4厘米处最细，拍杆直径只有6.5毫米，再往下直径逐渐加粗到锥盖处为7.5毫米。在保证拍杆的强劲同时又能得到高弹性，大力击球感觉不到震手。风阻小，提高了挥拍速度。进攻型选手刚开始使用此拍时，可能会有些不适应，感觉太轻，速度太快，有力使不上，其实扣杀出的力量已经打出来了。适应一段时间后，你会感觉轻轻的一挥，能打出意想不到力量。无论手感，击球感及实用度，都让你觉得它是超值的。', '超高炭素纤维融入鈦碳粉', '超高炭素纤维融入鈦碳粉', 89.0, 84.0, 675.0, 'G4', '中硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_830.html');
