insert into detail values('羽毛球拍', '佛雷斯FLEX', Null, 'CHALLENGER3', 2012, '球拍属于攻守兼备偏进攻，拍框采用破风设计，使杀球接杀速度加快，竹节中杆提供最好的回弹和减震效果。拍框5点和7点加厚设计提供良好的缓震和稳定。拍头垂直结构设计使得球拍拥有更强的攻击性，扩大了甜区的面积。锥形中杆使扣杀拥有更强大的力量', '超高刚性碳素纤维', '高刚性碳素纤维', 89.0, 85.0, 675.0, 'G2', '适中', 28.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_5779.html');
