insert into detail values('羽毛球拍', '奥立弗OLIVER', 'TITANIUM', Null, Null, '平衡290mm\n\n特\u3000\u3000性：\nA：窄边方头低断面设计，甜点区增大；\nB：加长握把，增加球拍控制范围，前套专利硅胶避震，减少25%震动；\nC：含有oliver特有的硅胶避震系统，属于进攻型球拍，适合初中级选手使用。', '高分子碳素钛合金', '高分子碳素钛合金', 86.0, 86.0, 675.0, '-', '高', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_359.html');
insert into detail values('羽毛球拍', '奥立弗OLIVER', 'TITANIUM', Null, Null, '特\u3000\u3000性：\na:窄边方头低断面设计.甜点区增大.\nb:加长握把,增加球拍控制范围.前套专利硅胶避震,减少25%震动\nc:属于进攻球拍,适合中级选手使用.', '高分子碳素钛合金', '高分子碳素钛合金', 84.0, 84.0, 668.0, '-', '中硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_360.html');
insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, 2011, '设计灵感来自丹麦国旗，独有双面双色（一面丹麦红色一面镀铬），细拍框、细拍杆，头较轻、中杆较硬，操控性强。', '40T刚性碳素纤维，超细拍框，超力量型', '40T刚性碳素纤维', 86.0, 86.0, 674.0, 'G5', '较硬（4）', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4967.html');
insert into detail values('羽毛球拍', '奥立弗OLIVER', Null, Null, 2008, '品牌：Oliver一.科技1、用高钢性碳纤维METACARBONTM为原料的拍子重量更轻，仍能维持低扭力值的球拍，在效能上采用高钢性碳纤维METACARBONTM所制造的球拍，除了能维持高档球拍所应有的特性之外，更高的钢性及力道传输更能充分提升选手运用的高爆发力及高技能的球技发挥；2、采用了MS弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；3、拍框形状为ISO方型，扩大了拍面的击球甜点区域；4、拍框和拍杆内部采用T型接头连接结构，以传送更大击球力量；5、拍柄加长10mm，有助于增强球员攻击性，适合大力杀球、增加快速反击性能。6、数字矩阵减震前套比传统一般减震拉片吸收震波更优秀7、用加厚弹性垫片增加能量存贮，更强的能量贮存，并以最快的速度释放出能量。8、出色的反击能量，迅速贮存能量并以最大的反弓力量把球击出！提升选手的反击力量。9、40T高尔夫中管，奈米镭射热溶真空成型。中管内壁厚度均匀，更有效发挥击球,平衡更佳。10、适合球员等级：力量与速度的象征,为专业选手量身定制的一款新型绝杀利器。', '高刚性钛碳纤维', '高刚性钛碳纤维+高弹性钛镍合金', 84.0, 80.0, 675.0, 'G4', '中软', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4088.html');
