insert into detail values('羽毛球拍', '凯胜KASON', '汤仙虎系列', Null, Null, Null, '超高弹性碳纤维&钛', '超高弹性碳纤维&钛', 89.0, 85.0, 675.0, 'G4', '偏软', 24.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_13.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'MP系列', Null, Null, '采用了新型MusclePower弧形筋力结构拍框线槽设计，有效地提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；\n2、拍框形状为ISO方形，扩大了拍面的击球甜点区域。与传统球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度：\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能：\n4、拍框采用了盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩。', '高弹性碳素纤维', '高弹性碳素纤维', 89.0, 85.0, 664.0, '3U', '-', 22.0, 17.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2514.html');
