insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, 2009, '平抽快打、接杀挑球、控制网前球十分轻快，力量传递毫无粘滞感，出球又快又准，630的弹性非常好。进攻性能方面，球拍虽然整体偏轻，但优质的材料和做工绝无影响到击球的扎实感，相反操作更轻盈.新版的宽边设计更“宽”了1毫米，拍框的整体耐受磅数就大为提高.', '超刚性碳素纤维', '高弹性加强中杆', 84.0, 80.0, 674.0, '台湾G2', '中杆硬度：8抗扭力：10.5以下', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2226.html');
