insert into detail values('羽毛球拍', '奥立弗OLIVER', 'WAVE', Null, Null, '特\u3000\u3000性：\na:拍框均为MP波浪形，扣杀时能几条线同时受力，大大增加反弹力；\nb:磨砂黑漆，耐磨、耐老化！\nc:全拍采用W**E网编织，大大提高柔韧性，扣杀更有力。', 'METACARBON&#8482;/高钢性钛碳纤维', '高尔夫中管', 87.0, 81.0, 668.0, '-', '中软', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_381.html');
