insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1.窄边大平头拍框设计，整支球拍用高刚性WOVEN碳布制成，增加拍框刚性，加强击球性和控球性。\n2.纳米科技\n采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上。\n3.适合专业选手使用的专业拍。\n4.100%严格筛选：不做任何补土、色漆喷涂，不经修饰，坚持挑选无瑕疵的高档拍！', '100%碳纤维+WOVEN编织+纳米技术', '100%碳纤维+WOVEN编织+纳米技术', 85.0, 79.0, 665.0, 'G2\\\\G3\\\\G4', 'S（主结构）、H、M', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2383.html');
insert into detail values('羽毛球拍', '高神Gosen', Null, Null, Null, '球拍特点：１、SPARKRRO碳编织技术，比普通拍框强度提高３０%；\n２、三通吸震软钉，降低击球时的震动感，获得更舒服的击球手感；\n３、专利GOSEN特有前套，双打控球手感更清晰\n４、全透明表漆，高碳材质立体质感清晰可见，附着性与耐磨性更出色\n５、SLIM超细拍杆，球拍更具灵动性', '碳纤维', '高系数碳纤维', 91.0, 87.0, 675.0, 'G5', '8.0-8.5（偏硬）', 24.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3453.html');
