insert into detail values('羽毛球拍', '邓禄普Dunlop', Null, '9000Lite', Null, 'Aerogel（气凝胶），世上最轻固体，因其甚似空气（比空气重三倍），故又被称作“冻结的烟”。气凝胶具有异常强大的隔热功能，一块一寸厚的气凝胶造，相当20至30块普通玻璃的隔热功能，如将气凝胶放在玫瑰与火焰之间，玫瑰丝毫无损。气凝胶在航天探测上也有多种用途，在俄罗斯“和平”号空间站和美国“火星探路者”的探测器上都有用到这种材料。\n\nAerogel（气凝胶）尽管其密度最低.重量最轻,却能轻松地承受其自身重量4000倍的压力,并同时具有最高的绝缘性能和高温稳定性.Aerogel（气凝胶）真正的太空材料.\n\n邓禄普DUNLOP是将Aerogel（气凝胶)运用于网.羽拍生产的第一家公司.从而使Aerogel（气凝胶）真正为其所有.其运用的这种技术不仅加强了拍框头部的硬度,而且将框振动减至最小,从而使球拍更具威力.在拍头底部的Aerogel（气凝胶）使球拍更稳固,从而使高级选手在打球时能更好地操控球', 'Aerogel.M-Fil+高级碳纤维', '高级碳纤维', 84.0, 84.0, 665.0, '-', '高弹力', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1218.html');
insert into detail values('羽毛球拍', '艾迪宝ADIBO', '碳素系列', Null, Null, '碳素系列羽毛球拍，是将碳素复合材料科技用于球拍制造工艺。采用世界最大纤维生产商TORAY生产的高强度碳素纤维，经过数百道工序精制围成。球拍结构经全面测试显示，球拍的强度比一般球拍提升20%，球拍耐打性更久。', '100%碳纤维', '100%碳纤维', 83.0, 81.0, 670.0, '3u', '软', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1897.html');
