insert into detail values('羽毛球拍', '奥立弗OLIVER', 'VISION梦幻', Null, Null, '特\u3000\u3000性：\nA:窄边方头低断面设计.甜点区增大.银色+灰色搭配\nB:加长握把,增加球拍控制范围.前套专利硅胶避震,减少25%震动\nC:高级坚实的头框加框外缘的W**E波浪系统，它提供球拍线更好的传送力，增加其POWER及扭力稳定性.Golfschaft(Golf中管)提供最佳的弹性及整体感。', 'METACARBON&#8482;/高钢性钛碳纤维', 'METACARBON&#8482;/高钢性钛碳纤维', 84.0, 84.0, 670.0, '-', '中性', 26.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_374.html');
insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', Null, Null, '1.专利新式螺纹碳柄，击球速度提升5%，握感舒爽有力，世界顶级超轻76g\n2.先进的微量避震前套具有极强的吸震功能\n3.NANO材料（纳米级二氧化硅）填充碳砂间隙有效提升球拍强度及降低疲劳', '高刚性碳素纤维+NANO材料', '高刚性碳素纤维+NANO材料', 78.0, 74.0, 675.0, 'G3G4', '软', 26.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2367.html');
insert into detail values('羽毛球拍', '泰迪Tactic', '潜能系列', Null, Null, '扭力：低\n类型：大平头\n平衡点:280±5mm\n颜色:红色/黑色\n特性：攻击力强。\n备注：不穿线，附带单支球拍袋。', '100%高密度碳纤维', '100%高密度碳纤维', 85.0, 85.0, 674.0, '-', '9度', 22.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_254.html');
insert into detail values('羽毛球拍', '索牌SOTX', 'D(铂金D)系列', 'D700', Null, '铂金D系列\n\n铂金D系列球拍是湖北羽毛球球队指定用品。是一种拍框内镶嵌具记忆功能的特殊合金金属丝，外镀高档汽车油漆的具铂金光泽外表的记忆性耐冲击力球拍。由于其创新的特点，优质的性能，独特的外观造型，受到广大羽毛球运动者和爱好者的亲睐，市场反响强烈，销售形势喜人。\n卖点：特殊记忆功能：在拍框内镶嵌了一根具有记忆功能的两条特殊合金金属丝，加上高碳纤维制造，具有减缓球拍老化，延长36%的球拍最佳击球周期。经典铂金：铂金般耐冲击力，能承受500万次强力冲击。高贵典雅：受次将高档汽车油漆运用到羽毛球拍领域，球拍\n外表和铂金一样耀眼夺目。\n\n平衡:288-294mm', 'HMCarbon高碳', 'HMCarbon高碳', 91.0, 85.0, 675.0, '2#3#', '8.0-8.5', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_526.html');
