insert into detail values('羽毛球拍', '川崎Kawasaki', '其它系列', Null, Null, '材料为40T超高钢性碳素纤维，性能超普通碳素纤维三倍\n★一般球拍的扭力为30度，SPEEDY（超鹰速）球拍能减少扭力6%-8%\n中管内接三通，吸震20%，同时使受力转折点从中管提升到三通处，在击球的瞬间加速球网的触球速度，完美的把力量由身体传导至球拍', '超高钢性碳素纤维+1KWOVEN编织+钛合金', '超高钢性碳素纤维+1KWOVEN编织+钛合金', 88.0, 84.0, 670.0, 'G2/G3', '8.0-8-2', 30.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1181.html');
insert into detail values('羽毛球拍', '李宁Lining', '立体编织系列', Null, Null, '杆软糖水\n分头重头轻\n非常适合拉吊打法\n亮点一：免钉孔技术：拍框3点和9点位置，采用线孔与拍框一体成型，去除了传统护线钉之后，网线与拍框直接接触，令力量反馈更直接、更清晰，击球更快速、更强劲！\n\n亮点二：机翼恒定系统：以超弹性3G钛合金打造拍框3、9点及以上部分。其卓著的记忆金属性质，将使拍框形变迅速复位，抗扭性也大大增强！\n\n亮点三：立体编织碳纤维：球拍本身采用的立体编织碳纤维，比一般碳纤维具有更高强度和刚性，经久耐用！据说从编制到加工，除了端点，中间绝不截断任何一束纤维，从而消除了拍身的接缝。藉此制造的球拍，让你真正得心应手，如臂使指。', '碳', '碳', 85.0, 85.0, 675.0, 'S2/S3', '偏软', 26.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2358.html');
