insert into detail values('羽毛球拍', '威尔胜Wilson', 'N系列', Null, Null, '1、nZone：全新的nZone线床科技，使击球甜区极大化。与nCode纳米科技共同创造出更耐打、更大威力和更佳击球性能。与普通球拍相比，具有2倍的强度，2倍的稳定性，并且增加了22%的威力。大大提升了整体碳素纤维结构的稳定性，将球拍内部未开发的潜能及稳定性完全释放出来，更好的拍框结构增加击球的爆发力；\n\n\n2、nCodeFrame：Wilson独家专利纳米制拍技术，将纳米级的SIO2（二氧化硅）渗透到每个碳纤维的空隙间，这种在碳纤维的分子键基准上进行的调整，巩固和增强了碳纤维的稳定性和强度，使球拍更强韧，更具弹性；\n\n\n3、包覆式三通（Outer-wrapT-Joint）：抗扭力更佳、控球更好、非甜区击球威力更大；\n\n\n4、改良型“火山型”威力前套（VolcanicPowerCap）：中空的火山型威力前套专利科技提供了中管更低的反折点，更长的反折距离(力臂)，从而增加球拍的反弹速度和威力；配上弹性校调中管，适合不同挥拍速度的选手；“火山型”威力横截面新的截面采用“火山型”专利技术；更强的“火山型”几何结构提供更高的拍框强度与威力；\n\n\n\n\n5、nTurboZones拍框设计：采用此设计的拍框，增加了3%的较大穿线区；更均衡的线床弹性，控球性更佳；非甜区击球更具威力；穿线孔较少、更少重叠穿线孔让拍框更耐用且可穿更高磅数；', '纳米超钢性高碳素纤维+碳素纤维', '纳米超钢性高碳素纤维+碳素纤维', 94.0, 90.0, 674.0, '56', '□低弹性√中等弹性□高弹性□超高弹性', 25.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4155.html');
