insert into detail values('羽毛球拍', '凯胜KASON', '新碳素时代系列', Null, Null, '框型：平头\n颜色：黄＋银\n重量：3U\n平衡点：280-290mm\n柄皮：PU\n网线：无\n拉网磅数：16－18LBS\n电脑标号码：6918089210224\n拍套：3支装拍包', '100%碳', '100%碳', 89.0, 85.0, 675.0, 'G3', '8.5-9.5（软）', 18.0, 16.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_167.html');
insert into detail values('羽毛球拍', '邓禄普Dunlop', Null, '2000XL', Null, '始创于英国。擅长将高科技成果应用于体育用品设计以使体坛明星达到其个人极限，同时代表着现代、流行和前卫，一向是为世界名将所推崇和喜爱的品牌。近百年来，在世界主要体育用品市场上（美国、澳洲、日本、欧洲等），DUNLOP的网球用品、羽毛球拍,壁球用品和高尔夫球用品系列一直雄居三甲之列，其中网球、壁球、壁球拍和高尔夫球等产品更是独占鳌头。\n\nAerogel（气凝胶），世上最轻固体，因其甚似空气（比空气重三倍），故又被称作“冻结的烟”。气凝胶具有异常强大的隔热功能，一块一寸厚的气凝胶造，相当20至30块普通玻璃的隔热功能，如将气凝胶放在玫瑰与火焰之间，玫瑰丝毫无损。气凝胶在航天探测上也有多种用途，在俄罗斯“和平”号空间站和美国“火星探路者”的探测器上都有用到这种材料。\n\nAerogel（气凝胶）尽管其密度最低.重量最轻,却能轻松地承受其自身重量4000倍的压力,并同时具有最高的绝缘性能和高温稳定性.Aerogel（气凝胶）真正的太空材料.\n\n邓禄普DUNLOP是将Aerogel（气凝胶)运用于网.羽拍生产的第一家公司.从而使Aerogel（气凝胶）真正为其所有.其运用的这种技术不仅加强了拍框头部的硬度,而且将框振动减至最小,从而使球拍更具威力.在拍头底部的Aerogel（气凝胶）使球拍更稳固,从而使高级选手在打球时能更好地操控球', 'Aerogel.M-Fil+高级碳纤维', '高级碳纤维', 85.0, 85.0, 675.0, '-', '高弹力', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1219.html');
insert into detail values('羽毛球拍', '奥立弗OLIVER', 'AEROFIGHTER绝地战警', Null, Null, '此拍重量为85克，有最新设计的硅胶避震装置，连接握柄和拍杆，令击球更加舒适！采用高刚性碳钛纤维，打造更优质的中管，柔韧性和反弹力极佳！偏进攻型', '纳米镭身热溶真空成型+WAVE系统+方形截面', '30T高尔夫中管+3DBRAIDED编织结构高弹性碳素+高钢性钛碳纤维', 85.0, 85.0, 670.0, '未知', '硬', 32.0, 32.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3126.html');
