insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2010, '整支运用真空电镀的制作，增强了油漆的亮度，用高档金属漆美化和装饰了球拍，从而在外观上展示出了高档羽拍的品位;采用纳米技术的球拍壁厚可减薄20%，从而使重量减轻约15%，而操控性能更优越.', 'TORRY24T+纳米碳素', 'TORRY24T+纳米碳素', 89.0, 85.0, 675.0, 'G2', '硬', 30.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4111.html');
