insert into detail values('羽毛球拍', '傲仕RS', Null, Null, 2009, '*粉红色的，针对女性业余高手设计，利用纳米新材料和高分子碳纤制成，通过纳米新分子溶剂以填补碳纤维间的空隙，使其更好的结合\n*纳米新分子增强了球拍的容忍性及减震，是强度和耐用度提高了百分之二十\n*拍框是以破风形加脊框设计，增强抗扭力，提高球怕的反应素的，威力强劲，同时减少风阻', '高强碳纤+纳米碳素', '高强碳纤+纳米碳素', 88.0, 86.0, 674.0, 'G2', '中', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2790.html');
