insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '130克全碳素加重训练拍\n新品DASHAMKI全碳素训练用拍，空拍重量130克（上线手胶后大概150-160克，平衡点大概300mm左右）\n用途：\n一，加强力量与爆发力；\n二，用加重训练拍击球，一点点击球拍面不正出球就会比普通球拍偏很多，发力稍不协调就会击球比普通球拍难受，可以把自己的缺点放大，发现并纠正；\n三，用于普通的场上对抗，如果经常要跟明显不如自己的球友打球，如LP或者GF等等，用这种球拍与她们打球，娱乐之余不误训练，不容易滋生浪费时间不耐烦的感觉。\n四，与用壁球拍与网球拍训练相比明显的优势，除了可以上场用于对拉练习，另外一点就是，加重训练拍的拍柄是羽毛球拍的尺寸，所以可以发力的时候紧握球拍的感觉与传统球拍一样，可以练习到手指发力。', '碳素', '碳素', 130.0, 130.0, 673.0, 'G2', '中硬', 35.0, 10.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1823.html');
