insert into detail values('羽毛球拍', '索牌SOTX', 'WOVEN系列', 'WOVEN11', Null, '平衡点295±5mm\n\n性能特点\n\n1、采用最新的WOVEN（昂贵的航空编织材料）编织而成，使球拍每点均达到最好的强度和韧性，受力更加均匀，手感极佳，适用于高级专业选手，适合高磅数，厂家保证最高可承受32磅拉力；\n..2、拍框采用MusclePower弧形筋力结构拍框线槽设计；\n..3、拍框形状为ISO小平头，扩大了拍面的击球甜点区域；\n..4、亮光漆表面，清晰可见拍体内部的Woven编织纹络。\n\nWoven特性介绍：\n\n1、是由800D高碳纤维和玻璃纤维合成，造就球拍超越传统材料的韧性，从而达到更好的手感。\n2、是成90度的编织，使球拍达到最佳的受力状态，从而使Woven的球拍最高拉线磅数可达30磅左右，详见各款。\n3、异于传统设计（不同受力角度采用不同角度的碳纱）每一点的受力都能达到均衡，使结构的稳定性更加趋于完美。\n4、经过高科技合成，完全不含溶剂，使球拍具有更好的稳定性和控球性。\n\n原价', '超级碳＋WOVEN', '超级碳＋WOVEN', 91.0, 87.0, 680.0, '2#/3#', '8.0-8.5', 31.0, 31.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_560.html');
