insert into detail values('羽毛球拍', '佛雷斯FLEX', '霹雳马系列', '868', Null, '以高科技材质制造出重量更轻,仍能维持低扭力值的球拍.在效能上采用高钢性碳纤维材料所制造的球拍,除了能维持高档的球拍应有的水准之外,更高的刚性(HIGHERRIGIDITY)及力道传输更能充分提升选手运用的高爆发力及高动能的球技发挥', '高系数碳素纤维', '高系数碳纤维', 89.0, 85.0, 670.0, '-', '适中', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_863.html');
insert into detail values('羽毛球拍', '威克多VICTOR', '其它系列', Null, Null, '嶄新設計的球拍風格，以大黃蜂的黃黑相間鮮明色調為概念，搭配蜂巢狀的閃耀塗裝使整體視覺更潮流時尚。操控型中平頭的BUMBLEBEE02，是您球場競技的夢幻選擇。', '超高剛性碳纖維+奈米樹脂', '超高剛性碳纖維+奈米樹脂+7.0shaft', 89.0, 80.0, 675.0, 'G2', 'S○○●○○F', 4.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3289.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, 'HEADMetallix是目前最轻最坚固的一种新型材料，由特殊设计成矩形排列的碳素材料结构和晶体金属合金制成，新的微粒尺寸比普通金属微粒小1000倍，进一步减小微粒间隙，提升球拍整体性能，更小的密度，更强的材质\n\nHEADMetallix被填充在羽毛球的拍头和T-joint位置，和Metallix10000tour8000tour和6000tour的拍头2.5.7和10点钟位置和Metallix4000Tour和8000TOur的2点和10点钟位置，结果是非常坚硬，耐用和抗扭力强的拍框，从而提升速度，威力和准确度\n\nEnergyBody是一个把球拍顶部11点钟到1点钟位置的拍框变细的结构设计，这样可使减少空气的阻力，加快速度，增强威力，操控更灵活。\n\nTopcap的握把顶部表面为平的，发球时提供绝佳的把持力，发挥最大的把手控制，还可以为快速反击提供最理想的操控', 'metallix，HMG', 'metallix，HMG', 94.0, 80.0, 675.0, 'G3—G5', '中硬', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2319.html');
