insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', 'Ti620', Null, '既不是轻盈的白鸽，也没有雷霆一击的威力。有的，只是池边的蛙声，风中的鸟吟。620是一把守中带攻的平衡拍，只有足智多谋，变化多端的人才能够得心应手，相得益彰。球场上，这柄金色的利剑唤醒你对王者的渴望，对胜利的追求。', '高刚性碳纤维', '高刚性碳纤维', 86.0, 86.0, 675.0, '4G', 'medium', 30.0, 30.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_3105.html');
