insert into detail values('羽毛球拍', '波力Bonny', '乌缺ZD系列', Null, Null, '1.破风式拍框，在保证拍框强度前提下，将拍框做到最纤细，进一步降低挥拍时的空气阻力，并提高扣杀速度，增加球拍攻击力。\n2.整支球拍使用日本高刚性碳布制成：\n（1）提升拍框刚性→\nA.从容承受高磅数网压\nB.有效提升攻击系数\nC.强化拍框控制性→强化控球效能\n（2）有效提升拍框及中管之抗扭力系数→\nA.强化控球效能\nB.提升击球手感\n3.乌缺工艺，100%严格筛选：不做任何补土、色漆喷涂，不经修饰，完整呈现无瑕疵的碳纤维纹路，坚持挑选成型优良的高档拍！\n4.纳米科技：采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者更加体会球质和球速的奥妙。耐用度增加50%以上。\n5.头框线孔采用金字塔结构，增强头框刚性强度，让羽线力量分布更加均匀。\n6.侧框使用1K碳编织强化拍框强度并提升质感。\n7.1K碳Woven中管设计，有效提升球拍抗扭力效果，并显现高档质感。\n8.单线孔设计+双连钉使用，提升线的耐久性，减缓掉磅。\n9.采用特殊透明漆及炫彩水标设计，呈现高品味的经典质感。\n10.高档水晶后套，彰显球拍档次。', '高刚性碳布', 'Woven高刚性中管', 87.0, 87.0, 675.0, '-', 'M', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_3124.html');
