insert into detail values('羽毛球拍', '波力Bonny', '钛装甲系列', Null, Null, '1.中边拍框，适合攻击与防守，小平头设计，在考虑风阻余，增加拍面积\n2.挥拍更顺手，不吃力\n3.顶框加钛装甲，增强线孔拉力，增加顶框刚性，增强击球性能\n4.软前套设计，增加避震功能', '100%碳纤维+Ti片', '100%碳纤维+Ti片', 89.0, 85.0, 665.0, '中', 'M（主结构）、H、S', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2371.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', 'Millennium5系列', '5800', Null, '平衡点：+ControlBALANCE\n适合使用范围：双打防守\\平抽快打\n特点:崭新轻盈设计、纤幼中管、进攻性较强、控球精确、耐用。\n点评：平头拍框设计增大了击球甜区。全拍框加钛粉让拍框使用更耐用控球更精确。7.5mm高密度多层碳素拍杆支持高速的挥拍、强力的扣杀技，术。采用了反回旋技术挥拍时更自如，拍杆更柔韧。专为单打攻击型的球员而设计。详细性能：伸缩扭力结构是RSL品牌最新研究而成的一种特性设计超柔幼韧性拍杆和适度平衡点的设计完美配合，令其在轻巧的拍杆中爆发更大的攻击力。高密度多层石墨结构，能让在拉线时得到充分的支撑并能承受双倍的冲击力。因为高密度多层石墨结构,因此成份的数量和位置的选择就很重要了。太多=扩张力与承受力降低太少=缺乏力量去承受冲力。在拍杆增加适当的反回旋力设计，能令拍子更耐久、更有伸缩力和防止拍杆回旋。', '高碳素纤维', '高碳素纤维', 89.0, 84.0, 670.0, 'G3,G4,G5', '中硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_781.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, 'joobong，这个以韩国羽毛球历史上最著名的运动员命名的品牌。就好像中国的李宁牌一样，是韩国的骄傲。而朴柱奉自从创办joobong这个品牌以来，就以最严格的品质要求，最领先的开发战略，推出了一款又一款经典的羽毛球拍，成为韩国很多羽毛球爱好者和中高级选手的最爱。\nT-Jeibee1900是joobong的经典款式之一，韩国售价是12万多韩币。在中国零售价也是600多元。1900的手感极佳，跟同等价位的YY相比，还显得更加柔顺，适合用来做技术球，扣杀也很厉害。', '碳素', '碳素', 89.0, 87.0, 675.0, '略', '略', 29.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2791.html');
