insert into detail values('羽毛球拍', '佛雷斯FLEX', Null, '999', Null, '最新独特的内框内凹设计，最大限度提升羽线弹性，击球时可减少对手柄的振动。拍框内凹整圈加防弹材料KEVLAR，增加头框重量，使击球惯性加大，令扣杀更准确，更有力。外框带MUSCLE能最大限度延长框体与羽线的寿命。涂装是全新的高级镜面银，配以烫银标设计，使整支球拍给人以高贵、典雅之感', 'Kevlar', '高碳纤维，镍钛合金丝', 89.0, 85.0, 665.0, 'G2', '硬', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_800.html');
insert into detail values('羽毛球拍', '佛雷斯FLEX', '星座拍系列', Null, Null, 'A:高强度头框－－流线型\u3000高断面拍框\u3000能承受高磅数拉线张力\n\nB:加长握把,增加球拍控制范围.\n\nC:方形拍头与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积(击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度。\n\nD:中管采用了热熔碳纤维材质制造的高性能羽中管－－可以增加球拍的稳定性，均匀，提高弹性', '高系数碳素纤维', '高系数碳纤维', 84.0, 80.0, 665.0, '-', '偏硬', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_836.html');
