insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', Null, Null, '1、超轻构造\n使用先进的nano技术，使球拍真正的做到了超轻、高强度；中管超强的抗扭性能使挥拍时更骨速度感及可操控性。\n2、碳纳米结构\n新型的CARBONNANOTUBE材料与碳纤维间树脂的有机结合。有效填充间隙，，极大的提升了球拍的耐疲劳性能，提高击球速度，与普通的成型方式及材料比较。其综合性能更优，在保证相同强度的前提下，重量可以降低10%。\n3、释能钛\n维护球拍轻化的基础上，中管下端采用“EXPEND钛”新型高科技材料，不但使中管强度加强，更使球拍击球时弯屈点上移，回球更加迅速！\n4、中平头框体\n采用中平头框体架构设计，提供更大的击球甜区，提供更好的可操控性能。\n5、中管30T碳砂设计\n中管30T碳砂设计，提供超强的抗扭性能', '高刚性碳素纤维＋真空电镀材料', '高刚性碳素纤维＋真空电镀材料', 89.0, 85.0, 675.0, 'G3,4,5', '适中', 26.0, 22.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_2329.html');
