insert into detail values('羽毛球拍', '阿尔法Alpha', Null, Null, 2007, '拍头/框形：椭圆框\n平衡点：285-290MM\n\n1、NANO科技，加强分子结构，增加了球拍的刚性和稳定性，有效降低球拍疲劳，有利于进攻型选手发挥更强大的威力；\n2、高纯度碳纤维+编织航空钛材料混合，经过高精度二段式工艺完美地连接，使球拍减轻重量的同时提升强大的力量性能和更为舒适的手感；在球拍的纤维间隙中加入TI材质的填充剂，使拍杆更纤细更强韧，带来惊人的操控性能和高反弹性，同时减少球拍震动；\n3、12点钟附近采用MUSCLEPOWER设计，减少球线拉力的流失，更好地保持击球的手感；', '碳素纤维', '碳素纤维', 84.0, 80.0, 0, '-', '-', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_349.html');
insert into detail values('羽毛球拍', '阿尔法Alpha', Null, Null, 2007, '拍头/框形：中平头\n平衡点：290-295MM\n\n1、NANO科技，加强分子结构，增加了球拍的刚性和稳定性，有效降低球拍疲劳，有利于进攻型选手发挥更强大的威力；\n2、高纯度碳纤维+编织航空钛材料混合，经过高精度二段式工艺完美地连接，使球拍减轻重量的同时提升强大的力量性能和更为舒适的手感；在球拍的纤维间隙中加入TI材质的填充剂，使拍杆更纤细更强韧，带来惊人的操控性能和高反弹性，同时减少球拍震动；\n3、拍框顶部采用盒式截面设计，给大力击球提供了更高的稳定性和较小的扭矩；\n4、12点钟附近采用MUSCLEPOWER设计，减少球线拉力的流失，更好地保持击球的手感；', '高弹性碳纤维+纳米', '高弹性碳纤维+纳米', 94.0, 80.0, 0, '-', '中硬', 0, 0, Null, 'https://www.badmintoncn.com/cbo_eq/view_348.html');
