insert into detail values('羽毛球拍', '索牌SOTX', 'SK系列', 'SK08', 2007, '平衡点288-299mm\n\nSOTX的“SK”系列羽拍的新技术：\n1、采用“锋速”框\n原理：“锋速”框3、9点处的三角形构造，新概念拍框，12%加速度。\n三角形截面凹槽三角形截面盆形截面，有效的减低风阻系数，瞬间提速8%。\n纯锐角锋面设计，中间厚，两边薄，从而最大限度增加空气动力等功效，瞬间加速4％。\n由上而下渐变式滴水设计，构型更加稳固流畅，抗扭转性极强，在遭受强劲冲击能快速回应，消压于无形，使得球拍可控性更强，攻守更均衡。\n2、惯性科技\n独特的中管鼓性设计，将调节球拍平衡与减震功能智慧融合，卓尔外观彰显骑士般的潇洒气度，堪称欧式美学与运动美学的完美典范，同时采用SOTX-索牌革命性突破传统结构的最新技术研发的“锋速”框，能瞬间加速12%，极速进击，锋向披靡，是球场上的进攻猛禽。', '高碳', '高碳', 89.0, 83.0, 675.0, '2#/3#', '9.0—9.3', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_517.html');
