insert into detail values('羽毛球拍', '川崎Kawasaki', 'Pro系列', 'PRO890', Null, '星级：★★★★★\n适合球员类型：专业单、双打进攻防守均宜\n\n\nkawasaki球拍Heart（凝动力系列）在综合kawasak多年研究和生产经验的基础上经过不断改革，采用了目前世界上最先进的材料科技——凝动力，使球拍在获得更快击球速度和更好回球控制的同时，更具耐用性。\n\n凝动力技术\n凝动力：学名“空气凝胶（aerogles）”，是氧化硅与聚异氰酸脂交叉得到的化学物质，具有质轻、坚固、防潮、隔热的优越性能，是目前世界上最轻却最坚固的材料。kawasak凝动力在球拍的三通处的应用，使球拍性能得到大幅度提高，极大的提高了能量传递的效率', '凝动力技术+超高钢性碳素纤维+钛合金+1KWOVEN编织', '凝动力技术+超高钢性碳素纤维+钛合金+1KWOVEN编织', 86.0, 82.0, 665.0, 'G2/G3', '8.5-9.0', 28.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1179.html');
