insert into detail values('羽毛球拍', '川崎Kawasaki', 'Impact系列', Null, Null, '川崎2星的拍子，适用于初级业余爱好者，平衡点290mm左右。\n偏进攻一点。感觉适合男生。\n价钱也不贵（实体店+yy65正品线260左右，网上应该更便宜些）\n推荐新手买，相对那些推荐给初级爱好者的彷拍，这款的感觉还是很不错的。', '高弹性碳素纤维', '高弹性碳素纤维', 89.0, 85.0, 675.0, 'G2（发现川崎的和其它的拍柄尺寸标准貌似不一致？）', '7.5-8.0', 26.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2439.html');
