insert into detail values('羽毛球拍', '奥立弗OLIVER', 'WAVE', Null, Null, '特点：\nA：窄边方头低断面设计.甜点区增大.\nB：.前套专利硅胶避震,减少25%震动\nC：高级坚实的头框加框外缘的WAVE波浪系统，它提供球拍线更好的传送力，增加其POWER及扭力稳定性，同时避免线受力而产生的直角切割，有效的保护线的安全\nD：Golfschaft(Golf中管)提供最佳的弹性及整体感。平衡相对靠前，是一款中性拍，适合初、中级选手使用。', 'METACARBON&#8482;/高钢性钛碳纤维', '钛合金+高尔夫中管', 87.0, 81.0, 668.0, '-', '中软', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_382.html');
