insert into detail values('羽毛球拍', '奥立弗OLIVER', Null, Null, Null, '特\u3000\u3000性：\na:小圆头低断面设计.拍速块，控制灵活.\nb:加长握把，增加球拍控制范围.前套专利硅胶避震，减少25%震动\nc:两段式真空成型中管，提供最佳的弹性及整体感。\nd:3DBraided编制结构', '100%Metacarbon，Wovenkevler（高刚性钛碳合金）', '100%Metacarbon，Wovenkevler（高刚性钛碳合金）', 84.0, 84.0, 668.0, '-', '坚硬', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_356.html');
