insert into detail values('羽毛球拍', '泰迪Tactic', '轻装甲系列', Null, Null, '扭力：低\n类型：大平头\n平衡点:295mm\n颜色:草绿/银灰\n特性：全新的碳素纤维与特殊金属复合钛装甲结构（CarBornFiber+UForceTi=AMORTIC装甲技术)“UForceTi”是特殊金属复合物，能产生2倍于碳素纤维的地心引力，将UForceTi配置于羽毛球拍前三分之一的拍框顶端，使球拍挥动时的惯性力得到提升，击打羽毛球的能量获得增强。\n\n全新的拍头边缘压缩型结构设计，增强3%的拍面稳定性，能有效抵抗拍框扭曲变形的机会和有效提高击球能力，带来“金属式”般质感的击球感觉。\n创新的T形护线钉和通过对拍框承载能力的反复改良，ANORTIC球拍的拍线保护能力大为提高，以满足球员喜欢高张力的要求。\n为双打球员提供新型的C.S.CAP精确制导拍柄锥(ControlSupportCap)AMORTIC羽毛球拍的新型拍柄锥盖平面比传统的羽毛球拍柄锥盖扩大88%的实用面积，创新的锥盖形状和更宽大接确面积，让拇指更易于握紧和控制球拍，使高速反手挥拍便得迅捷、精确。\n\n更轻量化的Ultimumti镍钛记忆合金拍杆（AT-700）和更轻巧的拍身净重（4U级别），使更灵活的身体动作和更轻盈的步法移动得以实现。\n\n备注：不穿线，附带单支球拍袋。', '100%强化高密度碳纤维+复合钛', '100%强化高密度碳纤维+复合钛', 85.0, 85.0, 674.0, '-', '8.5度', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_228.html');
insert into detail values('羽毛球拍', '泰迪Tactic', '轻装甲系列', Null, 2008, '扭力：低\n类型：大平头\n平衡点：295mm\n颜色：紫蓝/金\n特性：新的碳素纤维与特殊金属复合钛装甲结构（CarBornFiber+UForceTi=AMORTIC装甲技术)“UForceTi”是特殊金属复合物，能产生2倍于碳素纤维的地心引力，将UForceTi配置于羽毛球拍前三分之一的拍框顶端，使球拍挥动时的惯性力得到提升，击打羽毛球的能量获得增强。\n\n全新的拍头边缘压缩型结构设计，增强3%的拍面稳定性，能有效抵抗拍框扭曲变形的机会和有效提高击球能力，带来“金属式”般质感的击球感觉。\n创新的T形护线钉和通过对拍框承载能力的反复改良，ANORTIC球拍的拍线保护能力大为提高，以满足球员喜欢高张力的要求。\n为双打球员提供新型的C.S.CAP精确制导拍柄锥(ControlSupportCap)AMORTIC羽毛球拍的新型拍柄锥盖平面比传统的羽毛球拍柄锥盖扩大88%的实用面积，创新的锥盖形状和更宽大接确面积，让拇指更易于握紧和控制球拍，使高速反手挥拍便得迅捷、精确。更轻量化的Ultimumti镍钛记忆合金拍杆（AT-700）和更轻巧的拍身净重（4U级别），使更灵活的身体动作和更轻盈的步法移动得以实现。\n备注：不穿线，附带单支球拍袋。', '100%强化高密度碳纤维+复合钛', '100%强化高密度碳纤维+复合钛', 85.0, 85.0, 674.0, '-', '8.5度', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_230.html');
insert into detail values('羽毛球拍', '泰迪Tactic', '轻装甲系列', Null, 2008, '扭力：低\n类型：大平头\n平衡点：295mm\n颜色：红/银\n特性：新的碳素纤维与特殊金属复合钛装甲结构（CarBornFiber+UForceTi=AMORTIC装甲技术)“UForceTi”是特殊金属复合物，能产生2倍于碳素纤维的地心引力，将UForceTi配置于羽毛球拍前三分之一的拍框顶端，使球拍挥动时的惯性力得到提升，击打羽毛球的能量获得增强。\n\n全新的拍头边缘压缩型结构设计，增强3%的拍面稳定性，能有效抵抗拍框扭曲变形的机会和有效提高击球能力，带来“金属式”般质感的击球感觉。\n创新的T形护线钉和通过对拍框承载能力的反复改良，ANORTIC球拍的拍线保护能力大为提高，以满足球员喜欢高张力的要求。\n为双打球员提供新型的C.S.CAP精确制导拍柄锥(ControlSupportCap)AMORTIC羽毛球拍的新型拍柄锥盖平面比传统的羽毛球拍柄锥盖扩大88%的实用面积，创新的锥盖形状和更宽大接确面积，让拇指更易于握紧和控制球拍，使高速反手挥拍便得迅捷、精确。更轻量化的Ultimumti镍钛记忆合金拍杆（AT-700）和更轻巧的拍身净重（4U级别），使更灵活的身体动作和更轻盈的步法移动得以实现。\n\n备注：不穿线，附带单支球拍袋。', '100%强化高密度碳纤维+复合钛', '100%强化高密度碳纤维+复合钛', 85.0, 85.0, 674.0, '-', '8.5度', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_231.html');
insert into detail values('羽毛球拍', '泰迪Tactic', '交叉穿线系列', Null, Null, '扭力：低\n类型：太平头\n平衡点:295mm\n颜色:枣红\n适用者：中、高级选手\n特性：专利交叉穿线，加强最大弹力，主干加长，适合于后排助攻。\n1)泰迪球拍采用交叉穿线技术，应用于拍框中部以下，增强球拍在击球过程中的能量传递效率，有效提高扣杀能量5%。\n2)立体的穿线方式，令每根拍弦储备了一定的能量。\n3)泰迪交叉穿线系列球拍增强12%的反弹力\n备注：不穿线，附带单支球拍袋。', '100%强化高密度碳纤维+交叉穿线技术+AMORTIC顶框', '100%强化高密度碳纤维+交叉穿线技术+AMORTIC顶框', 85.0, 85.0, 674.0, '-', '8.5度', 24.0, 18.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_232.html');
