insert into detail values('羽毛球拍', '威尔胜Wilson', 'V系列', Null, Null, '此款为WilsonV系列之一，型号为V8（加长型）。\nV-TECH所含科技为改良型“火山型”威力前套\n最新专利改良型火山口威力前套科技，提供了中管更低的反折点，更长的反折距离（力臂），从而增加球拍的反弹速度和威力。\n\n产品特性：\n1.中等弹性，控制性能佳；\n2.是那些寻求控制力与力量并举的选手最佳选择；\n3.属全能型球拍，有效提高选手的攻防能力。', '高刚性碳纤维', '高刚性碳纤维', 85.0, 85.0, 674.0, 'G2/G3', '中等', 18.0, 15.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2002.html');
insert into detail values('羽毛球拍', '威尔胜Wilson', 'N系列', 'N78790', 2008, '羽毛球拍参数：\n\n材质：NCODE超钢性碳纤维/碳纤维。\n\n中管硬度：高弹性中管。\n\n拍框尺寸：361平方厘米/56平方英寸。\n\n未穿线平衡点：28.8±0.5厘米。\n\n未穿线重量：87±2克。\n\n长度：674毫米。\n\n质保磅数：26磅。\n\n球拍推荐：综合型羽拍.本款球拍适合中级水平的男女球员。\n\n重要科技：\n\n1、NCODE科技：Wilson运用纳米技术制造羽毛球拍，球拍经过NCODE制程，纳米级的二氧化硅晶体渗透到超钢性碳纤维的空隙间。这种在碳纤维的分子键基准上进行的调整，巩固和增强了碳素纤维的稳定性和强度，因此，NCODE科技的球拍比一般球拍多2倍的耐用性，2倍的稳定性和增加22%的威力。\n\n2、nTurboZones拍框设计其优点：*、增加2.8%较大穿线区（56.37*s54.28平方英寸）。B、更均衡的线床弹性，控球性更佳。C、非甜区击球更具威力；穿线孔较小、较小重复线孔（8vs20-24）让拍框更耐用且可穿较高磅数。\n\n3、组合型护线管，能有效调节球线的张力，使球拍最佳击球区的弹性更均衡！\n\n4、包覆式三通设计：使球拍抗扭力更佳、控球更好，非甜区击球威力更大。\n\n5、新型威力软质前套。采用丁基乙基橡胶制成。提供了中管更低的反折点，更长的反折距离（力臂），从而增加球拍的反弹速度和威力。', 'NCODE超钢性碳纤维/碳纤维', 'NCODE超钢性碳纤维/碳纤维', 89.0, 85.0, 674.0, '361平方厘米/56平方英寸', '高弹性中管', 26.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1732.html');
