insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1、宽边拍框设计，适于进攻\n2、大平头设计，增加击球面积\n3、2、5、7、10点波浪设计，可延长球线的寿命，维持较久的网压，增加击球力量。', '高质量羽拍专用碳纤维', '高质量羽拍专用碳纤维', 89.0, 85.0, 675.0, '-', 'M（主结构）、H、S', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2389.html');
insert into detail values('羽毛球拍', '波力Bonny', Null, Null, Null, '1.窄边大平头拍框设计，整支球拍用高刚性WOVEN碳布制成，增加拍框刚性，加强击球性和控球性\n2.纳米科技采用波力最新纳米材料，使球拍有超强韧性，为球拍高新科技材料的应用带来革命的突破。强化球拍的减震和平衡性及其它性能与材料更均匀分布的特性，使用者能更加体会球质和球速的奥妙。耐用度增加50%以上。\n3.新工艺突破，冲突的结合：扭距弹力系统：头框加重，增加攻击效能；增加中管弹性与力臂，使挥拍更佳灵巧、轻松。让球拍增加攻击力之余，同时具备轻量质感，将互相冲突的两大优点集于一身。', '100%碳纤维+WOVEN编织+纳米技术', '100%碳纤维+WOVEN编织+纳米技术', 85.0, 79.0, 665.0, '-', 'M（主结构）、S、H', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_2391.html');
