insert into detail values('羽毛球拍', '艾迪宝ADIBO', '镍钛系列', Null, Null, '采用原装进口三菱钛丝（TI）中管。21条金属钛互相支撑中管，强化中管强度，使球拍扭动幅度更小，操控性能精准，手感更优异。第二代超刚性碳纤维-极大的提升球拍的坚硬度，以适应击打出更快速、更有力、落点更准确、更有控制性的球。', '超刚性碳素纤维', '超刚性碳素纤维', 87.0, 83.0, 670.0, '3u', '中等', 25.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1910.html');
