insert into detail values('羽毛球拍', '艾迪宝ADIBO', '镍钛系列', Null, Null, 'NITI（镍钛系列）羽毛球拍，是以最先进的科技用于球拍制造工艺，采用日本TOKAY（东丽）T-700高级碳砂，融合镍元素，经过高温高压（热融技术）使球拍拍框增加硬度：使其能承受更高磅数球弦所产生的张力，使中杆有更强的韧性，使击球更有威力，能有效防止震荡、解决传统木柄因木纹引起的震荡。', '100%高弹性碳纤维+镍钛', '100%高弹性碳纤维+镍钛', 89.0, 85.0, 675.0, '3u', '特硬', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1913.html');
insert into detail values('羽毛球拍', '艾迪宝ADIBO', '纳米系列', Null, Null, 'WOVEN（编制纤维系列）羽毛球拍，使用高科技的生产工艺，将碳纤维和WOVEN（编制纤维）相结合，造就球拍超越传统材料的强度，有效增加球拍的硬度和提升球拍的抗扭力，使整治球拍极具攻击力。90%的编制纤维，使WOVEN系列球拍可达到30LBS以上拉线张力。', '高弹性编织碳纤维+钛网', '高弹性编织碳纤维+钛网', 87.0, 83.0, 675.0, '3u', '特硬', 28.0, 28.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_1916.html');
