insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, Null, '不加长则挥动惯性不会太大，防止发力不慎受伤。\n加大拍面，用MP拍框等，可以加大击中球的概率，适合尚在建立球感过程中的爱好者。\n简评：真正意义上的新大傻管理团队本年度处子之作，在严格的质量监督下生产，扎实的做工，新颖、朝气的配色，舒适的手感，带给广大球友新的感觉、新的信心！', '高级碳素纤维（碳纱含量比例：30暾）', '高级碳素纤维（碳纱含量比例：30暾）', 89.0, 84.0, 664.0, 'G2', '8.6±3（韧度佳）', 30.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_930.html');
