insert into detail values('羽毛球拍', '其它品牌Other', Null, 'AT06', 2021, 'REDSON继中高端热销拍款AT28推出数年后，发表了高规AT06，成功将SG无护线管设计移植到本系列中，产生更多样变化后，直接挑战ShapeSG最高地位。\n【外观】\n简单俐落的深墨绿色与白色波纹作结合设计，看起来像是把深藏不漏的剑，简单中略有杀气。烤漆部份在拍框与中杆呈现立体颗粒状，触感明显外，增加挥拍时空气导流可能。\n【拍框】\n框架与28相同，小平头72孔低风阻框架，相同的WOVEN材质架构，去掉大面积护线管，仅保留上下方两侧护线管。\n【中杆】\n中杆不是以28/28S的WOVEN材质架构，以超高强度刚性碳纤维设计，感受硬中略带有优秀的弹。\n【线床反应】\n原本在28/28S框架外侧的MuscleFrame拱桥外框形状取消，改为全内凹槽框架形式，线床更贴合拍框，搭配无线孔设计，线床反应更加紧密直接。\n【护线管差异】\n就现阶段条件下，与SG相同均保留部份位置护线管，SG使用护线连钉，06则使用单颗双线孔护线管。', '碳纤维', '碳纤维', 89.0, 80.0, 674.0, 'G5', '偏硬/适中', 4.0, 20.0, '3U(285-290mm)/4U(290-295mm)', 'https://www.badmintoncn.com/cbo_eq/view_11976.html');
