insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'ISO-80VF', Null, 'ISO-80VF是YONEX2002年的新产品之一，是ISO-87VF的替代产品。VF即“Vari-Frame”，意为AR、CAB二合一拍框。\n1、拍框两侧中部采用了新型防震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳。\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框上半部采用AR破风式设计，减小了空气阻力，提高了击球力\n4、拍框下半部采用CAB盒式截面设计，减小了击球扭矩，提高了拍面稳定性、耐久性', '碳素纤维', '碳素纤维', 94.0, 90.0, 664.0, '-', '偏软', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11892.html');
