insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB-017CAB017', Null, 'CARBONEX系列---造就了一代又一代的职业冠军\nCarbonex系列球拍的盒式横断面拍框设计,拥有极佳的拍面稳定性和极高的承载耐久性。当准确的甜区中心击球时，能产生响亮的击球声和反馈扎实的击球手感，为球员提供落点极其精确的回球。现在，更增加了许多先进要素，更使其历久常新。因此，有众多的职业球员对Carbonex系列情有独钟。\n\n一、破风Areo\n拍框采用流体力学形状设计，形似流线型飞机翼，可将空气阻力降至最低，挥拍时空气能更快地流过狐形表面，提高了挥拍的速度和击球的威力，适合防御打法。\n\n二、(内置合金接头Built-inT-Joint)\n用力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍杠和拍杆连接处碳素纤维内层的内置T形合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐尔的Build-inT-Joint世界性独家专利，让YONEX球拍同时兼具强大的力量性能和精确的控球性能。\n\n三、3U轻型设计\n球拍采用轻型设计，仅重85-89克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限。"', '碳素纤维', '碳素纤维', 89.0, 85.0, 664.0, '-', '较软', 20.0, 15.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_11277.html');
