insert into detail values('羽毛球拍', '红双喜DHS', Null, 'M362A', Null, '适合打法：进攻型\n材质：记忆性碳纤维\n包装：皮革拍套单支装\n记忆性碳纤维是红双喜在碳纤维成型树脂配方应用上的又一个功能性突破，传统的碳纤维成型树脂配方往往过分注意于对“硬度”性能的提高，而忽视了“韧度”性能。以至造成碳纤维球拍抗击能力的脆弱性。Memory-Graphite（记忆性碳纤维）正是通过对碳纤维成型树脂配方的优化改良，增强碳纤维成型后的“韧度”性能，使其在受到外部冲击时能迅速缓冲压力并迅速还原其形。实验让证明，记忆性碳纤维能有效增强25%的韧度。（更耐用、更高反弹）', '碳纤维', '碳纤维', 84.0, 75.0, 670.0, 'G2', '-', 24.0, 22.0, '285±5mm', 'https://www.badmintoncn.com/cbo_eq/view_11072.html');
