insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'NS系列', 'NSX-7NSX7', Null, '1、碳素纳米管：在拍杆的制造过程中，将小至纳米级别的气泡混合在固话树脂当中，提升了拍杆的硬度、弹性、柔韧性。\n\n2、方形拍框设计（Isometric）：YONEX原创的方形拍框设计，扩大了拍面的击球甜点区域。与传统圆头球拍相比，方形拍头能提供多32%的有效击球面积（击球甜区），即使是偏离球拍线床中心区的连续扣杀也能保持相应的精确和速度。\n\n3、拍框和拍杆内部连接处采用内置T型接头连接结构（Built-inT-Joint），以传送更大击球力量。\n在大力击球时，拍框受到的扭力瞬间传递到球拍的T型位置，T型部位承受着巨大的力学负荷。深藏于拍框和拍杆连接处碳素纤维内层的内置T型合金接头，使所有YONEX高精度两段式工艺生产的碳素纤维球拍完美地连接成一支高强度的一体式球拍。此闻名遐迩的内置T型接头连接结构是YONEX的世界性独家专利，让YONEX球拍同时兼具强大的力量性和精确的控球性能。', '碳素', '碳素+碳素纳米管', 89.0, 85.0, 674.0, '-', '适中', 24.0, 19.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10951.html');
insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'ISO系列', 'IOS500IOS-500', Null, '尤尼克斯Isometric-Swing-Power-500羽毛球拍\n1、球拍采用了SPS摆动系统原理设计，不同的重量、击球感、平衡点位置，适合不同类型的球员；\n2、拍框形状为ISO方型，扩大了拍面的击球甜点区域；\n3、拍框和拍杆内部采用T型接头连接结构，以传送更大的击球力量；\n4、拍框还采用了破风式宽体设计，拍框为空心而形似流线型飞机翼，以减小风之阻力，加快拍头速度，增加球拍攻击力；\n5、球拍采用轻型设计，仅重81/87克，特别适合追求高速击球之球员，球员使用轻型设计球拍，比使用传统球拍，效果明显，球员的击球力量能发挥至极限。\n6、拍杆加长10mm，接球面加大32%，有助于球员伸延其接回球之范围，增强攻击性，发出d钻短球，锐角落点产生强而有力之高角度杀球。', '碳素纤维', '碳素纤维', 87.0, 81.0, 674.0, '-', 'SX型：超硬、SS型：硬、SR型：中柔、SA型：柔', 20.0, 14.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_10949.html');
