insert into detail values('羽毛球拍', '尤尼克斯YONEX', 'CAB系列', 'CAB7000NCAB-7000N', Null, '箱形框架截面礜C瓮凡扛鳦arbonex一种独特而坚固的感觉。适用于寻求击球时琴弦扎实手感的乐手。在击球时，弹性钛抵抗变形，拉伸然后快速恢复其形状，以充分利用挥杆能量发射准确的击球。', '铝', '石墨/碳纳米管', 94.0, 90.0, 675.0, 'G4、G5', '-', 20.0, 16.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_9905.html');
