insert into detail values('羽毛球拍', '索牌SOTX', Null, Null, Null, '采用双实效吸震技术材料加速6%扇形低风阻。首创杯型内框设计该系列球拍，在拍框内框的1-2点、4-5点、7-8点、10-11点四处采用杯型结构设计。在不改变外框面积的情况下，增大甜区面积3%，超越了传统球拍改变框型来增大甜区面积，导致结构不稳定的后果，有效提高了控球性能，其震动感也更小，更容易打出高质量的球。', '碳素纤', '碳素纤', 93.0, 89.0, 680.0, '2#3#', '8.0-8.5', 28.0, 28.0, '295±5mm', 'https://www.badmintoncn.com/cbo_eq/view_9498.html');
