insert into detail values('羽毛球拍', '百宝力Babolat', Null, Null, 2014, '2014年版的BabolatSatelite6.5Synchro羽毛球拍是那些防守球员的理想拍子，特别是对于喜欢使用快速射门的双打球员而言。\n\n主要特点：\nMetriflex技术-一种革命性的轴，根据角度不同，具有不同的灵活性，可以在保持最佳控制的同时最大程度地提高动力。\n飞行员系统-握柄顶部的两个模制条纹使您获得自然而直接的印记，从而提高了决定性射击的准确性和速度。\n6.5轴-超薄轴比以往任何时候都更好地切入空气，以实现更快，更强劲的击球。\n细轴-超细轴可以更好地在空气中切成薄片，使击球更快，更有力。\nGT技术-结合了高密度碳纤维，为球拍头提供了最佳强度，从而具有更大的动力和控制力。\n20x21弦线模式-Babolat的创新技术：20个主电源交叉线代替了传统的弦线模式中的22和23，可以改善手感并允许更多旋转。', '碳纤维', '碳纤维', 89.0, 85.0, 675.0, '-', '适中', 0, 0, '285mm', 'https://www.badmintoncn.com/cbo_eq/view_9119.html');
