insert into detail values('羽毛球拍', '薰风kumpoo', 'POWERSHOT', '战8', 2019, '全能型球拍\n1：专利双硬度中管，红色面稍硬，反应迅速，杀球快，适合进攻！黄色面稍软，弹性好，控球精准，适合防守。\n2：整支球拍采用30T高刚性纤维，承保30lbs。', '超高刚性纤维碳纱', '超高刚性纤维碳纱', 84.0, 82.0, 675.0, 'G5（2#）', '红色面稍硬，黄色面稍软', 30.0, 26.0, '290±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7907.html');
insert into detail values('羽毛球拍', '薰风kumpoo', '特殊材料', Null, 2019, '进攻型球拍\n1：“盒式”断面结构设计提升抗扭性能，大大提高击球稳定性耐冲击。\n2：成型时原状螺纹未经研磨，直接保留。以防破坏其原本设计性能，视觉效果直观，打感上乘！', '超高刚性纤维碳纱与石墨烯材料', '超高刚性纤维碳纱与石墨烯材料', 85.0, 83.0, 675.0, 'G5（2#）', '偏硬', 30.0, 26.0, '292±3（mm）', 'https://www.badmintoncn.com/cbo_eq/view_7903.html');
insert into detail values('羽毛球拍', '亚狮龙RSL', Null, Null, Null, '球拍介绍：\n新科技组合不同机构的基层性碳素纤维及高碳素纤维，令球拍的抵御力大大增加19%，发挥更佳的能量及准确性。因为高密度多层石墨结构，因此成分的数量和位置的选择先得非常重要。太多会使球拍扩张力与承受力降低；太少会使球拍缺乏力量去承受冲力。在拍杆增加适当的反回旋力设计，能令拍子更耐久、更有伸缩力和回旋力。同时，球拍拍杆更细、拍子更轻巧，更增加了韧性，提高了力量和耐久性。\n伸缩扭力框是亚狮龙RSL品牌最新研究而成的一种特性设计，超幼柔韧性拍杆和适度平冲点的设计完美配合，令其在轻巧的拍杆中爆发更大的攻击力。\n（反向增容技术1）将X轴（横轴）及Z轴（前后轴）的击球点范围各增加了11%。X轴（横轴）上的改良加阔了最佳击球范围，击球时更容易达致最大限度的发挥。经过Z轴（前后轴）的改良后，加强了线原有的特性，令使用者在操控时能发出更大更强的力量。', '碳纤维', '碳纤维', 87.0, 85.0, 675.0, '-', '-', 0, 0, '-', 'https://www.badmintoncn.com/cbo_eq/view_7892.html');
