insert into detail values('羽毛球拍', '肯尼士Kennex', Null, 'CB-64251', Null, '这款KineticPro羽毛球拍才用独特的动力学技术、热熔科技有助于预防手臂受伤。使用螺旋技术碳纤维和高模量石墨结合纯纳米环氧树脂,增加了球拍的稳定性、强度以及控制力，从而增加了击球手感。八角形的头部形状添加稳定，还使用了锥形轴技术，使球拍不容易变形，此款球拍具有较好的机动性。', '高弹性碳纤维', '高弹性碳纤维', 89.0, 85.0, 673.0, '-', '特硬', 32.0, 24.0, '290+-3mm', 'https://www.badmintoncn.com/cbo_eq/view_7731.html');
