insert into detail values('羽毛球拍', '佛雷斯FLEX', Null, 'ACM300', Null, '线孔数：76孔\n特\u3000\u3000性:\nA.拍框采用空气力学截面设计,减小空气阻力,提升击球速度,扣杀力更强有力\nB.高强度头框－－超高刚性碳素材质增强拍框的弹性强度\u3000能承受高磅数拉线张力\nC:加长设计,增加球拍控制范围.F:方形拍头与传统球拍相比，均等化方形拍头能提供额外多32%的有效击球面积(击球甜区）即使是偏离球拍线床中心区的连续式扣杀也能保持相应的精确和速度.', '超高刚性碳素纤维', '超高刚性碳纤维拍身', 89.0, 85.0, 675.0, 'G2', '稍硬', 30.0, 26.0, '285-295MM', 'https://www.badmintoncn.com/cbo_eq/view_7479.html');
insert into detail values('羽毛球拍', '佛雷斯FLEX', Null, Null, Null, '特点：X链富勒烯纳米碳素，T形接头，流体与盒式拍框，整支碳纤编织，超导纳米，单线通道80个孔\u3000\u3000建议零售价：1680元', '超高刚性碳纤维+lk编织', '超高刚性碳纤维十钛网', 94.0, 85.0, 675.0, '-', '硬', 34.0, 30.0, '290mm', 'https://www.badmintoncn.com/cbo_eq/view_7478.html');
