insert into detail values('羽毛球拍', '凯胜KASON', Null, 'FYPE018-1', 2010, '1波浪外框（OuterWavesFrame）\n2低扭角中管（LowTorsionAngleShaft）\n3钛金属（TitaniumTech）\n4超细高系数碳纤维（HighModulusUltra-thinCarbonFiber）\n5细截面（ThinFrame）\n6方形拍头（IsometricRacquetHead）', '超细高系数碳纤维', '超细高系数碳纤维', 84.0, 80.0, 675.0, 'NG5', '中', 28.0, 24.0, '-', 'https://www.badmintoncn.com/cbo_eq/view_6659.html');
