insert into detail values('羽毛球拍', '鹰牌EAGLE', Null, Null, 2016, 'EAGLE鹰牌羽毛球拍E8+为智能羽拍系列，智能芯片攻守兼备。\n1、智能芯片。球拍植入一颗智能芯片，能准确记录各个动作，对运动数据了如指掌，可快速提升羽球运动技能。\n2、三合一框型。采用箱型、翼型、梯形三合一框型，有效降低球拍风阻，增加强度，提升控球精准度。\n3、纳米碳管。降低球拍疲劳度，提升强度，令球拍更具爆发力。\n4、幻彩变色龙涂装。独特涂装，不同角度、光线突显与众不同的幻彩颜色效果。\n5、N4级护线管。可耐受超高磅数压力。\n6、超刚性碳纤维。增强拍强度和拍杆抗扭性能。', '2D斜纹碳纤编织技术', '超高钢性碳纤维', 85.0, 85.0, 675.0, '2#', '硬', 30.0, 20.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_6549.html');
