insert into detail values('羽毛球拍', '其它品牌Other', Null, 'aaADONEX亚多力斯', 2011, 'FLEX2900弹性系列球拍的软中管弹性好，能减少挥拍时的空气阻力并提高拍框的扭力性能，出拍快，对力量要求低；后场拉高远球省力，平抽容易，发力点时间长，容易掌握；拍框能额外提供32%的有效击球甜区，即使羽球偏离线床中心区时的连续式扣杀，也能保持相应的精确和速度！\n弹性系列产品拍框主要由高钢性碳素纤维结合纳米树脂技术制作成型，使球拍的钢性大大加强，强力作用下拍框变形程度小，搭配流行的模型设计及优秀的控制性、耐久性，让挥动动作更加迅捷灵敏！\n高钢性碳素纤维拍框设计不但增大了拍框甜区，还让球拍重量大大减轻，其纤细的拍身，使球员在挥拍时能够达到更稳更快的挥拍速度，更易于发挥与掌控！', '高钢性碳素纤维24吨', '高钢性碳素纤维24吨', 86.0, 84.0, 674.0, '160mm', '稍软', 3.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5489.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, 'aaADONEX亚多力斯', 2011, 'SUPERCHROME8NX闪耀系列球拍使用高钢性全碳素材料，提高了球拍的强度与扭抗性，让您挥洒自如。\n中管软硬适中，使球拍的弹性、手感、韧性、强度达到极佳的效果和最佳的控球能力和击球力量。\n高质感真空电镀设计，强烈的金属外观与炫彩的反光度，使得球拍的颜色炫目十足，气度恢宏，卓越不凡，更加年轻时尚，让你感受无限的运动激情。光泽细致而持久如新，新颖独特，亮度达到前所未有的高亮度，高调张扬，动感纷呈，电镀拍一出其他所有的球拍均黯然失色。', '超高钢性碳素纤维40吨', '超高钢性碳素纤维40吨', 87.0, 85.0, 674.0, '160mm', '适中', 3.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5488.html');
insert into detail values('羽毛球拍', '其它品牌Other', Null, 'aaADONEX亚多力斯', 2011, '无限系列顶框四孔设计的风动原理大大降低了球拍的风阻，增强了羽球的转速与反应，使选手能强而有力的快速攻击与回防，自然的控制球的飞行与速度，使得羽球飞行更准确与完美，掌握全场。拍框的大孔设计给球拍提供了更大更具功能性的击球甜区,不管是截球还是抽球都能让球员轻松应对,甚至在甜区外的击球点也不会像传统球拍的死角区那般无力，使球员表现更稳定，更完美，更有力量。\n与一般球拍所使用的传统与限制多的钻孔方式相比,aaADONEX无限系列球拍拍框上的大孔专利设计增强了拍框上拉线的延展性，使球拍击球时的弹性更好，挥拍速度更快，击球更加舒适、稳定。此系列球拍所开发的特殊弹力大孔单粒钉与一般普通尺寸的单粒钉相比，降低了塑料材料引起的震动，搭配球拍本身的超高钢性碳纤维材料，使得整支球拍拥有自如的操控性及流畅的手感舒适性。', '超高钢性碳素纤维40吨+Kevlar', '超高钢性碳素纤维40吨+Kevlar', 88.0, 86.0, 674.0, '160mm', '适中', 3.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5487.html');
insert into detail values('羽毛球拍', '骏邦joobong', 'T-Jeibee', 'TJB-9', 2011, '设计科技：ISO拍框、钻石破风框、MuclePower边框、低风阻锥盖\n适合打法：TJB-9性能全面，适合中高级选手进攻型打法', '超高刚性碳素纤维、纳米环氧树脂', '碳纤维、超高刚纳米碳素管', 89.0, 85.0, 675.0, 'G2', '硬', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5183.html');
insert into detail values('羽毛球拍', '骏邦joobong', Null, 'TJB307', Null, '使用纳米环氧树脂\n纳米碳素和纳米树脂的完美结合！在碳素粒子之间细微缝隙里渗入了纳米环氧树脂，大幅度地提高了球拍的强度\n\n拍框采用具有出色稳定性和控球球性箱形设计，大大提高了控球性能，并且针对传统箱形拍框空气阻力打得缺点，对“箱角”进行了特殊处理以及调整了拍框的宽度和厚度，致使球拍在不失原有稳定控球性，也能快速抽挡。\n\n采用波浪型线槽（MUSCLE强化技术）', '纳米超高碳、纳米环氧树脂', '超高刚纳米碳素管', 89.0, 85.0, 675.0, 'G2', '适中', 28.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5025.html');
insert into detail values('羽毛球拍', '骏邦joobong', Null, 'TJB6500', Null, '使用纳米环氧树脂\n纳米碳素和纳米树脂的完美结合！在碳素粒子之间细微缝隙里渗入了纳米环氧树脂，大幅度地提高了球拍的强度\n\nISO破风大方头，甜区比普通方头大15%，比传统圆头大30%\n\n破风框利用三角抗力原理，大大提高了拍框的抗扭性和稳定性。击球干脆直接，抽挡迅速。', '纳米环氧树脂，纳米超高碳', '超高刚纳米碳素管', 89.0, 85.0, 675.0, 'G2', '硬', 29.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5011.html');
insert into detail values('羽毛球拍', '骏邦joobong', Null, 'TJB09', 2010, '使用纳米环氧树脂\n纳米碳素和纳米树脂的完美结合！在碳素粒子之间细微缝隙里\n\n渗入了纳米环氧树脂，大幅度地提高了球拍的强度\n\n箱型稳定ISO拍框\n拍框采用具有出色稳定性和控球球性箱形设计，大大提高了控\n\n球性能。并且针对传统箱型拍框空气阻力打的缺点，对“箱角”进\n\n行了特殊处理以及调整了拍框的宽度和厚度，至使球拍在不失原有\n\n稳定控球性，也能快速抽挡。\n\n波浪形线槽（MUSCLE强化技术）\n甜区对应的左右两边外框同样使用了波浪型线槽，提升了拍框稳定\n\n性和受力性能，使拍线得以更好的保护和更好的发挥，大大提升了\n\n中心甜区的能量。\n\n顶端波浪型线槽（MUSCLE技术）\n1.提升了拍框稳定性和受力性能\n2.拍线得以更好的保护和更好的发挥\n3.与底部四组连钉及波浪线槽互相呼应，大大提升了中心甜区的能\n\n量\n\n连钉技术\n四个双顶加上左右各一个波浪线槽让中心甜区10线得到更好的保护\n\n和更充分的发挥，与拍框顶端波浪十钉互相呼应，大大提高了中心\n\n甜区的能量。\n\n不但自身拥有高强的弹性，还可承受30磅的超高磅数，向甜区供应\n\n了强大的能量。另一方面，能有效地消弱击球时的反作用力，给球\n\n拍提供了卓越的稳定性和控球性，使落球点更加精准。', '纳米树脂，高刚性碳纤维', '纳米管', 89.0, 85.0, 675.0, 'G2', '硬', 29.0, 27.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_5010.html');
insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, 2011, '市场上最轻的羽毛球拍之一，仅有77克，有灰绿色和玫瑰红两种涂装，被称为“情侣拍”，平衡点、拍杆柔韧度均适中，轻盈跳脱，正适合快攻/双打选手。', '24/30T刚性纳米碳素纤维细拍框，超力量型', '24T刚性/高弹性纳米碳素纤维', 77.0, 77.0, 674.0, 'G5', '适中（3）', 28.0, 24.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4962.html');
