insert into detail values('羽毛球拍', 'FZFORZA', Null, Null, 2011, 'FZFORZAN系列中顶级球拍之一，细拍框，独有时尚酷炫双面双色涂装（一面皇室蓝色一面镀铬），尽显皇家风范，平衡点适中、中杆较硬，进攻性超强。', '40T超刚性CNT碳素纤维细拍框超力量型', '40T超刚性CNT碳素纤维', 84.0, 84.0, 674.0, 'G5', '较硬（4）', 30.0, 26.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4956.html');
