insert into detail values('羽毛球拍', '其它品牌Other', Null, Null, 2010, '全钛丝（40T）30磅，适合专业选手使用。中管采用高尔夫球杆钛合金工艺，头框采用全WOVEN编织，WOVEN（是一种防弹衣的材料，每平米达400美元，成90度角交叉编织而成，材质特点是，很轻，用于航空较多）整支球拍透明漆配合镭射烫金标设计，给人一种精工细作、高贵稳重之感。中管超高系数的纱料与钛合金的完美组合提升了中管的抗扭性达到15%，其挥拍寿命达到25万次。超强的抗扭性极大的提升了打球时落点的精确度，特别是直线杀球，其杀球速度比传统中管提升10%。', '高弹性碳纤维', '全钛丝', 85.0, 85.0, 675.0, 'G4', '中度', 30.0, 30.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4202.html');
insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2010, '整支运用真空电镀的制作，增强了油漆的亮度，用高档金属漆美化和装饰了球拍，从而在外观上展示出了高档羽拍的品位;采用纳米技术的球拍壁厚可减薄20%，从而使重量减轻约15%，而操控性能更优越.', 'TORRY24T+纳米碳素', 'TORRY24T+纳米碳素', 89.0, 85.0, 668.0, 'G2', '中硬', 30.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4201.html');
insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2011, '球拍的拍杆达到最好的强度和韧性，手感极佳;整体采用灰色涂装同时在6点和12点位置结合了黑色与黄色的LOGO对应,使得球拍的整体呈现出一种稳重兼容时尚的主题风格;加重的拍头及拍杆的硬度,能让进攻型选手产生更强的爆发力与击球快感', '100%高系数碳纤维', '100%高系数碳纤维', 89.0, 85.0, 675.0, 'G3', '硬', 28.0, 23.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4117.html');
insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2010, '提高了拍框头部和羽线的耐久性，适合更大的羽线拉力，使击球感更硬、爆发力更强；拍框两侧中部采用了新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳.', '高碳', '高碳', 84.0, 80.0, 675.0, 'G3', '超硬', 28.0, 25.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4116.html');
insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2009, '采用艳丽的图装,使得球拍整体在视觉效果上更时尚，更立体感；拍框形状为ISO方型，扩大了拍面的击球甜区;新型减震线孔胶粒，使球员在大力击球时手臂获得“柔感”，有效地减轻了在长时间比赛中手臂肌肉的疲劳.', '100%碳素纤维', '100%碳素纤维', 89.0, 85.0, 665.0, 'G2', '中软', 26.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4115.html');
insert into detail values('羽毛球拍', 'JK羽球jk-sports', Null, Null, 2010, '中杆不同的低、中、高弹点，以及大、小扭矩设计，更清晰的手感，增加击球的流畅感，更好的击球方向性与深度控制。;采用KVL高科技材料制造的中杆，带来更好的稳定性与耐用性，拥有极佳的吸震功能.', '高密度碳素纤维+KVL', '高密度碳素纤维+KVL', 84.0, 80.0, 665.0, 'G2', '中软', 28.0, 22.0, Null, 'https://www.badmintoncn.com/cbo_eq/view_4113.html');
